INSERT INTO `psic_class` VALUES ('0111','Growing of Cereals (Except Rice and Corn), Leguminous Crops and Oil Seeds',NULL,'011'),('0112','Growing of Paddy Rice\n','This class includes the growing of palay, including organic and the growing of genetically modified rice.','011'),('0113','Growing of Corn, Except Young Corn (Vegetable)',NULL,'011'),('0114','Growing of Sugarcane Including Muscovado Sugar-making in the Farm',NULL,'011'),('0115','Growing of Tobacco',NULL,'011'),('0116','Growing of Fiber Crops',NULL,'011'),('0117','Growing of Leafy and Fruit Bearing Vegetables',NULL,'011'),('0118','Growing of Other Vegetables, Melons, Roots and Tubers',NULL,'011'),('0119','Growing of Other Non-perennial Crops\n','This class includes growing of flowers, including production of cut flowers and flower buds.','011'),('0121','Growing of Banana',NULL,'012'),('0122','Growing of Pineapple',NULL,'012'),('0123','Growing of Citrus Fruits',NULL,'012'),('0124','Growing of Mango',NULL,'012'),('0125','Growing of Papaya',NULL,'012'),('0126','Growing of Coconut, Including Copra-making, Tuba Gathering and Coco-shell Charcoal and Coconut Sap Syrup Making in the Farm',NULL,'012'),('0127','Growing of Beverage Crops',NULL,'012'),('0128','Growing of Spices, Aromatic, Drugs and Pharmaceutical Crops',NULL,'012'),('0129','Growing of Other Fruits and Perennial Crops',NULL,'012'),('0130','Plant Propagation',NULL,'013'),('0141','Raising of Cattle and Buffaloes',NULL,'014'),('0142','Raising of Horses and Other Equines',NULL,'014'),('0143','Dairy Farming',NULL,'014'),('0144','Raising of Sheep and Goats',NULL,'014'),('0145','Hog Raising',NULL,'014'),('0146','Raising (Farming) of Chicken (Including Operation Chicken Hatcheries), in Confined and Free-range Environment',NULL,'014'),('0147','Raising of Poultry (Except Chicken)',NULL,'014'),('0148','Egg Production',NULL,'014'),('0149','Raising of Other Animals',NULL,'014'),('0151','Operation of Irrigation Systems Through Cooperatives and Non-cooperatives',NULL,'015'),('0152','Planting, Transplanting and Other Related Activities',NULL,'015'),('0153','Services to Establish Crops, Promote Their Growth and Protect Them from Pests and Diseases',NULL,'015'),('0154','Harvesting, Threshing, Grading, Bailing and Related Services',NULL,'015'),('0155','Rental of Farm Machinery with Drivers and Crew',NULL,'015'),('0156','Support Activities for Animal Production',NULL,'015'),('0157','Post-harvest Crop Activities',NULL,'015'),('0158','Seed Processing for Propagation\n','This class includes all post-harvest activities aimed at improving the propagation quality of seed through the removal of non-seed materials, undersized, mechanically or insect-damaged and immature seeds as well as removing the seed moisture to a safe level for seed storage. This activity includes the drying, cleaning, grading and treating of seeds until they are marketed. The treatment of genetically modified seeds is included here.\nThis class excludes :\nGrowing of seeds, see groups 011 and 012;\nProcessing of seeds to obtain oil, see 104;\nResearch of seeds or modify new forms of seeds, see 7210','015'),('0170','Hunting, Trapping and Related Service Activities\n','This class includes :\nHunting and trapping on a commercial basis\nTaking of animals (dead or alive) for food, fur, skin, or for use in research, in zoos or as pets\nProduction of fur skins, reptile, or bird skins from hunting or trapping activities\nThis class excludes :\nProduction of fur skins, reptile or bird skins from ranching operations, see group 014;\nRaising of game animals on ranching operations, see 0149;\nCatching of whales, see 0311;\nProduction of hides and skins originating from slaughterhouses, see 1011;\nHunting for sport or recreation and related service activities, see 9319;\nService activities to promote hunting and trapping, see 9499.','017'),('0211','Growing of Timber Forest Species (E.g. Gmelina, Eucalyptus, Etc.), Planting, Replanting, Transplanting, Thinning and Conserving of Forest and Timber Tracts',NULL,'021'),('0212','Operation of Forest Tree Nurseries',NULL,'021'),('0220','Logging\n','This class includes :\nProduction of roundwood for forest-based manufacturing industries\nProduction of roundwood use in an unprocessed form such as pit-props, fence posts and utility poles\nGathering and production of fire wood\nProduction of charcoal in the forest (using traditional method)\nThe output of this activity can take the form of logs, chips or fire wood.\nThis class excludes :\nGrowing of Christmas trees, see 0129;\nGrowing of standing timber; planting, replanting , transplanting, thinning and conserving of forests and timber tracts; see 0211;\nGathering of wild growing non-wood forest products, 0230;\nProduction of wood chips and particles, see 1610;\nProduction of charcoal through distillation of wood, see 2011.','022'),('0230','Gathering of Non-wood Forest Products',NULL,'023'),('0240','Support Services to Forestry',NULL,'024'),('0311','Marine Fishing\n','This class includes :\nFishing on a commercial basis in ocean and coastal water\nTaking of marine crustaceans and mollusks\nWhale catching\nTaking of marine aquatic animals : turtles, sea squirts, tunicates, sea urchins, etc.\nThis class also includes :\nActivities of vessels engaged in both fishing and in processing and preserving of fish\nGathering of other marine organisms and materials: natural pearls, sponges, coral and algae.\nThis class excludes :\nCapturing of marine mammals, except whales, e.g. walruses, seals, see 0170;\nProcessing of fish, crustaceans and mollusks on factory ships or in factories ashore, see 1020;\nRental of pleasure boats with crew for sea and coastal water transport (e.g. for fishing cruises), see 5011;\nFishing inspection for sport or recreation and related services, see 9319;\nFishing practiced for sport or recreation and related services, see 9319;\nOperation of sport fishing preserves, see 9319.','031'),('0312','Freshwater Fishing\n','This class includes :\nFishing on a commercial basis in inland waters\nTaking of freshwater crustaceans and mollusks\nTaking of freshwater aquatic animals\nGathering of freshwater materials\nThis class excludes :\nProcessing of fish, crustaceans and mollusks, see 1020;\nFishing inspection, protection and patrol services, see 8423;\nFishing practiced for sport or recreation and related services, see 9319;\nOperation of sport fishing preserves, see 9319.','031'),('0313','Support Service Activities Incidental to Fishing',NULL,'031'),('0321','Operation of Freshwater Fish Pond, Fish Pens, Cage and Hatcheries',NULL,'032'),('0322','Operation of Marine or Sea Water Fish Tanks, Pens, Cage and Hatcheries',NULL,'032'),('0323','Prawn Culture in Brackish Water',NULL,'032'),('0324','Culture of Mollusks, Bivalves and Other Crustaceans (Except Prawn Culture)',NULL,'032'),('0325','Pearl Culture and Pearl Shell Gathering',NULL,'032'),('0326','Seaweeds Farming and Gathering',NULL,'032'),('0329','Other Aquaculture Activities',NULL,'032'),('0510','Mining of Hard Coal',NULL,'051'),('0520','Mining of Lignite',NULL,'052'),('0610','Extraction of Crude Petroleum',NULL,'061'),('0620','Extraction of Natural Gas',NULL,'062'),('0710','Mining of Iron Ores',NULL,'071'),('0721','Mining of Uranium and Thorium Ores',NULL,'072'),('0722','Mining of Precious Metals\n','This class covers the mining of precious metals such as gold, silver, platinum and other precious metals. This also includes activities processing of to remove non-metallic parts.','072'),('0729','Mining of Other Non-ferrous Metal Ores\n','This class includes :\nMining and preparation of ores valued chiefly for non-ferrous meral content : aluminum (bauxite), copper, lead, zinc, tin, manganese, chrome, nickel, cobalt, molybdenum, tantalum, vanadium, etc.','072'),('0810','Quarrying of Stone, Sand and Clay\n','This class includes :\nQuarrying, rough trimming and sawing of monumental and building stone such as marble, granite, sandstone etc.\nQuarrying, crushing and breaking of limestone\nBreaking and crushing of stone\nMining of clays, refractory clays and kaolin\nQuarrying of sand; breaking and crushing of gravel; extraction and dredging of sand for construction and gravel\nExtraction and dredging of industrial sand\nMining of gypsum and anhydrite\nMining of chalk and uncalcined dolomite\nThis class excludes :\nMining of bituminous sand, see 0610;\nMining of chemical and fertilizer minerals, see 0891;\nProduction of calcined dolomite, see 2394;\nCutting, shaping and finishing of stone outside quarries, see 2396.','081'),('0891','Mining of Chemical and Fertilizer Minerals\n','This class includes :\nMining of natural phosphates and natural potassium salts\nMining of native sulphur\nExtraction and preparation of pyrites and pyrrhotite, except roasting\nMining of natural barium sulphate and carbonate (barytes and whiterite), natural borates, natural magnesium sulphates (kieserite)\nMining of earth colors, fluorspar and other minerals valued chiefly as a source of chemicals\nGuano mining\nThis class excludes :\nExtraction of salt, see 0893;\nRoasting of iron and pyrites, see 2011;\nManufacture of synthetic fertilizers and nitrogen compounds, see 2012.','089'),('0892','Extraction of Peat',NULL,'089'),('0893','Extraction of Salt',NULL,'089'),('0899','Other Mining and Quarrying, N.e.c.',NULL,'089'),('0910','Support Activities for Petroleum and Gas Extraction\n','This class includes :\nOil and gas extraction service activities provided on a fee or contract basis such as:\nexploration services in connection with petroleum or gas extraction, e,g, traditional prospecting methods, such as making geological observations at prospective sites\ndirectional drilling and redrilling; \"spudding inn\"; derrick erection in situ, repairing and dismantling; cementing oil and gas well casings; pumping of wells; plugging and abandoning wells, etc.\nliquefaction and regasification of natural gas for purpose of transport, done at the mine site\ndraining and pumping services, on a fee or contract basis\ntest drilling in connection with petroleum or gas extraction\nThis class also includes oil and gas field fire fighting services.\nThis class excludes:\nService activities performed by operators of oil & gas fields, see 0610, 0620;\nSpecialized repair of mining machinery, see 3312;\nLiquefaction and regasification of natural gas for purpose of transport, done off the mine site, see 5221;\nGeophysical, geologic and seismic surveying, see 7110.','091'),('0990','Support Activities for Other Mining and Quarrying',NULL,'099'),('1011','Slaughtering and Meat Packing',NULL,'101'),('1012','Production, Processing and Preserving of Meat and Meat Products\n','This class includes :\nProduction of fresh, chilled or frozen meat or poultry\nPreservation and preparation of meat and meat products by such processes as drying, smoking, salting, immersing in brine or canning\nProduction of meat products (tocino, tapa, ham, bacon, sausage, longanisa, corned beef, hotdog, meat loaf, salami, bolognas, pates and paste, rillettes)\nRendering of lard and other edible fats of animal origin\nThis class excludes:\nManufacture of prepared frozen meat and poultry dishes, see 1075;\nManufacture of soup containing meat, see 1079;\nWholesale trade of meat, see 4630;\nPackaging of meat, see 8292.','101'),('1020','Processing and Preserving of Fish, Crustaceans and Mollusks\n','This class includes :\nProduction of fish, crustaceans and mollusks products: cooked fish, fish fillets, roes, caviar, caviar substitutes, shrimp paste, crab paste, milkfish paste, etc.\nProduction of fishmeal for human consumption and animal feed\nProduction of fermented fish, fish paste or fish balls\nPreparation and preserving of fish, crustaceans and mollusks : freezing, deep-freezing, drying, smoking, salting, immersing in brine, canning, etc.\nProduction of meals and solubles from fish and other aquatic animals unfit for human consumption\nThis class also includes :\nActivities of vessels engaged only in the processing and preserving of fish\nProcessing of seaweeds, agar-agar or carrageenan\nThis class excludes :\nProcessing of whales on land or specialized vessels, see 1011;\nProduction of oils and fats from marine material, see 1049;\nManufacture of prepared frozen fish dishes, see 1075;\nManufacture of fish soups, see 1079.','102'),('1030','Processing and Preserving of Fruits and Vegetables\n','This class includes :\nManufacture of food consisting chiefly of fruit or vegetables, except ready-made dishes in frozen or canned form\nPreserving of fruit, nuts, beans or vegetables: freezing, drying, immersing /cooking in oil or in vinegar, sugar or sweetening matter, canning or in bottles\nManufacture of fruit or vegetable food products\nManufacture of fruit or vegetable juices\nManufacture of jams, marmalades and table jellies\nProcessing and preserving of potatoes:\nManufacture of prepared frozen potatoes\nManufacture of dehydrated mashed potatoes\nManufacture of potato snacks\nManufacture of potato crisps\nManufacture of potato flour and meal\nRoasting of nuts\nManufacture of nut foods and pastes\nIndustrial peeling of potatoes\nProduction of concentrates from fresh fruits and vegetables\nManufacture of perishable prepared foods of fruit and vegetables, such as : salads, peeled or cut vegetables, tofu (bean curd)\nThis class excludes :\nManufacture of flour or meal of dried leguminous vegetables, see 1062;\nPreservation of fruit and nuts in sugar, see 1073;\nManufacture of prepared vegetables dishes, see 1075;\nManufacture of artificial concentrates, see 1079.','103'),('1041','Manufacture of Virgin Coconut Oil',NULL,'104'),('1044','Production of Crude Vegetable Oil, Cake and Meals, Other Than Virgin Coconut Oil (See Class 1041)',NULL,'104'),('1045','Manufacture of Refined Coconut and Other Vegetable Oil (Including Corn Oil) and Margarine',NULL,'104'),('1046','Manufacture of Fish Oil and Other Marine Animal Oils',NULL,'104'),('1047','Manufacture of Unprepared Animal Feeds from Vegetable, Animal Oils and Fats',NULL,'104'),('1049','Manufacture of Vegetable and Animal Oil and Fats, N.e.c.',NULL,'104'),('1051','Processing of Fresh Milk and Cream',NULL,'105'),('1052','Manufacture of Powdered Milk (Except for Infants) and Condensed or Evaporated Milk (Filled, Combined or Reconstituted)',NULL,'105'),('1053','Manufacture of Infantsnull Powdered Milk',NULL,'105'),('1054','Manufacture of Butter, Cheese and Curd',NULL,'105'),('1055','Manufacture of Ice Cream and Sherbet, Ice Drop, Ice Candy and Other Flavored Ices',NULL,'105'),('1056','Manufacture of Milk-based Infantsnull and Dietetic Foods',NULL,'105'),('1057','Manufacture of Yoghurt',NULL,'105'),('1058','Manufacture of Whey',NULL,'105'),('1059','Manufacture of Dairy Products, N.e.c.',NULL,'105'),('1061','Rice/corn Milling',NULL,'106'),('1062','Manufacture of Grain and Vegetable Mill Products Except Rice and Corn\n','This class includes :\nGrain milling : production of flour, groats, meal or pellets of (wheat, rye, oats) or other cereal grains\nVegetable milling; production of flour or meal of dried leguminous vegetables, of roots or tubers, or of edible nuts\nManufacture of cereal breakfast foods\nManufacture of flour mixes and prepared blended flour and dough for bread, cakes, biscuits or pancakes.\nThis class excludes :\nManufacture of potato flour and meal, see 1030;\nWet corn milling, see 1063.','106'),('1063','Manufacture of Starches and Starch Products',NULL,'106'),('1071','Manufacture of Bakery Products\n','This class includes :\nManufacture of fresh, frozen or dry bakery products\nManufacture of bread and rolls\nManufacture of fresh pastry, cakes, pies, tarts, etc.\nManufacture of preserved pastry goods and cakes\nManufacture of frozen bakery products: pancakes, waffles, rolls, etc.\nManufacture of rusks, biscuits and other \"dry\" bakery products\nManufacture of snack products (cookies, crackers, pretzels, etc.) whether sweet or salted\nManufacture of tortillas\nThis class excludes :\nManufacture of farinaceous products (pastas), see 1074;\nManufacture of potato snacks, see 1030;\nHeating of bakery items for immediate consumption, see division 56.','107'),('1072','Manufacture of Sugar\n','This class includes :\nManufacture or refining of sugar (sucrose) and sugar substitutes from the juice of cane, beet, maple, coconut and palm\nManufacture of sugar syrups\nManufacture of molasses\nProduction of maple syrup and sugar\nThis class excludes manufacture of glucose, glucose syrup, maltose, see 1063.','107'),('1073','Manufacture of Cocoa, Chocolate and Sugar Confectionery\n','This class includes :\nManufacture of cocoa, cocoa butter, cocoa fat, cocoa paste, cocoa oil\nManufacture of chocolate and chocolate confectionery\nManufacture of sugar confectionery: caramels, cachous, nougats, fondant (white chocolate)\nManufacture of chewing gum\nPreserving in sugar of fruit, nuts, fruit peels and other parts of plants\nManufacture of confectionery lozenges and pastilles\nThis class excludes manufacture of sucrose sugar, see 1072.','107'),('1074','Manufacture of Macaroni, Noodles, Couscous and Similar Farinaceous Products',NULL,'107'),('1075','Manufactured of Prepared Meals and Dishes',NULL,'107'),('1076','Manufacture of Food Supplements from Herbs and Other Plants',NULL,'107'),('1077','Coffee Roasting and Processing',NULL,'107'),('1078','Manufacturing of Nata De Coco and Native Delicacies or \"kakanin\" E.g., Bibingka, Puto, Suman, Kalamay, Binagol, Moron and Other Similar Products',NULL,'107'),('1079','Manufacture of Other Food Products, N.e.c.\n','This class includes :\nBlending of tea and mate\nManufacture of extracts and preparation based on tea or mate\nManufacture of soup and broths\nManufacture of special foods, such as: infant formula, follow up milks and other follow up foods and baby foods\nFoods containing homogenized ingredients\nManufacture of spices, sauces and condiments : mayonnaise, mustard flour and meal and soya sauce etc.\nManufacture of vinegar\nManufacture of artificial honey and caramel\nManufacture of perishable prepared foods such as: sandwiches, fresh (uncooked) pizza\nThis class also includes :\nManufacture of herb infusions (mint, vervain, chamomile, etc.)\nManufacture of yeast\nManufacture of extracts and juices of meat, fish, crustaceans or mollusks\nManufacture of non-dairy milk and cheese substitutes\nManufacture of artificial concentrates\nManufacture of egg products, egg albumin\nProcessing of salt into food-grade salt, e.g. iodized salt.\nThis class excludes :\nGrowing of spice crops, see 0128;\nManufacture of inulin, see 1063;\nManufacture of frozen pizza, see 1075;\nManufacture of spirits, beer, wine and soft drinks, see division 11;\nPreparation of botanical products for pharmaceutical use, see 2100.','107'),('1080','Manufacture of Prepared Animal Feeds',NULL,'108'),('1101','Distilling, Rectifying and Blending of Spirits',NULL,'110'),('1102','Manufacture of Wines\n','This class includes :\nManufacture of wine from fruits (mango wine), sugarcane (basi), vegetables and root crops (ube wine), coconut (lambanog) and rice\nManufacture of sparkling wine\nManufacture of wine from concentrated grape must\nManufacture of fermented but not distilled alcoholic beverages: sake, cider, perry, mead, other fruit wines and mixed beverages containing alcohol\nBlending of wine\nManufacture of low alcohol or non-alcoholic wine\nThis class excludes :\nManufacture of vinegar, see 1079;\nMerely bottling and labeling , see 4630 (if performed as part of wholesale) and 8292 (if performed on a fee or contract basis)','110'),('1103','Manufacture of Malt Liquors and Malt',NULL,'110'),('1104','Manufacture of Soft Drinks\n','This class includes :\nManufacture of soft drinks : non-alcoholic flavored and/or sweetened waters: lemonade, orangeade, cola, fruit drinks, tonic waters, etc.\nThis class excludes :\nProduction of fruit and vegetable juice, see 1030;\nManufacture of milk-based drinks, see 1059;\nManufacture of coffee, tea and mate products, see 1079;\nManufacture of alcohol-based drinks, see 1101,1102,1103;\nManufacture of non-alcoholic wine, see 1102;\nManufacture of non-alcoholic beer, see 1103;\nMerely bottling and labeling , see 4630 (if performed as part of wholesale) and 8292 (if performed on a fee or contract basis).','110'),('1105','Manufacture of Drinking Water and Mineral Water',NULL,'110'),('1106','Manufacture of Sports and Energy Drink',NULL,'110'),('1109','Manufacture of Other Beverages, N.e.c.',NULL,'110'),('1201','Manufacture of Cigarettes',NULL,'120'),('1202','Manufacture of Cigars',NULL,'120'),('1203','Manufacture of Chewing and Smoking Tobacco, Snuff',NULL,'120'),('1204','Curing and Redrying Tobacco Leaves',NULL,'120'),('1209','Tobacco Manufacturing, N.e.c.',NULL,'120'),('1311','Preparation and Spinning of Textile Fibers\n','This class includes :\nPreparatory operations on textile fibers: reeling and washing of silk; degreasing and carbonizing of wool and dyeing of wool fleece; carding and combing of all kinds of animal, vegetable and man-made fibers\nSpinning and manufacture of yarn or thread for weaving or sewing, for the trade or for further processing :\nTexturizing, twisting, folding, cabling and dipping of synthetic or artificial filament yarns\nManufacture of paper yarn\nThis class excludes :\nPreparatory operations carried out in combination with agriculture or farming, see 01;\nRetting of plants bearing vegetable textile fibers(jute, flax, coir etc.), see 0116;\nCotton ginning, see 0157;\nManufacture of synthetic or artificial fibers and tows, manufacture of single yarns (including high tenacity yarn and yarn for carpets) of synthetic or artificial fibers see 2030;\nManufacture of glass fibers, see 2310.','131'),('1312','Weaving of Textiles',NULL,'131'),('1313','Finishing of Textiles',NULL,'131'),('1314','Preparation and Finishing of Textiles (Integrated)',NULL,'131'),('1391','Manufacture of Knitted and Crocheted Fabrics',NULL,'139'),('1392','Manufacture of Made-up Textile Articles, Except Wearing Apparel\n','This class includes :\nManufacture of made-up textile articles except wearing apparel, including of knitted or crocheted fabrics: blankets, including travelling rugs; bed, table, toilet or kitchen linen; quilts, eiderdowns, cushions, pouffes, pillows, sleeping bags, etc.\nManufacture of made-up furnishing articles :\ncurtains, valances, blinds, bedspreads, furniture or machine covers, etc.\ntarpaulins, tents, camping goods, sails, sun blinds, loose covers for cars, machines or furniture, etc.\nflags, banners, pennants, etc.\ndust cloths, dishcloths and similar articles, life jackets, parachutes etc.\nManufacture of hand-woven tapestries\nManufacture of tire covers.\nThis class excludes :\nManufacture of textile articles for technical use, see 1399.','139'),('1393','Manufacture of Carpet and Rugs\n','This class includes :\nManufacture of textile floor coverings : carpets, rugs and mats, tiles\nManufacture of needle-loom felt floor coverings\nThis class excludes :\nManufacture of mats and matting of plaiting materials, see 1629;\nManufacture of floor coverings of cork, see 1629;\nManufacture of resilient floor coverings, such as vinyl, linoleum, see 2220.','139'),('1394','Manufacture of Cordage, Rope, Twine and Netting\n','This class includes:\nManufacture of twine, cordage, rope and cables of textile fibers or strip or the like, whether or not impregnated, coated, covered or sheathed with rubber or plastic\nManufacture of products of rope or netting\nFishing nets, shipsNULL fenders, unloading cushions, loading slings, rope or cable fitted with metal rings, etc.\nManufacture of knotted netting of twine, cordage or rope\nThis class excludes :\nManufacture of hairnets, see 1419;\nManufacture of wire rope, see 2599.','139'),('1395','Manufacture of Embroidered Fabrics',NULL,'139'),('1399','Manufacture of Other Textiles, N.e.c.\n','This class includes all activities related to textiles or textile products, not specified elsewhere in division 13 (Manufacture of textiles) or 14 (Manufacture of wearing apparel), involving a large number of processes and a great variety of goods produced.\nThis class includes :\nManufacture of narrow woven fabrics, including fabrics consisting of warp without weft assembled by means of an adhesive\nManufacture of labels, badges etc.\nManufacture of ornamental trimmings : braids, tassels, pompons etc.\nManufacture of felt\nManufacture of tulles and other net fabrics, and of lace and embroidery, in piece, in strips or in motifs\nManufacture of fabrics impregnated, coated, covered or laminated with plastic\nManufacture of metallized yarn or gimped yarn, rubber thread and cord covered with textile material, textile yarn or strip covered, impregnated, coated or sheathed with rubber or plastic\nManufacture of tire cord fabric of high-tenacity man made yarn\nManufacture of other treated or coated fabrics; tracing cloth, canvas prepared for use by painters, buckram and similar stiffened textile fabrics, fabrics coated with gum or amylaceous substances\nManufacture of diverse textile articles; textile wicks, incandescent gas mantles and tubular gas mantle fabric, hosepiping, transmission or conveyor belts or belting (whether or not reinforced with metal or other material, bolting cloth, straining cloth)\nManufacture of automotive trimmings\nManufacture of pressure sensitive cloth-tape\nManufacture of artistNULLs canvas boards and tracing cloth\nManufacture of shoe-lace, of textiles\nManufacture of powder puffs and mints\nThis class excludes :\nManufacture of needle-loom felt floor coverings, see 1322;\nManufacture of textile wadding and articles of wadding: sanitary towels, tampons etc., see 1709;\nManufacture of transmission or conveyor belts of textile fabric, yarn or cord impregnated, coated, covered or laminated with rubber, where rubber is the chief constituent, see 2219;\nManufacture of plates or sheets of cellular rubber or plastic combined with textiles for reinforcing purposes only, see 2219, 2220;\nManufacture of cloth of woven metal wire, see 2599.','139'),('1411','Mennulls and Boynulls Garment Manufacturing',NULL,'141'),('1412','Womennulls and Girlnulls Garment Manufacturing',NULL,'141'),('1413','Ready-made Embroidered Garments Manufacturing',NULL,'141'),('1414','Babiesnull Garment Manufacturing',NULL,'141'),('1419','Manufacture of Wearing Apparel, N.e.c',NULL,'141'),('1421','Custom Tailoring',NULL,'142'),('1422','Custom Dressmaking',NULL,'142'),('1430','Manufacture of Knitted and Crocheted Apparel\n','This includes the manufacture of knitted or crocheted wearing apparel and other made-up articles directly into shape (such as pullovers, cardigans, jerseys, waistcoats and similar articles), and hosiery, including socks, tights and pantyhose.\nThis excludes the manufacture of knitted and crocheted textiles.\nThis class includes :\nManufacture of knitted or crocheted wearing apparel and other made-up articles directly into shape: pullovers, cardigans, jerseys, waistcoats and similar articles\nManufacture of hosiery, including socks, tights and pantyhose.\nThis class excludes manufacture of knitted and crocheted textiles, see 1391.','143'),('1440','Manufacture of Articles of Fur',NULL,'144'),('1511','Tanning and Dressing of Leather',NULL,'151'),('1512','Manufacture of Products of Leather and Imitation Leather\n','This class includes :\nManufacture of luggage, handbags and the like, of leather, composition leather or any other material, (mostly imitation leathers) such as plastic sheeting, textile materials, vulcanized fiber or paperboard, where the same technology is used as for leather.\nManufacture of non-metallic watch bands (e.g. fabric, leather, plastic)\nManufacture of diverse articles of leather or composition leather: driving belts, packings, etc.\nManufacture of shoe-lace, of leather\nManufacture of horse whips and riding crops\nThis class excludes :\nManufacture of leather wearing apparel, see 141;\nManufacture of leather gloves and hats, see 141;\nManufacture of footwear, see 152;\nManufacture of saddles for bicycles, see 3092;\nManufacture of precious metal watch straps, see 3211;\nManufacture of non-precious metal watch straps, see 3212;\nManufacture of linemenNULLs safety belts and other belts for occupational use, see 3299.','151'),('1521','Manufacture of Leather Shoes',NULL,'152'),('1522','Manufacture of Rubber Shoes',NULL,'152'),('1523','Manufacture of Plastic Shoes',NULL,'152'),('1524','Manufacture of Shoes Made of Textile Materials with Applied Soles',NULL,'152'),('1525','Manufacture of Wooden Footwear and Accessories',NULL,'152'),('1529','Manufacture of Footwear, N.e.c.',NULL,'152'),('1610','Sawmilling and Planing of Wood\n','This class includes :\nSawing, planing and machining of wood\nSlicing, peeling or chipping logs\nManufacture of wooden railway sleepers\nManufacture of unassembled wood flooring including parquet flooring\nImpregnation or chemical treatment of wood with preservatives or other materials, manufacture of wood wool, wood flour, chips, particles, when done as a primary activity\nOperation of sawmills and planing mill, whether or not mobile, in the forest or elsewhere\nSawing rough lumber or timber from logs and bolts or resawing cants and flitches into lumber\nPlaning combined with sawing or separately, producing surfaced lumber and timber and standard workings or patterns of lumber\nThis class excludes :\nLogging and production of wood in the rough, see 0220;\nManufacture of veneer sheets thin enough for use in plywood boards and panels, see 1621;\nManufacture shingles and shakes, beadings and moldings, see 1622.','161'),('1621','Manufacture of Veneer Sheets; Manufacture of Plywood, Laminboard, Particle Board and Other Panels and Board\n','This class includes :\nManufacture of veneer sheets thin enough to be used for veneering, making plywood or other purposes: smoothed dyed, coated, impregnated reinforced (with paper or fabric backing)\n made in the form of motifs\nManufacture of particle board and fiberboard\nManufacture of densified wood\nManufacture of plywood, veneer panels and similar laminated wood boards and sheets\nManufacture of glue laminated wood, laminated veneer wood','162'),('1622','Manufacture of Wooden Window and Door Screens, Shades and Venetian Blinds',NULL,'162'),('1623','Manufacture of Other Buildersnull Carpentry and Joinery; Millworking',NULL,'162'),('1624','Manufacture of Wooden Containers',NULL,'162'),('1625','Manufacture of Wood Carvings',NULL,'162'),('1626','Manufacture of Charcoal Outside the Forest',NULL,'162'),('1627','Manufacture of Wooden Wares',NULL,'162'),('1628','Manufacture of Products of Bamboo, Cane, Rattan and the Like, and Plaiting Materials Except Furniture',NULL,'162'),('1629','Manufacture of Other Products of Wood; Manufacture of Articles of Cork and Plaiting Materials, Except Furniture, N.e.c.',NULL,'162'),('1701','Manufacture of Pulp, Paper and Paperboard\n','This class includes :\nManufacture of bleached, semi-bleached or unbleached paper pulp by mechanical, chemical (dissolving or non-dissolving) or semi-chemical processes\nManufacture of cotton-linters pulp\nRemoval of ink and manufacture of pulp from waste paper\nManufacture of paper and paperboard intended for further industrial processing\nThis class also includes :\nFurther processing of paper and paperboard:\ncoating, covering and impregnation of paper and paperboard\nmanufacture of creped or crinkled paper\nmanufacture of laminates and foils, if laminated with paper and paperboard\nManufacture of hand-made paper\nManufacture of newsprint and other printing or writing paper\nManufacture of cellulose wadding and webs of cellulose fibers\nManufacture of carbon paper or stencil paper in rolls or large sheets\nThis class excludes :\nManufacture of corrugated paper and paperboard, see 1702;\nManufacture of further-processed articles of paper, paperboard or pulp, see 1709;\nManufacture of coated or impregnated paper, where the coating or impregnant is the main ingredient, see class in which the manufacture of the coating or impregnated is classified;\nManufacture of abrasive paper, see 2399;\nManufacture of cork life preservers, see 329.','170'),('1702','Manufacture of Corrugated Paper and Paperboard and of Containers of Paper and Paperboard',NULL,'170'),('1709','Manufacture of Other Articles of Paper and Paperboard\n','This class includes :\nManufacture of household and personal hygiene paper and cellulose wadding products :\ncleansing tissues\nhandkerchiefs, towels, serviettes\ntoilet paper\nsanitary towels and tampons, napkins and napkin liners for babies\ncups, dishes and trays\nManufacture of textile wadding and articles of wadding : sanitary towels, tampons etc.\nManufacture of printing and writing paper ready for use\nManufacture of computer printout paper ready for use\nManufacture of self-copy paper ready for use\nManufacture of duplicator stencils and carbon paper ready for use\nManufacture of gummed or adhesive paper ready for use\nManufacture of envelopes and letter-cards\nManufacture of registers, accounting books, binders, albums and similar educational and commercial stationery\nManufacture of boxes, pouches, wallets and writing compendium containing an assortment of paper stationery\nManufacture of wallpaper and similar wall coverings, including vinyl-coated and textile wallpaper\nManufacture of labels, whether printed or not\nManufacture of filter paper and paperboard\nManufacture of paper and paperboard bobbins, spools, cops, etc.\nManufacture of egg trays and other molded pulp packaging products, etc.\nManufacture of paper novelties\nThis class excludes :\nManufacture of paper or paperboard in bulk, see 1701;\nPrinting on paper products, see 1811;\nManufacture of playing cards, see 3240;\nManufacture of games and toys of paper or paperboard, see 3240.','170'),('1811','Printing',NULL,'181'),('1812','Service Activities Related to Printing\n','This class includes :\nBinding of printed sheets, e.g. into books, brochures, magazines, catalogues etc. by folding, assembling, stitching, glueing, collating, basting, adhesive binding, trimming, gold stamping, etc.\nComposition, typesetting, phototypesetting, pre-press data input including scanning and optical character recognition, electronic make-up\nPlate-making services including imagesetting and platesetting (for the printing processes letterpress and offset)\nEngraving or etching of cylinders for gravure\nPlate processes direct to plate (also photopolymer plates)\nPreparation of plates and dies for relief stamping or printing\nProduction of proofs\nArtistic work including preparation of litho stones and prepared woodblocks\nProduction of reprographic products\nDesign of printing products e.g. sketches, layouts, dummies etc.\nOther graphic activities such as die-sinking or die-stamping, Braille copying, punching and drilling, embossing, varnishing and laminating, collating and insetting, creasing','181'),('1820','Reproduction of Recorded Media\n','This class includes :\nReproduction from master copies of gramophone records, compact discs and tapes with music or other sound recordings from master copies of records\nReproduction from master copies of records, compact discs and tapes with motion pictures and other video recordings\nReproduction from master copies of software and data on discs and tapes\nThis class excludes :\nReproduction of printed matter, see 1811;\nPublishing of software, see 5820;\nProduction and distribution of motion pictures, videotapes and movies on DVD or similar media, see 5911, 5912, 5913;\nReproduction of motion picture films for theatrical distribution, see 5912;\nProduction of master copies for records or audio material, see 5920.','182'),('1910','Manufacture of Coke Oven Products',NULL,'191'),('1920','Manufacture of Refined Petroleum Products',NULL,'192'),('1990','Manufacture of Other Fuel Products',NULL,'199'),('2011','Manufacture of Basic Chemicals\n','This class includes the manufacture of chemicals using basic processes, such as thermal cracking and distillation. The output of these processes are usually separate chemical elements or separate chemically-defined compounds.\nThis class includes :\nManufacture of liquefied or compressed inorganic industrial or medical gases :\nelemental gases\nliquid or compressed air\nrefrigerant gases\nmixed industrial gases\ninert gases such as carbon dioxide\nisolating gases\nManufacture of dyes and pigments from any source in basic form or as concentrate\nManufacture of chemical elements\nManufacture of inorganic acids except nitric acid\nManufacture of alkalis, lyes and other inorganic bases except ammonia\nManufacture of other inorganic compounds\nManufacture of basic organic chemicals :\nacyclic hydrocarbons, saturated and unsaturated\ncyclic hydrocarbons, saturated and unsaturated\nacyclic and cyclic alcohols\nmono-and polycarboxylic acids, including acetic acid\nother oxygen-function compounds, including aldehydes, ketones, quinones and dual or poly oxygen-function compounds\nsynthetic glycerol; nitrogen-function organic compounds, including amines\nfermentation of sugarcane, cassava, corn or similar to produce alcohol and esters\nother organic compounds, including wood distillation products (e.g. charcoal) etc.\nManufacture of distilled water\nManufacture of synthetic aromatic products\nRoasting of iron pyrites\nManufacture of products of a kind used as fluorescent brightening agents or as luminophores\nEnrichment of uranium and thorium ores and production of fuel elements for nuclear reactors\nThis class excludes :\nExtraction of methane, ethane, butane or propane, see 0620;\nManufacture of fuel gases, such as ethane, butane or propane in a petroleum refinery, see 1920;\nManufacture of nitrogenous fertilizers and nitrogen compounds, see 2012;\nManufacture of ammonia, see 2012;\nManufacture of ammonium chloride, see 2012;\nManufacture of nitrites and nitrates of potassium, see 2012;\nManufacture of ammonium carbonates, see 2012;\nManufacture of plastics in primary forms, see 2013;\nManufacture of synthetic rubber in primary forms, see 2013;\nManufacture of prepared dyes and pigments, see 2022;\nManufacture of crude glycerol, see 2023;\nManufacture of natural essential oils, see 2029;\nManufacture of aromatic distilled waters, see 2029;\nManufacture of salicylic and O-acetylsalicylic acids, see 2100.','201'),('2012','Manufacture of Fertilizers and Nitrogen Compounds',NULL,'201'),('2013','Manufacture of Plastics and Synthetic Rubber in Primary Forms\n','This class includes the manufacture of resins, plastic materials, and non-vulcanizable thermoplastic elastomers and mixing and blending resins on a custom basis as well as the manufacture of non-customized synthetic resins.\nThis class includes :\nManufacture of plastics in primary forms :\npolymers, including those of ethylene, propylene, styrene, vinyl chloride, vinyl acetate and acrylics\npolyamides\nphenolic and epoxide resins and polyurethanes\nalkyd and polyester resins and polyethers\nsilicones\nion-exchangers based on polymers\nManufacture of synthetic rubber in primary forms: synthetic rubber, factice\nManufacture of mixtures of synthetic rubber and natural rubber or rubber-like gums (e.g. balata)\nManufacture of cellulose and its chemical derivatives\nThis class excludes :\nManufacture of artificial and synthetic fibers, filaments and yarn, see 2030;\nShredding of plastic products, see 3830.','201'),('2021','Manufacture of Pesticides and Other Agro-chemical Products',NULL,'202'),('2022','Manufacture of Paints, Varnishes and Similar Coatings, Printing Ink and Mastics\n','This class includes :\nManufacture of paints and varnishes, enamels or lacquers\nManufacture of prepared pigments and dyes, opacifiers and colors\nManufacture of vitrifiable enamels and glazes and engobes and similar preparations\nManufacture of mastics\nManufacture of caulking compounds and similar non-refractory filling or surfacing preparations\nManufacture of organic composite solvents and thinners\nManufacture of prepared paint or varnish removers\nManufacture of printing ink\nThis class excludes :\nManufacture of dyestuffs and pigments, see 2011;\nManufacture of writing and drawing ink, see 2029.','202'),('2023','Manufacture of Soap and Detergents, Cleaning and Polishing Preparations, Perfumes and Toilet Preparations\n','This class includes :\nManufacture of organic surface-active agents\nManufacture of soap\nManufacture of paper, wadding, felt etc., coated or covered with soap or detergent\nManufacture of crude glycerol\nManufacture of surface-active preparations: washing powders in solid or liquid form and detergents, dishwashing preparations and textile softeners\nManufacture of cleaning and polishing products :\npreparations for perfuming or deodorizing rooms\nartificial waxes and prepared waxes\npolishes and creams for leather\npolishes and creams for wood\npolishes for coachwork, glass and metal\nscouring pastes and powders, including paper, wadding etc. coated or covered with these\nManufacture of perfumes and toilet preparations :\nperfumes and toilet water\nbeauty and make-up preparations\nsunburn prevention and suntan preparations\nmanicure and pedicure preparations\nshampoos, hair lacquers, waxing and straightening preparations\ndentifrices and preparations for oral hygiene, including denture fixative preparations\nshaving preparations, including pre-shave and aftershave preparations\ndeodorants and bath salts and depilatories\nThis class excludes :\nManufacture of separate, chemically-defined compounds, see 2011;\nManufacture of glycerol, synthesized from petroleum products, see 2011;\nExtraction and refining of natural essential oils, see 2029.','202'),('2029','Manufacture of Other Chemical Products, N.e.c.\n','This class includes :\nManufacture of propellant powders\nManufacture of explosives and pyrotechnic products, including percussion caps, detonators, signalling flares, etc.\nManufacture of gelatine and its derivatives, glues and prepared adhesives, including rubber-based glues and adhesives\nManufacture of extracts of natural aromatic products\nManufacture of resinoids\nManufacture of aromatic distilled waters\nManufacture of mixtures of odoriferous products for the manufacture of perfumes or food\nManufacture of photographic plates, films, sensitized paper and other sensitized unexposed materials\nManufacture of chemical preparations for photographic uses\nManufacture of various chemical products :\npeptones, peptone derivatives other protein substances and their derivatives, n.e.c.\nessentials oils\nchemically-modified oils and fats\nmaterials used in the finishing of textiles and leather\npowders and pastes used in soldering, brazing or welding\nsubstances used to pickle metal\nprepared additives for cements\nactivated carbon, lubricating oil additives, prepared rubber accelerators, catalysts and other chemical products for industrial use\nanti-knock preparations, anti-freeze preparations\ncomposite diagnostic or laboratory reagents\nThis class also includes :\nManufacture of writing and drawing ink\nManufacture of matches\nThis class excludes :\nManufacture of chemically defined products in bulk, see 2011;\nManufacture of distilled water, see 2011;\nManufacture of synthetic aromatic products, see 2011;\nManufacture of printing ink, see 2022;\nManufacture of perfumes and toilet preparations, see 2023;\nManufacture of asphalt-based adhesives, see 2399.','202'),('2030','Manufacture of Man-made Fibers\n','This class includes :\nManufacture of synthetic or artificial filament tow\nManufacture of synthetic or artificial staple fibers, not carded, combined or otherwise processed for spinning\nManufacture of synthetic or artificial filament yarn, including high-tenacity yarn\nManufacture of synthetic or artificial mono-filament or strip\nThis class excludes :\nSpinning of synthetic or artificial fibers, see 1311;\nManufacture of yarns made of man-made staple, see 1311.','203'),('2100','Manufacture of Pharmaceuticals, Medicinal Chemical and Botanical Products\n','This class includes :\nManufacture of medicinal active substances to be used for their pharmacological properties in the manufacture of medicaments: antibiotics, basic vitamins, salicylic and O-acetylsalicylic acids, etc.\nManufacture of medicaments: antisera and other blood fractions, vaccines and diverse medicaments, including homeopathic preparations\nManufacture of chemical contraceptive products for external use and hormonal contraceptive medicaments\nManufacture of radioactive in-vivo diagnostic substances\nManufacture of biotech pharmaceuticals\nManufacture of medical diagnostic preparations, including pregnancy tests\nManufacture of chemically pure sugars\nProcessing of blood\nProcessing of glands and manufacture of extracts of glands, etc.\nManufacture of medical impregnated wadding, gauze, bandages, dressings, surgical gut string, etc.\nPreparation of botanical products (grinding, grading, milling) for pharmaceutical use\nThis class excludes :\nManufacture of herb infusions (mint, vervain, chamomile etc.), see 1079;\nManufacture of dental fillings, manufacture of dental cement, see 3250;\nManufacture of bone reconstruction cements, see 3250;\nWholesale of pharmaceuticals, see 4649;\nRetail sale of pharmaceuticals, see 4772;\nResearch and development for pharmaceuticals and biotech pharmaceuticals, see 7210;\nPackaging of pharmaceuticals, see 8292.','210'),('2211','Manufacture of Rubber Tires and Tubes; Retreading and Rebuilding of Rubber Tires\n','This class includes :\nManufacture of rubber tires for vehicles, equipment, mobile machinery, aircraft, toy, furniture and other uses: pneumatic tires and solid or cushion tires\nManufacture of inner tubes for tires\nManufacture of interchangeable tire treads, tire flaps, \"camelback\" strips for retreading tires, etc.\nTire rebuilding and retreading.\nThis class excludes :\nManufacture of tube repair materials, see 2219;\nTire and tube repair, fitting or replacement, see 4520.','221'),('2219','Manufacture of Other Rubber Products\n','This class includes :\nManufacture of other products of natural or synthetic rubber, unvulcanized, vulcanized or hardened :\nrubber plates, sheets, strips, rods, profile shapes\ntubes, pipes and hoses\nrubber conveyor or transmission belts or belting\nrubber hygienic articles, sheath contraceptives, teats, hot water bottles etc.\nrubber articles of apparel (if only seated together, not sewn)\nrubber thread and rope\nrubberized yarn and fabrics\nrubber rings, fittings and seals\nrubber roller coverings\ninflatable rubber mattresses\ninflatable balloons\nManufacture of rubber brushes\nManufacture of hard rubber pipe stems\nManufacture of hard rubber combs, hair pins, hair rollers, and similar\nThis class also includes :\nManufacture of rubber repair materials\nManufacture of textile fabric impregnated, coated, covered or laminated with rubber, where rubber is the chief constituent\nManufacture of rubber waterbed mattresses\nManufacture of rubber bathing caps and apron\nManufacture of rubber wet suits and diving suits\nThis class excludes :\nManufacture of tire cord fabrics, see 1399;\nManufacture of apparel of elastic fabrics, see 1419;\nManufacture of rubber footwear, see 152;\nManufacture of glues and adhesives based on rubber, see 2029;\nManufacture of \"camelback\" strips, see 2211;\nManufacture of inflatable rafts and boats, see 3011, 3012;\nManufacture of mattresses or uncovered cellular rubber, see 310;\nManufacture of rubber sports requisites, except apparel, see 3230;\nManufacture of rubber games and toys (including childrenNULLs wading pools, inflatable children rubber boats, inflatable rubber animals, balls and the like), see 3240;\nReclaiming of rubber, see 3830.','221'),('2220','Manufacture of Plastics Products\n','This includes processing of new or spent (i.e. recycled) plastics resins into intermediate or final products, using such processes as compression molding, extrusion molding, injection molding, blow molding and casting. For most of these, the production process is such that a wide variety of products can be made.\nThis class includes :\nManufacture of semi-manufactures of plastic products : plastic plates, sheets, blocks, films, foil, strip etc. (whether self-adhesive or not)\nManufacture of finished plastic products: plastic tubes, pipes and hoses; hose and pipe fittings\nManufacture of plastic articles for the packing of goods: plastic bags, sacks, containers, boxes, cases, carboys, bottles etc.\nManufacture of buildersNULL plastics ware : plastic doors, windows, frames, shutters, blinds, skirting boards; tanks, reservoirs; plastic floor, wall or ceiling coverings in rolls or in the form of tiles, etc; plastic sanitary ware like plastic baths, shower-baths, washbasins, lavatory pans, flushing cisterns etc.\nManufacture of plastic tableware, kitchenware and toilet articles\nManufacture of cellophane film or sheet\nManufacture of resilient floor coverings, such as vinyl, linoleum etc.\nManufacture of artificial stone (e.g. cultured marble)\nManufacture of plastic signs (non-electrical)\nManufacture of diverse plastic products: plastic headgear, insulating fittings, parts of lighting fittings, office or school supplies, articles of apparel (if only sealed together, not sewn), fittings for furniture, statuettes, transmission and conveyer belts, self-adhesive tapes of plastic, plastic wallpaper plastic shoe lasts, plastic cigar and cigarettes holders, combs, plastic hair curlers, plastic novelties, etc.\nThis class excludes :\nManufacture of plastic luggage, see 1512;\nManufacture of plastic footwear, see 152;\nManufacture of plastics in primary forms, see 2013;\nManufacture of articles of synthetic or natural rubber, see 221;\nManufacture of plastic furniture, see 3105;\nManufacture of mattresses of uncovered cellular plastic, see 3109;\nManufacture of plastic sports requisites, see 3230;\nManufacture of plastic games and toys, see 3240;\nManufacture of plastic medical and dental appliances, see 3250;\nManufacture of plastic ophthalmic goods, see 3250;\nManufacture of plastic hard hats and other personal safety equipment of plastic, see 3299;\nManufacture of plastic non-current carrying wiring devices (e.g. junction boxes, face plates etc.), see 2733.','222'),('2310','Manufacture of Glass and Glass Products\n','This class includes the manufacture of glass in all forms, made by any process and the manufacture of articles of glass.\nThis class includes :\nManufacture of flat glass, including wired, colored or tinted flat glass\nManufacture of toughened or laminated flat glass\nManufacture of glass in rods or tubes\nManufacture of glass paving blocks\nManufacture of glass mirrors\nManufacture of multiple-walled insulating units of glass\nManufacture of bottles and other containers of glass or crystal\nManufacture of drinking glasses and other domestic glass or crystal articles\nManufacture of glass fibers, including glass wool and non-woven products thereof\nManufacture of laboratory, hygienic or pharmaceutical glassware\nManufacture of clock or watch glasses, optical glass and optical elements not optically worked\nManufacture of glassware used in imitation jewelry\nManufacture of glass insulators and glass insulating fittings\nManufacture of glass envelopes for lamps\nManufacture of glass figurines\nThis class excludes :\nManufacture of woven fabrics of glass yarn, see 1312;\nManufacture of optical elements optically worked, see 2670;\nManufacture of fiber optic cable for data transmission or live transmission of images, see 2731;\nManufacture of glass toys, see 3240;\nManufacture of syringes and other medical laboratory equipment, see 3250.','231'),('2391','Manufacture of Refractory Products',NULL,'239'),('2392','Manufacture of Clay Building Materials',NULL,'239'),('2393','Manufacture of Other Porcelain and Ceramic Products\n','This class includes :\nManufacture of ceramic tableware and other domestic or toilet articles\nManufacture of statuettes and other ornamental ceramic articles\nManufacture of electrical insulators and insulating fittings of ceramics\nManufacture of ceramic and ferrite magnets\nManufacture of ceramic laboratory, chemical and industrial products\nManufacture of ceramic pots, jars and similar articles of a kind used for conveyance or packing of goods\nManufacture of ceramic furniture\nManufacture of ceramic products, n.e.c.\nThis class excludes:\nManufacture of artificial stone (e.g. cultured marble), see 2220;\nManufacture of refractory ceramic goods, see 2391;\nManufacture of ceramic building materials, see 2392;\nManufacture of ceramic sanitary fixtures, see 2392;\nManufacture of permanent metallic magnets, see 2599;\nManufacture of imitation jewelry, see 3212;\nManufacture of ceramic toys, see 3240;\nManufacture of artificial teeth, see 3250.','239'),('2394','Manufacture of Cement',NULL,'239'),('2395','Manufacture of Lime and Plaster\n','This class includes :\nManufacture of quicklime, slaked lime and hydraulic lime\nManufacture of plasters of calcined gypsum or calcined sulfate\nManufacture of calcined dolomite','239'),('2396','Manufacture of Articles of Concrete, Cement and Plaster\n','This class includes :\nManufacture of precast concrete, cement or artificial stone articles for use in construction: tiles, flagstones, bricks, boards, sheets, panels, pipes, posts, etc.\nManufacture of prefabricated structural components for building or civil engineering of cement, concrete or artificial stone\nManufacture of plaster articles for use in construction: boards, sheets, panels, etc.\nManufacture of building materials of vegetable substances (wood wool, straw, reeds, rushes) agglomerated with cement, plaster or other mineral binder\nManufacture of articles of asbestos-cement or cellulose fiber-cement or the like: corrugated sheets, other sheets, panels, tiles, tubes, pipes, reservoirs, troughs, basins, sinks, jars, furniture, window frames, etc.\nManufacture of other articles of concrete, plaster, cement or artificial stone: statuary, furniture, bas-and haut-reliefs, vases, flowerpots, etc.\nManufacture of powdered mortars\nManufacture of ready-mix and dry-mix concrete and mortars\nThis class excludes manufacture of refractory cements and mortars, see 2391.','239'),('2397','Cutting, Shaping and Finishing of Stone',NULL,'239'),('2399','Manufacture of Other Non-metallic Mineral Products, N.e.c.\n','This class includes :\nManufacture of millstones, sharpening or polishing stones and natural or artificial abrasive products, including abrasive products on a soft base (e.g. sandpaper)\nManufacture of friction material and unmounted articles thereof with a base of mineral substances or of cellulose\nManufacture of mineral insulating materials: slag wool, rock wool and similar mineral wools; exfoliated vermiculite, expanded clays and similar heat-insulating, sound-insulating or sound absorbing materials\nManufacture of articles of diverse mineral substances: worked mica and articles of mica, of peat, of graphite (other than electrical articles), etc.\nManufacture of articles of asphalt or similar materials, e.g. asphalt-based adhesives, coal tar pitch, etc.\nCarbon and graphite fibers and products (except electrodes and electrical applications)\nThis class excludes:\nManufacture of glass wool and non-woven glass wool products, see 2310;\nManufacture of carbon or graphite gaskets, see 2819.','239'),('2411','Operation of Blast Furnaces and Steel Making Furnaces',NULL,'241'),('2412','Operation of Steel Works and Rolling Mills',NULL,'241'),('2421','Gold and Other Precious Metal Refining',NULL,'242'),('2422','Non-ferrous Smelting and Refining , Except Precious Metals',NULL,'242'),('2423','Non-ferrous Rolling, Drawing and Extrusion Mills',NULL,'242'),('2424','Manufacture of Pipe Fittings of Non-ferrous Metals',NULL,'242'),('2429','Manufacture of Basic Precious and Other Non-ferrous Metals, N.e.c.',NULL,'242'),('2431','Casting of Iron and Steel\n','This class includes the casting of iron and steel, i.e. the activities of iron and steel foundries.\nThis class includes :\nCasting of semi-finished iron products\nCasting of grey iron castings\nCasting of spheroidal graphite iron castings\nCasting of malleable cast-iron products\nManufacture of tubes, pipes and hollow profiles and of tube or pipe fittings of cast-iron\nCasting of semi-finished steel products\nCasting of steel castings\nManufacture of seamless tubes and pipes of steel by centrifugal casting\nManufacture of tube or pipe fittings of cast-steel','243'),('2432','Casting of Non-ferrous Metals\n','This class includes :\nCasting of semi-finished products of aluminum, magnesium, titanium, zinc, etc.\nCasting of light metal castings\nCasting of heavy metal castings\nCasting of precious metal castings\nDie-casting of non-ferrous metal castings','243'),('2511','Manufacture of Structural Metal Products\n','This class includes :\nManufacture of metal frameworks or skeletons for construction and parts thereof (towers, masts, trusses, bridges, etc)\nManufacture of industrial frameworks in metal (frameworks for blast furnaces, lifting and handling equipment, etc)\nManufacture of prefabricated buildings mainly of metal: site huts, modular exhibition elements, etc.\nManufacture of metal doors, windows and their frames, shutters and gates\nMetal room partitions for floor attachment.\nThis class excludes :\nManufacture of parts for marine or power boilers, see 2513;\nManufacture of assembled railway track fixtures, see 2599;\nManufacture of sections of ships, see 3011.','251'),('2512','Manufacture of Tanks, Reservoirs and Containers of Metal',NULL,'251'),('2513','Manufacture of Steam Generators, Except Central Heating Hot Water Boilers',NULL,'251'),('2520','Manufacture of Weapons and Ammunition\n','This class includes :\nManufacture of heavy weapons (artillery, mobile guns, rocket launchers, torpedo tubes, heavy machine guns)\nManufacture of small arms (revolvers, shotguns, light machine guns)\nManufacture of air or gas guns and pistols\nManufacture of war ammunition\nManufacture of hunting sporting or protective firearms and ammunition\nManufacture of explosive devices such as bombs, mines and torpedoes\nThis class excludes :\nManufacture of percussion caps, detonators or signalling flares, see 2029;\nManufacture of cutlasses, swords, bayonets, etc., see 2593;\nManufacture of armored vehicles for the transport of banknotes or valuables, see 2910;\nManufacture of space vehicles, see 3030;\nManufacture of tanks and other fighting vehicles, see 3040.','252'),('2591','Forging, Pressing, Stamping and Roll-forming of Metal; Powder Metallurgy\n','This class includes :\nForging, pressing, stamping and roll forming of metal\nPowder metallurgy: production of metal objects directly from metal powders by heat treatment (sintering) or under pressure\nThis class excludes production of metal powder, see 241, 242.','259'),('2592','Treatment and Coating of Metals; Machining',NULL,'259'),('2593','Manufacture of Cutlery, Hand Tools and General Hardware\n','This class includes :\nManufacture of domestic cutlery, such as knives, forks, spoons, etc.\nManufacture of other articles of cutlery: cleavers and choppers, razors and razor blades, scissors and hair clippers\nManufacture of knives and cutting blades for machines or for mechanical appliances\nManufacture of hand tools such as pliers, screwdrivers, etc.\nManufacture of non-power-driven agricultural hand tools\nManufacture of saws and saw blades, including circular saw blades and chainsaw blades\nManufacture of interchangeable tools for hand tools, whether or not power-operated, or for machine tools, drills, punches, milling cutters, etc.\nManufacture of press tools\nManufacture of blacksmithsNULL tools: forges, anvils, etc.\nManufacture of molding boxes and molds (except ingot molds)\nManufacture of vices, clamps\nManufacture of padlocks, locks, key, hinges and the like, hardware for buildings, furniture, vehicles, etc.\nManufacture of cutlasses, swords, bayonets, etc.\nThis class excludes :\nManufacture of hollowware (pots, kettles, etc.), dinnerware (bowls, platters, etc.) or flatware (plates, saucers, etc.), see 2599;\nManufacture of power-driven hand tools, see 2818;\nManufacture of ingot molds, see 2823;\nManufacture of cutlery of precious metals, see 3211.','259'),('2599','Manufacture of Other Fabricated Metal Products, N.e.c.\n','This class includes :\nManufacture of pails, cans, drums, buckets, boxes\nManufacture of tins and cans for food products, collapsible tubes and boxes\nManufacture of metallic closures\nManufacture of metal cable, plaited bands and similar articles\nManufacture of uninsulated, metal cable or insulated cable not capable of being used as a conductor of electricity\nManufacture of articles made of wire, barbed wire, wire fencing, grill, netting, cloth, etc.\nManufacture of nails and pins\nManufacture of rivets, washers and similar non-threaded products\nManufacture of screw machine products\nManufacture of bolts, screws, nuts and similar threaded products\nManufacture of springs (except watch springs) : leaf springs, helical springs, torsion bar springs; leave for springs\nManufacture of chain, except power transmission chain\nManufacture of metal household articles : flatware - plates, saucers, etc.; hollowware - pots, kettles, etc.; dinnerware - bowls, platters, etc.; saucepans, frying pans and other non-electrical utensils for use at the table or in the kitchen; small hand-operated kitchen appliances and accessories; metal scouring pads\nManufacture of baths, sinks, washbasins and similar articles\nManufacture of metal goods for office use, except furniture\nManufacture of safes, strongboxes, armored doors, etc.\nManufacture of various metal articles : ship propellers and blades thereof; anchors; bells; assembled railway track fixtures; clasps, buckles, hooks\nManufacture of foil bags\nManufacture of permanent metallic magnets\nManufacture of metal vacuum jugs and bottles\nManufacture of metal signs (non-electrical)\nManufacture of metal badges and metal military insignia\nManufacture of metal hair curlers, metal umbrella handles and frames, combs\nThis class excludes :\nManufacture of ceramic and ferrite magnets, see 2393;\nManufacture of tanks and reservoirs, see 2512;\nManufacture of swords, bayonets, see 2593;\nManufacture of clock or watch springs, see 2652;\nManufacture of wire and cable for electricity transmission, see 2732;\nManufacture of power transmission chain, see 2814;\nManufacture of shopping carts, see 3099;\nManufacture of metal furniture, see 3106;\nManufacture of sports goods, see 3230;\nManufacture of games and toys, see 3240.','259'),('2611','Manufacture of Electronic Valves and Tubes',NULL,'261'),('2612','Manufacture of Semi-conductor Devices and Other Electronic Components',NULL,'261'),('2620','Manufacture of Computers and Peripheral Equipment and Accessories',NULL,'262'),('2630','Manufacture of Communication Equipment',NULL,'263'),('2640','Manufacture of Consumer Electronics',NULL,'264'),('2651','Manufacture of Measuring, Testing, Navigating and Control Equipment\n','This class includes manufacture of search, detection, navigation, guidance, aeronautical and nautical systems and instruments; automatic controls and regulators for applications, such as heating, air-conditioning, refrigeration and appliances; instruments and devices for measuring, displaying, indicating, recording, transmitting and controlling industrial process variables, such as temperature, humidity, pressure, vacuum, combustion, flow, level, viscosity, density, acidity, concentration and rotation totalizing (i.e. registering) fluid meters and counting devices; instruments for measuring and testing the characteristics of electricity and electrical signals; instruments and instrumentation systems for laboratory analysis of the chemical or physical composition or concentration of samples of solid, fluid, gaseous or composite material and other measuring and testing instruments and parts thereof.\nThe manufacture of non-electric measuring, testing, navigating and control equipment (except simple mechanical tools) is included here.\nThis class includes :\nManufacture of aircraft engine instruments\nManufacture of automotive emissions testing equipment\nManufacture of meteorological instruments\nManufacture of physical properties testing and inspection equipment\nManufacture of polygraph machines\nManufacture of instruments for measuring and testing electricity and electrical signals (including for telecommunications)\nManufacture of radiation detection and monitoring instruments\nManufacture of surveying instruments\nManufacture of electron and proton microscopes\nManufacture of thermometers liquid-in-glass and bimetal types (except medical)\nManufacture of humidistats\nManufacture of hydronic limit controls\nManufacture of flame and burner control\nManufacture of spectrometers\nManufacture of pneumatic gauges\nManufacture of consumption meters (e.g. water, gas)\nManufacture of flow meters and counting devices\nManufacture of tally counters\nManufacture of mine detectors, pulse (signal) generators; metal detectors\nManufacture of search, detection, navigation, aeronautical and nautical equipment, including sonobuoys\nManufacture of radar equipment\nManufacture of GPS devices\nManufacture of environmental controls and automatic controls for appliances\nManufacture of measuring and recording equipment (e.g. flight recorders)\nManufacture of motion detectors\nManufacture of laboratory analytical instruments (e.g. blood analysis equipment)\nManufacture of laboratory scales, balances, incubators, and miscellaneous laboratory apparatus for measuring testing, etc.\nThis class excludes :\nManufacture of telephone answering machines, see 2630;\nManufacture of irradiation equipment, see 2660;\nManufacture of optical measuring and checking devices and instrument (e.g. fire control equipment, photographic light meters, range finders) see 2670;\nManufacture of optical positioning equipment, see 2670;\nManufacture of dictating machines, see 2817;\nManufacture of levels, tape measures and similar hand tools, machinists precision tools, see 2819;\nManufacture of medical thermometers, see 3250;\nInstallation of industrial process control equipment, see 3320.','265'),('2652','Manufacture of Watches and Clocks\n','This class includes the manufacture of watches, clocks and timing mechanisms and parts thereof.\nThis class includes :\nManufacture of watches and clocks of all kinds, including instrument panel clocks\nManufacture of watch and clock cases, including cases of precious metals\nManufacture of time-recording equipment and equipment for measuring, recording and otherwise displaying intervals of time with a watch or clock movement or with synchronous motor, such as: parking meters, time clocks, time/date stamps, process timers\nManufacture of time switches and other releases with a watch or clock movement or with synchronous motor: time locks\nManufacture of components for clocks and watches: movement of all kinds for watches and clocks, spring, jewels, dials, hands, plates, bridges and other parts\nThis class excludes :\nManufacture of non-metal watch bands (textile, leather, plastic), see 1512;\nManufacture of watch bands of precious metal, see 3211;\nManufacture of watch bands of non-precious metal, see 3212.','265'),('2660','Manufacture of Irradiation, Electromedical and Electrotherapeutic Equipment\n','This class includes :\nManufacture of irradiation apparatus and tubes (e.g. industrial, medical diagnostic, medical therapeutic, research, scientific) : beta, gamma, X-ray or other radiation equipment\nManufacture of CT scanners\nManufacture of PET scanners\nManufacture of magnetic resonance imaging (MRI) equipment\nManufacture of medical ultrasound equipment\nManufacture of electrocardiographs\nManufacture of electromedical endoscopic equipment\nManufacture of medical laser equipment\nManufacture of pacemakers\nManufacture of hearing aids\nManufacture of food and milk irradiation equipment\nThis class excludes :\nManufacture of laboratory analytical instruments (e.g. blood analysis equipment), see 2651;\nManufacture of tanning beds, see 2790.','266'),('2670','Manufacture of Optical Instruments and Photographic Equipment\n','This class includes the manufacture of optical instruments and lenses, such as binoculars, microscopes (except electron, proton), telescopes, prisms, and lenses (except ophthalmic)\n coating or polishing lenses (except ophthalmic)\n mounting of lenses (except ophthalmic)\n and the manufacture of photographic equipment such as cameras and light meters.\nThis class includes :\nManufacture of lenses and prisms\nManufacture of optical mirrors\nManufacture of optical gun sighting equipment\nManufacture of optical positioning equipment\nManufacture of optical magnifying instruments\nManufacture of optical machinistNULLs precision tools\nManufacture of optical comparators\nManufacture of film cameras and digital cameras\nManufacture of motion picture and slide projectors\nManufacture of overhead transparency projectors\nManufacture of optical measuring and checking devices and instruments (e.g. fire control equipment, photographic light meters, range finders)\nManufacture of optical microscopes, binoculars and telescopes\nManufacture of laser assemblies\nAlso includes coating, polishing and mounting of lenses.\nThis class excludes :\nManufacture of computer projections, see 2620;\nManufacture of commercial TV and video cameras, see 2630;\nManufacture of household-type video cameras, see 2640;\nManufacture of electron and proton microscopes, see 2651;\nManufacture of complete equipment using laser components, see manufacturing class by type of machinery (e.g. medical laser equipment, see 2660)\n Manufacture of photocopy machinery, see 2817;\nManufacture of ophthalmic goods, see 3250.','267'),('2680','Manufacture of Magnetic and Optical Media',NULL,'268'),('2711','Manufacture of Electric Motors, Generators, Transformers and Electric Generating Sets',NULL,'271'),('2712','Manufacture of Electricity Distribution and Control Apparatus',NULL,'271'),('2720','Manufacture of Batteries and Accumulators\n','This class includes the manufacture of non-rechargeable and rechargeable batteries.\nThis class includes :\nManufacture of primary cells and primary batteries: cells containing manganese dioxide, mercuric dioxide, silver oxide, etc.\nManufacture of electric accumulators, including parts thereof : separators, containers, covers\nManufacture of lead acid batteries\nManufacture of NiCad batteries\nManufacture of NiMH batteries\nManufacture of lithium batteries\nManufacture of dry cell batteries\nManufacture of wet cell batteries','272'),('2731','Manufacture of Fiber Optic Cables',NULL,'273'),('2732','Manufacture of Other Electronic and Electric Wires and Cables',NULL,'273'),('2733','Manufacture of Wiring Devices',NULL,'273'),('2740','Manufacture of Electric Lighting Equipment\n','This class includes the manufacture of electric light bulbs and tubes and parts and components thereof (except glass blanks for electric light bulbs), electric lighting fixtures and lighting fixture components (except current-carrying wiring devices).\nThis class includes :\nManufacture of discharge, incandescent, fluorescent, ultra-violet, infra-red etc., lamps, fixtures and bulbs\nManufacture of ceiling lighting fixtures\nManufacture of chandeliers\nManufacture of table lamps (i.e. lighting fixture)\nManufacture of Christmas tree lighting sets\nManufacture of electric fireplace logs\nManufacture of flashlights\nManufacture of electric insect lamps\nManufacture of lanterns (e.g. carbide, electric, gas, gasoline, kerosene)\nManufacture of spotlights\nManufacture of street lighting fixtures (except traffic signals)\nManufacture of lighting equipment for transportation equipment (e.g. for motor vehicles, aircraft, boats)\nThis class also includes manufacture of non-electrical lighting equipment\nThis class excludes :\nManufacture of glassware and glass parts for lighting fixtures, see 2310;\nManufacture of current-carrying wiring devices for lighting fixtures, see 2733;\nManufacture of ceiling fans or bath fans with integrated lighting fixtures, see 2750;\nManufacture of electrical signalling equipment such as traffic lights and pedestrian signalling equipment, see 2790.','274'),('2750','Manufacture of Domestic Appliances\n','This class includes the manufacture of small electric appliances and electric housewares, household-type fans, vacuum cleaners, electric floor care machines, cooking appliances, laundry equipment, refrigerators, upright and chest freezers and other electrical and non-electrical household appliances, such as dishwashers, water heaters and garbage disposal units. This class includes the manufacture of appliances with electric, gas or other fuel sources.\nThis class includes :\nManufacture of domestic electric appliances :\nrefrigerators, freezers, dishwashers, washing and drying machines, vacuum cleaners, floor polishers, waste disposers, grinders, blenders, juice squeezers, tin openers, electric shavers, electric toothbrushes, and other electric personal care device, knife sharpeners, ventilating or recycling hoods\nManufacture of domestic electrothermic appliances:\nelectric water heaters, electric blankets, electric dryers, combs, brushes, curlers, electric smoothing irons, space heaters and household-type fans, portable, electric oven, microwave ovens, cookers, hotplates, toasters, coffee or tea makers, fry pans, roasters, grills, hoods, electric heating resistors, etc.\nManufacture of domestic non-electric cooking and heating equipment: non-electric space heaters, cooking ranges, grates, stoves, water heaters, cooking appliances, plate warmers.\nThis class excludes :\nManufacture of commercial and industrial refrigerators and freezers, room air-conditioners, attic fans, permanent mount space heaters, and commercial ventilation and exhaust fans, commercial-type, cooking equipment; commercial-type laundry, dry-cleaning and pressing equipment, commercial, industrial and institutional vacuum cleaners, see division 28;\nManufacture of household-type sewing machines, see 2826;\nInstallation of central vacuum cleaning systems, see 4329.','275'),('2790','Manufacture of Other Electrical Equipment\n','This class includes the manufacture of miscellaneous electrical equipment other than motors, generators and transformers, batteries and accumulators, wires and wiring devices, lighting equipment or domestic appliances.\nThis class includes :\nManufacture of battery chargers, solid-state\nManufacture of door opening and closing devices, electrical\nManufacture of electric bells\nManufacture of ultrasonic cleaning machines (except laboratory and dental)\nManufacture of tanning beds\nManufacture of solid state inverters, rectifying apparatus, fuel cells, regulated and unregulated power supplies\nManufacture of uninterruptible power supplies (UPS)\nManufacture of surge suppressors (except for distribution level voltage)\nManufacture of appliance cords, extension cords, and other electrical cord sets with insulated wire and connectors\nManufacture of carbon and graphite electrodes, contacts, and other electrical carbon and graphite products\nManufacture of particle accelerators\nManufacture of electrical capacitors, resistors, condensers, and similar components\nManufacture of electromagnets\nManufacture of sirens\nManufacture of electronic scoreboards\nManufacture of electrical signs\nManufacture of electrical signalling equipment such as traffic lights and pedestrian signalling equipment\nManufacture of electrical insulators (except glass or porcelain)\nManufacture of electrical welding and soldering equipment, including hand-held soldering irons\nThis class excludes :\nManufacture of non-electrical signs, see class according to material (plastic signs 2220, metal signs 2599)  \nManufacture of porcelain electrical insulators, see 2393;\nManufacture of carbon and graphite fibers and products (except electrodes and electrical applications), see 2399;\nManufacture of electronic component-type rectifiers, voltage regulating integrated circuits, power converting integrated circuits, electronic capacitors, electronic resistors, and similar devices, see 2612;\nManufacture of transformers, motors, generators, switch gear, relays, and industrial controls, see 2712;\nManufacture of batteries, see 2720;\nManufacture of communication and energy wire, current-carrying and non current-carrying wiring devices, see 2733;\nManufacture of lighting equipment, see 2740;\nManufacture of household-type appliances, see 2750;\nManufacture of non-electrical welding and soldering equipment, see 2819;\nManufacture of motor vehicle electrical equipment, such as generators, alternators, spark plugs, ignition wiring harnesses, power window and door systems, voltage regulators, see 2930;\nManufacture of mechanical and electromechanical signalling equipment, safety and traffic control equipment for railways, tramways, inland waterways, roads, parking facilities, airfields, see 3020.','279'),('2811','Manufacture of Engines and Turbines, Except Aircraft, Vehicle and Cycle Engines\n','This class includes :\nManufacture of internal combustion piston engines, except motor vehicle, aircraft and cycle propulsion engines: marine engines, railway engines\nManufacture of pistons, piston rings, carburetors and such for all internal combustion engines, diesel engines, etc.\nManufacture of inlet and exhaust valves of internal combustion engines\nManufacture of turbines and parts thereof: steam turbines and other vapor turbines, hydraulic turbines, waterwheels and regulators thereof, wind turbines, gas turbines, except turbo jets or turbo propellers for aircraft propulsion\nManufacture of boiler-turbine sets\nManufacture of turbine-generator sets\nThis class excludes :\nManufacture of electric generators (except turbine generator sets), see 2711;\nManufacture of prime mover generator sets (except turbine generator sets), see 2711;\nManufacture of electrical equipment and components of internal combustion engines, see 2790;\nManufacture of motor vehicle, aircraft or cycle propulsion engines, see 2910, 3030, 3091;\nManufacture of turbojets and turbo propellers, see 3030.','281'),('2812','Manufacture of Fluid Power Equipment',NULL,'281'),('2813','Manufacture of Other Pumps, Compressors, Taps and Valves\n','This class includes :\nManufacture of air or vacuum pumps, air or other gas compressors\nManufacture of pumps for liquid whether or not fitted with a measuring device\nManufacture of pumps designed for fitting to internal combustion engines: oil, water and fuel pumps for motor vehicles, etc.\nThis class also includes :\nManufacture of industrial taps and valves, including regulating valves and intake taps\nManufacture of sanitary taps and valves\nManufacture of heating taps and valves\nManufacture of hand pumps.\nThis class excludes :\nManufacture of valves of unhardened vulcanized rubber, glass or of ceramic materials, see 2219, 2310 or 2393.\nManufacture of hydraulic transmission equipment, see 2812;\nManufacture of inlet and exhaust of internal combustion engines, see 2811.','281'),('2814','Manufacture of Bearings, Gears and Driving Elements',NULL,'281'),('2815','Manufacture of Ovens, Furnaces and Furnace Burners',NULL,'281'),('2816','Manufacture of Lifting and Handling Equipment\n','This class includes :\nManufacture of hand-operated or power-driven lifting, handling, loading or unloading machinery :\npulley tackle and hoists, winches, capstans and jacks\nderricks, cranes, mobile lifting frames, straddle carriers etc.\nworks trucks, whether or not fitted with lifting or handling equipment, whether or not self-propelled, of the type used in factories (including hand trucks and wheelbarrows)\nmechanical manipulators and industrial robots specifically designed for lifting, handling, loading or unloading\nManufacture of conveyors, telfers, etc.\nManufacture of lifts, escalators and moving walkways\nManufacture of parts specialized for lifting and handling equipment\nThis class excludes :\nManufacture of continuous-action elevators and conveyors for underground use, see 2824;\nManufacture of mechanical shovels, excavators and shovel loaders, see 2824;\nManufacture of industrial robots for multiple uses, see 2829;\nManufacture of crane-lorries, floating cranes, railway cranes, see 2910,3011,3020;\nInstallation of lifts and elevators, see 4329.','281'),('2817','Manufacture of Office Machinery and Equipment (Except Computers and Peripheral Equipment)\n','This class includes :\nManufacture of calculating machines\nManufacture of adding machines, cash registers\nManufacture of calculators, electronic or not\nManufacture of postage meters, mail handling machines (envelope stuffing, sealing and addressing machinery; opening, sorting, scanning), collating machinery\nManufacture of typewriters\nManufacture of stenography machines\nManufacture of office-type binding equipment (I.e. plastic or tape binding)\nManufacture of cheque writing machines\nManufacture of coin counting and coin wrapping machinery\nManufacture of pencil sharpeners\nManufacture of staplers and staple removers\nManufacture of voting machines\nManufacture of tape dispensers\nManufacture of hole punches\nManufacture of cash registers, mechanically operated\nManufacture of photocopy machines\nManufacture of toner cartridges\nManufacture of blackboards, white boards and marker boards\nManufacture of dictating machines\nThis class excludes manufacture of computers and peripheral equipment, see 2620.','281'),('2818','Manufacture of Power-driven Hand Tools',NULL,'281'),('2819','Manufacture of Other General-purpose Machinery\n','This class includes :\nManufacture of industrial refrigerating or freezing equipment, including assemblies of major components\nManufacture of air-conditioning machines, including for motor vehicles\nManufacture of non-domestic fans\nManufacture of weighing machinery (other than sensitive laboratory balances): household and shop scales, platform scales, scales for continuous weighing, weighbridges, weights, etc.\nManufacture of filtering or purifying machinery and apparatus for liquids\nManufacture of equipment for projecting, dispersing or spraying liquids or powders: spray guns, fire extinguishers, sandblasting machines, steam cleaning machines, etc.\nManufacture of packing and wrapping machinery: filling, closing, sealing, capsulling or labeling machines, etc.\nManufacture of machinery for cleaning or drying bottles and for aerating beverages\nManufacture of distilling or rectifying plant for petroleum refineries, chemical industries, beverage industries, etc.\nManufacture of heat exchangers\nManufacture of machinery for liquefying air or gas\nManufacture of gas generators\nManufacture of calendering or other rolling machines and cylinders thereof (except for metal and glass)\nManufacture of centrifuges (except cream separators and clothes dryers)\nManufacture of gaskets and similar joints made of a combination of materials or layers of the same material\nManufacture of automatic goods vending machines\nManufacture of parts for general-purpose machinery\nManufacture of attic ventilation fans (gable fans, roof ventilators, etc.)\nManufacture of levels, tape measures and similar hand tools, machinistsNULL precision tools (except optical)\nManufacture of non-electrical welding and soldering equipment\nThis class excludes :\nManufacture of sensitive (laboratory-type) balances, see 2651;\nManufacture of domestic refrigerating or freezing equipment, see 2750;\nManufacture of domestic fans, see 2750;\nManufacture of electrical welding and soldering equipment, see 2790;\nManufacture of agricultural spraying machinery, see 2821;\nManufacture of metal or glass rolling machinery and cylinders thereof, see 2823, 2829;\nManufacture of agricultural dryers, machinery for filtering or purifying food and cream separators see 2825;\nManufacture of commercial clothes dryers and textile printing machinery see 2826.','281'),('2821','Manufacture of Agricultural and Forestry Machinery\n','This class includes :\nManufacture of tractors used in agriculture and forestry\nManufacture of walking (pedestrian-controlled) tractors\nManufacture of mowers, including lawnmowers\nManufacture of agricultural self-loading or self-unloading trailers or semi-trailers\nManufacture of agricultural machinery for soil preparation, planning or fertilizing: ploughs, manure spreaders, seeders, harrows, etc.\nManufacture of harvesting or threshing machinery: harvesters, threshers, sorters, etc.\nManufacture of milking machines\nManufacture of spraying machinery for agricultural use\nManufacture of diverse agricultural machinery: poultry-keeping machinery, bee-keeping machinery, equipment for preparing fodder, etc.; machines for cleaning, sorting or grading eggs, fruits, etc.\nThis class excludes :\nManufacture of non-power-driven agricultural hand tools, see 2593;\nManufacture of conveyors for farm use, see 2816;\nManufacture of power-driven hand tools, see 2818;\nManufacture of cream separators, see 2825;\nManufacture of machinery to clean, sort or grade seed, grain or dried leguminous vegetables, see 2825;\nManufacture of road tractors for semi-trailers, see 2910;\nManufacture of road trailers or semi-trailers, see 2920.','282'),('2822','Manufacture of Metal-forming Machinery and Machine Tools\n','This class includes :\nManufacture of machine tools for working metals and other materials (wood, bone, stone, hard rubber, hard plastic, cold glass, etc.), including those using a laser beam, ultrasonic waves, plasma arc, magnetic pulse etc.\nManufacture of machine tools for turning, drilling, milling, shaping, planning, boring, grinding, etc.\nManufacture of stamping or pressing machine tools\nManufacture of punch presses, hydraulic presses, hydraulic brakes, drop hammers, forging machines, etc.\nManufacture of draw-benches, thread rollers or machines for working wires\nManufacture of stationary machines for nailing, stapling, glueing or otherwise assembling wood, cork, bone, hard rubber or plastics, etc.\nManufacture of stationary rotary or rotary percussions drills, filing machines, riveters, sheet metal cutters etc.\nManufacture of presses for the manufacture of particle board and the like\nManufacture of electroplating machinery\nThis class also includes the manufacture of parts and accessories for the machine tools listed above: work holders, dividing heads and other special attachments for machine tools\nThis class excludes :\nManufacture of interchangeable tools for hand tools or machine tools (drills, punches, dies, taps, milling cutters, turning tools, saw blades, cutting knives, etc., see 2593;\nManufacture of electric hand-held soldering irons and soldering guns, see 2790;\nManufacture of power-driven hand tools, see 2818;\nManufacture of machinery used in metal mills or foundries, see 2823;\nManufacture of machinery for mining and quarrying, see 2824.','282'),('2823','Manufacture of Machinery for Metallurgy',NULL,'282'),('2824','Manufacture of Machinery for Mining, Quarrying and Construction\n','This class includes :\nManufacture of continuous-action elevators and conveyors for underground use\nManufacture of boring, cutting, sinking and tunneling machinery (whether or not for underground use)\nManufacture of machinery for treating minerals by screening, sorting, separation, washing, crushing, etc.\nManufacture of concrete and mortar mixers\nManufacture of earth-moving machinery: bulldozers, angle-dozers, graders, scrapers, levelers, mechanical shovels, shovel loaders, etc.\nManufacture of pile drivers and pile-extractors, mortar spreaders, bitumen spreaders, concrete surfacing machinery, etc.\nManufacture of tracklaying tractors and tractors used in construction or mining\nManufacture of bulldozers and angle-dozer blades\nManufacture of off-road dumping trucks\nThis class excludes :\nManufacture of lifting and handling equipment, see 2816;\nManufacture of other tractors, see 2821, 2910;\nManufacture of machine tools for working stone, including machines for splitting or clearing stone, see 2822;\nManufacture of concrete-mixer lorries, see 2910;\nManufacture of mining locomotives and mining rail cars, see 3020.','282'),('2825','Manufacture of Machinery for Food Beverage and Tobacco Processing\n','This class includes :\nManufacture of agricultural dryers\nManufacture of machinery for the dairy industry :\ncream separators\nmilk processing machinery (e.g. homogenizers)\nmilk converting machinery (e.g. butter chums, butter workers and molding machines)\ncheese-making machines (e.g. homogenizers, molders, presses) etc.\nManufacture of machinery for the grain milling industry :\nmachinery to clean, sort or grade seeds, grain or dried leguminous vegetables (winnowers, sieving belts, separators, grain brushing machines, etc.)\nmachinery to produce flour and meal etc. (grinding mills, feeders, sifters, bran cleaners, blenders, rice hullers, pea splitters)\nManufacture of presses, crushers, etc. used to make wine, cider, fruit juices, etc.\nManufacture of machinery for the bakery industry or for making macaroni, spaghetti or similar products : bakery ovens, dough mixers, dough-dividers, molders, slicers, cake depositing machines, etc.\nManufacture of machines and equipment to process diverse foods :\nmachinery to make confectionary, cocoa or chocolate; to manufacture sugar; for breweries; to process meat or poultry, to prepare fruit, nuts or vegetables; to prepare fish, shellfish or other seafood\nmachinery for filtering and purifying\nother machinery for the industrial preparation or manufacture of food or drink\nManufacture of machinery for the extraction or preparation of animal or vegetable fats or oils\nManufacture of machinery for the preparation of tobacco and for the making of cigarettes or cigars, or pipe or chewing tobacco or snuff\nManufacture of machinery for the preparation of food in hotels and restaurants.\nThis class excludes :\nManufacture of food and milk irradiation equipment, see 2660;\nManufacture of packing, wrapping and weighing machinery, see 2819;\nManufacture of cleaning, sorting or grading machinery for eggs, fruit or other crops (except seeds, grains and dried leguminous vegetables), see 2821.','282'),('2826','Manufacture of Machinery for Textile, Apparel and Leather Production\n','This class includes :\nManufacture of textile machinery :\nmachines for preparing, producing, extruding, drawing, texturizing or cutting man-made textile fibers, materials or yarns\nmachines for preparing textile fibers: cotton gins, bale breakers, garnetters, cotton spreaders, wool scourers, wool carbonizers, combs, carders, roving frames, etc.\nspinning machines\nmachines for preparing textile yarns: reelers; warpers and related machines\nweaving machines (looms), including hand looms\nknitting machines\nmachines for making knotted net, tulle, lace, braid, etc.\nManufacture of auxiliary machines or equipment for textile machinery: dobbies, jacquards, automatic stop motions, shuttle changing mechanisms, spindles and spindle flyers, etc.\nManufacture of textile printing machines\nManufacture of machinery for fabric processing :\nmachinery for washing, bleaching, dyeing, dressing, finishing, coating or impregnating textile fabrics\nmanufacture of machines for reeling, unreeling, folding, cutting or pinking textile fabrics;\nManufacture of laundry machinery :\nironing machines, including fusing presses\ncommercial washing and drying machines\ndry-cleaning machines\nManufacture of sewing machines, sewing machine heads and sewing machine needles (whether or not for household use)\nManufacture of machines for producing or finishing felt or non-wovens\nManufacture of leather machines :\nmachinery for preparing, tanning or working hides, skins or leather\nmachinery for making or repairing footwear or other articles of hides, skins, leather or fur skins\nThis class excludes :\nManufacture of paper or paperboard cards for use on jacquard machines, see 1709;\nManufacture of domestic washing and drying machines, see 2750;\nManufacture of calendering machines, see 2819;\nManufacture of machines used in bookbinding, see 2829.','282'),('2829','Manufacture of Other Special-purpose Machinery\n','This class includes the manufacture of special-purpose machinery not elsewhere classified.\nThis class includes :\nManufacture of machinery for making paper pulp\nManufacture of paper and paperboard making machinery\nManufacture of dryers for wood, paper pulp, paper or paperboard\nManufacture of machinery producing articles of paper and paperboard\nManufacture of machinery for working soft rubber or plastics or for the manufacture of products of these materials: extruders, molders, pneumatic tire making or retreading machines and other machines for making a specific rubber or plastic product\nManufacture of printing and bookbinding machines and machines for activities supporting printing on a variety of materials\nManufacture of machinery for producing tiles, bricks, shaped ceramic pastes, pipes, graphite electrodes, blackboard chalk, foundry molds, etc.\nManufacture of semi-conductor manufacturing machinery\nManufacture of industrial robots performing multiple tasks for special purposes\nManufacture of diverse special machinery and equipment :\nmachines to assemble electric or electronic lamps, tubes (valves) or bulbs\nmachines for production or hot-working of glass or glassware, glass fiber or yarn\nmachinery or apparatus for isotopic separation\nManufacture of tire alignment and balancing equipment; balancing equipment (except wheel balancing)\nManufacture of central greasing systems\nManufacture of aircraft launching gear, aircraft carrier catapults and related equipment\nManufacture of automatic bowling alley equipment (e.g. pin-setters)\nManufacture of roundabouts, swings, shooting galleries and other fairground amusements\nThis class excludes :\nManufacture of household appliances, see 2750;\nManufacture of photocopy machines, etc., see 2817;\nManufacture of machinery or equipment to work hard rubber, hard plastics or cold glass, see 2822;\nManufacture of ingot molds, see 2823;\nManufacture of textile printing machinery, see 2826.','282'),('2910','Manufacture of Motor Vehicles',NULL,'291'),('2920','Manufacture of Bodies (Coachwork) for Motor Vehicles; Manufacture of Trailers and Semi-trailers\n','This class includes :\nManufacture of bodies, including cabs of motor vehicles\nOutfitting of all types of motor vehicles, trailers and semi-trailers\nManufacture of trailers and semi-trailers :\nfor transport of goods : tankers, removal trailers, etc.\nfor transport of passengers: caravan trailers, etc.\nManufacture of containers for carriage by one or more modes of transport\nThis class excludes :\nManufacture of trailers and semi-trailers specially designed for use in agriculture, see 2821;\nManufacture of parts and accessories of bodies for motor vehicles, see 2930;\nManufacture of vehicles drawn by animals, see 3099.','292'),('2930','Manufacture of Parts and Accessories for Motor Vehicles\n','This class includes :\nManufacture of diverse parts and accessories for motor vehicles : brakes, gearboxes, axles, road wheels, suspension shock absorbers, radiators, silencers, exhaust pipes, catalytic converters, clutches, steering wheels, steering columns and steering boxes\nManufacture of parts and accessories of bodies for motor vehicles : safety belts, airbags, doors, bumpers\nManufacture of car seats\nManufacture of motor vehicle electrical equipment, such as generators, alternators, spark plugs, ignition, wiring harnesses, power window and door systems, assembly of purchased gauges into instrument panels, voltage regulators, etc.\nThis class excludes :\nManufacture of tires, see 2211;\nManufacture of rubber hoses and belts and other rubber products, see 2219;\nManufacture of plastic hoses and belts and other plastic products, see 2220;\nManufacture of batteries for vehicles, see 2720;\nManufacture of lighting equipment for motor vehicles, see 2740;\nManufacture of pistons, piston rings and carburetors, see 2811;\nManufacture of pumps for motor vehicles and engines, see 2813;\nManufacture, repair and alteration of motor vehicles, see 4520.','293'),('3011','Building of Ships and Floating Structures\n','This class includes the building of ships, except vessels for sports or recreation and construction of floating structures.\nThis class includes:\nBuilding of commercial vessels: passenger vessels, ferry-boats, cargo ships, tankers, tugs etc.\nBuilding of warships\nBuilding of fishing boats and fish-processing factory vessel\nThis class also includes :\nBuilding of hovercraft (except recreation-type hovercraft)\nConstruction of drilling platforms, floating or submersible\nConstruction of floating structures: floating docks, pontoons, coffer-dams, floating landing stages, buoys, floating tanks, barges, lighters, floating cranes, non-recreational inflatable rafts, etc.\nManufacture of sections for ships and floating structures\nThis class excludes :\nManufacture of parts of vessels, other than major hull assemblies: manufacture of sails, see 1392; manufacture of iron or steel anchors, see 2599; manufacture of marine engines, see 2811;\nManufacture of navigational instruments, see 2651;\nManufacture of lighting equipment for ships, see 2740;\nManufacture of amphibious motor vehicles, see 2910;\nManufacture of inflatable boats or rafts for recreation, see 3012;\nSpecialized repair and maintenance of ships and floating structures, see 3315;\nShip-breaking, see 3830;\nInterior installation of boats, see 4330.','301'),('3012','Building of Pleasure and Sporting Boats\n','This class includes :\nManufacture of inflatable boats and raft\nBuilding of sailboats with or without auxiliary motor\nBuilding of motor boats\nBuilding of recreation-type hovercraft\nManufacture of personal watercraft\nManufacture of other pleasure and sporting boats: canoes, kayaks, rowing boats, skiffs\nThis class excludes :\nManufacture of parts of pleasure and sporting boats: manufacture of sails, see 1392; manufacture of iron or steel anchors, see 2599; manufacture of marine engines, see 2811;\nManufacture of sailboards and surfboards, see 3230;\nMaintenance, repair or alteration of pleasure boats, see 3315.','301'),('3020','Manufacture of Railway Locomotive and Rolling Stock\n','This class includes :\nManufacture of electric, diesel, steam and other rail locomotives\nManufacture of self-propelled railway or tramway coaches, vans and trucks, maintenance or service vehicles\nManufacture of railway or tramway rolling stock, not self-propelled: passenger coaches, goods vans, tank wagons, self-discharging vans and wagons, workshop vans, crane vans, tenders, etc.\nManufacture of specialized parts or railway or tramway locomotives or of rolling stock : bogies, axles and wheels, brakes and parts of brakes; hooks and coupling devices, buffers and buffer parts; shock absorbers; wagon and locomotive frames; bodies; corridor connections, etc.\nThis class also includes :\nManufacture of mechanical and electromechanical signalling, safety and traffic control equipment for railways, tramways, inland waterways, roads, parking facilities, airfields, etc.\nManufacture of mining locomotives and mining rail cars\nManufacture of railway car seats\nThis class excludes :\nManufacture of unassembled rails, see 241;\nManufacture of assembled railway track fixtures, see 2599;\nManufacture of electric motors, see 2711;\nManufacture of electrical signalling, safety or traffic-control equipment, see 2790;\nManufacture of engines and turbines, see 2811.','302'),('3030','Manufacture of Air and Spacecraft and Related Machinery\n','This class includes :\nManufacture of airplanes for the transport of goods or passengers, for use by the defense forces, for sport or other purposes\nManufacture of helicopters\nManufacture of gliders, hang gliders\nManufacture of dirigibles and hot air balloons\nManufacture of unmanned aerial vehicles (UAV)\nManufacture of parts and accessories of the aircraft of this class :\nmajor assemblies such as fuselages, wings, doors, control surfaces, landing gear, fuel tanks, nacelles, etc.\nairscrews, helicopter rotors and propelled rotor blades\nmotors and engines of a kind typically found on aircraft\nparts of turbojets and turbo propellers for aircraft\nManufacture of ground flying trainers\nManufacture of spacecraft and launch vehicles, satellites, planetary probes, orbital, shuttles\nManufacture of intercontinental ballistic (ICBM), and similar missiles\nThis class also includes overhaul and conversion of aircraft or aircraft engines.\nThis class excludes :\nManufacture of parachutes, see 1392;\nManufacture of military ordinance and ammunitions, see 2520;\nManufacture of telecommunication equipment for satellites, see 2630;\nManufacture of aircraft instrumentation and aeronautical instruments, see 2651;\nManufacture of air navigation systems, see 2651;\nManufacture of lighting equipment for aircraft, see 2740;\nManufacture of ignition parts and other electrical parts for internal combustion engines, see 2790;\nManufacture of pistons, piston rings and carburetors, see 2811;\nManufacture of aircraft launching gear, aircraft carrier catapults and related equipment, see 2829.','303'),('3040','Manufacture of Military Fighting Vehicles',NULL,'304'),('3091','Manufacture of Motorcycles\n','This class includes :\nManufacture of motorcycles, mopeds and cycles fitted with an auxiliary engine\nManufacture of engines for motorcycles\nManufacture of sidecars\nManufacture of parts and accessories for motorcycles\nThis class excludes manufacture of bicycles and invalid carriages see 3092.','309'),('3092','Manufacture of Bicycles and Invalid Carriages\n','This class includes :\nManufacture of non-motorized bicycles and other cycles, including (delivery) tricycles, tandems, childrenNULLs bicycles and tricycles\nManufacture of parts and accessories of bicycles\nManufacture of invalid carriages with or without motor\nManufacture of parts and accessories of invalid carriages\nManufacture of baby carriages\nThis class excludes :\nManufacture of bicycles with auxiliary motor, see 3091;\nManufacture of wheeled toys designed to be ridden, including plastic bicycles and tricycles, see 3240.','309'),('3099','Manufacture of Other Transport Equipment, N.e.c\n','This class includes :\nManufacture of hand-propelled vehicles : luggage trucks, handcarts, sledges, shopping carts, etc.\nManufacture of vehicles drawn by animals, sulkies, donkey-carts, hearses etc.\nThis class excludes :\nWorks trucks, whether or not fitted with lifting or handling equipment, whether or not self-propelled, of the type used in factories (including hand trucks and wheelbarrows), see 2816;\nDecorative restaurants carts, such as a dessert cart, food wagons, see 3109.','309'),('3101','Manufacture of Wood Furniture',NULL,'310'),('3102','Manufacture of Rattan Furniture (Reed, Wicker, and Cane)',NULL,'310'),('3103','Manufacture of Box Beds and Mattresses',NULL,'310'),('3104','Manufacture of Partitions, Shelves, Lockers and Office and Store Fixtures',NULL,'310'),('3105','Manufacture of Plastic Furniture',NULL,'310'),('3106','Manufacture of Furniture and Fixtures of Metal',NULL,'310'),('3109','Manufacture of Other Furniture and Fixtures, N.e.c.',NULL,'310'),('3211','Manufacture of Jewelry and Related Articles\n','This class includes :\nProduction of worked pearls\nProduction of precious and semi-precious stones in the worked state, including the working of industrial quality stones and synthetic or reconstructed precious or semi-precious stone\nWorking of diamonds\nManufacture of jewelry of precious metal or of base metals clad with precious metals or precious or semi-precious stones or of combinations of precious metal or semi-precious stones or of other materials\nManufacture of goldsmithNULLs articles or precious metals or of base metals clad with precious metals : dinnerware, flatware, hollowware, toilet articles, office or desk articles, articles for religious use, etc.\nManufacture of technical or laboratory articles of precious metal (except instruments and parts thereof) crucible, spatulas, electroplating anodes, etc.\nManufacture of precious metal watch bands, wristbands, watch straps and cigarette cases\nManufacture of coins, including coins for use as legal tender, whether or not of precious metal\nThis class also includes engraving of personal precious and non-precious metal products.\nThis class excludes :\nManufacture of non-metal watch bands (fabric, leather, plastic etc.), see 1512;\nManufacture of articles of base metal plated with precious metal (except imitation jewelry), see division 25;\nManufacture of watchcases, see 2652;\nManufacture of (non-precious) metal watch bands, see 3212;\nManufacture of imitation jewelry, see 3212.','321'),('3212','Manufacture of Imitation of Jewelry and Related Articles',NULL,'321'),('3220','Manufacture of Musical Instruments\n','This class includes :\nManufacture of string instruments\nManufacture of keyboard string instruments, including automatic pianos\nManufacture of keyboard pipe organs, including harmoniums and similar keyboard instruments with free metal reeds\nManufacture of accordions and similar instruments, including mouth organs\nManufacture of wind instruments; manufacture of percussions musical instruments\nManufacture of musical instruments, the sound of which is produced electronically\nManufacture of musical boxes, fairground organs calliopes, etc.\nManufacture of instrument parts and accessories : metronomes, tuning forks, pitch pipes, cards, discs and rolls for automatic mechanical instruments, etc.\nThis class also includes manufacture of whistles, call horns and other mouth-blown sound signalling instruments\nThis class excludes :\nReproduction of pre-recorded sound and video tapes and discs, see 1820;\nManufacture of microphones, amplifiers, loudspeakers, headphones and similar components, see 2640;\nManufacture of record players, tape recorders and the like, see 2640;\nManufacture of toy musical instruments, see 3240;\nRestoring of organs and other historic musical instruments, see 3319;\nPublishing of pre-recorded sound and video tapes and discs, see 5920;\nPiano tuning, see 9529.','322'),('3230','Manufacture of Sports Goods\n','This class includes the manufacture of sporting and athletic goods (except apparel and footwear).\nThis class includes :\nManufacture of articles and equipment for sports, outdoor and indoor games, of any material :\nhard, soft and inflatable balls\nrackets, bats and clubs\nskis, bindings and poles;\nski-boots; sailboards and surfboards\nrequisites for sport fishing, including land nets\nrequisites for hunting, mountain climbing, etc.\nleather sports, gloves and sports headgear; ice skates, roller skates, etc.\nbows and crossbows; gymnasium, fitness center or athletic equipment\nThis class excludes :\nManufacture of boat sails, see 1392;\nManufacture of sports apparel, see 1419;\nManufacture of saddlery and harness, see 1512;\nManufacture of whips and riding crops, see 1512;\nManufacture of sports footwear, see 1529;\nManufacturing of sporting weapons and ammunitions, see 2520;\nManufacture of metal weights as used for weightlifting, see 2599;\nManufacture of automatic bowling alley equipment (e.g. pin-setters), see 2829;\nManufacture of sports vehicles other than toboggans and the like, see divisions 29 and 30;\nManufacture of boats, see 3012;\nManufacture of billiard tables, see 3240;\nManufacture of ear and noise plugs (e.g. for swimming and noise protection), see 3299.','323'),('3240','Manufacture of Games and Toys\n','This class includes the manufacture of dolls, toys and games (including electronic games), scale models and childrenNULLs vehicles (except metal bicycles and tricycles).\nThis class includes :\nManufacture of dolls and doll garments, parts and accessories\nManufacture of action figures\nManufacture of toy animals\nManufacture of toy musical instruments\nManufacture of playing cards\nManufacture of board games and similar games\nManufacture of electronic games, chess, etc.\nManufacture of reduced-size (\"scale\") models and similar recreational models, electrical trains, construction sets, etc.\nManufacture of coin-operated games, billiards, special tables for casino games, etc.\nManufacture of articles for funfair, table or parlor games\nManufacture of wheeled toys designed to be ridden, including plastic bicycles and tricycles\nManufacture of puzzles and similar articles\nThis class excludes :\nManufacture of video game consoles, see 2640;\nManufacture of bicycles, see 3092;\nWriting and publishing of software for video games consoler, see 5820, 6201.','324'),('3250','Manufacture of Medical and Dental Instruments and Supplies\n','This class includes the manufacture of laboratory apparatus, surgical and medical instruments, surgical appliances and supplies, dental equipment and supplies, orthodontic goods, dentures and orthodontic appliances. Included is the manufacture of medical, dental and similar furniture where the additional specific functions determines the purpose of the product, such as dentistNULLs chairs with built-in hydraulic functions.\nThis class includes :\nManufacture of surgical drapes and sterile string and tissue\nManufacture of dental fillings and cements (except denture adhesive dental wax) and other dental plaster preparations\nManufacture of bone reconstruction cements\nManufacture of dental laboratory furnaces\nManufacture of laboratory ultrasonic cleaning machinery\nManufacture of laboratory sterilizers\nManufacture of laboratory type distilling apparatus, laboratory centrifuges\nManufacture of medical, surgical , dental or veterinary furniture, such as :\noperating tables\nexamination tables\nhospital beds with mechanical fittings\ndentistNULLs chairs\nManufacture of bone plates and screws, syringes, needles, catheters, cannulae, etc.\nManufacture of dental instruments (including dentistNULLs chairs incorporating dental equipment)\nManufacture of artificial teeth, bridges, etc. made in dental labs\nManufacture of orthopedic and prosthetic devices\nManufacture of glass eyes\nManufacture of medical thermometers\nManufacture of ophthalmic goods, eyeglasses, sunglasses, lenses ground to prescription, contact lenses, safety goggles\nThis class excludes :\nManufacture of denture adhesives, see 2023;\nManufacture of medical impregnated wadding, dressings, etc. see 2100;\nManufacture of electromedical and electrotherapeutic equipment, see 2660;\nManufacture of wheelchairs, see 3092.','325'),('3291','Manufacture of Pens and Pencils of All Kinds',NULL,'329'),('3292','Manufacture of Umbrellas, Walking Sticks, Canes, Whips and Riding Crops',NULL,'329'),('3293','Manufacture of Articles for Personal Use, E.g. Smoking Pipes, Combs, Slides and Similar Articles',NULL,'329'),('3294','Manufacture of Candles',NULL,'329'),('3295','Manufacture of Artificial Flowers, Fruits and Foliage',NULL,'329'),('3296','Manufacture of Burial Coffin',NULL,'329'),('3299','Manufacture of Other Miscellaneous Articles, N.e.c.',NULL,'329'),('3311','Repair of Fabricated Metal Products',NULL,'331'),('3312','Repair of Machinery',NULL,'331'),('3313','Repair of Electronic and Optical Equipment',NULL,'331'),('3314','Repair of Electrical Equipment',NULL,'331'),('3315','Repair of Transport Equipment, Except Motor Vehicles\n','This class includes the repair and maintenance of transport equipment of division 30, except motorcycles and bicycles. However, the factory rebuilding or overhaul of ships, locomotives, railroad cars and aircraft is classified in division 30.\nThis class includes :\nRepair and maintenance of ships\nRepair and maintenance of pleasure boats\nRepair and maintenance of locomotives and railroad cars (except factory rebuilding or factory conversion)\nRepair and maintenance of aircraft (except factory conversion, factory overhaul, factory rebuilding)\nRepair and maintenance of aircraft engines\nRepair and maintenance of drawn buggies and wagons\nThis class excludes :\nFactory rebuilding of ships, see 301;\nFactory rebuilding of locomotives and railroad cars, see 3020;\nFactory rebuilding of aircraft, see 3030;\nRepair of ship or rail engines, see 3312;\nShip scaling and dismantling, see 3830;\nRepair and maintenance of motorcycles, see 4540;\nRepair of bicycles and invalid carriages, see 9529.','331'),('3319','Repair of Other Equipment',NULL,'331'),('3320','Installation of Industrial Machinery and Equipment',NULL,'332'),('3510','Electric Power Generation, Transmission and Distribution\n','This includes the generation of bulk electric power, transmission and distribution to end users.\nThis class includes :\nOperation of generation facilities that produce electric energy, including thermal, nuclear, hydroelectric, gas turbine, diesel and renewable\nOperation of transmission systems that convey the electricity from the generation facility to the distribution system\nOperation of distribution systems (i.e. consisting of lines, poles, meters, and wiring) that convey electric power received from the generation facility or the transmission system to the final consumer\nSale of electricity to the user\nActivities of electric power brokers or agents that arrange the sale of electricity via power distribution systems operated by others\nOperation of electricity and transmission capacity exchanges for electric power\nThis class excludes production of electricity through incineration of waste, see 3821','351'),('3520','Manufacture of Gas; Distribution of Gaseous Fuels Through Mains',NULL,'352'),('3530','Steam, Air Conditioning Supply and Production of Ice',NULL,'353'),('3600','Water Collection, Treatment and Supply',NULL,'360'),('3700','Sewerage',NULL,'370'),('3811','Collection of Non-hazardous Waste',NULL,'381'),('3812','Collection of Hazardous Waste',NULL,'381'),('3821','Treatment and Disposal of Non-hazardous Waste',NULL,'382'),('3822','Treatment and Disposal of Hazardous Waste',NULL,'382'),('3830','Materials Recovery',NULL,'383'),('3900','Remediation Activities and Other Waste Management Services',NULL,'390'),('4100','Construction of Buildings\n','This class includes the construction of complete residential or non-residential buildings, on own account for sale or on a fee or contract basis. Outsourcing parts or even the whole construction process is possible. If only specialized parts of the construction process are carried out, the activity is classified in division 43.\nThis class includes :\nConstruction of all types of residential buildings: single-family houses; multi-family buildings, mass housing, including high-rise buildings\nConstruction of all types of non-residential buildings:\nbuildings for industrial production, e.g. factories, workshops, assembly plants, etc.\nhospitals, schools, office buildings\nhotels, stores, shopping malls, restaurants\nairport buildings\nindoor sports facilities\nparking garages, including underground parking garages\nwarehouses\nreligious buildings\nAssembly and erection of prefabricated construction on the site\nThis class also includes remodeling or renovating existing residential structures\nThis class excludes :\nErection of complete prefabricated constructions from self-manufactured parts not of concrete, see divisions 16 and 25;\nConstruction of industrial facilities, except buildings, see 4290;\nArchitectural and engineering activities, see 7110;\nProject management activities related to construction, see 7110.','410'),('4210','Construction of Roads and Railways',NULL,'421'),('4220','Construction of Utility Projects\n','This includes the construction of distribution lines and related buildings and structures that are integral part of these systems.\nThis class includes :\nConstruction of civil engineering construction for :\nlong-distance pipelines, communication and power lines\nurban pipelines, urban communication and power lines, ancillary urban works\nwater main and line construction\nirrigation systems (canals)\nreservoirs\nConstruction of: sewer systems, including repair; sewage disposal plants; pumping stations and power plants.\nWater well drilling\nThis class excludes :\nProject management activities related to civil engineering works, see 7110.','422'),('4290','Construction of Other Civil Engineering Projects',NULL,'429'),('4311','Demolition',NULL,'431'),('4312','Site Preparation',NULL,'431'),('4321','Electrical Installation',NULL,'432'),('4322','Plumbing, Heat and Air-conditioning Installation',NULL,'432'),('4329','Other Construction Installation',NULL,'432'),('4330','Building Completion and Finishing\n','This class includes :\nApplication in buildings or other construction projects of interior and exterior plaster or stucco, including related lathing materials\nInstallation of doors (except automated and revolving), windows, door and window frames, fitted kitchens, staircases, shop fittings and the like, of wood or other materials\nInstallation of fitted kitchens, staircases, shop fittings and the like\nInstallation of furniture\nInterior completion such as ceilings, wooden wall coverings, movable partitions, etc.\nInterior installation of shops, mobile homes, boats, etc.\nInterior and exterior painting of buildings\nPainting of civil engineering structures\nLaying, tiling, hanging or fitting in buildings or other construction projects of :\nceramic, concrete or cut stone wall or floor tiles, ceramic stove fitting\nparquet and other wooden floor coverings\ncarpets and linoleum floor coverings, including of rubber or plastic\nterrazzo, marble, granite or slate floor or wall coverings\nwall paper\nInterior and exterior painting of buildings\nPainting of civil engineering structures\nInstallation of glass, mirrors, etc.\nCleaning of new buildings after construction\nOther building completion work, n.e.c.\nThis class also includes interior installation of shops, mobile homes, boats etc.\nThis class excludes :\nGeneral interior cleaning of buildings and other structures, see 8121;\nSpecialized interior and exterior cleaning of buildings, see 8129;\nActivities of interior decoration designers, see 7410.\nAssembly of self-standing furniture, see 9524;\nPainting of roads, see 4210;\nInstallation of automated and revolving doors, see 4329.','433'),('4390','Other Specialized Construction Activities',NULL,'439'),('4510','Sale of Motor Vehicles\n','This class includes :\nWholesale and retail sale of new and used vehicles :\npassenger motor vehicles, including specialized passenger motor vehicles such as ambulances and minibuses, etc.\nlorries, trailers and semi-trailers\ncamping vehicles such as caravans and motor homes\nThis class also includes :\nWholesale and retail sale of off-road motor vehicles (jeeps, etc)\nWholesale and retail sale by commission agents\nCar auctions\nThis class excludes :\nWholesale and retail sale of parts and accessories for motor vehicles, see 4530;\nRenting of motor vehicles with driver, see 4932;\nRenting of trucks with driver, see 4933;\nRenting of motor vehicles and trucks without driver, see 7710.','451'),('4520','Maintenance and Repair of Motor Vehicles\n','This class includes :\nMaintenance and repair of motor vehicles :\nmechanical repairs\nelectrical repairs\nelectronic injection system repair\nordinary servicing\nbodywork repair\nrepair of motor vehicle parts\nwashing, polishing, etc.\nspraying and painting\nrepair of screens and windows\nrepair of motor vehicle seats\nTire and tube repair, fitting or replacement\nAnti-rust treatment\nInstallation of parts and accessories not as part of the manufacturing process\nThis class excludes retreading and rebuilding of tires, see 2211.','452'),('4530','Sale of Motor Vehicle Parts and Accessories\n','This class includes :\nWholesale and retail sale of all kinds of parts, components, supplies, tools and accessories for motor vehicles, such as :\nrubber tires and inner tubes for tires\nspark plugs, batteries, lighting equipment and electrical parts\nThis class excludes : retail sale of automotive fuel, see 4730.','453'),('4540','Sale, Maintenance and Repair of Motorcycles and Related Parts and Accessories\n','This class includes :\nWholesale and retail sale of motorcycles including mopeds\nWholesale and retail sale of parts and accessories for motorcycles (including by commission agents and mail order houses)\nMaintenance and repair of motorcycles.\nThis class excludes :\nWholesale of bicycles and related parts and accessories, see 4649;\nRetail sale of bicycles and related parts and accessories, see 4763;\nRenting of motorcycles, see 7730;\nRepair and maintenance of bicycles, see 9529.','454'),('4610','Wholesale on a Fee or Contract Basis\n','This class includes :\nActivities of commission agents, commodity brokers and all other wholesalers who trade on behalf and on the accounts of others\nActivities of those involved in bringing sellers and buyers together or undertaking commercial transactions on behalf of a principal, including in the internet\nSuch agents involved in the sale of :\nagricultural raw materials, live animals, textile raw materials and semi-finished goods\nfuels ores, metals and industrial chemicals, including fertilizers\nfood, beverage and tobacco\ntextiles, clothing, fur, footwear and leather goods\ntimber and building materials\nmachinery, including office machinery and computers, industrial equipment, ships and aircraft\nfurniture, household goods and hardware\nThis class also includes activities of wholesale auctioneering houses.\nThis class excludes :\nWholesale trade in own name, see Groups 462 to 469;\nActivities of commission agents for motor vehicles, see 4510;\nAuctions of motor vehicles, see 4510;\nRetail sale by non-store commission agents, see 4799;\nActivities of insurance agents, see 6622;\nActivities of real estate agents, see 6820.','461'),('4620','Wholesale of Agricultural Raw Materials and Live Animals\n','This class includes :\nWholesale of grains and seeds\nWholesale of oleaginous fruits\nWholesale of unmanufactured tobacco\nWholesale of live animals\nWholesale of hides and skins\nWholesale of leather\nWholesale of agricultural material, waste, residues and by-products used for animal feed\nThis class excludes wholesale of textile fibers, see 4669.','462'),('4630','Wholesale of Food, Beverages and Tobacco\n','This class includes:\nWholesale of fruit and vegetables\nWholesale of dairy products\nWholesale of eggs and egg products\nWholesale of edible oils and fats of animal or vegetable origin\nWholesale of meat and meat products\nWholesale of fishery products\nWholesale of sugar, chocolate and sugar confectionery\nWholesale of bakery products\nWholesale of beverages\nWholesale of coffee, tea, cocoa and spices\nWholesale of tobacco products\nThis class also includes :\nBuying of wine in bulk and bottling without transformation\nWholesale of feed for pet animals.\nThis class excludes blending of wine or distilled spirits, see 1101, 1102.','463'),('4641','Wholesale of Textiles, Clothing and Footwear\n','This class includes :\nWholesale of yarn\nWholesale of fabrics\nWholesale of household linen, etc.\nWholesale of haberdashery: needles, sewing thread, etc.\nWholesale of clothing, including sports clothes\nWholesale of clothing accessories such as gloves, ties and braces\nWholesale of footwear\nWholesale of fur articles\nWholesale of umbrellas\nThis class excludes wholesale of jewelry and leather goods, see 4649 and wholesale of textile fibers, see 4669.','464'),('4642','Wholesale of Miscellaneous Consumer Goods',NULL,'464'),('4649','Wholesale of Other Household Goods',NULL,'464'),('4651','Wholesale of Computers, Computer Peripheral Equipment and Software',NULL,'465'),('4652','Wholesale of Electronic and Telecommunications Equipment and Parts\n','This class includes :\nWholesale of electronic valves and tubes\nWholesale of semi-conductor devices\nWholesale micro-chips and integrated circuits\nWholesale of printed circuits\nWholesale of blank audio and video tapes and diskettes, magnetic and optical disks (CDs, DVDs)\nWholesale of telephone and communications equipment\nThis class excludes :\nWholesale of recorded audio and video tapes, CDs, DVDs, see 4649;\nWholesale of consumer electronics, see 4649;\nWholesale of computers and computer peripheral equipment, see 4651.','465'),('4653','Wholesale of Agricultural Machinery, Equipment and Supplies',NULL,'465'),('4659','Wholesale of Other Machinery and Equipment\n','This class includes :\nWholesale of office machinery and equipment, except computers and computer peripheral equipment\nWholesale of office furniture\nWholesale of transport equipment except motor vehicles, motorcycles and bicycles\nWholesale of production-line robots\nWholesale of wires and switches and other installation equipment for industrial use\nWholesale of other electrical materials such as electrical motors, transformers\nWholesale of machine tools of any type and for any material\nWholesale of other machinery, n.e.c. for use in industry, trade and navigation and other services\nThis class also includes :\nWholesale of computer-controlled machine tools\nWholesale of computer-controlled machinery for the textile industry and of computer-controlled sewing and knitting machines','465'),('4661','Wholesale of Solid, Liquid and Gaseous Fuels and Related Products',NULL,'466'),('4662','Wholesale of Metals and Metal Ores',NULL,'466'),('4663','Wholesale of Construction Materials, Hardware, Plumbing and Heating Equipment and Supplies\n','This class includes :\nWholesale of wood in the rough\nWholesale of products of primary processing of wood\nWholesale of paint and varnish\nWholesale of construction materials: sand and gravel\nWholesale of wallpaper and floor coverings\nWholesale of flat glass\nWholesale of hardware and locks\nWholesale of fittings and fixtures\nWholesale of hot water heaters\nWholesale of sanitary equipment: baths, washbasins, toilets and other sanitary porcelain\nWholesale of sanitary installation equipment: tubes, pipes, fittings, taps, T-pieces, connections, rubber pipes, etc.\nWholesale of tools such as hammers, saws, screwdrivers and other hand tools','466'),('4669','Wholesale of Waste and Scrap and Other Products, N.e.c.\n','This class includes :\nWholesale of industrial chemicals :\naniline, printing ink, essential oils, industrial gases, chemical glues, coloring matter, synthetic resin, methanol, paraffin, scents and flavorings, soda, industrial salt, acids and sulfurs, starch derivative, etc.\nWholesale of fertilizers and agro-chemical products\nWholesale of plastic materials in primary forms\nWholesale of rubber\nWholesale of textile fibers, etc.\nWholesale of paper in bulk\nWholesale of precious stones\nWholesale of metal and non-metal waste and scrap and materials for recycling, including collecting, sorting, separating, stripping of used goods such as cars in order to obtain reusable parts, packing and repacking, storage and delivery, but without a real transformation process. Additionally, the purchased and sold waste has a remaining value.\nThis class also includes:\nDismantling of automobiles, computers, televisions and other equipment to obtain and re-sell usable parts.\nThis class excludes :\nCollection of household and industrial waste, see 381;\nTreatment of waste, not for further use in an industrial manufacturing process, but with the aim of disposal, see 382;\nProcessing of waste and scrap and other articles into secondary raw material when a real transformation process is required (the resulting secondary raw material is fit for direct use in an industrial manufacturing process, but is not a final product), see 3830;\nDismantling of automobiles, computers, televisions and other equipment for materials recovery, see 3830;\nShredding of cars by means of a mechanical process, see 3830;\nShip-breaking, see 3830;\nRetail sale of second-hand goods, see 4774.','466'),('4690','Non-specialized Wholesale Trade',NULL,'469'),('4711','Retail Sale in Non-specialized Stores with Food, Beverages or Tobacco Predominating\n','This class includes :\nRetail sale of a large variety of goods of which, however, food products, beverages or tobacco should be predominant, such as :\nretail sale activities of general stores that have, apart from their main sales of food products, beverages or tobacco, several other lines of merchandise such as wearing apparel, furniture, appliances, hardware, cosmetics, etc.\nThis class excludes :\nRetail sale of fuel in combination with food, beverages, etc. with fuel sales dominating, see 4730.','471'),('4719','Other Retail Sale in Non-specialized Stores\n','This class includes :\nRetail sale of a large variety of goods of which food products, beverages or tobacco are not predominant, such as :\nretail sale activities of department stores carrying a general line of merchandise, including wearing apparel, furniture, appliances, hardware, cosmetics, jewelry, toys, sports goods, etc.','471'),('4721','Retail Sale of Food in Specialized Stores',NULL,'472'),('4722','Retail Sale of Beverages in Specialized Stores',NULL,'472'),('4723','Retail Sale of Tobacco Products in Specialized Stores',NULL,'472'),('4730','Retail Sale of Automotive Fuel in Specialized Stores',NULL,'473'),('4741','Retail Sale of Computers, Peripheral Units, Software and Telecommunications Equipment in Specialized Stores\n','This class includes :\nRetail sale of computers, computer peripheral equipment, video game consoles, non-customized software, including video games and retail sale of telecommunications equipment.\nThis class excludes retail sale of blank tapes and disks, see 4762.','474'),('4742','Retail Sale of Audio and Video Equipment in Specialized Stores',NULL,'474'),('4751','Retail Sale of Textiles in Specialized Stores\n','This class includes retail sale of fabrics, knitting yarn, basic materials for rug, tapestry or embroidery making, textiles, haberdashery (needles, and sewing thread, etc.).\nThis class excludes retail sale of clothing, see 4771.','475'),('4752','Retail Sale of Hardware, Paints and Glass in Specialized Stores',NULL,'475'),('4753','Retail Sale of Carpets, Rugs, Wall and Floor Coverings in Specialized Stores',NULL,'475'),('4759','Retail Sale of Electrical Household Appliances, Furniture, Lighting Equipment and Other Household Articles in Specialized Stores',NULL,'475'),('4761','Retail Sale of Books, Newspapers and Stationery in Specialized Stores',NULL,'476'),('4762','Retail Sale of Music and Video Recordings in Specialized Stores',NULL,'476'),('4763','Retail Sale of Sporting Equipment in Specialized Stores\n','This class includes retail sale of sports goods, fishing gear, camping goods and bicycles.','476'),('4764','Retail Sale of Games and Toys in Specialized Stores',NULL,'476'),('4771','Retail Sale of Clothing, Footwear and Leather Articles in Specialized Stores\n','This class includes :\nRetail sale of articles of clothing\nRetail sale of articles of fur\nRetail sale of clothing accessories such as gloves, ties, braces, etc.\nRetail sale of umbrellas\nRetail sale of footwear\nRetail sale of leather goods\nRetail sale of travel accessories of leather and leather substitutes\nThis class excludes retail sale of textiles, see 4751.','477'),('4772','Retail Sale of Pharmaceutical and Medical Goods, Cosmetic and Toilet Articles in Specialized Stores\n','This class includes :\nRetail sale of pharmaceuticals\nRetail sale of medical and orthopedic goods\nRetail sale of perfumery, cosmetic articles and toilet articles','477'),('4773','Other Retail Sale of New Goods in Specialized Stores',NULL,'477'),('4774','Retail Sale of Second-hand Goods\n','This class includes retail sale of second-hand clothing, footwear and leather articles, books and other goods, antiques and activities of auctioning houses.\nThis class excludes retail sale of second-hand motor vehicles, see 4510; activities of internet auctions and other non-store auction (retail), see 4791, 4799; activities of pawnshop, see 6493.','477'),('4775','Retail Sale of Liquefied Petroleum Gas and Other Fuel Products',NULL,'477'),('4776','Retail Sale of Pet and Pet Supplies (Pet Shop)',NULL,'477'),('4781','Retail Sale Via Stalls and Markets of Food, Beverages and Tobacco Products',NULL,'478'),('4782','Retail Sale Via Stalls and Markets of Textiles, Clothing and Footwear',NULL,'478'),('4789','Retail Sale Via Stalls and Markets of Other Goods\n','This class includes retail sale of other goods via stalls or markets.','478'),('4791','Retail Sale Via Mail/telephone Order Houses or Via Internet\n','This class includes retail sale activities via mail order houses of internet, i.e., retail sale activities where the buyer makes his choice on the basis of advertisements, catalogues, information provided on a website, models or any other means of advertising and places his order by mail, phone or over the internet (usually through special means provided by a website). The products purchased can be either directly downloaded from the internet or physically delivered to the customer.','479'),('4799','Other Retail Sale Not in Stores, Stalls or Markets\n','This class includes :\nRetail sale of any kind of product in any way that is not included in previous classes :\nby direct sales or door-to-door sales persons;\nthrough vending machines, etc.\nDirect selling of fuel (heating oil, fire wood, etc), drinking water, delivered directly to the customer\nActivities of non-store auction, (retail)\nRetail sale by (non-store) commission agents\nThis class excludes delivery of products by stores, see Groups 471-477.','479'),('4911','Passenger Rail Transport, Inter-urban\n','This class includes :\nPassenger transport by inter-urban railways\nOperation of sleeping cars or dining cars as an integrated operation of railway companies\nThis class excludes :\nPassenger terminal activities, see 5221;\nOperation of sleeping cars or dining cars when operated by separate units, see 5590, 5610.','491'),('4912','Freight Rail Transport',NULL,'491'),('4920','Transport Via Buses\n','This class includes transport of scheduled buses at short or long distances. It also includes tourism and sightseeing buses, which are scheduled or chartered and operation of school and employee buses.','492'),('4931','Urban or Suburban Passenger Land Transport, Except Railway or Bus',NULL,'493'),('4932','Other Passenger Land Transport\n','This class includes :\nOther passenger road transport :\ncharters, excursions and other occasional coach services\ntaxi operations\nairport shuttles\nOperations of telfers, funiculars, ski and cable lifts if not part of urban or suburban transit systems\nThis class also includes :\nRental of cars and trucks with driver\nPassenger transport by man-or animal-drawn vehicles\nThis class excludes ambulance transport, see 8690.','493'),('4933','Freight Transport by Road',NULL,'493'),('4940','Transport Via Pipeline',NULL,'494'),('5011','Sea and Coastal Passenger Water Transport\n','This class includes :\nTransport of passengers over seas and coastal waters, whether scheduled or not :\noperation of excursion, cruise or sightseeing boats;\noperation of ferries, water taxis, etc\nThis class excludes :\nRestaurant and bar activities on board ships, when provided by separate units, see 5610, 5630;\nOperation of \"floating casinos\", see 9200.','501'),('5012','Sea and Coastal Freight Water Transport\n','This class includes :\nTransport of freight over seas and coastal waters, whether scheduled or not\nTransport by towing or pushing of barges, oil rigs, etc.\nThis class excludes :\nStorage of freight, see 5210;\nHarbor operation and other auxiliary activities such as docking, pilotage, lighterage, vessel salvage, see 5222.\nCargo handling, see 5224.','501'),('5021','Inland Passenger Water Transport',NULL,'502'),('5022','Inland Freight Water Transport',NULL,'502'),('5110','Passenger Air Transport\n','This class includes :\nTransport of passengers by air over regular routes and on regular schedules\nCharter flights for passengers\nScenic and sightseeing flights.\nThis class also includes :\nRenting of air-transport equipment with operator for the purpose of passenger transportation\nGeneral aviation activities, such as: transport of passengers by aero clubs for instruction or pleasure.','511'),('5120','Freight Air Transport\n','This class includes :\nTransport freight by air over regular routes and on regular schedules\nNon-scheduled transport of freight by air\nLaunching of satellites and space vehicles\nSpace transport\nThis class also includes renting of air transport equipment with operator for the purpose of freight transportation.','512'),('5210','Warehousing and Storage\n','This class includes :\nOperation of storage and warehouse facilities for all kind of goods :\noperation of grain silos, general merchandise warehouses, refrigerated warehouses, storage tanks, etc.\nThis class also includes storage of goods in foreign trade zones and blast freezing.\nThis class excludes :\nParking facilities for motor vehicles, see 5221;\nOperation of self storage facilities, see 6819;\nRental of vacant space, see 6819.','521'),('5221','Service Activities Incidental to Land Transportation\n','This class includes :\nActivities related to land transport of passengers, animals or freight :\noperation of terminal facilities such as railway stations, bus stations, stations for the handling of goods\noperation of railroad infrastructure\noperation of roads, bridges, tunnels, car parks or garages, bicycle parkings\nSwitching and shunting\nTowing and road side assistance\nThis class also includes liquefaction of gas for transportation purposes.\nThis class excludes cargo handling, see 5224.','522'),('5222','Service Activities Incidental to Water Transportation',NULL,'522'),('5223','Service Activities Incidental to Air Transportation',NULL,'522'),('5224','Cargo Handling\n','This class includes :\nLoading and unloading of goods or passengersNULL luggage irrespective of the mode of transport used for transportation\nStevedoring\nLoading and unloading of freight railway cars.\nThis class excludes operation of terminal facilities, see 5221; 5222 and 5223.','522'),('5229','Other Transportation Support Activities\n','This class includes :\nForwarding of freight\nArranging or organizing of transport operations by rail, road, sea or air\nOrganization of group or individual consignments (including pickup and delivery of goods and grouping of consignments)\nLogistics activities, i.e. planning, designing and supporting operations of transportation, warehousing and distribution\nIssue and procurement of transport documents and waybills\nActivities of customs agents\nActivities of sea-freight forwarders and air-cargo agents\nBrokerage for ship and aircraft space\nGoods-handling operations, e.g. temporary crafting for the sole purpose of protecting the goods during transit, uncrating, sampling, weighing of goods\nThis class excludes :\nCourier activities, see 5320;\nProvision of motor, marine, aviation and transport insurance, see 6512;\nActivities of travel agencies, see 7911;\nActivities of tour operators, see 7912;\nTourist assistance activities, see 7990.','522'),('5310','Postal Activities',NULL,'531'),('5320','Courier Activities\n','This class includes :\nPickup, sorting, transport and delivery (domestic or international) of letter-post and (mail-type) parcels and packages by firms not operating under a universal service obligation. One or more modes of transport may be involved and the activity may be carried out with either self-owned (private) transport or via public transport\nDistribution and delivery of mail and parcels\nThis class also includes home delivery services.\nThis class excludes transport of freight, see according to mode of transport 4912, 4933, 5012, 5022, 5120.','532'),('5510','Short Term Accommodation Activities\n','This class includes the provision of accommodation, typically on a daily or weekly basis, principally for short stay by visitors. This includes the provision of furnished accommodation in guest rooms and suites or complete self-contained units with kitchens, with or without daily or other regular housekeeping services, and may often include a range of additional services such as food and beverage services, parking, laundry services, swimming pools and exercise rooms, recreational facilities and conference and convention facilities.\nThis class includes the provision of short-term accommodation provided by : hotels; motels; resort hotels; suite/apartment hotels; condotels; inns; guesthouses; youth hostels; pensions; visitor flats and bungalows; chalets, housekeeping cottages and cabins; holiday homes; time-share units.\nThis class excludes provision of homes and furnished or unfurnished flats or apartments for more permanent use, typically on a monthly or annual basis, see Division 68.','551'),('5590','Other Accommodation\n','This class includes the provision of temporary or long-term lodging in single or shared rooms or dormitories for students, migrant (seasonal) workers and other individuals.','559'),('5610','Restaurants and Mobile Food Service Activities\n','This class includes the activity of providing food services to customers, whether they are served while seated or serve themselves from a display of items, whether they eat the prepared meals on the premises, take them out or have them delivered. This includes the preparation and serving of meals for immediate consumption from motorized vehicles or non-motorized carts.\nThis class includes activities of :\nRestaurants\nCafeterias\nFast-food restaurants\nPizza delivery\nTake-out eating places\nIce cream truck vendors\nMobile food carts\nFood preparation in market stalls\nThis class also includes restaurant and bar activities connected to transportation, when carried out by separate units.\nThis class excludes concession operation of eating facilities, see 5629.','561'),('5621','Event Catering',NULL,'562'),('5629','Other Food Service Activities',NULL,'562'),('5630','Beverage Serving Activities\n','This class includes the activity of preparing and serving beverages for immediate consumption on the premises.\nThis class includes :\nBars\nTaverns\nCocktail lounge\nDiscotheques (with beverage serving predominantly)\nBeer parlors and pubs\nCoffee shops\nFruit juice bars\nMobile beverage vendors\nThis class excludes :\nReselling packaged/prepared beverages, see 4711, 4722, 4781, 4799;\nOperation of discotheques and dance floors without beverage serving, see 9329.','563'),('5811','Book Publishing',NULL,'581'),('5812','Publishing of Directories and Mailing Lists',NULL,'581'),('5813','Publishing of Newspapers, Journals and Periodicals',NULL,'581'),('5819','Other Publishing Activities',NULL,'581'),('5820','Software Publishing',NULL,'582'),('5911','Motion Picture, Video and Television Programme Production Activities\n','This class includes production of theatrical and non-theatrical motion pictures whether on film, video tape, DVD or other media, including digital distribution, for direct projection in theatres or for broadcasting on television; supporting activities such as film editing, cutting, dubbing etc.; distribution of motion pictures or other film productions (video tapes, DVDNULLs etc.) to other industries; as well as their projection. Buying and selling of motion picture or any other film production distribution rights is also included.\nIt also includes production of motion pictures, videos, television programs or television commercials.\nThis class excludes :\nFilm duplication (except reproduction of motion picture film for theatrical distribution ) as well as audio and video tape, CD or DVD reproduction from master copies, see 1820;\nWholesale of recorded video tapes, CDNULLs, DVDNULLs, see 4649;\nRetail trade of video tapes, CDNULLs, DVDNULLs, see 4762;\nPost-production activities, see 5912;\nSound recording and recording of books on tape, see 5920;\nTelevision broadcasting, see 6020;\nFilm processing other than for the motion picture industry, see 7420;\nActivities of personal theatrical or artistic agents or agencies, see 7490;\nRenting of video tapes, DVDNULLs to the general public, see 7722;\nReal-time (i.e. simultaneous) closed captioning of live television performances of meetings, conferences, see 8299;\nActivities of own account actors, cartoonists, directors, stage designers and technical specialists, see 9000.','591'),('5912','Motion Picture, Video and Television Programme Post-production Activities\n','This class includes :\nPost production activities such as:\nediting, film/tape transfers, titling, subtitling, credits\nclosed captioning\ncomputer-produced graphics, animation and special effects\nfilm/tape transfers\nActivities of motion pictures film laboratories and activities of special laboratories for animated films:\ndeveloping and processing motion picture film, activities of motion picture film\nreproduction of motion picture film for theatrical distribution\nThis class excludes :\nFilm duplicating (except reproduction of motion picture film for theatrical distribution) as well as audio and video tape, CD or DVD reproduction from master copies, see 1820;\nWholesale of recorded video tapes, CDNULLs, DVDNULLs, see 4649;\nRetail trade of video tapes, CDs, DVDs, see 4762;\nRenting of video tapes, DVDNULLs to the general public, see 7722;\nActivities of own account actors, cartoonists, directors, stage designers and technical specialists, see 9000.','591'),('5913','Motion Picture, Video and Television Programme Distribution Activities',NULL,'591'),('5914','Motion Picture Projection Activities',NULL,'591'),('5920','Sound Recording and Music Publishing Activities\n','This class includes :\nProduction of original (sound) master recording, such as tapes, CDs\nSound recording service activities in a studio or elsewhere, including the production of taped (i.e. non-live) radio programming, audio for film, television, etc.\nMusic publishing, i.e. activities of :\nacquiring and registering copyrights for musical compositions\npromoting, authorizing and using these compositions, in recordings, radio, television, motion pictures, live performances, print and other media\ninclude on-line and other media\ndistributing sound recordings to wholesalers, retailers of directly to the public.\nUnits engaged in these activities may own the copyright or act as administrator of the music copyrights on behalf of the copyrights owners.\nPublishing of music and sheet books\nThis class excludes :\nReproduction from master copies of music or other sound recordings, see 1820;\nWholesale of recorded audio tapes and disks, see 4649.','592'),('6010','Radio Broadcasting\n','This class includes broadcasting audio signals through radio broadcasting studios and facilities for the transmission of aural programming to the public, to affiliates or to subscribers.\nThis class also includes :\nActivities of radio networks, i.e. assembling and transmitting aural programming to the affiliates or subscribers via over-the-air broadcasts, cable or satellite\nRadio broadcasting activities over the Internet (Internet radio stations)\nData broadcasting integrated with radio broadcasting\nThis class excludes the production of taped radio programming, see class 5920.','601'),('6020','Television Programming and Broadcasting Activities\n','This class includes :\nCreation of a complete television channel programme, from purchased programme components (e.g., movies, documentaries, etc.), self produced programme components (e.g., local news, live reports) or a combination thereof.\nThis complete television programme can be either broadcast by the producing unit or produced from transmission by third party distributors, such as cable companies or satellite providers.\nThe programming may be of a general or specialized nature (e.g. limited formats such as news, sports, education or youth oriented programming), may be made freely available to users or may be available only on a subscription basis.\nThis class also includes :\nProgramming of video-on-demand channels\nData broadcasting integrated with television broadcasting\nThis class excludes :\nProduction of television programme elements (e.g. movies, documentaries, commercials) see 5911;\nAssembly of a package of channels and distribution of that package via cable or satellite to viewers, see division 61.','602'),('6110','Wired Telecommunications Activities\n','This class includes :\nOperating, maintaining or providing access to facilities for the transmission of voice, data, text, sound and video using a wired telecommunications infrastructure, including :\noperating and maintaining switching and transmission facilities to provide point-to-point communications via landlines, microwave or a combination of landlines and satellite linkups\noperating of cable distribution systems (e.g. for distribution of data and television signals)\nfurnishing telegraph and other non-vocal communications using own facilities\nThe transmission facilities that carry out these activities may be based on a single technology or a combination of technologies.\nThis class also includes :\nPurchasing access and network capacity from owners and operators of networks and providing telecommunications services using this capacity to businesses and households\nProvision of Internet access by the operator of the wired infrastructures.\nThis class excludes telecommunications resellers, see 6190.','611'),('6120','Wireless Telecommunications Activities\n','This class includes :\nActivities of operating, maintaining or providing access to facilities for the transmission of voice, data, text, sound and video using a wireless telecommunications infrastructure\nMaintaining and operating paging as well as cellular and other wireless telecommunications networks\nThe transmission facilities provide omni-directional via airwaves and they may be based on a single technology or a combination of technologies.\nThis class also includes :\nPurchasing access and network capacity from owners and operators of networks and providing wireless telecommunications services (except satellite) using this capacity to businesses and households.\nProvision of Internet access by the operator of the wireless infrastructure.\nThis class excludes telecommunications resellers, see 6190.','612'),('6130','Satellite Telecommunications Activities',NULL,'613'),('6190','Other Telecommunications Activities\n','This class includes :\nProvision of specialized telecommunications applications, such as satellite tracking, communication telemetry, and radar station operations\nOperation of satellite terminal stations and associated facilities operationally connected with one or more terrestrial communications systems and capable of transmitting telecommunications to or receiving telecommunications from satellite systems\nProvision of Internet access over networks between the client and the Internet Service Provider (ISP) not owned or controlled by the ISP, such as dial-up Internet access, etc.\nProvision of telephone and internet access in facilities open to the public\nProvision of telecommunications services over existing telecom connections: VOIP (Voice Over Internet Protocol) provision\nThis class excludes provision of Internet access by operators of telecommunications infrastructure, see 6110, 6120, 6130.','619'),('6201','Computer Programming Activities\n','This class includes the activities of writing, modifying, testing, and supporting software.\nThis class includes :\nDesigning the structure and content of, and/or writing the computer code necessary to create and implement :\nsystems software (including updates and patches)\nsoftware applications (including updates and patches)\ndatabases\nweb pages\nCustomizing of software, i.e. modifying and configuring an existing application so that it is functional within the clientNULLs information system environment.\nThis class excludes :\nPublishing packaged software, see 5820;\nPlanning and designing computer systems that integrate computer hardware, software, and communication technologies, even though providing software might be an integral part, see 6202.','620'),('6202','Computer Consultancy and Computer Facilities Management Activities',NULL,'620'),('6209','Other Information Technology and Computer Service Activities',NULL,'620'),('6311','Data Processing, Hosting and Related Activities\n','This class includes :\nProvision of infrastructure for hosting, data processing services and related activities\nSpecialized hosting activities such as :\nweb hosting\nstreaming services\napplication hosting\nApplication service provisioning\nGeneral time-share provision of mainframe to clients\nData processing activities :\ncomplete processing of data supplied by clients\ngeneration of specialized reports from data supplied by clients\nProvision of data entry services','631'),('6312','Web Portals',NULL,'631'),('6391','News Agency Activities',NULL,'639'),('6399','Other Information Service Activities, N.e.c.',NULL,'639'),('6411','Central Banking',NULL,'641'),('6419','Other Monetary Intermediation\n','This class includes the receiving of deposits and/or close substitutes for deposits and extending of credit or lending funds. The granting of credit can take a variety of forms, such as loans, mortgages, credit cards etc. These activities are generally carried out by monetary institutions other than central banks, such as: banks; savings banks; and credit unions.\nThis class also includes postal giro and postal savings bank activities; credit granting for house purchase by specialized deposits-taking institutions.\nThis class excludes:\nCredit granting for house purchase by specialized non-depository institutions, see 6492;\nCredit card transaction processing and settlement activities, see 6619.','641'),('6420','Activities of Holding Companies',NULL,'642'),('6430','Trusts, Funds and Other Financial Vehicles\n','This class includes legal entities organized to pool securities or other financial assets, without managing, on behalf of shareholders or beneficiaries. The portfolio is customized to achieve specific investment characteristics, such as diversification, risks, rate of return, and price volatility. These entities earn interest, dividends, and other property income, but have little or no employment and no revenue from the sale of services.\nThis class excludes :\nFunds and trusts that earn revenue from the sale of goods or services, see PSIC class according to their principal activity;\nActivities of holding companies, see 6420;\nPension funding, see 6530; management of funds, see 6630.','643'),('6491','Financial Leasing',NULL,'649'),('6492','Other Credit Granting\n','This class includes :\nFinancial service activities primarily concerned with making loans by institutions not involved in monetary intermediation, where the granting of credit can take a variety of forms, such as loans, mortgages, credit cards etc., providing the following types of services :\ngranting of consumer credit\ninternational trade financing\nprovision of long-term finance to industry by industrial banks\nmoney lending outside the banking system\ncredit granting for house purchase by specialized non-depository institutions\nThis class excludes :\nCredit granting for house purchased by specialized institutions that also take deposits, see 6419;\nOperational leasing, see division 77, according to type of goods leased;\nGrant-giving activities by membership organization, see 9499.','649'),('6493','Pawnshop Operations',NULL,'649'),('6499','Other Financial Service Activities, Except Insurance and Pension Funding Activities, N.e.c.\n','This class includes :\nOther financial intermediation primarily concerned with distributing funds other than by making loans:\nfactoring activities\nwriting of swaps, options and other hedging arrangements\nactivities of viatical settlement companies\nThis class excludes :\nFinancial leasing, see 6491;\nSecurity dealing on behalf of others, see 6612;\nTrade, leasing and renting of real estate property, see division 68;\nBill collection without debt buying up, see 8291;\nGrant-giving activities by membership organization, see 9499.','649'),('6511','Life Insurance',NULL,'651'),('6512','Non-life Insurance',NULL,'651'),('6520','Reinsurance\n','This class includes the activities of assuming all or part of the risk associated with existing insurance policies originally underwritten by other insurance carriers.','652'),('6530','Pension Funding',NULL,'653'),('6611','Administration of Financial Markets',NULL,'661'),('6612','Security and Commodity Contracts Brokerage',NULL,'661'),('6619','Other Activities Auxiliary to Financial Service Activities',NULL,'661'),('6621','Risk and Damage Evaluation',NULL,'662'),('6622','Activities of Insurance Agents and Brokers',NULL,'662'),('6623','Pre-need Plan Activities\n','This class includes pre-need plans for health, education, memorial, interment, pension and travel.','662'),('6629','Other Activities Auxiliary to Insurance and Pension Funding',NULL,'662'),('6630','Fund Management Activities',NULL,'663'),('6811','Real Estate Buying, Selling, Renting, Leasing and Operating of Self-owned/leased Apartment Buildings, Non-residential and Dwellings',NULL,'681'),('6812','Real Estate Buying, Developing, Subdividing and Selling, of Residential Including Mass Housing',NULL,'681'),('6813','Cemetery and Columbarium Development, Selling, Renting, Leasing and Operating of Self-owned Cemetery/columbarium (Including Burial Crypt)',NULL,'681'),('6814','Renting or Leasing Services of Residential Properties',NULL,'681'),('6819','Other Real Estate Activities with Own or Leased Property',NULL,'681'),('6820','Real Estate Activities on a Fee or Contract Basis',NULL,'682'),('6910','Legal Activities',NULL,'691'),('6920','Accounting, Bookkeeping and Auditing Activities; Tax Consultancy',NULL,'692'),('7010','Activities of Head Offices',NULL,'701'),('7020','Management Consultancy Activities',NULL,'702'),('7110','Architectural and Engineering Activities and Related Technical Consultancy\n','This class includes the provision of architectural services, engineering services, drafting services, building inspection services and surveying and mapping services and the like.\nThis class includes :\nArchitectural consulting activities :\nbuilding design and drafting\ntown and the city planning and landscape architecture\nEngineering design (i.e. applying physical laws and principles of engineering in the design of machines, materials, instruments, structures, processes and systems) and consulting activities for :\nmachinery, industrial processes and industrial plant\nprojects involving civil engineering, hydraulic engineering, traffic engineering\nwater management projects\nprojects elaboration and realization relative to electrical and electronic engineering, mining engineering, chemical engineering, mechanical, industrial and systems engineering, safety engineering\nproject management activities related to construction\nElaboration of projects using air conditioning, refrigeration, sanitary and pollution control engineering, acoustical engineering, etc.;\nGeophysical, geologic and seismic surveying\nGeodetic surveying activities :\nland and boundary surveying activities\nhydrologic surveying activities\nsubsurface surveying activities\ncartographic and spatial information activities\nThis class also includes environmental engineering activities such as: management and provision of anti-pollution technologies covering wastewater treatment or pollution control and solid and hazardous waste management, etc.\nThis class excludes :\nTest drilling in connection with mining operations, see 0910,0990;\nDevelopment or publishing of associated software, see 5820,6201;\nActivities of computer consultants, see 6202,6209;\nTechnical testing, see 7120;\nResearch and development activities related to engineering, see 7210;\nIndustrial design, see 7410;\nInterior decorating, see 7410;\nAerial photography, see 7420.','711'),('7120','Technical Testing and Analysis',NULL,'712'),('7210','Research and Experimental Development on Natural Sciences and Engineering\n','This class includes :\nresearch and development on natural sciences\nresearch and development on biotechnology\nresearch and development on engineering and technology\nresearch and development on medical sciences\nresearch and development on agricultural sciences\ninterdisciplinary research and development, predominantly on natural sciences and engineering','721'),('7220','Research and Experimental Development on Social Sciences and Humanities',NULL,'722'),('7230','Research and Experimental Development in Information Technology',NULL,'723'),('7310','Advertising\n','This class includes the provision of a full range of advertising services (i.e. through in-house capabilities or subcontracting), including advice, creative services, production of advertising material, media planning, and buying.\nThis class includes :\nCreation and realization of advertising campaigns:\ncreating and placing advertising in newspapers, periodicals, radio, television, the internet and other media\ncreating and placing of outdoor advertising, e.g. billboards, panels, bulletins and frames, window dressing , showroom design, car and bus carding, etc.\nmedia representation, i.e. sale of time and space for various media soliciting advertising\naerial advertising\ndistribution or delivery of advertising material or samples\nprovision of advertising space on billboards, etc.\ncreation of stands and other display structures and sites\nConducting marketing campaigns and other advertising services aimed at attracting and retaining customers :\npromotion of products\npoint-of-sale marketing\ndirect mail advertising\nmarketing consulting\nThis class excludes :\nPublishing of advertising material, see 5819;\nProduction of commercial messages for radio, television and film, see 5911;\nPublic-relations activities, see 7020;\nMarket research, see 7320;\nGraphic design activities, see 7410;\nAdvertising photography, see 7420;\nConvention and trade show organizers, see 8230;\nMailing activities, see 8219.','731'),('7320','Market Research and Public Opinion Polling',NULL,'732'),('7410','Specialized Design Activities\n','This class includes :\nFashion design related to textiles, wearing apparel, shoes, jewelry, furniture and other interior decoration and other fashion goods as well as other personal or household goods.\nIndustrial design, i.e. creating and developing designs and specifications that optimize the use, value and appearance of products, including the determination of the materials, construction, mechanism, shape, color and surface finishes of the product, taking into consideration human characteristics and needs, safety, market appeal and efficiency in production, distribution, use and maintenance.\nActivities of graphic designers\nActivities of interior decorators\nThis class excludes :\nDesign and programming of web pages, see 6201;\nArchitectural design, see 7110;\nEngineering design, i.e. applying physical laws and principles of engineering in the design of machines, materials, instruments, structures, processes and systems, see 7110.\nTheatrical stage-set design, see 9000.','741'),('7420','Photographic Activities\n','This class includes the commercial and consumer photograph production such as :\ndigital photograph processing\nportrait photography for passport, schools, weddings, etc.\nphotography for commercial, publishers, fashion, real estate or tourism purposes\naerial photography\nvideotaping of events: weddings, meetings, etc.\nFilm processing :\ndeveloping, printing and enlarging from client-taken negatives or cine-films\nfilm developing and photo printing laboratories\none hour photo shops (not part of camera stores)\nmounting slides\ncopying and restoring or transparency retouching in connections with photographs\nActivities of photojournalists\nThis class also includes microfilming of documents.\nThis class excludes :\nProcessing motion picture film related to the motion picture and television industries, see 5912;\nCartographic and spatial information activities, see 7110.','742'),('7490','Other Professional, Scientific and Technical Activities, N.e.c.\n','This class includes a great variety of service activities generally delivered to commercial clients. It includes those activities for which more advanced professional, scientific and technical skill levels are required, but does not include ongoing, routine business functions that are generally of short duration.\nThis class includes :\nTranslation and interpretation activities\nBusiness brokerage activities, i.e. arranging for the purchase and sale of small and medium-sized businesses, including professional practices, but not including real estate brokerage\nPatent brokerage activities (arranging for the purchase and sale of patents)\nAppraisal activities other than for real estate and insurance (for antiques, jewelry, etc.)\nBill auditing and freight rate information\nActivities of quantity surveyors\nWeather forecasting activities\nSecurity consulting\nAgronomy consulting\nEnvironmental consulting\nOther technical consulting\nActivities of consultants other than architecture, engineering and management consultants\nThis class also includes :\nActivities carried on by agents and agencies on behalf of individuals usually involving the obtaining of engagements in motion picture, theatrical production or other entertainment or sports attractions and the placement of books, plays, artworks, photographs etc., with publishers, producers, etc.\nThis class excludes :\nWholesale of used motor vehicles by auctioning, see 4510;\nOnline auction activities (retail), see 4791;\nActivities of auctioning houses (retail), see 4799;\nActivities of real estate brokers, see 6820;\nBookkeeping activities, see 6920;\nActivities of management consultants, see 7020;\nActivities of architecture and engineering consultants, see 7110;\nEngineering design activities, see 7110;\nIndustrial and machinery design activities, see 7110;\nDisplay of advertisement and other advertising design, see 7310;\nCreation of stands and other display structures and sites, see 7310;\nActivities of convention and trade show organizers, see 8230;\nActivities of independent auctioneers, see 8299;\nAdministration of loyalty programs, see 8299;\nConsumer credit and debt counseling, see 8890;\nActivities of authors of scientific and technical books, see 9000;\nActivities of independent journalists, see 9000.','749'),('7500','Veterinary Activities',NULL,'750'),('7710','Renting and Leasing of Motor Vehicles (Except Motorcycle, Caravans, Campers)',NULL,'771'),('7721','Renting and Leasing of Recreational and Sports Goods',NULL,'772'),('7722','Renting of Video Tapes and Disks',NULL,'772'),('7729','Renting and Leasing of Other Personal and Household Goods\n','This class includes :\nRenting of all kinds of household or personal goods, to households or industries (except recreational and sports equipment) :\ntextiles, wearing apparel and footwear\nfurniture, pottery and glass, kitchen and tableware, electrical appliances and housewares\njewelry, musical instruments, scenery and costumes\nbooks, journals and magazines\nflowers and plants\nelectronic equipment for household use\nmachinery and equipment used by amateurs or as a hobby, e.g. tools for home repairs.\nThis class excludes :\nRenting of cars, trucks, trailers and recreational vehicles without driver, see 7710;\nRenting of recreational and sports goods, see 7721;\nRental of video tapes and disks, see 7722;\nRenting of motorcycles and caravans without driver, see 7730;\nRenting of office furniture, see 7730;\nProvision of linen, work uniforms and related items by laundries, see 9601.','772'),('7730','Renting and Leasing of Other Machinery, Equipment and Tangible Goods\n','This class includes :\nRenting and operational leasing, without operator, of other machinery and equipment that are generally used as capital goods by industries :\nengine and turbines\nmachine tools\nmining and oil field equipment\nprofessional radio, television and communication equipment\nmotion picture production equipment\nmeasuring and controlling equipment\nother scientific, commercial and industrial machinery\nRenting and operational leasing of land-transport equipment (other than motor vehicles) without drivers:\nmotorcycles, caravans and campers, etc.\nrailroad vehicles\nRenting and operational leasing of water-transport equipment without operator : commercial boats and ships\nRenting and operational leasing of air transport equipment without operator :\nairplanes\nhot-air balloons\nRenting and operational leasing of agricultural and forestry machinery and equipment without operator\nRenting of products produced by class 2821 (Manufacture of agricultural and forestry machinery), such as agricultural tractors, etc.\nRenting and operational leasing of construction and civil-engineering machinery and equipment without operator :\ncrane lorries\nscaffolds and work platforms, without erection and dismantling\nRenting and operational leasing of office machinery and equipment without operator :\ncomputers and computer peripheral equipment\nduplicating machines, typewriters and word-processing machines\naccounting machinery and equipment: cash registers, electronic calculators etc., and office furniture\nThis class also includes :\nRenting of accommodation or office containers\nRenting of containers\nRenting of pallets\nRenting of animals (e.g. herds, race horses)\nThis class excludes :\nRenting of agricultural and forestry machinery or equipment with operator, see 015, 0240;\nRenting of construction and civil engineering machinery or equipment with operator, see division 43;\nRenting of water-transport equipment with operator, see division 50;\nRenting of air-transport with operator, see division 51;\nFinancial leasing, see 6491;\nRenting of pleasure boats, see 7721;\nRenting of bicycles, see 7721.','773'),('7740','Leasing of Intellectual Property and Similar Products, Except Copyrighted Works',NULL,'774'),('7810','Activities of Employment Placement Agencies\n','This class includes listing employment vacancies and referring or placing applicants for employment, where the individuals referred or placed are not employees of the employment agencies.\nThis class includes :\nPersonnel search, selection referral and placement activities, including executive placement and search activities\nActivities of casting agencies and bureaus, such as theatrical casting agencies\nActivities of on-line employment placement agencies\nThis class excludes activities of personal theatrical or artistic agents or agencies, see 7490.','781'),('7820','Temporary Employment Agency Activities\n','This class includes activities of supplying workers to clientNULLs businesses for limited periods of time to temporarily supplement the working force of the client, where the individuals provided are employees of the temporary help service unit.\nUnits classified here do not provide direct supervision of their employees at the clientNULLs work sites.','782'),('7830','Other Human Resources Provision',NULL,'783'),('7911','Travel Agency Activities',NULL,'791'),('7912','Tour Operator Activities',NULL,'791'),('7990','Other Reservation Service and Related Activities\n','This class includes :\nProvision of other travel-related reservation services :\nreservations for transportation, hotels, restaurants, car rentals, entertainment and sport etc.\nProvision of time-share exchange services\nTicket sales activities for theatrical, sports and other amusement and entertainment events\nProvision of visitor assistance services :\nprovision of travel information to visitors\nactivities of tourist guides\nTourism promotion activities\nThis class excludes :\nActivities of travel agencies and tour operators, see 7911, 7912;\nOrganization and management of events such as meetings, conventions and conferences, see 8230.','799'),('8010','Private Security Activities',NULL,'801'),('8020','Security Systems Service Activities',NULL,'802'),('8030','Investigation Activities',NULL,'803'),('8110','Combined Facilities Support Activities',NULL,'811'),('8121','General Cleaning of Buildings',NULL,'812'),('8129','Other Building and Industrial Cleaning Activities\n','This class includes :\nExterior cleaning of buildings of all types, including offices, factories, shops, institutions and other business and professional premises and multiunit residential buildings\nSpecialized cleaning activities for buildings such as window cleaning, chimney cleaning and cleaning of fireplaces, stoves, furnaces, incinerators, boilers, ventilation ducts and exhaust units\nSwimming pool cleaning and maintenance services\nCleaning of industrial machinery\nBottle cleaning\nCleaning of trains, buses, planes, etc.\nCleaning of the inside of road and sea tankers\nDisinfecting and exterminating activities\nStreet sweeping\nOther building and industrial cleaning activities, n.e.c.\nThis class excludes :\nAgriculture pest control, see 0153;\nCleaning of sewers and drains, see 3700;\nAutomobile cleaning, car wash, see 4520.','812'),('8130','Landscape Care and Maintenance Service Activities',NULL,'813'),('8211','Combined Office Administrative Service Activities',NULL,'821'),('8219','Photocopying, Document Preparation and Other Specialized Office Support Activities\n','This class includes a variety of copying, document preparation and specialized office support activities. The document copying/printing activities included here cover only short-run type printing activities.\nThis class includes :\nDocument preparation\nDocument editing or proofreading\nTyping, word processing, or desktop publishing\nSecretarial support services\nTranscription of documents, and other secretarial services\nLetter or resume writing\nProvision of mailbox rental and other postal and mailing services (except direct mail advertising)\nDuplicating\nMailing services.\nBlueprinting\nWord processing services\nPhotocopying\nOther document copying services without also providing printing services, such as offset printing, quick printing, digital printing, prepress services\nThis class excludes :\nPrinting of documents (offset printing, quick printing etc.), see 1811;\nDirect mail advertising, see 7310;\nSpecialized stenotype services such as court reporting, see 8299;\nPublic stenography services, 8299.','821'),('8221','Call Centers Activities (Voice)\n','This class includes :\nInbound call centers, answering calls from clients by using human operators, automatic call distribution, computer telephone integration, interactive voice response systems or similar methods to receive orders, provide product information, deal with customer request for assistance or address customer complaints.\nOutbound call centers using similar methods to sell or market goods or services to potential customers, undertake market research or public opinion polling and similar activities for clients.','822'),('8222','Back-office Operations Activities (Non-voice)\n','This class includes the export of business process services that are not primarily delivered through live, spoken interaction by frontline customer-service agents directly to customers or clients','822'),('8229','Other Non-voice Related Activities',NULL,'822'),('8230','Organization of Conventions and Trade Shows\n','This class includes the organization, promotion and/or management of events, such as business and trade shows, conventions, conferences and meetings, whether or not including the management and provision of the staff to operate the facilities in which these events take place.','823'),('8291','Activities of Collection Agencies and Credit Bureaus',NULL,'829'),('8292','Packaging Activities',NULL,'829'),('8299','Other Business Support Service Activities, N.e.c.',NULL,'829'),('8411','General Public Administration Activities\n','This class includes :\nExecutive and legislative administration of central, regional and local bodies\nAdministration and supervision of fiscal affairs :\noperation of taxation schemes\nduty/tax collection on goods and tax violation investigation\ncustoms administration\nBudget implementation and management of public funds and public debt : raising and receiving of moneys and control of their disbursement\nAdministration of overall (civil) R&D policy and associated funds\nAdministration and operation of overall economic and social planning and statistical services at the various levels of government\nThis class excludes :\nOperation of government owned or occupied buildings, see 681, 6820;\nAdministration of R&D policies intended to increase personal well-being and of associated funds, see 8412;\nAdministration of R&D policies intended to improve economic performance and competitiveness, see 8413;\nAdministration of defense-related R&D policies and of associated funds, see 8422;\nOperation of government archives, see 9101.','841'),('8412','Regulation of the Activities of Providing Health Care, Education, Cultural Services and Other Social Services, Excluding Social Security',NULL,'841'),('8413','Regulation of and Contribution to More Efficient Operation of Businesses',NULL,'841'),('8421','Foreign Affairs',NULL,'842'),('8422','Defense Activities',NULL,'842'),('8423','Public Order and Safety Activities',NULL,'842'),('8430','Compulsory Social Security Activities',NULL,'843'),('8511','Pre-primary/pre-school Education (For Children without Special Needs)',NULL,'851'),('8512','Pre-primary Education for Children with Special Needs',NULL,'851'),('8521','Primary/elementary Education (For Children without Special Needs)',NULL,'852'),('8522','Primary/elementary Education for Children with Special Needs',NULL,'852'),('8531','General Secondary Education for Children without Special Needs',NULL,'853'),('8532','General Secondary Education for Children with Special Needs',NULL,'853'),('8533','Technical and Vocational Secondary Education for Children without Special Needs\n','This class includes programs that prepare students both for higher education and for employment in specific vocational pursuits. While academic subjects are offered, emphasis is placed on vocational/technical subjects either as preparation for a range of more advanced vocational/technical programs or for a specific occupation.\nThe programs consist of the following areas of concern: (a) trade, craft and industries, (b) agriculture, and (c) fisheries. The principal subject-matter content of these programs include the regular school curriculum at this level but with more attention and time to elementary drafting, blueprint reading, and a range of technical subjects depending on the studentNULLs interests.','853'),('8534','Technical and Vocational Secondary Education for Children with Special Needs',NULL,'853'),('8540','Higher Education\n','This class includes the provision of post-secondary non-tertiary and tertiary education, including granting of degrees at baccalaureate, graduate or post-graduate level. The requirements for admission is at least a high school diploma or equivalent general academic training.\nEducation can be provided in classrooms or through radio, television broadcast, Internet or correspondence.','854'),('8551','Sports and Recreation Education',NULL,'855'),('8552','Cultural Education',NULL,'855'),('8559','Other Education\n','This class includes the provision of instruction and specialized training, generally for adults, not comparable to the general education in groups 851-853. This class does not include activities of academic schools, colleges, and universities. Instruction may be provided in diverse settings, such as the unitNULLs or clientNULLs training facilities, educational institutions, the workplace, or the home, and through correspondence, radio, television, Internet, in classrooms or by other means. Such instruction does not lead to a high school diploma, baccalaureate or graduate degree.\nThis class includes :\nEducation that is not definable by level\nAcademic tutoring services\nPreparation for college entrance examination\nLearning centers offering remedial courses\nProfessional examination review courses\nLanguage instruction and conversational skills instruction\nSpeed reading instruction\nReligious instruction\nThis class also includes :\nAutomobile driving schools\nFlying schools\nLifeguard training\nSurvival training\nPublic speaking training\nComputer training','855'),('8560','Educational Support Services\n','This class includes :\nProvision of non-instructional services that support educational processes or systems :\nEducational consulting\nEducational guidance counseling services\nEducational testing evaluation services\nEducational testing services\nOrganization of students exchange programs\nThis class excludes scientific research and development, see division 72.','856'),('8611','Public Hospitals, Sanitaria and Other Similar Activities',NULL,'861'),('8612','Private Hospitals, Sanitaria and Other Similar Activities',NULL,'861'),('8621','Public Medical, Dental and Other Health Activities',NULL,'862'),('8622','Private Medical, Dental and Other Health Activities',NULL,'862'),('8690','Other Human Health Activities',NULL,'869'),('8710','Residential Nursing Care Facilities',NULL,'871'),('8720','Residential Care Activities for Mental Retardation, Mental Health and Substance Abuse\n','This class includes the provision of residential care (but not licensed hospital care) to people with mental retardation, mental illness, or substance abuse problems. Facilities provide room, board, protective supervision and counseling and some health care. It also includes provision of residential care and treatment for patients with mental health and substance abuse illnesses.\nThis class includes activities of :\nFacilities for treatment of alcoholism and drug addiction\nPsychiatric convalescent homes\nResidential group homes for the emotionally disturbed\nMental retardation facilities\nMental health halfway houses\nThis class excludes social work activities with accommodation, such as temporary homeless shelters, see 8790.','872'),('8730','Residential Care Activities for the Elderly and Disabled',NULL,'873'),('8790','Other Residential Care Activities, N.e.c.\n','This class includes the provision of residential and personal care services for persons, except the elderly and disabled, who are unable to fully care for themselves or who do not desire to live independently.\nThis class includes :\nActivities provided on a round-the-clock basis directed to provide social assistance to children and special categories of persons with some limits on ability for self-care, but where medical treatment or education are nor important elements:\norphanages\nchildrenNULLs boarding homes and hostels\ntemporary homeless shelters\ninstitutions that take care of unmarried mothers and their children.\nThe activities may be carried out by public or private organizations.\nThis class also includes activities of :\nHalfway group homes for persons with social or personal problems\nHalfway homes for delinquents and offenders\nDisciplinary camps\nThis class excludes :\nFunding and administration of compulsory social security programs, see 8430;\nActivities of nursing care facilities, see 8710;\nResidential care activities for the elderly or disabled, see 8730;\nAdoption activities, see 8890;\nShort-term shelter activities for disaster victims, see 8890.','879'),('8810','Social Work Activities without Accommodation for the Elderly and Disabled\n','This class includes :\nSocial, counseling, welfare, referral and similar services which aimed at the elderly and disabled in their homes or elsewhere and carried out by government offices or by private organizations, national or local self-help organizations and by specialists providing counseling services :\nvisiting of the elderly and disabled\nday-care activities for the elderly or for handicapped adults\nvocational rehabilitation and habilitation activities for disabled persons provided that the education component is limited.\nThis class excludes :\nFunding and administration of compulsory social security programs, see 8430;\nActivities similar to those described in this class, but including accommodation, see 8730;\nDay-care activities for handicapped children, see 8890.','881'),('8890','Other Social Work Activities without Accommodation, N.e.c.\n','This class includes :\nSocial, counseling, welfare, refugee and referral and similar services which are delivered to individuals and families in their homes or elsewhere and carried out by government offices or by private organizations, disaster relief organizations and national or local self-help organizations and by specialists providing counseling services :\nwelfare and guidance activities for children and adolescents\nadoption activities, activities for the prevention of cruelty to children and others\nmarriage and family guidance, credit and debt counseling services, household budget counseling\ncommunity and neighborhood activities\nactivities for the disaster victims, refugees, immigrants, etc., including temporary or extended shelter for them\nvocational rehabilitation and habilitation activities for unemployed persons provided that the education component is limited\neligibility determination in connection with welfare aid, rent supplements or food stamps\nchild day-care activities including for handicapped children\nday facilities for the homeless and other socially weak groups\ncharitable activities like fund-raising or other supporting activities aimed at social work.\nThis class excludes :\nFunding and administration of compulsory social security programs, see 8430;\nActivities similar to those described in this class, but including accommodation, see 8790.','889'),('9000','Creative, Arts and Entertainment Activities\n','This class includes the operation of facilities and provision of services to meet the cultural and entertainment interests of their customers. This includes the production and promotion of, and participation in, live performances, events or exhibits intended for public viewing; the provision of artistic, creative or technical skills for the production of artistic production of artistic products and live performances.\nThis class includes :\nProduction of live theatrical presentations, concerts and opera or dance productions and other stage productions :\nactivities of groups, circuses or companies, orchestras or bands\nactivities of individual artists such as authors, actors, directors, musicians, lecturers or speakers, stage-set designers and builders, etc.\nOperation of concert and theatre halls and other arts facilities\nActivities of sculptors, painters, cartoonists, engravers, etchers, etc.\nActivities of individual writers, for all subjects including fictional writing, technical writing, etc.\nActivities of independent journalists\nRestoring of works of art such as paintings, etc.\nThis class also includes activities of producers or entrepreneurs of arts live events, with or without facilities.\nThis class excludes :\nRestoring of stained glass windows, see 2310;\nManufacture of statues, other than artistic originals, see 2397;\nRestoring of organs and other historical musical instruments, see 3319;\nRestoring of historical sites and buildings, see 4100;\nMotion picture and video production, see 5911, 5912;\nOperation of cinemas, see 5914;\nActivities of personal theatrical or artistic agents or agencies, see 7490;\nCasting activities, see 7810;\nActivities of ticket agencies, see 7990;\nOperation of museums of all kinds, see 9102;\nSports and amusement and recreation activities, see division 93;\nRestoring of furniture (except museum type of restoration), see 9524.','900'),('9101','Library and Archives Activities',NULL,'910'),('9102','Museums Activities and Operation of Historical Sites and Buildings',NULL,'910'),('9103','Botanical and Zoological Gardens and Nature Reserves Activities',NULL,'910'),('9200','Gambling and Betting Activities',NULL,'920'),('9311','Operation of Sports Facilities',NULL,'931'),('9312','Activities of Sports Clubs',NULL,'931'),('9319','Other Sports Activities',NULL,'931'),('9321','Activities of Amusement Parks and Theme Parks',NULL,'932'),('9329','Other Amusement and Recreation Activities, N.e.c.\n','This class includes :\nActivities of recreation parks, beaches, including renting of facilities such as bathhouses, lockers, chairs etc.\nOperation of recreational transport facilities\nRenting of leisure and pleasure equipment as an integral part of recreational facilities\nOperation of fairs and shows of a recreational nature\nOperation of discotheques and dance floors\nOperation of (exploitation) of coin-operated games\nOther amusement and recreation activities (except amusement parks and theme parks, see 9321) not elsewhere classified.\nThis class also includes activities of producers or entrepreneurs of live events other than arts or sports events, with or without facilities.\nThis class excludes\nFishing cruises, see 5011, 5021;\nProvision of space and facilities for short stay by visitors in recreational parks and forests and campgrounds, see 5510;\nBeverage serving activities of discotheques, see 5630;\nTrailer parks, campgrounds, recreational camps, hunting and fishing camps, campsites and campgrounds, see 5510;\nSeparate renting of leisure and pleasure equipment, see 7721;\nOperation (exploitation) of coin-operated gambling machines, see 9200;\nActivities of amusement parks and theme parks, see 9321.','932'),('9411','Activities of Business and Employers Membership Organizations',NULL,'941'),('9412','Activities of Professional Membership Organizations',NULL,'941'),('9420','Activities of Trade Unions',NULL,'942'),('9491','Activities of Religious Organizations',NULL,'949'),('9492','Activities of Political Organizations',NULL,'949'),('9499','Activities of Other Membership Organizations, N.e.c.',NULL,'949'),('9511','Repair of Computers and Peripheral Equipment',NULL,'951'),('9512','Repair of Communications Equipment',NULL,'951'),('9521','Repair of Consumer Electronics',NULL,'952'),('9522','Repair of Household Appliances and Home and Garden Equipment\n','This class includes:\nRepair and servicing of household appliances:\nrefrigerators, stoves, washing machines, clothes dryers, room air conditioners\nRepair and servicing of home and garden equipment:\nlawnmowers, edgers, snow-and leaf-blowers, trimmers, etc.\nThis class excludes:\nrepair of hand held power tools, see 3312\nrepair of central air conditioning systems, see 4322.','952'),('9523','Repair of Footwear and Leather Goods\n','This class includes:\nRepair and maintenance of footwear: shoes, boots etc.\nFitting of heels\nRepair and maintenance of leather goods: luggage and the like','952'),('9524','Repair of Furniture and Home Furnishings\n','This class includes :\nReupholstering , refinishing, repairing and restoring of furniture and home furnishing\nAssembly of self-standing furniture\nThis class excludes installation of fitted kitchen, shop fittings and the like, see 4330.','952'),('9529','Repair of Other Personal and Household Goods\n','This class includes repair of personal and household goods :\nRepair of bicycles\nRepair and alteration of clothing\nRepair and alteration of jewelry\nRepair of watches, clocks and their parts such as watch cases and housings of all materials; movements, chronometers, etc.\nRepair of sporting goods (except sporting guns)\nRepair of books\nRepair of musical instruments\nRepair of toys and similar articles\nRepair of other personal and household goods\nPiano - tuning\nThis class excludes :\nIndustrial engraving of metals, see 2592;\nRepair of sporting and recreational guns, see 3311;\nRepair of hand held power tools, see 3312;\nRepair of time clocks, time/date stamps, time locks and similar time keeping devices, see 3313.','952'),('9610','Personal Services for Wellness, Except Sports Activities\n','This includes activities providing services for wellness such as hairdressing and other beauty treatment, activities of spa, steam bath, sauna, solarium, reducing and slendering saloon, massage saloon and Turkish bath.','961'),('9621','Washing and Dry Cleaning of Textile and Fur Products',NULL,'962'),('9630','Funeral and Related Activities',NULL,'963'),('9640','Domestic Services',NULL,'964'),('9690','Other Personal Service Activities, N.e.c.\n','Social activities such as escort services, dating services, services of marriage bureau\nPet care services such as boarding, grooming, sitting and training pets\nAstrological and spiritualistsNULL activities\nGenealogical organizations\nShoe shiners, porters, valet car parkers etc.\nConcession operation of coin-operated personal service machines (photo booths, weighing machines, machines for checking blood pressure, coin-operated lockers, etc.\nThis class excludes veterinary activities, see 7500.','969'),('9700','Activities of Households as Employers of Domestic Personnel',NULL,'970'),('9810','Undifferentiated Goods-producing Activities of Private Households for Own Use',NULL,'981'),('9820','Undifferentiated Services-producing Activities of Private Households for Own Use',NULL,'982'),('9901','Activities of Extra-territorial Organizations and Bodies\n','This class includes the activities of international organizations, such as the United Nations and its specialized agencies, regional bodies, etc.; the Association of Southeast Asian Nations (ASEAN)\nthe International Committee of the Red Cross (ICRC)\nthe International Labor Organization (ILO), the International Finance Corporation (IFC)\nthe International Monetary Fund (IMF)\nthe World Bank; the Japan International Cooperation Agency (JICA)\nthe Joint United States Military Assistance Group (JUSMAG)\netc.\nThis class also includes :\nActivities of diplomatic and consular mission when being determined by the country of their location rather than by the country they represent.','990'),('9909','Activities of Other International Organizations',NULL,'990');
