INSERT INTO `psic_group` VALUES ('011','Growing of Non-perennial Crops\n','This group includes the growing of non-perennial crops, i.e. plants that do not last for more than two growing seasons. Included is the growing of these plants for the purpose of seed production.','01'),('012','Growing of Perennial Crops\n','This group includes the growing of perennial crops, i.e. plants that last for more than two growing seasons, either each season or growing continuously. Included is the growing of these plants for the purpose of seed production.','01'),('013','Plant Propagation',NULL,'01'),('014','Animal Production\n','This group includes raising (farming) and breeding of all animals, except aquatic animals.\nIt includes raising (farming) of domestic animals, such as carabao, cattle, sheep, goats, deer, horses, asses, mules or hinnies, etc.; raising (farming) of poultry such as chicken, ducks, quails, etc., provision of feed lot services; production of raw milk, bovine semen; production of butter, cheese, other dairy products in the farm; sheep shearing by the sheep owner; and stud farming.','01'),('015','Support Activities to Agriculture and Post-harvest Crop Activities\n','This group includes activities incidental to agricultural production and activities similar to agriculture not undertaken for production purposes, done on a fee or contract basis. Also included are post-harvest crop activities, aimed at preparing agricultural products for the primary market.','01'),('017','Hunting, Trapping and Related Service Activities',NULL,'01'),('021','Silviculture and Other Forestry Activities\n','This class includes :\nGrowing of standing timber : planting, replanting, transplanting, thinning and conserving of forests and timber tracts\nGrowing of coppice, pulpwood and fire wood\nOperation of forest tree nurseries\nThese activities can be carried out in natural or planted forests.\nThis class excludes :\nGrowing of Christmas tree, see 0129;\nGathering of wild growing non-wood forest products, see 0230;\nProduction of wood chips and particles, see 1610.','02'),('022','Logging',NULL,'02'),('023','Gathering of Non-wood Forest Products',NULL,'02'),('024','Support Services to Forestry',NULL,'02'),('031','Fishing\n','This group includes capture fishery, i.e. the hunting, collecting and gathering activities directed at removing or collecting live wild aquatic organisms (predominantly fish, mollusks and crustaceans) including plants from the oceanic, coastal or inland waters for human consumption and other purposes by hand or more usually by various types of fishing gear such as nets, lines and stationary traps. Such activities can be conducted on the intertidal shoreline (e.g. collection of mollusks such as mussels and oysters) or shore based netting, or from home-made dugouts or more commonly using commercially made boats in inshore, coastal waters or offshore waters.\nUnlike in aquaculture (group 032), the aquatic resource being captured is usually common property resource irrespective of whether the harvest from this resource is undertaken with or without exploitation rights. Such activities also include fishing restocked water bodies.','03'),('032','Aquaculture\n','This group includes aquaculture (or aquafarming), i.e. the production process involving the culturing or farming (including harvesting) of aquatic organisms (fish, mollusks, crustaceans, plants, crocodile, alligators and amphibians) using techniques designed to increase the production of the organisms in question beyond the natural capacity of the environment (for example regular stocking, feeding and protection from predators).\nCulturing/farming refers to the rearing up to their juvenile and/or adult phase under captive conditions of the above organisms. In addition, aquaculture also encompasses individual, corporate or state ownership of the individual organisms throughout the rearing or culture stage, up to and including harvesting.','03'),('051','Mining of Hard Coal',NULL,'05'),('052','Mining of Lignite',NULL,'05'),('061','Extraction of Crude Petroleum',NULL,'06'),('062','Extraction of Natural Gas',NULL,'06'),('071','Mining of Iron Ores',NULL,'07'),('072','Mining of Non-ferrous Metal Ores\n','This group includes mining and preparation of non-ferrous metal ores.','07'),('081','Quarrying of Stone, Sand and Clay',NULL,'08'),('089','Mining and Quarrying, N.e.c.',NULL,'08'),('091','Support Activities for Petroleum and Gas Extraction',NULL,'09'),('099','Support Activities for Other Mining and Quarrying',NULL,'09'),('101','Processing and Preserving of Meat',NULL,'10'),('102','Processing and Preserving of Fish, Crustaceans and Mollusks',NULL,'10'),('103','Processing and Preserving of Fruits and Vegetables',NULL,'10'),('104','Manufacture of Vegetable and Animal Oils and Fats\n','This class includes:\nManufacture of oils and fats from vegetable or animal materials, except rendering and refining of lard and other edible animal fats\nProcessing of vegetable oils: boiling, dehydration, hydrogenation, compression such as virgin coconut oil etc.\nManufacture of crude vegetable oils: olive oil, soya-bean oil, palm oil, sunflower-seed oil, cotton-seed oil, rape, colza or mustard oil, linseed oil, etc.\nManufacture of non-defatted flour or meal of oilseeds, oil nuts or oil kernels\nManufacture of refined vegetable oils: olive oil, soya-bean oil, etc.\nManufacture of margarine\nManufacture of melanges and similar spreads\nProduction of partly hydrogenated oils, margarine or other table oils or cooking fats\nManufacture of compound cooking fats\nManufacture of non-edible animal oils and fats\nExtraction of oil from fish or fish livers and marine mammal oils\nProduction of cotton linters, oilcakes and other residual products of oil production\nThis class excludes :\nRendering and refining of lard and other edible animal fats, see 1012;\nWet corn milling, see 1063;\nProduction of essential oils, see 2029;\nTreatment of oil and fats by chemical processes, see 2029.','10'),('105','Manufacture of Dairy Products\n','\nThis class includes :\nManufacture of fresh liquid milk, pasteurized, sterilized, homogenized and/or ultra heat treated\nManufacture of milk-based drinks\nManufacture of cream from fresh liquid milk, pasteurized, sterilized, homogenized\nManufacture of yoghurt\nManufacture of dried or concentrated milk whether or not sweetened\nManufacture of milk or cream in solid form\nManufacture of butter\nManufacture of yoghurt\nManufacture of cheese and curd\nManufacture of milk-based drinks\nManufacture of whey\nManufacture of casein or lactose such as manufacture of ice cream and other edible ice such as sorbet\nThis class excludes :\nProduction of raw milk (cattle, 0141) (sheep, goats, horses, assess, etc. 0142; 0143)\nManufacture of non-dairy milk and cheese substitutes, see 1079;\nActivities of ice cream parlors, see 5610.','10'),('106','Manufacture of Grain Mill Products, Starches and Starch Products\n','This group includes the milling of flour or meal from grains or vegetables, the milling, cleaning and polishing of rice, as well as the manufacture of flour mixes or doughs from these products. Also included in this group is the wet milling of corn and vegetables and the manufacture of starch and starch products.','10'),('107','Manufacture of Other Food Products',NULL,'10'),('108','Manufacture of Prepared Animal Feeds',NULL,'10'),('110','Manufacture of Beverages\n','The group includes the manufacture and blending of alcoholic beverage such as whisky, brandy, gin, distilled spirits and neutral spirits; wines, fermented but not distilled alcoholic beverage; malt liquors such as beer, ale etc. including manufacture of low alcohol or non-alcohol. This also includes manufacture of soft drinks, mineral waters and other bottled waters.','11'),('120','Manufacture of Tobacco Products\n','This group includes :\nManufacture of tobacco products and products of tobacco substitutes :\ncigarettes\ncigars\npipe tobacco\ncigarette tobacco; chewing tobacco; snuff\nManufacture of \"homogenized\" or \"reconstituted\" tobacco\nStemming and redrying of tobacco\nThis group excludes growing or preliminary processing of tobacco, see 0115, 0157.','12'),('131','Spinning, Weaving and Finishing of Textiles\n','This group includes preparatory operations, spinning, weaving and finishing of textiles and the weaving of textiles. This can be done from varying raw materials, such as silk, wool, other animal, vegetable or manmade fibers, paper or glass etc. Also included is the finishing of textiles and wearing apparel such as bleaching, dyeing, and similar activities.','13'),('139','Manufacture of Other Textiles\n','This group includes the manufacture of products produced from textiles, except wearing apparel, such as knitted and crocheted fabrics, made-up textile articles, carpets and rugs; cordage, rope, twine and netting, coated fabrics, narrow woven fabrics, trimmings, curtains, blinds, tents, camping goods, sails and loose covers of cars, flags, life jackets and parachutes.','13'),('141','Manufacture of Wearing Apparel, Except Fur Apparel\n','\nThis class includes :\nManufacture of wearing apparel made of leather or composition leather including leather industrial work accessories as welderNULLs leather aprons\nManufacture of work wear\nManufacture of other outerwear made of woven, knitted or crocheted fabric, lace etc. for men, women and children; coat, suits, ensembles, jackets, trousers, skirts, etc.\nManufacture of underwear and nightwear made of woven, knitted or crocheted fabric, lace etc. for men, women and children: shirts, T-shirts, underpants, briefs, pajamas, nightdresses, dressing gowns, blouses, slips, brassieres, corsets, etc.\nManufacture of babiesNULL garments, tracksuits, ski suits, swimwear, etc.\nManufacture of hats and caps\nManufacture of other clothing accessories: gloves, belts, shawls, ties, cravats, hairnets, etc.\nCustom tailoring\nManufacture of headgear of fur skins\nManufacture of footwear of textile material without applied soles\nManufacture of parts of the products listed\nThis class excludes :\nManufacture of wearing apparel of fur skins (except headgear), see 1440;\nManufacture of footwear, see 152;\nManufacture of wearing apparel of rubber or plastic not assembled by stitching but merely sealed together, see 2219, 2220;\nManufacture of leather sports gloves and sports headgear, see 3230;\nManufacture of safety headgear (except sports headgear), see 3299;\nManufacture of fire-resistant and protective safety clothing, see 329;\nRepair of wearing apparel, see 9529.','14'),('142','Custom Tailoring and Dressmaking',NULL,'14'),('143','Manufacture of Knitted and Crocheted Apparel',NULL,'14'),('144','Manufacture of Articles of Fur',NULL,'14'),('151','Tanning and Dressing of Leather; Manufacture of Luggage and Handbags\n','This group includes the manufacture of leather and fur and products thereof.','15'),('152','Manufacture of Footwear\n','This class includes :\nManufacture of footwear for all purposes, of any material, by any process, including molding (see below for exceptions)\nManufacture of leather parts of footwear: manufacture of uppers and parts of uppers, outer and inner soles, heels, etc.\nManufacture of gaiters, leggings and similar articles\nThis class excludes :\nManufacture of footwear of textile material without applied soles, see 141;\nManufacture of plastic footwear parts, see 2220;\nManufacture of rubber boot and shoe heels and soles and other rubber footwear parts, see 2219.\nManufacture of wooden shoe parts (e.g. heels and lasts), see 1629.','15'),('161','Sawmilling and Planing of Wood',NULL,'16'),('162','Manufacture of Products of Wood, Cork, Straw and Plaiting Materials',NULL,'16'),('170','Manufacture of Paper and Paper Products',NULL,'17'),('181','Printing and Service Activities Related to Printing\n','This group includes printing of products, such as newspapers, books, periodicals, business forms, greeting cards, and other materials, and associated support activities, such as bookbinding, plate-making services, and data imaging. Printing can be done using various techniques and on different materials.','18'),('182','Reproduction of Recorded Media',NULL,'18'),('191','Manufacture of Coke Oven Products',NULL,'19'),('192','Manufacture of Refined Petroleum Products',NULL,'19'),('199','Manufacture of Other Fuel Products',NULL,'19'),('201','Manufacture of Basic Chemicals',NULL,'20'),('202','Manufacture of Other Chemical Products, N.e.c.\n','This group includes the manufacture of chemical products other than basic chemicals and man-made fibers. It also includes the manufacture of a variety of goods such as pesticides, paints, varnish and similar coatings, printing inks, and mastics; soap and detergents, cleaning preparations, perfumes and toilet preparations; and other chemical products such as explosives and pyrotechnic products, glue, chemical preparations for photographic uses (including film and sensitized paper), gelatins, composite diagnostic preparations, etc.','20'),('203','Manufacture of Man-made Fibers',NULL,'20'),('210','Manufacture of Pharmaceuticals, Medicinal Chemical and Botanical Products',NULL,'21'),('221','Manufacture of Rubber Products',NULL,'22'),('222','Manufacture of Plastics Products',NULL,'22'),('231','Manufacture of Glass and Glass Products',NULL,'23'),('239','Manufacture of Non-metallic Mineral Products, N.e.c.\n','This group includes the manufacture of intermediate and final products from mined or quarried non-metallic minerals, such as sand, gravel, stone or clay.','23'),('241','Manufacture of Basic Iron and Steel\n','\nThis class includes operations of conversion by reduction of iron ore in blast furnaces and oxygen converters or of ferrous waste and scrap in electric are furnaces or by direct reduction of iron ore without fusion to obtain crude steel which is smelted and refined in a ladle furnace and then poured and solidified in a continuous caster in order to produce semi-finished flat or long products, which are used, after reheating, in rolling, drawing and extruding operations to manufacture finished products such as plate, sheet, strip, bars, rods, wire, tubes, pipes and hollow profiles.\nThis class includes :\nOperation of blast furnaces, steel converters, rolling and finishing mills\nProduction of pig iron and spiegeleisen in pigs, blocks or other primary forms\nProduction of ferro-alloys\nProduction of ferrous products by direct reduction of iron and other spongy ferrous products\nProduction of iron of exceptional purity by electrolysis or other chemical processes\nProduction of granular iron and iron powder\nProduction of steel in ingots or other primary forms\nRemelting of scrap ingots of iron or steel\nProduction of semi-finished products of steel\nManufacture of hot-rolled and cold-rolled flat rolled products of steel\nManufacture of hot-rolled bars and rods of steel\nManufacture of hot-rolled open sections of steel\nManufacture of steel bars and solid sections of steel by cold drawing, grinding or turning\nManufacture of open sections by progressive cold forming on a roll mill or folding on a press of flat-rolled products of steel\nManufacture of wire of steel by cold drawing or stretching\nManufacture of sheet piling of steel, and welded open sections of steel\nManufacture of railway track materials (unassembled rails) of steel\nManufacture of seamless tubes, pipes and hollow profiles of steel, by hot rolling, hot extrusion or hot drawing, or by cold drawing or cold rolling\nManufacture of welded tubes and pipes of steel, by cold or hot forming and welding, delivered as welded or further processed by cold drawing or cold rolling or manufactured by hot forming, welding and reducing\nManufacture of tube fittings of steel, such as flat flanges and flanges with forged collars, butt-welded fittings, threaded fittings and socket-welded fittings\nThis class excludes :\nManufacture of tubes, pipes and hollow profiles and of tube or pipe fittings of cast-iron, see 2431;\nManufacture of seamless tubes and pipes of steel by centrifugal casting, see 2431;\nManufacture of tube or pipe fittings of cast-steel, see 2431.','24'),('242','Manufacture of Basic Precious and Other Non-ferrous Metals\n','\nThis class includes :\nProduction of basic precious metals : production and refining of unwrought or wrought precious metals - gold, silver, platinum, etc. from ore and scrap\nProduction of precious metal alloys\nProduction of precious metal semi-products\nProduction of silver rolled onto base metals\nProduction of gold rolled onto base metals or silver\nProduction of platinum and platinum group metals rolled onto gold, silver or base metals\nProduction of aluminum from alumina\nProduction of aluminum from electrolytic refining of aluminum waste and scrap\nProduction of aluminum alloys\nSemi-manufacturing of aluminum\nProduction of lead, zinc and tin from ores\nProduction of lead, zinc and tin from electrolytic refining of lead, zinc and tin waste and scrap\nProduction of lead, zinc and tin alloys\nSemi-manufacturing of lead, zinc and tin\nProduction of copper from ores\nProduction of copper from electrolytic refining of copper waste and scrap\nProduction of copper alloys\nManufacture of fuse wire or strip\nSemi-manufacturing of copper\nProduction of chrome, manganese, nickel etc. from ores or oxides\nProduction of chrome, manganese, nickel, etc. from electrolytic and aluminothermic refining of chrome, manganese, nickel etc. from waste and scrap\nProduction of alloys of chrome, manganese, nickel, etc.\nSemi-manufacturing of chrome, manganese, nickel, etc.\nProduction of mattes of nickel\nProduction of uranium metal from pitchblende or other ores\nSmelting and refining of uranium\nThis class also includes :\nManufacture of wire of these metals by drawing\nProduction of aluminum oxide (alumina)\nProduction of aluminum wrapping foil\nManufacture of aluminum (tin) foil laminates made from aluminum (tin) foil as primary component\nManufacture of precious metal foil laminates\nThis class excludes :\nCasting of non-ferrous metals, see 2432;\nManufacture of precious metal jewelry, see 3211.','24'),('243','Casting of Metals\n','This group includes the manufacture of semi-finished products and various castings by a casting process.','24'),('251','Manufacture of Structural Metal Products, Tanks, Reservoirs and Steam Generators\n','This group includes the manufacture of structural metal products (such as metal frameworks or parts for construction), as well as metal container-type objects (such as reservoirs, tanks, central heating boilers) and steam generators.','25'),('252','Manufacture of Weapons and Ammunition',NULL,'25'),('259','Manufacture of Other Fabricated Metal Products; Metal Working Service Activities\n','This group includes general activities for the treatment of metal, such as forging or pressing, plaiting, coating engraving, boring polishing, welding, etc., which are typically carried out on a fee or contract basis. This group also includes the manufacture of a variety of metal products, such as cutlery; metal hand tools and general hardware; cans and buckets; nails, bolts and nuts; metal household articles; metal fixtures; ships propellers and anchors; assembled railway track fixtures, etc. for a variety of household and industrial uses.','25'),('261','Manufacture of Electronic Components\n','\nThis class includes :\nManufacture of electron tubes\nManufacture of capacitors, electronic\nManufacture of resistors, electronic\nManufacture of microprocessors\nManufacture of bare printed circuit boards\nManufacture of electronic connectors\nManufacture of integrated circuits (analog, digital or hybrid)\nManufacture of diodes, transistors, and related discrete devices\nManufacture of inductors (e.g. chokes, coils, transformers), electronic component type\nManufacture of electronic crystals and crystal assemblies\nManufacture of solenoids, switches, and transducers for electronic applications\nManufacture of dice or wafers, semiconductor, finished or semi-finished\nManufacture of interface cards (e.g. sound video, controllers, network, modems)\nLoading of components onto printed circuit boards\nManufacture of display components (plasma, polymer, LCD)\nManufacture of light emitting diodes (LED)\nManufacture of printer cables, monitor cables, USB cables, connectors, etc.\nThis class excludes :\nPrinting of smart cards, see 1811;\nManufacture of modems (carrier equipment), see 2630;\nManufacture of computer and television displays, see 2620, 2640;\nManufacture of X-ray tubes and similar irradiation devices, see 2660;\nManufacture of optical equipment and instruments, see 2670;\nManufacture of similar devices for electrical applications, see division 27;\nManufacture of lighting ballasts, see 2712;\nManufacture of electrical relays, see 2712;\nManufacture of electrical wiring devices, see 2733;\nManufacture of complete equipment is classified elsewhere based on complete equipment classification.','26'),('262','Manufacture of Computers and Peripheral Equipment and Accessories',NULL,'26'),('263','Manufacture of Communication Equipment',NULL,'26'),('264','Manufacture of Consumer Electronics',NULL,'26'),('265','Manufacture of Measuring, Testing, Navigating and Control Equipment; Watches and Clocks\n','This group includes the manufacture of measuring, testing, navigating and control equipment for various industrial and non-industrial purposes, including time-based measuring devices such as watches and clocks and related devices.','26'),('266','Manufacture of Irradiation, Electromedical and Electrotherapeutic Equipment',NULL,'26'),('267','Manufacture of Optical Instruments and Photographic Equipment',NULL,'26'),('268','Manufacture of Magnetic and Optical Media',NULL,'26'),('271','Manufacture of Electric Motors, Generators, Transformers and Electricity Distribution and Control Apparatus\n','\nThis class includes the manufacture of power, distribution and specialty transformers; electric motors, generators and motor generator sets; switchgear and switchboard apparatus, relays and industrial controls. The electrical equipment manufactured in this class is for distribution level voltages.\nThis class includes :\nManufacture of distribution transformers, electric\nManufacture of arc-welding transformers\nManufacture of fluorescent ballasts (i.e. transformers)\nManufacture of substation transformers for electric power distribution\nManufacture of transmission and distribution voltage regulators\nManufacture of electric motors (except internal combustion engine starting motors)\nManufacture of power generators (except battery charging alternators for internal combustion engines)\nManufacture of motor generator sets (except turbine generator set units)\nManufacture of power circuit breakers\nManufacture of control panels for electric power distribution\nManufacture of electrical relays\nManufacture of duct for electrical switchboard apparatus\nManufacture of electric fuses\nManufacture of power switching equipment\nManufacture of electric power switches (except pushbutton, snap, solenoid, tumbler)\nManufacture of prime mover generator sets\nRewinding of armatures on a factory basis\nManufacture of surge suppressors (for distribution level voltage)\nThis class excludes :\nManufacture of electronic component-type transformers and switches, see 2612;\nManufacture of environmental controls and industrial process control instruments, see 2651;\nManufacture of switches for electrical circuits, such as pushbutton and snap switches, see 2733;\nManufacture of electric welding and soldering equipment, see 2790;\nManufacture of solid state inverters, rectifiers and converters, see 2790;\nManufacture of turbine-generator sets, see 2811;\nManufacture of starting motors and generators for internal combustion engines, see 2930.','27'),('272','Manufacture of Batteries and Accumulators',NULL,'27'),('273','Manufacture of Wiring and Wiring Devices\n','This group includes the manufacture of current-carrying wiring devices and non current-carrying wiring devices for wiring electrical circuits regardless of material. This group also includes the insulating of wire and the manufacture of fiber optic cables.','27'),('274','Manufacture of Electric Lighting Equipment',NULL,'27'),('275','Manufacture of Domestic Appliances',NULL,'27'),('279','Manufacture of Other Electrical Equipment',NULL,'27'),('281','Manufacture of General Purpose Machinery\n','This group includes the manufacture of general-purpose machinery, i.e. machinery that is being used in a wide range of PSIC industries. This can include the manufacture of components used in the manufacture of a variety of other machinery or the manufacture of machinery that support the operation of other businesses.','28'),('282','Manufacture of Special Purpose Machinery\n','This group includes the manufacture of special-purpose machinery, i.e. machinery for exclusive use in an PSIC industry or a small cluster of PSIC industries. While most of these are used in other manufacturing processes, such as food manufacturing or textile manufacturing, this group also includes the manufacture of machinery specific for other (non-manufacturing industries), such as aircraft launching gear or amusement park equipment.','28'),('291','Manufacture of Motor Vehicles',NULL,'29'),('292','Manufacture of Bodies (Coachwork) for Motor Vehicles; Manufacture of Trailers and Semi-trailers',NULL,'29'),('293','Manufacture of Parts and Accessories for Motor Vehicles',NULL,'29'),('301','Building of Ships and Boats\n','This group includes the building of ships, boats and other floating structures for transportation and other commercial purposes, as well as for special recreational purposes.','30'),('302','Manufacture of Railway Locomotive and Rolling Stock',NULL,'30'),('303','Manufacture of Air and Spacecraft and Related Machinery',NULL,'30'),('304','Manufacture of Military Fighting Vehicles',NULL,'30'),('309','Manufacture of Transport Equipment, N.e.c.\n','This group includes the manufacture of transport equipment other than motor vehicles and rail water, air or space transport equipment and military vehicles.','30'),('310','Manufacture of Furniture\n','\nThis class includes manufacture of furniture of any kind, any material (except stone, concrete or ceramic) for any place and various purposes.\nThis class includes :\nManufacture of chairs and seats for offices, workrooms, hotels, restaurants, public and domestic premises\nManufacture of chairs and seats for theaters, cinemas and the like\nManufacture of sofas, sofa beds and sofa sets\nManufacture of garden chairs and seats\nManufacture of special furniture for shops, counters, display cases, shelves, etc.\nManufacture of furniture for churches, schools, restaurants\nManufacture of office furniture\nManufacture of kitchen furniture\nManufacture of furniture for bedrooms, living rooms, gardens, etc.\nManufacture of cabinets for sewing machines, televisions, etc.\nManufacture of laboratory benches, stools and other laboratory seating, laboratory furniture (e.g. cabinets and tables)\nThis class also includes :\nFinishing such as upholstery of chairs and seats\nFinishing of furniture such as spraying, painting, polishing and upholstering\nManufacture of mattress supports\nManufacture of mattresses : mattresses fitted with springs or stuffed or internally fitted with a supporting material; uncovered cellular rubber or plastic mattresses\nDecorative restaurant carts, such as a dessert cart, food wagons\nThis class excludes :\nManufacture of pillows, pouffes, cushions, quilts and eiderdowns, see 1392;\nManufacture of inflatable rubber mattresses, see 2219;\nManufacture of furniture of ceramics, concrete and stone, see 2393, 2395, 2396;\nManufacture of lighting fittings or lamps, see 2740;\nBlackboard, see 2817;\nManufacture of car seats, railway seats, aircraft seats, see 2930, 3020, 3030;\nModular furniture attachment and installation, partition installation, laboratory equipment furniture installation, see 4330.','31'),('321','Manufacture of Jewelry, Bijouterie and Related Articles\n','This group includes the manufacture of jewelry and imitation jewelry articles.','32'),('322','Manufacture of Musical Instruments',NULL,'32'),('323','Manufacture of Sports Goods',NULL,'32'),('324','Manufacture of Games and Toys',NULL,'32'),('325','Manufacture of Medical and Dental Instruments and Supplies',NULL,'32'),('329','Other Manufacturing, N.e.c.\n','This class includes :\nManufacture of protective safety equipment :\nmanufacture of fire-resistant and protective safety clothing\nmanufacture of linemenNULLs safety belts and other belts for occupational use\nmanufacture of cork life preservers\nmanufacture of plastic hard hats and other personal safety equipment of plastic (e.g. athletic helmets)\nmanufacture of fire-fighting protection suits\nmanufacture of metal safety headgear and other metal safety devices\nmanufacture of ear and noise plugs (e.g. for swimming and noise protection)\nmanufacture of gas masks\nManufacture of brooms and brushes, including brushes constituting parts of machines, hand-operated mechanical floor sweepers, mops and feather dusters, paint brushes, paint pads and rollers, squeezers and other brushes, brooms, mops, etc.\nManufacture of shoe and clothes brushes\nManufacture of pens and pencils of all kinds whether or not mechanical\nManufacture of pencil leads\nManufacture of date, sealing or numbering stamps, hand-operated devices for printing, or embossing labels, hand printing sets, prepared typewriters ribbons and inked pads\nManufacture of globes\nManufacture of umbrellas, sun-umbrellas, walking sticks, seat-sticks\nManufacture of buttons, press-fasteners, snap-fasteners, press-studs, slide fasteners\nManufacture of cigarette lighters\nManufacture of articles of personal use : smoking pipes, combs, hair slides, scent sprays, vacuum flasks and other vacuum vessels for personal or household use, wigs, false beards, eyebrows\nManufacture of miscellaneous articles : candles, tapers and the like, bouquets, wreaths and floral baskets, artificial flowers, fruit and foliage, jokes and novelties, hand sieves and hand riddles, tailorsNULL dummies, burial caskets, etc.\nTaxidermy activities\nThis class excludes :\nManufacture of lighter wicks, see 1399;\nManufacture of workwear and service apparel (e.g. laboratory costs, work overalls, uniforms), see 1419;\nManufacture of paper novelties, see 1709.\nManufacture of plastic novelties, see 2220.','32'),('331','Repair of Fabricated Metal Products, Machinery and Equipment\n','This group includes the specialized repair of goods produced in the manufacturing sector with the aim to restore these metal products, machinery, equipment and other products to working order. The provision of general or routine maintenance (i.e. servicing) on such products to ensure they work efficiently and to prevent breakdown and unnecessary repair is included.\nThis group excludes :\nRebuilding or remanufacturing of machinery and equipment, see corresponding class in division 25-31;\nCleaning of industrial machinery, see 8129;\nRepair and maintenance of computers and communication equipment, see 951;\nRepair and maintenance of household goods, see 952.','33'),('332','Installation of Industrial Machinery and Equipment',NULL,'33'),('351','Electric Power Generation, Transmission and Distribution',NULL,'35'),('352','Manufacture of Gas; Distribution of Gaseous Fuels Through Mains',NULL,'35'),('353','Steam, Air Conditioning Supply and Production of Ice',NULL,'35'),('360','Water Collection, Treatment and Supply',NULL,'36'),('370','Sewerage',NULL,'37'),('381','Waste Collection\n','This group includes the collection of waste from households and businesses by means of refuse bins, wheeled bins, containers, etc. It includes collection of non-hazardous waste and hazardous waste, e.g. waste from households, used batteries, used cooking oils and fats, waste oil from ships and used oil from garages, as well as construction and demolition waste.','38'),('382','Waste Treatment and Disposal\n','This group includes the disposal and treatment prior to disposal of various forms of waste by different means, such as waste treatment of organic waste with the aim of disposal; treatment and disposal of toxic live or dead animals and other contaminated waste; treatment and disposal of transition radioactive waste from hospitals, etc.; dumping of refuse on land or in water; burial or ploughing under of refuse; disposal of used goods such as refrigerators to eliminate harmful waste by incineration or combustion.\nIncluded also is the generation of electricity resulting from waste incineration processes.','38'),('383','Materials Recovery',NULL,'38'),('390','Remediation Activities and Other Waste Management Services',NULL,'39'),('410','Construction of Buildings',NULL,'41'),('421','Construction of Roads and Railways',NULL,'42'),('422','Construction of Utility Projects',NULL,'42'),('429','Construction of Other Civil Engineering Projects',NULL,'42'),('431','Demolition and Site Preparation\n','This group includes activities of preparing a site for subsequent construction activities, including the removal of previously existing structures.','43'),('432','Electrical, Plumbing and Other Construction Installation Activities\n','This group includes installation activities that support the functioning of a building as such, including installation of electrical systems, plumbing (water, gas and sewage systems), heat and air-conditioning systems, elevators, etc.','43'),('433','Building Completion and Finishing',NULL,'43'),('439','Other Specialized Construction Activities',NULL,'43'),('451','Sale of Motor Vehicles',NULL,'45'),('452','Maintenance and Repair of Motor Vehicles',NULL,'45'),('453','Sale of Motor Vehicle Parts and Accessories',NULL,'45'),('454','Sale, Maintenance and Repair of Motorcycles and Related Parts and Accessories',NULL,'45'),('461','Wholesale on a Fee or Contract Basis',NULL,'46'),('462','Wholesale of Agricultural Raw Materials and Live Animals',NULL,'46'),('463','Wholesale of Food, Beverages and Tobacco',NULL,'46'),('464','Wholesale of Household Goods\n','This group includes the wholesale of households goods, including textiles.','46'),('465','Wholesale of Machinery, Equipment and Supplies\n','This group includes the wholesale of computers, telecommunications equipment, specialized machinery for all kinds of industries and general-purpose machinery.','46'),('466','Other Specialized Wholesale\n','This group includes other specialized wholesale activities not classified in other groups of this division. This group includes the wholesale of intermediate products, except agricultural, typically not for household use.','46'),('469','Non-specialized Wholesale Trade',NULL,'46'),('471','Retail Sale in Non-specialized Stores\n','This group includes the retail sale of a variety of product lines in the same unit (non-specialized stores), such as supermarkets or department stores.','47'),('472','Retail Sale of Food, Beverages and Tobacco in Specialized Stores\n','This group includes retail sale in stores specialized in selling food, beverage or tobacco products.','47'),('473','Retail Sale of Automotive Fuel in Specialized Stores',NULL,'47'),('474','Retail Sale of Information and Communications Equipment in Specialized Stores\n','This group includes retail sale of information and communications equipment, such as computers and peripheral equipment, telecommunications equipment and consumer electronics, by specialized stores.','47'),('475','Retail Sale of Other Household Equipment in Specialized Stores\n','This group includes the retail sale of household equipment, such as textiles, hardware, floor coverings, electrical appliances or furniture, in specialized stores. This includes the retail sale of articles for lighting, household utensils and glassware, musical instruments, security systems, and other household articles and equipment, n.e.c.','47'),('476','Retail Sale of Cultural and Recreation Goods in Specialized Stores\n','This group includes the retail sale in specialized stores of cultural and recreation goods, such as books, newspapers, music and video recordings, sporting equipment, games and toys.','47'),('477','Retail Sale of Other Goods in Specialized Stores\n','This group includes the sale in specialized stores carrying a particular line of products not included in other parts of the classification, such as clothing, footwear and leather articles, pharmaceutical and medical goods, watches, souvenirs, cleaning materials, weapons, flowers and pets and others. Also included is the retail sale of used goods in specialized stores.','47'),('478','Retail Sale Via Stalls and Markets\n','This group includes the retail sale of any kind of new or second hand product in a usually movable stall either along a public road or at a fixed marketplace.','47'),('479','Retail Trade Not in Stores, Stalls or Markets\n','This group includes retail sale activities by mail order houses, over the internet, through door-to-door sales, vending machines, etc.','47'),('491','Transport Via Railways\n','This group comprises rail transportation of passengers and/or freight using railroad rolling stock on mainline networks, usually spread over an extensive geographic area. Freight rail transport over short-line railroads is included here.\nThis group excludes :\nUrban and suburban passenger land transport, see 4931;\nRelated articles such as switching and shunting, see 5221;\nOperation of railroad infrastructure, see 5221.','49'),('492','Transport Via Buses',NULL,'49'),('493','Other Land Transport\n','This group includes all land-based transport activities other than rail and bus transport.','49'),('494','Transport Via Pipeline',NULL,'49'),('501','Sea and Coastal Water Transport\n','This group includes the transport of passengers or freight on vessels designed for operating on sea or coastal waters. Also included is the transport of passengers or freight on great lakes, etc. when similar types of vessel are used.','50'),('502','Inland Water Transport\n','This group includes the transport of passengers or freight on inland waters, involving vessels that are not suitable for sea transport.','50'),('511','Passenger Air Transport',NULL,'51'),('512','Freight Air Transport',NULL,'51'),('521','Warehousing and Storage',NULL,'52'),('522','Support Activities for Transportation\n','This group includes activities supporting the transport of passengers or freight, such as operation of parts of the transport infrastructure or activities related to handling freight immediately before or after transport or between transport segments. The operation and maintenance of all transport facilities is also included.','52'),('531','Postal Activities',NULL,'53'),('532','Courier Activities',NULL,'53'),('551','Short Term Accommodation Activities',NULL,'55'),('559','Other Accommodation',NULL,'55'),('561','Restaurants and Mobile Food Service Activities',NULL,'56'),('562','Event Catering and Other Food Service Activities\n','This group includes catering activities for individual events or for a specified period of time and the operation of food concessions, such as sports or similar facilities.','56'),('563','Beverage Serving Activities',NULL,'56'),('581','Publishing of Books, Periodicals and Other Publishing Activities\n','This group includes activities of publishing books, newspapers, magazines and other periodicals, directories and mailing lists, and other works such as photos, engravings, postcards, timetables, forms, posters and reproductions of works of art. These works are characterized by the intellectual creativity required in their development and are usually protected by copyright.','58'),('582','Software Publishing',NULL,'58'),('591','Motion Picture, Video and Television Programme Production Activities',NULL,'59'),('592','Sound Recording and Music Publishing Activities',NULL,'59'),('601','Radio Broadcasting',NULL,'60'),('602','Television Programming and Broadcasting Activities',NULL,'60'),('611','Wired Telecommunications Activities',NULL,'61'),('612','Wireless Telecommunications Activities',NULL,'61'),('613','Satellite Telecommunications Activities',NULL,'61'),('619','Other Telecommunications Activities',NULL,'61'),('620','Computer Programming, Consultancy and Related Activities',NULL,'62'),('631','Data Processing, Hosting and Related Activities; Web Portals\n','This group includes the activities of providing infrastructure for hosting, data processing services and related activities, as well as the provision of search facilities and other portals for the internet.','63'),('639','Other Information Service Activities\n','This group includes the activities of news agencies, libraries and archives and all other remaining information service activities., such as telephone based information services, information search services on a contract or fee basis, news clipping services, press clipping services, etc.','63'),('641','Monetary Intermediation\n','This group includes the obtaining of funds in the form of transferable deposits, i.e. funds that are fixed in money terms, and obtained on a day-to-day basis and, apart from central banking, obtained from financial sources.','64'),('642','Activities of Holding Companies',NULL,'64'),('643','Trusts, Funds and Other Financial Vehicles',NULL,'64'),('649','Other Financial Service Activities, Except Insurance and Pension Funding Activities\n','This group includes financial service activities, other than that conducted by monetary institutions.\nThis group excludes insurance and pension funding activities, see Division 65.','64'),('651','Insurance\n','This group includes life insurance and life insurance with or without a substantial savings element and other non-life insurance.','65'),('652','Reinsurance',NULL,'65'),('653','Pension Funding',NULL,'65'),('661','Activities Auxiliary to Financial Service, Except Insurance and Pension Funding\n','This group includes the furnishing of physical or electronic marketplaces for the purpose of facilitating the buying and selling of stocks, stock options, bonds or commodity contracts.','66'),('662','Activities Auxiliary to Insurance and Pension Funding\n','This group includes activities of those acting as agents (i.e. broker) in selling annuities and insurance policies or providing other employee benefits and insurance and pension related services such as claims adjustment and third party administration.','66'),('663','Fund Management Activities',NULL,'66'),('681','Real Estate Activities with Own or Leased Property\n','This group includes :\nBuying, selling, renting and operating of self-owned or leased real estate such as :\napartment buildings and dwellings\nnon-residential buildings, including exhibition halls, self-storage facilities, malls and shopping centers\nland\nProvision of homes and furnished or unfurnished flats or apartments for more permanent use, typically on a monthly or annual basis\nThis group also includes :\nDevelopment of building projects for own operation, i.e. for renting of space in these buildings\nSubdividing real estate into lots, without land improvement\nOperation of residential mobile home sites\nDevelopment and sale of land and cemetery lots and operation of apartelles.\nThis group excludes :\nDevelopment of building projects for sale, see 4100;\nSubdividing and improving of land, see 4290;\nOperation of hotels, suite hotels and similar accommodations, see 5510;\nOperation of campgrounds, trailer parks and similar accommodation, see 5510;\nOperation of workers hostels, rooming houses and similar accommodations, see 5590.','68'),('682','Real Estate Activities on a Fee or Contract Basis',NULL,'68'),('691','Legal Activities',NULL,'69'),('692','Accounting, Bookkeeping and Auditing Activities; Tax Consultancy',NULL,'69'),('701','Activities of Head Offices',NULL,'70'),('702','Management Consultancy Activities',NULL,'70'),('711','Architectural and Engineering Activities and Related Technical Consultancy',NULL,'71'),('712','Technical Testing and Analysis',NULL,'71'),('721','Research and Experimental Development on Natural Sciences and Engineering',NULL,'72'),('722','Research and Experimental Development on Social Sciences and Humanities',NULL,'72'),('723','Research and Experimental Development in Information Technology',NULL,'72'),('731','Advertising',NULL,'73'),('732','Market Research and Public Opinion Polling',NULL,'73'),('741','Specialized Design Activities',NULL,'74'),('742','Photographic Activities',NULL,'74'),('749','Other Professional, Scientific and Technical Activities, N.e.c.',NULL,'74'),('750','Veterinary Activities',NULL,'75'),('771','Renting and Leasing of Motor Vehicles (Except Motorcycle, Caravans, Campers)',NULL,'77'),('772','Renting and Leasing of Personal and Household Goods\n','This group includes the renting of personal and household goods as well as renting of recreational and sports equipment and video tapes. Activities generally include short-term renting of goods although in some instances, the goods may be leased for longer periods of time.','77'),('773','Renting and Leasing of Other Machinery, Equipment and Tangible Goods',NULL,'77'),('774','Leasing of Intellectual Property and Similar Products, Except Copyrighted Works',NULL,'77'),('781','Activities of Employment Placement Agencies',NULL,'78'),('782','Temporary Employment Agency Activities',NULL,'78'),('783','Other Human Resources Provision',NULL,'78'),('791','Travel Agency and Tour Operator Activities\n','This group includes the activities of agencies, primarily engaged in selling travel, tour, transportation and accommodation services to the general public and commercial clients and the activity of arranging and assembling tours that are sold through travel agencies or directly by agents such as tour operators.','79'),('799','Other Reservation Service and Related Activities',NULL,'79'),('801','Private Security Activities',NULL,'80'),('802','Security Systems Service Activities',NULL,'80'),('803','Investigation Activities',NULL,'80'),('811','Combined Facilities Support Activities',NULL,'81'),('812','Cleaning Activities\n','This group includes the activities of general interior cleaning of all types of buildings, exterior cleaning of buildings, specialized cleaning activities for buildings or other specialized cleaning activities, cleaning of industrial machinery, cleaning of the inside of road and sea tankers, disinfecting and extermination activities for buildings and industrial machinery, bottle cleaning, street sweeping.\nThis group excludes :\nAgricultural pest control, see 0153;\nCleaning of new buildings immediately after construction, see 4330.\nSteam-cleaning, sand blasting and similar activities for building exteriors, see 4390.\nCarpet and rug shampooing, drapery and curtain cleaning, see 9621.','81'),('813','Landscape Care and Maintenance Service Activities',NULL,'81'),('821','Office Administrative and Support Activities\n','This group includes the provision of a range of day-to-day office administrative services, such as financial planning, billing and record keeping, personnel and physical distribution and logistics for others on a contract or fee basis.\nThis group includes also support activities for others on a contract or fee basis, that are ongoing routine business support functions that businesses and organizations traditionally do for themselves.\nUnits classified in this group do not provide operating staff to carry out the complete operations of a business. Units engaged in one particular aspect of these activities are classified according to that particular activity.','82'),('822','Call Centers and Other Related Activities',NULL,'82'),('823','Organization of Conventions and Trade Shows',NULL,'82'),('829','Business Support Service Activities, N.e.c.\n','This group includes the activities of collection agencies, credit bureaus and all support activities typically provided to businesses not elsewhere classified.','82'),('841','Education\n','This group includes general administration (e.g. executive, legislative, financial administration etc. at all levels of government) and supervision in the field of social and economic life.','84'),('842','Provision of Services to the Community as a Whole\n','This group includes foreign affairs, defense and public order and safety activities.','84'),('843','Compulsory Social Security Activities',NULL,'84'),('851','Pre-primary/pre-school Education\n','This group include activities to prepare young children to the first level of education, second stage. Such programs are directed mainly towards children becoming accustomed to group activities such as singing, dancing, participation in rhythm groups and group games to promote healthy and socially desirable habits. Also stressed is the development of skills in handling coloring, molding, lettering and similar materials as well as simple tools. Introduction to basic educational programs includes readiness in the learning areas. The entry to this level of education may begin at age three or four. The pre-primary/pre-school level may last from one to four years.\nAlso included in this group are programs covering the initial stages of organized instruction for special children including the gifted and those who, due to mental, psycho-social or physical handicaps, are unable to participate in the same groups along with other children. Programs for the differently-abled children while having the same objectives as the core program, may be given in hospitals or in special schools or training centers or special classes in regular schools. Age of entry at this level cannot be specified for special children and the differently-abled.','85'),('852','Primary/elementary Education\n','Elementary education refers to the stage of compulsory formal education primarily concerned with providing basic education, and usually corresponding to six or seven grades.\nThe core at this level consists of education for children, the customary or normal age of entrance to which is seven years. Programs in this level are designed to give the pupils a sound basic education in reading, writing, and arithmetic along with an elementary understanding of other subject areas such as social studies, science, arts and music, practical arts, and values education.\nThis group also includes special education for children with special needs, e.g., the gifted and the mentally, psycho-socially and differently-abled.','85'),('853','Secondary/high School Education\n','This group includes formal education following the elementary education level usually corresponding to four years of high school, concerned primarily with continuing basic education and expanding it to prepare the students for higher education and/or the world of work through the acquisition of employable/gainful skills. The students at this level normally begin at age 13.\nAlso included is the special education for exceptional students including the gifted, the mentally, psycho-socially and differently-abled which is similar to that at the first level but more advanced in terms of subject matter.','85'),('854','Higher Education',NULL,'85'),('855','Other Education Services\n','This group includes general continuing education and continuing vocational education and training for any profession. Instruction my be oral or written and may be provided in classrooms or by radio, television, Internet, correspondence or other means of communication. This group also includes the provision of instruction in athletic activities to groups or individuals, foreign language instructions, instruction in the arts, drama or music or other instruction or specialized training, not comparable to the education in groups 851-853.\nThis group excludes provision of primary education, secondary education or higher education, see group 852, 853 and 854.','85'),('856','Educational Support Services',NULL,'85'),('861','Hospital Activities\n','This class includes :\nShort-or long-term hospital activities, i.e. medical, diagnostic and treatment activities, of general hospitals (e.g. community and regional hospitals, hospital of non-profit organizations, university hospitals, military-base and prison hospitals) and specialized hospitals (e.g. mental health and substance abuse hospitals, hospitals for infectious diseases, maternity hospitals, specialized sanitaria).\nThe activities which are chiefly directed to inpatients are carried out under the direct supervision of medical doctors and include :\nservices of medical and paramedical staff\nservices of laboratory and technical facilities, including radiologic and anaesthesiologic services\nemergency room services\nprovision of operating room services, pharmacy services, food and other hospital services\nservices of family planning centers providing medical treatment such as sterilization and termination of pregnancy, with accommodation.\nThis class excludes :\nLaboratory testing and inspection of all types of materials and products, except medical, see 7120;\nVeterinary activities, see 7500;\nHealth activities for military personnel in the field, see 8422;\nDental practice activities of a general or specialized nature, e.g. dentistry, endodontic and pediatric dentistry; oral pathology, orthodontic activities, see 862;\nPrivate consultantNULLs services to inpatients, see 862;\nMedical laboratory testing, see 8690;\nAmbulance transport activities, see 8690.','86'),('862','Medical and Dental Practice Activities\n','This group includes :\nMedical consultation and treatment in the field of general and specialized medicine by general practitioners and medical specialists and surgeons\nDental practice activities of a general or specialized nature, e.g. dentistry, endodontic and pediatric dentistry; oral pathology\nOrthodontic activities\nFamily planning centers providing medical treatment such as sterilization and termination of pregnancy, without accommodation.\nThese activities can be carried out in private practice, group practices and in hospital outpatient clinics, and in clinics such as those attached to firms, schools, homes for the aged, labor organizations and fraternal organizations, as well as in patientNULLs home.\nThis class also includes :\nDental activities in operating rooms\nPrivate consultants services to inpatients\nThis class excludes :\nProduction of artificial teeth, denture and prosthetic appliances by dental laboratories, see 3250;\nInpatient hospital activities, see 861;\nParamedical activities such as those of midwives, nurses and physiotherapists, see 8690.','86'),('869','Other Human Health Activities',NULL,'86'),('871','Residential Nursing Care Facilities',NULL,'87'),('872','Residential Care Activities for Mental Retardation, Mental Health and Substance Abuse',NULL,'87'),('873','Residential Care Activities for the Elderly and Disabled',NULL,'87'),('879','Other Residential Care Activities, N.e.c.',NULL,'87'),('881','Social Work Activities without Accommodation for the Elderly and Disabled',NULL,'88'),('889','Other Social Work Activities without Accommodation, N.e.c.',NULL,'88'),('900','Creative, Arts and Entertainment Activities',NULL,'90'),('910','Libraries, Archives, Museums and Other Cultural Activities',NULL,'91'),('920','Gambling and Betting Activities',NULL,'92'),('931','Sports Activities\n','This group includes the operation of sports facilities; activities of sports teams or clubs primarily participating in live sports events before a paying audience; independent athletes engaged in participating in live sporting or racing events before a paying audience; owners of racing participants such as cars, dogs, horses, etc. primarily engaged in entering them in racing events or other spectator sports events; sports trainers providing specialized services to support participants in sports events or competitions; operators of arenas and stadiums; other activities of organizing, promoting or managing sports events, n.e.c.','93'),('932','Other Amusement and Recreation Activities\n','This group includes the activities of a wide range of units that operate facilities or provide services to meet the varied recreational interests of their patrons, including the operation of a variety of attractions, such as mechanical rides, water rides, games, shows, theme exhibits and picnic grounds.\nThis group excludes :\nSports activities, see group 931;\nDramatic arts, music and other arts and entertainment activities, see 9000.','93'),('941','Activities of Business, Employers and Professional Membership Organizations\n','This group includes the activities of units that promote the interests of the members of business and employers organization. In the case of professional membership organizations, it also includes the activities of promoting the professional interests of members of the profession.','94'),('942','Activities of Trade Unions',NULL,'94'),('949','Activities of Other Membership Organizations\n','This group includes the activities of units (except business and employers organizations, professional organizations, trade unions) that promote the interests of their members.','94'),('951','Repair of Computers and Communications Equipment\n','This group includes the repair and maintenance of computers and peripheral equipment and communications equipment.','95'),('952','Repair of Personal and Household Goods\n','This group includes the repair and servicing of personal and household goods.','95'),('961','Personal Services for Wellness, Except Sports Activities',NULL,'96'),('962','Laundry Services',NULL,'96'),('963','Funeral and Related Activities',NULL,'96'),('964','Domestic Services',NULL,'96'),('969','Other Personal Service Activities, N.e.c.',NULL,'96'),('970','Activities of Households as Employers of Domestic Personnel',NULL,'97'),('981','Undifferentiated Goods-producing Activities of Private Households for Own Use',NULL,'98'),('982','Undifferentiated Services-producing Activities of Private Households for Own Use',NULL,'98'),('990','Activities of Extra-territorial Organizations and Bodies',NULL,'99');
