t',NULL,'0118'),('01184','Growing of Potato',NULL,'0118'),('01185','Growing of Cassava',NULL,'0118'),('01186','Growing of Sweet Potato (Camote)',NULL,'0118'),('01187','Growing of Melons and Watermelons',NULL,'0118'),('01188','Growing of Yams (Ube)',NULL,'0118'),('01189','Growing of Other Roots, Bulbs, Tuberous Crops and Vegetables Including Mushroom',NULL,'0118'),('01191','Growing of Orchids',NULL,'0119'),('01192','Growing of Flowers or Flower Buds, (Except Orchids), Cut Flowers',NULL,'0119'),('01193','Production or Growing of Horticultural Specialties Including Nursery Products and Ornamental Plants',NULL,'0119'),('01194','Growing of Plant Materials Used Chiefly in Medicinal/ Pharmaceutical or for Insecticidal, Fungicidal or Similar Purposes',NULL,'0119'),('01195','Growing of Crops Chiefly for Construction, Furniture and Other Purposes (E.g., Bamboo, Buri, Nipa, Etc.)',NULL,'0119'),('01196','Growing of Forage Crops and Other Grasses',NULL,'0119'),('01199','Growing of Other Non-perennial Crops, N.e.c.',NULL,'0119'),('01211','Growing of Banana, Cavendish',NULL,'0121'),('01212','Growing of Other Banana',NULL,'0121'),('01220','Growing of Pineapple',NULL,'0122'),('01231','Growing of Calamansi',NULL,'0123'),('01232','Growing of Dalandan',NULL,'0123'),('01233','Growing of Mandarin (Dalanghita)',NULL,'0123'),('01234','Growing of Pomelo (Suha)',NULL,'0123'),('01235','Growing of Citrus Fruits, N.e.c.',NULL,'0123'),('01240','Growing of Mango',NULL,'0124'),('01250','Growing of Papaya',NULL,'0125'),('01260','Growing of Coconut, Including Copra-making, Tuba Gathering and Coco-shell Charcoal and Coconut Sap Syrup Making in the Farm',NULL,'0126'),('01271','Growing of Coffee Plant',NULL,'0127'),('01272','Growing of Cacao',NULL,'0127'),('01273','Growing of Tea Plant',NULL,'0127'),('01279','Growing of Other Beverage Crops',NULL,'0127'),('01281','Growing of Perennial Spices and Aromatic Crops such As: Ginger, Pepper, Chili, Achuete, Laurel, Etc.',NULL,'0128'),('01282','Growing of Plants Used Primarily in Medical/ Pharmaceutical Purposes such as : Lagundi, Banaba, Ginseng, Oregano, Etc.',NULL,'0128'),('01283','Growing of Plants for Insecticidal, Fungicidal or Similar Purposes',NULL,'0128'),('01284','Growing of Crops Used Primarily in Perfumery or Similar Purposes',NULL,'0128'),('01289','Growing of Other Spices, Aromatic, Drug and Pharmaceutical Crops, N.e.c.',NULL,'0128'),('01291','Growing of Other Tropical Fruits, E.g. Jackfruit, Guavas, Avocados, Lanzones, Durian, Rambutan, Chico, Atis, Mangosteen, Makopa, Dragon Fruit Etc.',NULL,'0129'),('01292','Growing of Perennial Trees with Edible Nuts, E.g. Pili Nuts, Cashew Nuts, Etc',NULL,'0129'),('01293','Growing of Rubber Tree',NULL,'0129'),('01294','Growing of Jatropha Tree',NULL,'0129'),('01295','Growing of Ornamental or Decorative Trees such as Christmas or Pine Trees, Fire Trees, Etc.',NULL,'0129'),('01296','Growing of Oleaginous Fruits, Except Coconut',NULL,'0129'),('01297','Growing of Bush Fruits, Including Strawberries',NULL,'0129'),('01299','Growing of Other Fruits and Perennial Crops, N.e.c.',NULL,'0129'),('01300','Plant Propagation\n\nThis class includes the production of vegetative planting materials including cuttings, suckers and seedlings for direct plant propagation or to create plant grafting stock into which selected scion is grafted for eventual planting to produce crops.',NULL,'0130'),('01411','Beef Cattle Farming (Including Feed Lot Fattening)',NULL,'0141'),('01412','Carabao Farming',NULL,'0141'),('01420','Raising of Horses and Other Equines\n','This class includes raising and breeding of horses (including racing horses), asses, mules or hinnies.','0142'),('01430','Dairy Farming\n','This class includes processing of dairy products done in the farm such as milk, butter, cottage, cheese, etc.','0143'),('01441','Sheep Farming Including Sheep Shearing by the Owner',NULL,'0144'),('01442','Goat Farming',NULL,'0144'),('01443','Deer Faming',NULL,'0144'),('01450','Hog Raising',NULL,'0145'),