es\nnuts\ncork\nlac and resins\nbalsams\nvegetable hair\neelgrass\nacorns, horse, chestnuts\nmosses and lichens\nThis class excludes :\nManaged production of any of these products (except of cork trees), see division 01;\nGrowing of mushrooms or truffles, see 0118;\nGrowing of berries and nuts, see 0129;\nGathering of fire wood, see 0220.','0230'),('02400','Support Services to Forestry\n','\nThis includes the activities in support of forestry operation on a fee or contract basis :\nThis class includes :\nForestry service activities :\nforestry inventories\nforest management consulting services\ntimber evaluation\nforest fire fighting and protection\nforest pest control\nLogging service activities : transport of logs within the forest\nThis class excludes operation of forest tree nurseries, see 021.','0240'),('03111','Ocean Fishing, Commercial (Using Vessels Over 3 Tons)',NULL,'0311'),('03112','Coastal Fishing, Municipal (Using Vessels of Less Than 3 Tons)',NULL,'0311'),('03113','Fish Corral Fishing',NULL,'0311'),('03121','Catching Fish, Crabs and Crustaceans in Inland Waters',NULL,'0312'),('03122','Gathering Shells and Clams, Edible, in Inland Waters',NULL,'0312'),('03129','Other Freshwater Fishing Activities, N.e.c.',NULL,'0312'),('03130','Support Service Activities Incidental to Fishing',NULL,'0313'),('03211','Operation of Freshwater Fishpond, Except Fish Breeding Farms and Nurseries',NULL,'0321'),('03212','Operation of Freshwater Fish Pens and Fish Cage',NULL,'0321'),('03213','Operation of Freshwater Fish Breeding Farms and Nurseries',NULL,'0321'),('03214','Culture of Freshwater Ornamental Fish',NULL,'0321'),('03219','Other Freshwater Fish Farming Activities',NULL,'0321'),('03221','Operation of Marine Fish Tanks, Pens, Cage Except Fish Breeding Farms and Nurseries in Sea Water',NULL,'0322'),('03222','Operation of Marine Fish Breeding Farms and Nurseries',NULL,'0322'),('03223','Catching and Culturing Ornamental (Aquarium) Fish',NULL,'0322'),('03224','Gathering of Fry',NULL,'0322'),('03229','Other Marine Fish Farming Activities',NULL,'0322'),('03230','Prawn Culture in Brackish Water',NULL,'0323'),('03241','Culture of Freshwater Crustaceans (Except Prawns), Bivalves, and Other Mollusks',NULL,'0324'),('03242','Culture of Oysters, Other Bivalves and Other Mollusks in Sea Water',NULL,'0324'),('03251','Pearl Culture',NULL,'0325'),('03252','Pearl Shell Gathering',NULL,'0325'),('03261','Seaweeds Farming',NULL,'0326'),('03262','Gathering of Laver and Other Seaweeds',NULL,'0326'),('03291','Frog Farming',NULL,'0329'),('03292','Operation of Marine Worm Farms',NULL,'0329'),('03299','Other Aquaculture Activities, N.e.c',NULL,'0329'),('05100','Mining of Hard Coal\n','\nThis class includes :\nMining of hard coal : underground or surface mining, including mining through liquefaction methods\nCleaning, sizing, grading, pulverizing, compressing etc. of coal to classify, improve quality or facilitate transport\nThis class also includes recovery of hard coal from culm banks.\nThis class excludes :\nLignite mining, see 0520;\nPeat digging and agglomeration of peat, see 0892;\nTest drilling for coal mining, see 0990;\nSupport activities for hard coal mining, see 0990;\nCoke ovens producing solid fuels, see 1910;\nManufacture of hard coal briquettes, see 1920;\nWork performed to develop or prepare properties for coal mining, see 4312','0510'),('05200','Mining of Lignite\n','This class includes :\nMining of lignite (brown coal): underground or surface mining, including mining through liquefaction methods\nWashing, dehydrating, pulverizing, compressing of lignite to improve quality, facilitate, transport or storage\nThis class excludes :\nHard coal mining, see 0510;\nPeat digging and agglomeration of peat, see 0892;\nTest drilling for coal mining, see 0990;\nSupport activities for hard coal mining, see 0990;\nCoke ovens producing solid fuels, see 1910;\nManufacture of hard coal briquettes, see 1920;\nWork performed to develop or prepare properties for coal mining, see 4312.','0520'),('06100','Extraction of Crude Petroleum\n','This class includes :\nExtraction of crude petroleum oils\nExtraction of bituminous or oil shale and tar sand\nProduction of crude petroleum from bituminous shale and sand\nProcess to obtain crude oils; decantation, desalting, dehydration, stabilization, etc.\nThis class excludes :\nSupport activities for oil and gas extraction, see 0910;\nOil and gas exploration, see 0910;\nManufacture of refined petroleum products, see 1920;\nRecovery of liquified petroelum gases in the refining of petroleum, see 1920;\nOperation of pipelines, see 4930','0610'),('06200','Extraction of Natural Gas\n','\nThis class includes :\nProduction of crude gaseous hydrocarbon (natural gas)\nExtraction of condensates\nDraining and separation of liquid hydrocarbon fractions\nGas desulphurization\nThis class also includes mining of hydrocarbon liquids, obtained through liquefaction or pyrolysis\nThis class excludes :\nSupport activities for oil and gas extraction, see 0910;\nOil and gas exploration, see 0910;\nManufacture of refined petroleum products, see 1920;\nRecovery of liquified petroelum gases in the refining of petroleum, see 1920;\nManufacture of industrial gases, see 2011;\nOperation of pipelines, see 4930.','0620'),('07100','Mining of Iron Ores\n','\nThis class includes :\nMining of ores valued chiefly for iron content\nBeneficiation and agglomeration of iron ores\nThis class excludes extraction and preparation of pyrites and pyrrhotite (except roasting), see 0891.','0710'),('07210','Mining of Uranium and Thorium Ores\n','\nThis class includes :\nMining of ores chiefly valued for uranium and thorium content: pitchblende etc.\nConcentration of such ores\nProduction of yellow cake\nThis class excludes:\nEnrichment of uranium and thorium ores, see 2011;\nProduction of uranium metal from pitchblende or other ores, see 2420;\nSmelting and refining of uranium, see 2420.','0721'),('07221','Gold Ore Mining',NULL,'0722'),('07222','Silver Ore Mining',NULL,'0722'),('07229','Mining of Other Precious Metal Ores',NULL,'0722'),('07291','Copper Ore Mining',NULL,'0729'),('07292','Chromite Ore Mining',NULL,'0729'),('07293','Manganese Ore Mining',NULL,'0729'),('07294','Nickel Ore Mining',NULL,'0729'),('07299','Mining of Other Non-ferrous Metal Ores, N.e.c.',NULL,'0729'),('08101','Marble Quarrying',NULL,'0810'),('08102','Limestone Quarrying',NULL,'0810'),('08103','Stone Quarrying, Except Limestone and Marble',NULL,'0810'),('08104','Clay Quarrying',NULL,'0810'),('08105','Sand and Gravel Quarrying',NULL,'0810'),('08106','Silica Sand and Silica Stone Quarrying',NULL,'0810'),('08109','Stone Quarrying, Clay and Sand Pits, N.e.c.',NULL,'0810'),('08911','Baryte Mining',NULL,'0891'),('08912','Guano Gathering',NULL,'0891'),('08913','Pyrite Mining',NULL,'0891'),('08914','Rock Phosphate Mining',NULL,'0891'),('08915','Sulphur Mining',NULL,'0891'),('08919','Other Chemical and Fertilizer Mineral Mining',NULL,'0891'),('08920','Extraction of Peat\n','This class includes :\nPeat digging\nPeat agglomeration\nPreparation of peat to improve quality or facilitate transport or storage\nThis class excludes :\nService activities incidental to peat mining, see 0990;\nManufacture of articles of peat, see 2399','0892'),('08930','Extraction of Salt\n','This class includes :\nExtraction of salt from underground including by dissolving and pumping\nSalt production by evaporation of sea water or other saline waters\nCrushing, purification and refining of salt by the producer\nThis class excludes :\nProcessing of salt into food-grade salt, e.g. iodized salt, see 1079;\nPotable water production by evaporation of saline water, see 3600.','0893'),('08990','Other Mining and Quarrying, N.e.c.\n','This class includes mining and quarrying of various minerals and materials : abrasive materials, asbestos, siliceous fossil meals, natural graphite, steatite (talc), feldspar etc.; gemstones, quartz, mica, etc.','0899'),('09101','Oil and Gas Extraction Activities on a Fee or Contract Basis',NULL,'0910'),('09102','Oil and Gas Extraction Activities Not Performed on a Fee or Contract Basis',NULL,'0910'),('09900','Support Activities for Other Mining and Quarrying\n','\nThis class includes :\nSupport services on a fee or contract basis, required for mining activities of divisions 05, 07 & 08 :\nexploration services, e.g. traditional prospecting methods, such as taking core samples and making geological observations as prospective sites\ndraining and pumping services, on a fee or contract basis\ntest drilling and test hole boring\nThis class excludes :\nOperating mines or quarries on a contract or fee basis, see division 05,07,08;\nSpecialized repair of mining machinery, see 3312;\nGeophysical surveying services, on a contract or fee basis, see 7110.','0990'),('10110','Slaughtering and Meat Packing\n','\nThis class includes :\nOperation of slaughterhouses engaged in killing, dressing or packing meat of cattle, hogs, sheep, goats, horses, poultry, rabbits, game or other animals including whales processed on land or on vessels specialized for this work\nProduction or by-products such as raw hides and skins\nProduction of pulled wool\nProduction of feathers and down','1011'),('10121','Production, Processing and Preserving of Meat and Meat Products Including Tocino, Tapa, Ham, Bacon, Sausage, Longanisa, Corned Beef, Hotdog, Meat Loaf, and Bologna',NULL,'1012'),('10122','Production of Fresh, Chilled or Frozen Meat or Poultry',NULL,'1012'),('10123','Rendering of Lard and Other Edible Fats of Animal Origin',NULL,'1012'),('10124','Production of Flours and Meals of Meat or Meat Offal',NULL,'1012'),('10129','Production, Processing and Preserving of Meat and Meat Products, N.e.c.',NULL,'1012'),('10201','Canning/packing of Fish and Other Marine Products',NULL,'1020'),('10202','Drying of Fish and Other Marine Products',NULL,'1020'),('10203','Smoking of Fish (Tinapa) and Other Marine Products',NULL,'1020'),('1020