l Powdered Milk',NULL,'1053'),('10540','Manufacture of Butter, Cheese and Curd',NULL,'1054'),('10550','Manufacture of Ice Cream and Sherbet, Ice Drop, Ice Candy and Other Flavored Ices',NULL,'1055'),('10560','Manufacture of Milk-based Infantsnull and Dietetic Foods',NULL,'1056'),('10570','Manufacture of Yoghurt',NULL,'1057'),('10580','Manufacture of Whey',NULL,'1058'),('10590','Manufacture of Dairy Products, N.e.c.',NULL,'1059'),('10610','Rice/corn Milling\n','This includes rice milling, husked, milled, polished, glazed, parboiled or converted; production of rice flour, and corn milling.','1061'),('10621','Cassava Flour Milling',NULL,'1062'),('10622','Flour Milling Except Cassava Flour Milling',NULL,'1062'),('10623','Manufacture of Cereal Breakfast Foods Obtained by Roasting or Swelling, Etc.',NULL,'1062'),('10624','Manufacture of Unprepared Animal Feeds from Grain Milling Residues',NULL,'1062'),('10625','Manufacture of Flour Mixes and Prepared Blended Flour and Dough for Bread, Cakes, Biscuits or Pancakes',NULL,'1062'),('10629','Manufacture of Grain and Vegetable Mill Products, N.e.c.',NULL,'1062'),('10630','Manufacture of Starches and Starch Products\n','This class includes :\nManufacture of starches from rice, potatoes, maize, etc.\nWet corn milling\nManufacture of glucose, glucose syrup, maltose, inulin, etc.\nManufacture of gluten\nManufacture of tapioca and tapioca substitutes prepared from starch\nManufacture of corn oil\nThis class excludes :\nManufacture of lactose milk (milk sugar), see 1059;\nProduction of cane or beet sugar, see 1072.','1063'),('10711','Baking of Bread, Cakes, Pastries, Pies and Similar \"perishable\" Bakery Products, Including Hopia and Doughnut Making',NULL,'1071'),('10712','Baking of Biscuits Cookies, Crackers, Pretzels and Similar Dry Bakery Products',NULL,'1071'),('10713','Manufacture of Ice Cream Cones (Apa) and Wafers (Barquillos)',NULL,'1071'),('10714','Manufacture of Snack Products such as Corn Curls, Wheat Crunchies and Similar Products',NULL,'1071'),('10721','Sugarcane Milling',NULL,'1072'),('10722','Sugar Refining',NULL,'1072'),('10723','Manufacture of Muscovado Sugar Not Carried on in the Farm',NULL,'1072'),('10724','Manufacture of Molasses',NULL,'1072'),('10725','Manufacture of Coconut Sap Sugar',NULL,'1072'),('10726','Manufacture of Palm Sugar (Buri, Nipa), Except Coconut',NULL,'1072'),('10729','Manufacture of Sugar, N.e.c.',NULL,'1072'),('10731','Manufacture of Chocolate and Cocoa Products Including Chocolate Candies',NULL,'1073'),('10732','Manufacture of Candies (Excluding Chocolate Candies) and Chewing Gum',NULL,'1073'),('10733','Manufacture of Popcorn and Poprice',NULL,'1073'),('10739','Manufacture of Chocolate and Sugar Confectionery Products, N.e.c.',NULL,'1073'),('10740','Manufacture of Macaroni, Noodles, Couscous and Similar Farinaceous Products\n','\nThis class includes :\nManufacture of pastas such as macaroni, spaghetti, etc. and noodles including instant noodles, misua, bihon, vermicelli (sotanghon), whether or not cooked or stuffed\nManufacture of couscous\nManufacture of canned or frozen pasta products\nThis class excludes :\nManufacture of prepared couscous dishes, see 1075;\nManufacture of soup containing pasta, see 1079.','1074'),('10750','Manufactured of Prepared Meals and Dishes\n','\nThis class includes manufacture of ready-made (i.e. prepared, seasoned and cooked) meals and dishes, in frozen or canned form. These dishes are usually packaged and labeled for re-sale, i.e. this class does not include the preparation of meals for immediate consumption, such as in restaurants.\nThis class includes :\nManufacture of fresh or frozen meat or poultry dishes\nManufacture of canned stews, canned or bottled vegetables and vacuum prepared meals\nManufacture of other prepared meals (such as \"TV dinners\", etc.)\nManufacture of frozen fish dishes, including fish and chips\nManufacture of prepared dishes of vegetables\nManufacture of frozen pizza\nThis class excludes :\nPreparation of meals and dishes for immediate consumption, see division 56;\nActivities of food service contractors, see 5629.','1075'),('10760','Manufacture of Food Supplements from Herbs and Other Plants',NULL,'1076'),('10770','Coffee Roasting and Processing\n','\nThis class includes :\nCoffee roasting, grinding, decaffeinating or packing\nManufacture of coffee substitutes containing coffee\nManufacture of extracts, essences or concentrates of coffee and preparations with a basis of these products\nChicory roasting and preparation of other roasted coffee substitutes and their essences, extracts or concentrates','1077'),('10781','Manufacture of Nata De Coco',NULL,'1078'),('10782','Manufacturing of Native Delicacies or \"kakanin\" E.g., Bibingka, Puto, Suman, Kalamay, Binagol, Moron and Other Similar Products',NULL,'1078'),('10791','Manufacture of Herb from Drying and Further Extraction (E.g. Banaba, Ampalaya, Moringa (Malunggay), Sambong, Lagundi Etc.)',NULL,'1079'),('10792','Manufacture of Ice, Except Dry Ice',NULL,'1079'),('10793','Manufacture of Soup Containing Meat, Fish, Crustaceans, Mollusks or Pasta',NULL,'1079'),('10794','Manufacture of Infant or Dietetic Foods Containing Homogenized Ingredients',NULL,'1079'),('10795','Egg Processing Including Fertilized Egg (Balut) and Salted Eggs',NULL,'1079'),('10796','Manufacture of Flavoring Extracts and Food Coloring',NULL,'1079'),('10797','Manufacture of Mayonnaise, Salad Dressing, Sandwich Spread and Similar Products',NULL,'1079'),('10798','Manufacture of Vinegar',NULL,'1079'),('10799','Manufacture of Food Products, N.e.c.',NULL,'1079'),('10800','Manufacture of Prepared Animal Feeds\n','\nThis class includes :\nManufacture of prepared feeds for pets, including dogs, cats, birds, fish, etc.\nManufacture of prepared feeds for farm animals, including animal feed concentrated and feed supplements\nPreparation consisting of mixtures of materials or of materials specially treated or packaged to make them suitable as feed for dogs, cats, birds, fish or other pet animals\nPreparation of unmixed (single) feeds for farm animals\nTreatment of slaughter waste to produce animal feeds\nThis class excludes :\nProduction of fishmeal for animal, see 1020;\nProduction of oilseed cake, see 1041;\nActivities resulting in by-products usable as animal feed without special treatment, e.g. oil seeds (see 1040), grain milling residues (see 1062).','1080'),('11010','Distilling, Rectifying and Blending of Spirits\n','\nThis class includes :\nManufacture of distilled, potable, alcoholic beverages: whisky, brandy, gin, liquors, \"mixed drinks\", etc.\nBlending of distilled spirits\nProduction of neutral spirits\nThis class excludes :\nManufacture of ethyl alcohol, see 2011;\nManufacture of non-distilled alcoholic beverages, see 1102, 1103;\nMerely bottling and labeling , see 4630 (if performed as part of wholesale) and 8292 (if performed on a fee or contract basis).','1101'),('11021','Fruit Wine Manufacturing',NULL,'1102'),('11029','Wine Manufacturing, N.e.c.',NULL,'1102'),('11030','Manufacture of Malt Liquors and Malt\n','\nThis class includes :\nManufacture of malt liquors, such as beer, ale, porter and stout\nManufacture of malt\nManufacture of low alcohol or non-alcoholic beer','1103'),('11041','Manufacture of Soft Drinks Except Drinks Flavored with Fruit Juices, Syrups or Other Materials',NULL,'1104'),('11042','Manufacture of Drinks Flavored with Fruit Juices, Syrups or Other Materials',NULL,'1104'),('11051','Manufacture of Bottled Drinking Water',NULL,'1105'),('11052','Manufacture of Carbonated Water',NULL,'1105'),('11053','Water Purifying and Refilling Station',NULL,'1105'),('11059','Manufacture of Drinking Water and Mineral Water, N.e.c.',NULL,'1105'),('11060','Manufacture of Sports and Energy Drink',NULL,'1106'),('11090','Manufacture of Other Beverages, N.e.c.',NULL,'1109'),('12010','Manufacture of Cigarettes',NULL,'1201'),('12020','Manufacture of Cigars',NULL,'1202'),('12030','Manufacture of Chewing and Smoking Tobacco, Snuff',NULL,'1203'),('12040','Curing and Redrying Tobacco Leaves',NULL,'1204'),('12090','Tobacco Manufacturing, N.e.c.',NULL,'1209'),('13111','Spinning',NULL,'1311'),('13112','Texturizing',NULL,'1311'),('13113','Manufacture of Paper Yarn',NULL,'1311'),('13119','Preparation of Textiles, N.e.c.',NULL,'1311'),('13120','Weaving of Textiles\n','\nThis class includes :\nManufacture of broad woven cotton-type, woolen type, worsted-type or silk-type fabrics, including from mixtures or artificial or synthetic yarns\nManufacture of other broad woven fabrics, using flax, ramie, hemp, jute, bast fibers and special yarns\nManufacture of woven pile or chenille fabrics, terry toweling, gauze etc.\nManufacture of woven fabrics of glass fibers\nManufacture of woven carbon and aramid threads\nManufacture of imitation fur by weaving\nThis class excludes :\nManufacture of textile floor coverings, see 1393;\nManufacture of non-woven fabrics and felts, see 1399;\nManufacture of narrow fabrics, see 1399;\nManufacture of knitted and crocheted fabrics, see 1391.','1312'),('13130','Finishing of Textiles\n','\nThis class includes :\nBleaching and dyeing of textile fibers, yarns, fabrics and textile articles, including wearing apparel\nDressing, drying, steaming, shrinking, mending, Sanforizing, mercerizing of textiles and textile articles, including wearing apparel\nBleaching of jeans\nPleating and similar work on textiles\nWaterproofing, coating, rubberizing, or impregnating purchased garments\nSilk screen- printing on textiles and wearing apparel\nThis class excludes :\nManufacture of textile fabric impregnated, coated, covered or laminated with rubber, where the rubber is the chief constituent, see 2219.','1313'),('13140','Preparation and Finishing of Textiles (Integrated)',NULL,'1314'),('13910','Manufacture of Knitted and Crocheted Fabrics\n','\nThis class includes :\nManufacture and processing of knitted or crocheted fabrics : pile and terry fabrics; net and window furnishing type fabrics knitted on Raschel or similar machines, other knitted or crocheted fabrics\nManufacture of imitation fur by knitting\nThis class excludes :\nManufacture of net and window furnishing type fabrics of lace knitted on Raschel or similar machines, see 1399;\nManufacture of knitted and crocheted apparel, see 1430.','1391'),('13921','Manufacture of Textile Industrial Bags',NULL,'1392'),('13922','Manufacture of Made-up Textile Goods for House Furnishings',NULL,'1392'),('13923','Manufacture of Canvas Products',NULL,'1392'),('13929','Manufacture of Made-up Textile Articles, Except Wearing Apparel, N.e.c.',NULL,'1392'),('13931','Manufacture of Carpets and Rugs, Except Mats of Textile Materials',NULL,'1393'),('13932','Manufacture of Mats (Including Mattings) of Textile Materials',NULL,'1393'),('13941','Manufacture of Cordage, Rope, and Twine',NULL,'1394'),('13942','Manufacture of Fishing Nets and Other Nettings, (Excluding Mosquito and Hairnets)',NULL,'1394'),('13943','Manufacture of Products of Cordage, Rope and Twine',NULL,'1394'),('13950','Manufacture of Embroidered Fabrics',NULL,'1395'),('13991','Manufacture of Narrow Fabrics, Laces, Tulles and Other Net Fabrics',NULL,'1399'),('13992','Manufacture of Felt and Non-woven Fabrics',NULL,'1399'),('13993','Manufacture of Fabrics, Impregnated, Coated, Covered or Laminated with Plastic',NULL,'1399'),('13994','Manufacture of Fabrics, Impregnated, Coated, Covered or Laminated Other Than with Plastic and Rubber',NULL,'1399'),('13995','Manufacture of Fabrics for Industrial Use (Wicks and Gas Mantles)',NULL,'1399'),('13996','Manufacture of Fiber Batting, Padding and Upholstery Filling Including Coir',NULL,'1399'),('13999','Manufacture of Miscellaneous Textiles, N.e.c.',NULL,'1399'),('14110','Mennulls and Boynulls Garment Manufacturing',NULL,'1411'),('14120','Womennulls and Girlnulls Garment Manufacturing',NULL,'1412'),('14130','Ready-made Embroidered Garments Manufacturing',NULL,'1413'),('14140','Babiesnull Garment Manufacturing',NULL,'1414'),('14191','Manufacture of Raincoats by Cutting or Sewing Except Rubber or Plastics',NULL,'1419'),('14192','Manufacture of Hats, Gloves, Handkerchiefs, Neckwear and Belts Regardless of Material',NULL,'1419'),('14193','Manufacture of Sportswear',NULL,'1419'),('14199','Manufacture of Wearing Apparel, N.e.c',NULL,'1419'),('14210','Custom Tailoring',NULL,'1421'),('14220','Custom Dressmaking',NULL,'1422'),('14301','Manufacture of Knitted and Crocheted Apparel',NULL,'1430'),('14302','Manufacture of Knitted or Crocheted Hosiery, Underwear and Outerwear When Knitted or Crocheted Directly Into Shape',NULL,'1430'),('14309','Manufacture of Knitted and Crocheted Articles, N.e.c.',NULL,'1430'),('14400','Manufacture of Articles of Fur',NULL,'1440'),('15110','Tanning and Dressing of Leather\n','\nThis class includes :\nManufacture of chamois dressed, parchment dressed, patent or metallized leathers\nManufacture of composition leather, i.e. slabs, sheets or strip of a material with a basis of leather or leather fiber\nThis class excludes :\nProduction of hides and skins as part of ranching, see 014;\nProduction of hides and skins as part of slaughtering, see 1011;\nManufacture of leather apparel, see 141;\nManufacture of imitation leather not based on natural leather, see 2219, 2220.','1511'),('15121','Manufacture of Luggage, Handbags and Wallets of Leather and Imitation Leather',NULL,'1512'),('15129','Manufacture of Products of Leather and Imitation Leather, N.e.c.',NULL,'1512'),('15210','Manufacture of Leather Shoes',NULL,'1521'),('15220','Manufacture of Rubber Shoes',NULL,'1522'),('15230','Manufacture of Plastic Shoes',NULL,'1523'),('15240','Manufacture of Shoes Made of Textile Materials with Applied Soles',NULL,'1524'),('15250','Manufacture of Wooden Footwear and Accessories',NULL,'1525'),('15291','Manufacture of Rubber Slippers',NULL,'1529'),('15292','Manufacture of Slippers and Sandals, Other Than Rubber',NULL,'1529'),('15293','Manufacture of Leather Parts of Footwear',NULL,'1529'),('15299','Manufacture of Other Footwear, N.e.c.',NULL,'1529'),('16101','Manufacture of Rough Lumber',NULL,'1610'),('16102','Manufacture of Worked Lumber',NULL,'1610'),('16103','Wood Preserving and Drying',NULL,'1610'),('16109','Sawmilling and Planing of Wood Products, N.e.c.',NULL,'1610'),('16211','Manufacture of Veneer Sheets and Plywood',NULL,'1621'),('16212','Manufacture of Laminboard, Particle Board and Other Panels and Board',NULL,'1621'),('16220','Manufacture of Wooden Window and Door Screens, Shades and Venetian Blinds',NULL,'1622'),('16230','Manufacture of Other Buildersnull Carpentry and Joinery; Millworking',NULL,'1623'),('16240','Manufacture of Wooden Containers\n','\nThis class includes :\nManufacture of packing cases, boxes, crated, drums and similar packings of wood\nManufacture of pallets, box pallets and other load boards of wood\nManufacture of barrels, vats, tubs and other cooperNULLs products of wood\nManufacture of wooden cable-drums.\nThis class excludes :\nManufacture of luggage, see 1512;\nManufacture of cases of plaiting material, see 1629.','1624'),('16250','Manufacture of Wood Carvings',NULL,'1625'),('16260','Manufacture of Charcoal Outside the Forest',NULL,'1626'),('16270','Manufacture of Wooden Wares',NULL,'1627'),('16281','Manufacture of Rattan and Cane Containers',NULL,'1628'),('16282','Manufacture of Sawali, Nipa and Split Canes',NULL,'1628'),('16283','Manufacture of Mats, Matting or Screen',NULL,'1628'),('16284','Manufacture of Small Cane Wares',NULL,'1628'),('16285','Manufacture of Articles of Cork, Straw and Plaiting Materials',NULL,'1628'),('16289','Manufacture of Other Products of Bamboo, Cane, Rattan and the Like, and Plaiting Materials Except Furniture, N.e.c.',NULL,'1628'),('16290','Manufacture of Other Products of Wood; Manufacture of Articles of Cork and Plaiting Materials, Except Furniture, N.e.c.',NULL,'1629'),('17011','Integrated Pulp, Paper and Paperboard Milling',NULL,'1701'),('17012','Pulp Milling',NULL,'1701'),('17013','Paper and Paperboard Milling',NULL,'1701'),('17014','Manufacture of Hand-made Paper',NULL,'1701'),('17019','Manufacture of Pulp, Paper and Paperboard, N.e.c.',NULL,'1701'),('17020','Manufacture of Corrugated Paper and Paperboard and of Containers of Paper and Paperboard\n','\nThis class includes :\nManufacture of corrugated paper and paperboard\nManufacture of containers of corrugated paper and paperboard\nManufacture of folding paperboard containers\nManufacture of containers of solid board\nManufacture of other containers of paper and paperboard\nManufacture of sacks and bags of paper\nManufacture of office box files and similar articles\nThis class excludes :\nManufacture of envelopes, see 1709;\nManufacture of molded or pressed articles of paper pulp (e.g. boxes for packing eggs, molded pulp paper plates), see 1709.','1702'),('17091','Manufacture of Household and Personal Hygiene Paper and Cellulose Wadding Products',NULL,'1709'),('17092','Manufacture of Wadding of Textile Materials and Articles of Wadding (E.g. Sanitary Towels, Tampons, Etc.)',NULL,'1709'),('17093','Manufacture of Other Articles of Paper',NULL,'1709'),('17099','Manufacture of Other Articles of Paperboard',NULL,'1709'),('18110','Printing\n','\nThis class includes :\nPrinting of newspapers, magazines and other periodicals, books and brochures, music and music manuscripts, maps, atlases, posters, advertising catalogues, prospectuses and other printed advertising, postage stamps, taxation stamps, documents of title, cheques and other security papers, registers, albums, diaries, calendars, business forms and other commercial printed matter, personal stationery and other printed matter by letterpress, offset, photogravure, flexographic and other printing presses, duplication machines, computer printers, embossers, etc., including quick printing.\nPrinting directly into textiles, plastic, glass, metal, wood and ceramics (except silk-screen printing on textiles and wearing apparel).\nThe material printed is typically copyrighted.\nThis class also includes :\nPrinting on labels or tags (lithographic, gravure printing, flexographic printing, others).\nThis class excludes :\nSilk screen-printing on textiles and wearing apparel, see 1313;\nManufacture of paper articles, such as binders, see 1709;\nPublishing of printed matter, see 581;\nPhotocopying of documents, see 8219.','1811'),('18121','Electrotyping, Stereotyping and Photoengraving',NULL,'1812'),('18122','Bookbinding and Related Work',NULL,'1812'),('18129','Service Activities Related to Printing, N.e.c.',NULL,'1812'),('18201','Reproduction of Video and Computer Tapes from Master Copies',NULL,'1820'),('18202','Reproduction of Floppy, Hard or Compact Disks',NULL,'1820'),('18203','Film and Video Reproduction',NULL,'1820'),('19100','Manufacture of Coke Oven Products\n','\nThis class includes :\nOperation of coke ovens\nProduction of coke and semi-coke\nProduction of pitch and pitch coke\nProduction coke oven gas\nProduction of crude coal and lignite tars\nAgglomeration of coke','1910'),('19200','Manufacture of Refined Petroleum Products\n','\nThis class includes the manufacture of liquid or gaseous fuels or other products from crude petroleum, bituminous minerals or their fractionation products. Petroleum refining involves one or more of the following activities: fractionation, straight distillation of crude oil, and cracking.\nThis class includes :\nProduction of motor fuel : gasoline, kerosene, etc.\nProduction of fuel: light, medium and heavy fuel oil, refinery gases such as ethane, propane, butane etc.\nManufacture of oil-based lubricating oils or greases, including from waste oil\nManufacture of products for the petrochemical industry and for the manufacture of road coverings\nManufacture of various products : white spirit, vaseline, paraffin wax, petroleum jelly, etc.\nManufacture of hard-coal and lignite fuel briquettes\nManufacture of petroleum briquettes\nBlending of biofuels, i.e. blending of alcohols with petroleum (e.g. gasohol)','1920'),('19900','Manufacture of Other Fuel Products',NULL,'1990'),('20111','Manufacture of Ethanol',NULL,'2011'),('20112','Manufacture of Industrial (Compressed and Liquefied) Gases',NULL,'2011'),('20113','Manufacture of Inorganic Salts and Compounds',NULL,'2011'),('20114','Manufacture of Ethyl Alcohol',NULL,'2011'),('20115','Manufacture of Alcohol Except Ethyl',NULL,'2011'),('20116','Manufacture of Inorganic Acids, Alkalis and Chlorine',NULL,'2011'),('20117','Manufacture of Organic Acids and Organic Compounds',NULL,'2011'),('20119','Manufacture of Basic Chemicals, Except Fertilizers and Nitrogen Compounds, N.e.c.',NULL,'2011'),('20120','Manufacture of Fertilizers and Nitrogen Compounds\n','\nThis class includes :\nManufacture of fertilizers : straight or complex nitrogenous, phosphatic or potassic fertilizers, urea, crude natural phosphates and crude natural potassium salts\nManufacture of associated nitrogen products : nitric and sulfonitric acids, ammonia, ammonium chloride, ammonium carbonate, nitrites and nitrates of potassium\nManufacture of potting soil with peat as main constituent\nManufacture of potting soil mixtures of natural soil, sand, clays and minerals\nThis class excludes :\nMining of guano, see 0891;\nManufacture of agro-chemical products, such as pesticides, see 2021;\nOperation of compost dumps, see 3821.','2012'),('20131','Manufacture of Synthetic Rubber and Factice Derived from Oils, in Primary Forms',NULL,'2013'),('20132','Production of Mixtures of Synthetic Rubber and Natural Rubber or Rubber-like Gums (E.g., Balata), in Primary Forms',NULL,'2013'),('20133','Manufacture of Plastic Synthetic Resins',NULL,'2013'),('20134','Manufacture of Plastic Materials Except Man-made Fiber and Glass Fiber',NULL,'2013'),('20210','Manufacture of Pesticides and Other Agro-chemical Products\n','\nThis class includes :\nManufacture of insecticides, rodenticides, fungicides, herbicides\nManufacture of anti-sprouting products, plant growth regulators\nManufacture of disinfectants (for agricultural and other use)\nManufacture of other agro-chemical products, n.e.c.\nThis class excludes manufacture of fertilizers and nitrogen compounds, see 2012.','2021'),('20221','Manufacture of Paints',NULL,'2022'),('20222','Manufacture of Varnishes, Lacquers, Shellac and Stains',NULL,'2022'),('20223','Manufacture of Paint Removers, Thinners, and Brush Cleaners',NULL,'2022'),('20224','Manufacture of Pigments and Other Coloring Matter of a Kind Used in the Manufacture of Paints or by Artists or Other Painters',NULL,'2022'),('20225','Manufacture of Printing Ink',NULL,'2022'),('20229','Manufacture of Paint Products, N.e.c.',NULL,'2022'),('20231','Manufacture of Soap and Detergents',NULL,'2023'),('20232','Manufacture of Cleaning Preparations, Except Soap and Detergents',NULL,'2023'),('20233','Manufacture of Waxes and Polishing Preparations',NULL,'2023'),('20234','Manufacture of Perfumes, Cosmetics and Other Toilet Preparations',NULL,'2023'),('20291','Manufacture of Explosives, Fireworks and Firecrackers',NULL,'2029'),('20292','Manufacture of Matches',NULL,'2029'),('20293','Manufacture of Writing and Drawing Ink',NULL,'2029'),('20294','Manufacture of Glues and Adhesives',NULL,'2029'),('20295','Manufacture of Activated Carbon',NULL,'2029'),('20299','Manufacture of Miscellaneous Chemical Products, N.e.c.',NULL,'2029'),('20301','Manufacture of Synthetic or Artificial Filament Yarn',NULL,'2030'),('20302','Manufacture of Man-made Filament Tow or Staple Fibers, Except Glass Fiber',NULL,'2030'),('21001','Manufacture of Drugs and Medicines Including Biological Products such as Bacterial and Virus Vaccines, Sera and Plasma',NULL,'2100'),('21002','Manufacture of Surgical Dressings, Medicated Wadding , Fracture Bandages, Catgut, and Other Prepared Sutures',NULL,'2100'),('22111','Manufacture of Rubber Tires (Including Parts) and Tubes',NULL,'2211'),('22112','Retreading and Rebuilding of Tires',NULL,'2211'),('22191','Manufacture of Rubber Garments',NULL,'2219'),('22192','Manufacture of Industrial and Other Molded Rubber Products, Excluding Tires and Tubes',NULL,'2219'),('22199','Manufacture of Other Rubber Products, N.e.c.',NULL,'2219'),('22201','Manufacture of Plastic Articles for Packing Goods (E.g. Boxes, Bags, Sacks, Etc)',NULL,'2220'),('22202','Manufacture of Plastic Household Wares',NULL,'2220'),('22203','Manufacture of Plastic Furniture Fittings',NULL,'2220'),('22204','Manufacture of Plastic Pipes and Tubes',NULL,'2220'),('22205','Manufacture of Other Plastic, Industrial /office/school Supplies',NULL,'2220'),('22206','Manufacture of Primary Plastic Products (E.g. Sheets, Film, Plates, Etc.)',NULL,'2220'),('22207','Manufacture of Linoleum and Hard Surface Floor Coverings',NULL,'2220'),('22208','Manufacture of Plastic Window and Doorscreen, Shades and Venetian Blinds',NULL,'2220'),('22209','Manufacture of Plastics Products, N.e.c.',NULL,'2220'),('23101','Manufacture of Flat Glass (Including Float Glass)',NULL,'2310'),('23102','Manufacture of Glass Containers',NULL,'2310'),('23103','Manufacture of Glass Fibers (Including Glass Wool) and Yarn of Glass Fibers',NULL,'2310'),('23109','Manufacture of Glass and Glass Products, N.e.c.',NULL,'2310'),('23910','Manufacture of Refractory Products\n','\nThis class includes :\nManufacture of refractory mortars, concretes etc.\nManufacture of refractory ceramic goods :\nheat-insulating ceramic goods of siliceous fossil meals\nrefractory bricks, blocks and tiles, etc.\nretorts, crucibles, muffles, nozzles, tubes, pipes, etc.\nManufacture of refractory articles containing magnesite, dolomite or chromite','2391'),('23920','Manufacture of Clay Building Materials\n','\nThis class includes :\nManufacture of non-refractory ceramic hearth or wall tiles, mosaic cubes, etc.\nManufacture of non-refractory ceramic flags and paving\nManufacture of structural non-refractory clay building materials :\nceramic bricks, roofing tiles, chimney pots, pipes, conduits, etc.\nManufacture of flooring blocks in baked clay\nManufacture of ceramic sanitary fixtures\nThis class excludes :\nManufacture of artificial stone (e.g. cultured marble), see 2220;\nManufacture of refractory ceramic products, see 2391.','2392'),('23931','Manufacture of Vitreous China Tableware and Other Kitchen Articles of a Kind Commonly Used for Domestic or Toilet Purposes',NULL,'2393'),('23932','Manufacture of Articles of Porcelain or China, Stoneware, Earthenware, Imitation Porcelain or Common Pottery',NULL,'2393'),('23933','Manufacture of Coarse Clay Products',NULL,'2393'),('23934','Manufacture of Sanitary Ware, Vitreous China Plumbing Fittings and Fixtures',NULL,'2393'),('23939','Manufacture of Other Porcelain and Ceramic Products, N.e.c.',NULL,'2393'),('23940','Manufacture of Cement\n','\nThis group includes manufacture of clinkers and hydraulic cements, including Portland, aluminous cement, slag cement and superphosphate cements.\nThis class excludes :\nManufacture of refractory mortars, concrete, etc. see 2391;\nManufacture of cements used in dentistry, see 3250;\nManufacture of articles of cement, see 2396;\nManufacture of ready-mix and dry-mix concrete and mortars, see 2396.','2394'),('23951','Manufacture of Lime',NULL,'2395'),('23952','Manufacture of Plaster',NULL,'2395'),('23961','Manufacture of Structural Concrete Products',NULL,'2396'),('23969','Manufacture of Articles of Concrete, Cement and Plaster, N.e.c.',NULL,'2396'),('23970','Cutting, Shaping and Finishing of Stone\n','\nThis class includes :\nCutting, shaping and finishing of stone for use in construction, in cemeteries, on roads, as roofing, etc.\nManufacture of stone furniture\nThis class excludes :\nProduction of rough cut stone, i.e. quarrying activities, see 0810;\nProduction of millstones, abrasives stones and similar products, see 2399;\nActivities of sculptors, see 9000.','2397'),('23991','Manufacture of Asphalt Products',NULL,'2399'),('23992','Manufacture of Asbestos Products',NULL,'2399'),('23993','Manufacture of Marble Products',NULL,'2399'),('23994','Manufacture of Abrasive Products',NULL,'2399'),('23999','Manufacture of Miscellaneous Non-metallic Mineral Products, N.e.c.',NULL,'2399'),('24110','Operation of Blast Furnaces and Steel Making Furnaces',NULL,'2411'),('24121','Operation of Rolling Mills',NULL,'2412'),('24122','Pipes and Tubes Manufacturing, Iron or Steel',NULL,'2412'),('24123','Manufacture of Pipe Fittings of Iron or Steel',NULL,'2412'),('24124','Manufacture of Galvanized Steel Sheets, Tinplates and Other Coated Metal Products Made in Steel Works or Rolling Mills',NULL,'2412'),('24129','Operation of Steel Works and Rolling Mills, N.e.c.',NULL,'2412'),('24210','Gold and Other Precious Metal Refining',NULL,'2421'),('24220','Non-ferrous Smelting and Refining , Except Precious Metals',NULL,'2422'),('24230','Non-ferrous Rolling, Drawing and Extrusion Mills',NULL,'2423'),('24240','Manufacture of Pipe Fittings of Non-ferrous Metals',NULL,'2424'),('24290','Manufacture of Basic Precious and Other Non-ferrous Metals, N.e.c.',NULL,'2429'),('24311','Casting/foundry of Iron',NULL,'2431'),('24312','Casting/foundry of Steel',NULL,'2431'),('24321','Aluminum and Aluminum Base Alloy Casting',NULL,'2432'),('24322','Copper and Copper Base Alloy (Brass, Bronze) Casting',NULL,'2432'),('24323','Zinc and Zinc Alloy Casting',NULL,'2432'),('24329','Casting of Non-ferrous Metal, N.e.c.',NULL,'2432'),('25111','Manufacture of Structural Steel Products and Metal Components of Bridges, Smoke Stacks and Buildings',NULL,'2511'),('25112','Manufacture of Other Architectural and Related Metal Work (E.g., Doors, Windows, Shutters, Gates, Etc.)',NULL,'2511'),('25119','Manufacture of Structural Metal Products, N.e.c.',NULL,'2511'),('25120','Manufacture of Tanks, Reservoirs and Containers of Metal\n','\nThis class includes :\nManufacture of reservoirs, tanks and similar containers of metal, of types normally installed as fixtures for storage or manufacturing use\nManufacture of metal containers for compressed or liquified gas\nManufacture of central heating boilers and radiators\nThis class excludes :\nManufacture of metal casks, drums, cans, pails, boxes, etc. of a kind normally used for carrying and packing of goods (irrespective of size), see 2599;\nManufacture of transport containers, see 2920;\nManufacture of tanks (armored military vehicles), see 3040.','2512'),('25130','Manufacture of Steam Generators, Except Central Heating Hot Water Boilers\n','\nThis class includes :\nManufacture of steam or other vapor generators\nManufacture of auxiliary plant for use with steam generators: condensers, economizers, superheaters, steam collectors and accumulators\nManufacture of nuclear reactors, except isotope separators\nThe term \"nuclear reactor \" covers, in general, all the apparatus and appliances inside the area screened off by the biological shield, including , where appropriate the shield itself. The term also includes any other apparatus or appliances outside the area provided they form an integral part of those contained inside the screen.\nManufacture of parts for marine or power boilers\nThis class excludes :\nManufacture of central heating hot-water boilers and radiators, see 2512;\nManufacture of boiler-turbine sets, see 2811;\nManufacture of isotope separators, see 2829.','2513'),('25201','Manufacture of Small Arms and Accessories',NULL,'2520'),('25209','Manufacture of Weapons and Ammunitions, N.e.c.',NULL,'2520'),('25911','Forging, Pressing, Stamping and Roll-forming of Metal Products',NULL,'2591'),('25912','Powder Metallurgy',NULL,'2591'),('25920','Treatment and Coating of Metals; Machining\n','\nThis class includes :\nPlating, anodizing, etc. of metals\nHeat treatment of metals\nDeburring, sandblasting, tumbling, cleaning of metals\nColoring and engraving of metals\nNon-metallic coating of metals: plasticizing, enamelling, lacquering, etc.\nHardening, buffing of metals\nBoring, turning, milling, eroding, planing, lapping, broaching, leveling, sawing, grinding, sharpening, polishing, welding, splicing, etc. of metalwork pieces\nCutting of and writing on metals by means of laser beams\nThis class excludes :\nActivities of farriers, see 0156;\nRolling precious metal onto base metals or other metals, see 242.','2592'),('25931','Manufacture of Cutlery',NULL,'2593'),('25932','Manufacture of Hand Tools',NULL,'2593'),('25933','Manufacture of General Hardware',NULL,'2593'),('25934','Manufacture of Blacksmithing Tools and Welding Shop Operation',NULL,'2593'),('25935','Manufacture of Molding Boxes for Metal Foundry',NULL,'2593'),('25991','Manufacture of Metal Containers Used for the Packing or Conveyance of Goods',NULL,'2599'),('25992','Manufacture of Wire Nails, Not in Steel Rolling',NULL,'2599'),('25993','Manufacture of Fabricated Wire Products',NULL,'2599'),('25994','Manufacture of Small Hand-operated Kitchen Appliances',NULL,'2599'),('25995','Manufacture of Metal Sanitary Ware and Plumbing Fixtures',NULL,'2599'),('25996','Manufacture of Needles (Except for Knitting and Sewing Machines), Pins and Fasteners Including Zippers',NULL,'2599'),('25997','Manufacture of Aluminum Window and Door Screens, Shades and Venetian Blinds',NULL,'2599'),('25999','Manufacture of Miscellaneous Fabricated Metal Products, N.e.c.',NULL,'2599'),('26110','Manufacture of Electronic Valves and Tubes',NULL,'2611'),('26121','Manufacture of Sensors',NULL,'2612'),('26122','Manufacture of Actuators',NULL,'2612'),('26123','Manufacture of Oscillators',NULL,'2612'),('26124','Manufacture of Resonators',NULL,'2612'),('26129','Manufacture of Semi-conductor Devices and Other Electronic Components, N.e.c.',NULL,'2612'),('26200','Manufacture of Computers and Peripheral Equipment and Accessories\n','\nThis includes the manufacture and/or assembly of various electronic computers, and computer peripheral equipment, such as storage devices and input/output devices (printers, monitors, keyboards). Computers can be analog, digital, or hybrid. Digital computers, the most common type, are devices that do all the following : (1) store the processing program or programs and the data immediately necessary for the execution of the program, (2) can be freely programmed in accordance with the requirements of the user, (3) perform arithmetical computations specified by the user and (4) execute, without human intervention, a processing program that requires the computer to modify its execution by logical decision during the processing run. Analog computers are capable of simulating mathematical models and comprise at least analog control and programming elements.\nThis class includes :\nManufacture of desktop computers\nManufacture of laptop computers\nManufacture of main frame computers\nManufacture of hand-held computers (e.g. PDA)\nManufacture of magnetic disk drives, flash drives and other storage devices\nManufacture of optical (e.g. CD-RW, CD-ROM, DVD-ROM, DVD-RW) disk drive\nManufacture of printers\nManufacture of monitors\nManufacture of keyboards\nManufacture of all types of mice, joysticks and trackball accessories\nManufacture of dedicated computer terminals\nManufacture of computer servers\nManufacture of scanners, including bar code scanners\nManufacture of smart card readers\nManufacture of virtual reality helmets\nManufacture of computer projectors (video beamers)\nManufacture of computer terminals, like automatic teller machines (ATMNULLs), point-of-scale (POS) terminals, not mechanically operated\nManufacture of multi-function office equipment, such as fax-scanner-copier combinations\nThis class excludes :\nReproduction of recorded media (computer media, sound, video, etc.), see 1820;\nManufacture of electronic components and electronic assemblies used in computers and peripherals, see 261;\nManufacture of internal/external computer modems, see 261;\nManufacture of interface cards, modules and assemblies, see 261;\nManufacture of modems, carrier equipment, see 2630;\nManufacture of digital communication switches, data communications equipment (e.g. bridges, routers, gateways, see 2630;\nManufacture of consumer electronic devices, such as CD players and DVD players, see 2640;\nManufacture of television monitors and displays, see 2640;\nManufacture of video game consoles, see 2640;\nManufacture of blank optical and magnetic media for use with computers or other devices, see 2680.','2620'),('26300','Manufacture of Communication Equipment\n','\nThis class includes the manufacture of telephone and data communications equipment used to move signals electronically over wires or through the air such as radio and television broadcast and wireless communications equipment.\nThis class includes :\nManufacture of central office switching equipment\nManufacture of cordless telephones\nManufacture of private branch exchange (PBX) equipment\nManufacture of telephone and facsimile equipment including telephone answering machines\nManufacture of data communications equipment, such as bridges, routers, and gateways\nManufacture of transmitting and receiving antenna\nManufacture of cable television equipment\nManufacture of pagers\nManufacture of cellular phones\nManufacture of mobile communication equipment\nManufacture of radio and television studio and broadcasting equipment, including television cameras\nManufacture of modems, carrier equipment\nManufacture of burglar and fire alarm systems, sending signals to a control station\nManufacture of radio and television transmitters\nManufacture of infrared devices (e.g. remote controls)\nThis class excludes :\nManufacture of computers and computer peripheral equipment, see 2620;\nManufacture of consumer audio and video equipment, see 2640;\nManufacture of electronic components and subassemblies used in communications equipment, see 261;\nManufacture of internal/external computer modems (PC-type), see 261;\nManufacture of electronic scoreboards, see 2790;\nManufacture of traffic lights, see 2790.','2630'),('26400','Manufacture of Consumer Electronics\n','\nThis class includes the manufacture of electronic audio and video equipment for home entertainment, motor vehicle, public address systems and musical instrument amplification.\nThis class includes :\nManufacture of video cassette recorders and duplicating equipment\nManufacture of televisions\nManufacture of television monitors and displays\nManufacture of audio recording and duplicating systems\nManufacture of stereo equipment\nManufacture of radio receivers\nManufacture of speaker systems\nManufacture of household-type video cameras\nManufacture of jukeboxes\nManufacture of amplifiers for musical instruments and public address systems\nManufacture of microphones\nManufacture of CD and DVD players\nManufacture of karaoke machines\nManufacture of headphones (e.g. radio, stereo, computer)\nManufacture of video game consoles\nThis class excludes :\nReproduction of recorded media (computer media, sound, video, etc), see 1820;\nManufacture of computer peripheral devices and computer monitors, see 2620;\nManufacture of telephone answering machines, see 2630;\nManufacture of paging equipment, see 2630;\nManufacture of remote control devices (radio and infrared), see 2630;\nManufacture of broadcast studio equipment such as reproduction equipment, transmitting and receiving antennas, commercial video cameras, see 2630;\nManufacture of electronic games with fixed (non-replaceable) software, see 3240.','2640'),('26511','Manufacture of Radar Equipment, Radio Remote Control Apparatus',NULL,'2651'),('26512','Manufacture of Electrical Quantities Measuring and Controlling Instruments',NULL,'2651'),('26513','Manufacture of Temperature Measuring and Controlling Hygrometric Instruments',NULL,'2651'),('26514','Manufacture of Pressure Measuring and Controlling Instruments and Gauges',NULL,'2651'),('26515','Manufacture of Flow of Liquids or Gases Measuring and Controlling Instruments',NULL,'2651'),('26516','Manufacture of Mechanical Motion, Measuring and Controlling, Timing and Cycle Instruments',NULL,'2651'),('26517','Manufacture of Industrial Process Control Equipment',NULL,'2651'),('26519','Manufacture of Professional and Scientific and Measuring and Controlling Equipment, N.e.c.',NULL,'2651'),('26521','Manufacture of Watches and Clocks of All Kinds Including Cases of Precious Metals',NULL,'2652'),('26529','Manufacture of Other Watch and Clocks Parts, N.e.c.',NULL,'2652'),('26601','Manufacture of X-ray Apparatus',NULL,'2660'),('26602','Manufacture of Electrotherapeutic Apparatus',NULL,'2660'),('26603','Manufacture of Medical Laser Equipment',NULL,'2660'),('26604','Manufacture of Computerized Tomography (Ct) Scanner, Positron Emission Tomography (Pet) Scanner',NULL,'2660'),('26605','Manufacture of Mri Equipment',NULL,'2660'),('26606','Manufacture of Medical Ultrasound Equipment',NULL,'2660'),('26609','Manufacture of Other Irradiation, Electromedical and Electrotherapeutic Equipment, N.e.c.',NULL,'2660'),('26701','Manufacture of Optical Instruments and Lenses',NULL,'2670'),('26702','Manufacture of Photographic Equipment and Accessories',NULL,'2670'),('26800','Manufacture of Magnetic and Optical Media\n','\nThis class includes the manufacture of magnetic and optical recording media, such as : blank magnetic audio and video tapes and cassettes, blank diskettes, blank optical discs and hard drive media.\nThis class excludes reproduction of recorded media (computer media, sound, video, etc.), see 1820.','2680'),('27111','Manufacture of Electric Motors and Generators',NULL,'2711'),('27112','Manufacture of Electrical Transformers',NULL,'2711'),('27113','Manufacture of Electric Generating Sets',NULL,'2711'),('27121','Manufacture of Switch Gear and Switchboard Apparatus',NULL,'2712'),('27122','Manufacture of Electricity Distribution Equipment',NULL,'2712'),('27123','Manufacture of Switches, Fuses, Sockets, Plugs, Conductors and Lightning Arresters and Other Control Apparatus',NULL,'2712'),('27201','Manufacture of Accumulators (Storage Batteries) Including Parts',NULL,'2720'),('27202','Manufacture of Primary Cells and Batteries',NULL,'2720'),('27310','Manufacture of Fiber Optic Cables\n','\nThis class includes manufacture of fiber optic cable for data transmission or live transmission of images\nThis class excludes :\nManufacture of glass fibers or strand, see 2310;\nManufacture of optical cable sets or assemblies with connectors or other attachments, see depending on application, e.g. 261.','2731'),('27320','Manufacture of Other Electronic and Electric Wires and Cables\n','\nThis class includes manufacture of insulated wire and cable, made of steel, copper and aluminum.\nThis class excludes :\nManufacture (drawing) of wire, see 241, 242;\nManufacture of computer cables, printer cables, USB cables and similar cable sets or assemblies, see 2612;\nManufacture of extension cords, see 2790;\nManufacture of cable sets, wiring harnesses and similar cable sets or assemblies for automotive applications, see 2930.','2732'),('27330','Manufacture of Wiring Devices\n','\nThis class includes the manufacture of current-carrying and non current-carrying wiring devices for electrical circuits regardless of material.\nThis class includes :\nManufacture of bus bars, electrical conductors (except switchgear-type)\nManufacture of GFCI (ground fault circuit interrupters)\nManufacture of lamp holders\nManufacture of lightning arrestors and coils\nManufacture of switches for electrical wiring (e.g. pressure, pushbutton, snap, tumbler switches)\nManufacture of electrical outlets and sockets\nManufacture of boxes for electrical wiring (e.g. junction outlet, switch boxes)\nManufacture of electrical conduit and fitting\nManufacture of transmission pole and line hardware\nManufacture of plastic non current - carrying wiring devices including plastic junction boxes, face plates, and similar, plastic pole line fittings\nThis class excludes :\nManufacture of ceramic insulators; see 2393;\nManufacture of electronic component-type connectors sockets, and switches, see 261.','2733'),('27401','Manufacture of Electric Lamps Fluorescent and Fixtures',NULL,'2740'),('27402','Manufacture of Lighting Equipment and Parts Except for Use on Cycle and Motor Equipment',NULL,'2740'),('27403','Manufacture of Motor Vehicle Lighting Equipment',NULL,'2740'),('27404','Manufacture of Bicycle Lighting Equipment',NULL,'2740'),('27405','Manufacture of Lighting Sets Used for Christmas Trees and the Like',NULL,'2740'),('27501','Manufacture of Domestic Electric Fans',NULL,'2750'),('27502','Manufacture of Domestic-type Refrigerators and Laundry Equipment (E.g. Clothes Washers, Washer-dryers, Dryers)',NULL,'2750'),('27503','Manufacture of Domestic Cooking Appliances (E.g. Ovens, Ranges, Cookers, Stoves, Grillers, Etc.)',NULL,'2750'),('27504','Manufacture of Electrothermic Domestic Appliances (E.g. Hair Dressing Appliances, Electric Instantaneous Storage, Heaters, Flat-irons, Plate Warmers, Coffee or Tea Makers)',NULL,'2750'),('27505','Manufacture of Domestic-type Water Filters And/or Purifiers',NULL,'2750'),('27509','Manufacture of Domestic Appliances, N.e.c.',NULL,'2750'),('27901','Manufacture of Battery Chargers, Solid State',NULL,'2790'),('27902','Manufacture of Uninterruptible Power Supplies (Ups)',NULL,'2790'),('27903','Manufacture of Appliance Cords, Extension Cords, and Other Electrical Cord',NULL,'2790'),('27904','Manufacture of Accelerators (Cyclotrons, Betatrons)',NULL,'2790'),('27905','Manufacture of Electrical Signalling Equipment such as Traffic Lights and Pedestrian Signalling Equipment',NULL,'2790'),('27909','Manufacture of Other Electrical Equipment, N.e.c.',NULL,'2790'),('28111','Manufacture of Internal Combustion Engines (Gas and Diesel)',NULL,'2811'),('28112','Manufacture of Engines and Turbines for Marine Propulsion',NULL,'2811'),('28113','Manufacture of Parts of Engines and Turbines, Except for Aircraft, Vehicle and Cycle Engines',NULL,'2811'),('28119','Manufacture of Engines and Turbines, Except for Transport, N.e.c.',NULL,'2811'),('28120','Manufacture of Fluid Power Equipment\n','\nThis class includes :\nManufacture of hydraulic and pneumatic components (including hydraulic pumps, hydraulic and pneumatic cylinders, hydraulic and pneumatic valves, hydraulic and pneumatic hose and fittings)\nManufacture of air preparation equipment for use in pneumatic systems\nManufacture of fluid power systems\nManufacture of hydraulic transmission equipment\nThis class excludes :\nManufacture of compressors, see 2813;\nManufacture of pumps and valves for non-fluid power applications, see 2813;\nManufacture of mechanical transmission equipment, see 2814.','2812'),('28131','Manufacture of Pumps for Liquids, Vacuum Pumps, Air or Other Gas Compressors',NULL,'2813'),('28132','Manufacture of Taps, Cocks, Valves and Similar Appliances for Pipes, Boiler Shells, Tanks, Vats or the Like',NULL,'2813'),('28140','Manufacture of Bearings, Gears and Driving Elements\n','\nThis class includes :\nManufacture of ball and roller bearings and parts thereof\nManufacture of mechanical power transmission equipment: transmission shafts and cranks: camshafts, crankshafts, cranks etc., bearing housings and plain shaft bearings\nManufacture of gears, gearing and gear boxes and other speed changers\nManufacture of clutches and shaft couplings\nManufacture of flywheels and pulleys\nManufacture of articulated link chain\nManufacture of power transmission chain\nThis class excludes :\nManufacture of other chain, see 2599;\nManufacture of (electromagnetic) clutches, see 2930;\nManufacture of sub-assemblies of power transmission equipment identifiable as parts of vehicles or aircraft, see divisions 29 and 30.','2814'),('28150','Manufacture of Ovens, Furnaces and Furnace Burners\n','\nThis class includes :\nManufacture of electrical and other industrial and laboratory furnaces and ovens, including incinerators\nManufacture of burners\nManufacture of permanent mount electric space heaters, electric swimming pool heaters\nManufacture of permanent mount non-electric household heating equipment, such as solar heating, steam heating, oil heat and similar furnaces and heating equipment\nManufacture of electric household-type furnaces (electric forced air furnaces, heat pumps, etc.), non-electric household forced air furnaces\nThis class also includes the manufacture of mechanical stokers, grates, ash discharges, etc.\nThis class excludes :\nManufacture of household ovens, see 2750;\nManufacture of agricultural dryers, see 2825;\nManufacture of bakery ovens, see 2825;\nManufacture of dryers for wood, paper pulp, paper or paperboard, see 2829;\nManufacture of medical, surgical or laboratory sterilizers, see 3250;\nManufacture of (dental) laboratory furnaces, see 3250.','2815'),('28161','Manufacture of Lifting and Hoisting Machinery, Cranes, Elevators, Industrial Trucks, Tractors, Stackers, Specialized Ports for Lifting and Handling Equipment',NULL,'2816'),('28162','Manufacture of Derricks, Lifting and Handling Equipment for Construction and Mining',NULL,'2816'),('28163','Manufacture of Marine Capstans, Pulley Tackle and Hoists, Etc.',NULL,'2816'),('28169','Manufacture of Other Lifting and Handling Equipment, N.e.c.',NULL,'2816'),('28171','Manufacture of Calculating Machines, Adding Machines, Cash Registers, Calculators',NULL,'2817'),('28172','Manufacture of Bills/coin Counting and Coin Wrapping Machinery',NULL,'2817'),('28173','Manufacture of Postage Meters, Mail Handling Machines (Envelope Stuffing, Sealing and Addressing Machinery, Opening, Sorting, Scanning), Collating Machinery',NULL,'2817'),('28174','Manufacture of Typewriters',NULL,'2817'),('28175','Manufacture of Duplicating Machines',NULL,'2817'),('28176','Manufacture of Photo-copying Apparatus Incorporating an Optical System or of the Contact Type and Thermo Copying Apparatus',NULL,'2817'),('28177','Manufacture of Other Office and Accounting Machineries',NULL,'2817'),('28179','Manufacture of Other Office Machinery and Equipment (Except Computers and Peripheral Equipment), N.e.c.',NULL,'2817'),('28180','Manufacture of Power-driven Hand Tools\n','\nThis class includes the manufacture of hand tools, with self-contained electric or non-electric motor or pneumatic drive, such as : circular or reciprocating saws, drills and hammer drills, hand held power sanders, pneumatic nailers, buffers, routers, grinders, staplers, pneumatic rivet guns, planers, shears and nibblers, impact wrenches, and powder actuated nailers.\nThis class excludes the manufacture of electrical hand-held soldering and welding equipment, see 2790.','2818'),('28191','Manufacture of Weighing Machines Except Scientific Weighing Apparatus Used for Laboratories',NULL,'2819'),('28192','Manufacture of Refrigerating or Freezing Equipment for Commercial Purposes',NULL,'2819'),('28193','Manufacture of Unit Air-conditioners',NULL,'2819'),('28194','Manufacture of Packing and Wrapping Machinery',NULL,'2819'),('28195','Manufacture of Machinery for Cleaning or Drying Bottles or Other Containers or for Aerating Beverages',NULL,'2819'),('28196','Manufacture of Fans Intended for Industrial Applications, Exhaust Hoods for Commercial, Laboratory or Industrial Use',NULL,'2819'),('28197','Manufacture of Calendering or Other Rolling Machines Other Than for Metals or Glass',NULL,'2819'),('28198','Manufacture of Gas or Electric Welding, Brazing or Soldering Machines',NULL,'2819'),('28199','Manufacture of Other General-purpose Machinery, N.e.c. (Including Manufacture of Specialized Parts for General Purpose Machinery and Equipment)',NULL,'2819'),('28211','Manufacture of Farm Tractors',NULL,'2821'),('28212','Manufacture of Mechanical Implements for Crop Production',NULL,'2821'),('28213','Manufacture of Animal Husbandry Machinery and Equipment',NULL,'2821'),('28219','Manufacture of Agricultural and Forestry Machinery and Equipment, N.e.c.',NULL,'2821'),('28221','Manufacture of Machine Tools for Working Metal',NULL,'2822'),('28222','Manufacture of Machine Tools and Accessories Including Precision Measuring Tools',NULL,'2822'),('28223','Parts and Accessories for the Machine Tools Classified in This Group',NULL,'2822'),('28224','Manufacture of Apparatus for Electroplating, Electrolysis and Electrophoresis',NULL,'2822'),('28229','Manufacture of Metal-forming Machinery and Machine Tools, N.e.c.',NULL,'2822'),('28230','Manufacture of Machinery for Metallurgy\n','\nThis class includes :\nManufacture of machines and equipment for handling hot metals : converters, ingot molds, ladles, casting machines\nManufacture of metal-rolling mills and rolls for such mills\nThis class excludes :\nManufacture of draw-benches, see 2822;\nManufacture of molding boxes and molds (except ingot molds), see 2593;\nManufacture of machines for forming foundry molds, see 2829.','2823'),('28241','Manufacture of Heavy Machinery and Equipment Used for Mining and Quarrying',NULL,'2824'),('28242','Manufacture of Heavy Machinery and Equipment Used for Construction',NULL,'2824'),('28251','Manufacture of Machinery for Food Processing',NULL,'2825'),('28252','Manufacture of Presses, Crushers and Similar Machinery Used to Make Wine, Cider, Fruit Juices or Similar Beverages',NULL,'2825'),('28253','Manufacture of Machinery for the Preparation of Tobacco and for the Making of Cigarettes or Cigars, or Pipe or Chewing Tobacco or Snuff',NULL,'2825'),('28261','Manufacture of Textile Machinery',NULL,'2826'),('28262','Manufacture of Machineries for Man-made Textile Fibers or Yarns',NULL,'2826'),('28263','Manufacture of Sewing Machines',NULL,'2826'),('28264','Manufacture of Commericial Washing, Laundry, Dry-cleaning and Pressing Machines',NULL,'2826'),('28265','Manufacture of Needles for Knitting, Sewing Machines',NULL,'2826'),('28269','Manufacture of Machinery for Textile Apparel and Leather Production, N.e.c.',NULL,'2826'),('28291','Manufacture of Machinery for Pulp, Paper and Paperboard Industries',NULL,'2829'),('28292','Manufacture of Machinery for Working Rubber or Plastic or for the Manufacture of Products of These Materials',NULL,'2829'),('28293','Manufacture of Printing-trade Machinery and Equipment',NULL,'2829'),('28294','Manufacture of Machinery for Producing Tiles, Bricks, Shaped Ceramic Pastes, Pipes, Graphite, Electrodes, Blackboard Chalk, Foundry Molds, Etc.',NULL,'2829'),('28295','Manufacture of Machines for Production or Hot-working of Glass; Glassware or Yarn',NULL,'2829'),('28296','Manufacture of Centrifugal Clothes Driers',NULL,'2829'),('28299','Manufacture of Other Special-purpose Machinery, N.e.c.',NULL,'2829'),('29100','Manufacture of Motor Vehicles\n','\nThis class includes :\nManufacture of passenger cars\nManufacture of commercial vehicles : vans, lorries, over-the-road tractors for semi-trailers, etc.\nManufacture of buses, trolley-buses and coaches\nManufacture of motor vehicle engines\nManufacture of chassis fitted with engines\nManufacture of other motor vehicles : snowmobiles, golf carts, amphibious vehicles; fire engines, street sweepers, travelling libraries, armored cars, etc.; concrete-mixer lorries\nThis class also includes factory rebuilding of motor vehicle engines\nThis class excludes :\nManufacture of lighting equipment for motor vehicles, see 2740;\nManufacture of pistons, piston rings and carburetors, see 2811;\nManufacture of agricultural tractors, see 2821;\nManufacture of tractors used in construction and mining, see 2824;\nManufacture of off-road dumping trucks, see 2824;\nManufacture of bodies for motor vehicles, see 2920;\nManufacture of electrical parts for motor vehicles, see 2930;\nManufacture of parts and accessories for motor vehicles, see 2930;\nManufacture of tanks and other military fighting vehicles, see 3040;\nMaintenance, repair and alteration of motor vehicles, see 4520.','2910'),('29201','Manufacture of Bodies (Coachwork) for Motor Vehicles',NULL,'2920'),('29202','Manufacture of Trailers and Semi-trailers',NULL,'2920'),('29301','Manufacture of Electric Ignition or Starting Equipment for Internal Combustion Engines',NULL,'2930'),('29302','Manufacture of Parts and Accessories for Motor Vehicles and Their Engines',NULL,'2930'),('30111','Building of Ships and Boats Other Than Sports and Pleasure Boats',NULL,'3011'),('30112','Manufacture of Floating or Submersible Drilling Platforms',NULL,'3011'),('30113','Manufacture of Inflatable Rafts',NULL,'3011'),('30114','Manufacture of Metal Sections for Ships and Barges',NULL,'3011'),('30121','Manufacture of Inflatable Boats',NULL,'3012'),('30129','Manufacture of Other Pleasure and Sporting Boats, N.e.c.',NULL,'3012'),('30201','Building and Rebuilding of Locomotives of Any Type of Gauge, and Railroad and Tramway Cars for Freight and Passenger Service',NULL,'3020'),('30202','Production of Specialized Parts for Locomotives, Railroad and Tramway',NULL,'3020'),('30301','Manufacture of Airplanes for the Transport of Goods or Passengers, for Use by the Defense Forces, for Sport or Other Purposes',NULL,'3030'),('30302','Manufacture of Spacecraft and Launch Vehicles, Satellites, Planetary Probes, Orbital, Shuttles',NULL,'3030'),('30303','Conversion, Modification and Overhaul of Aircrafts',NULL,'3030'),('30309','Manufacture of Other Air and Spacecraft and Related Machinery, N.e.c.',NULL,'3030'),('30400','Manufacture of Military Fighting Vehicles\n','\nThis class includes :\nManufacture of tanks\nManufacture of armored amphibious military vehicles\nManufacture of other military fighting vehicles\nThis class excludes manufacture of weapons and ammunitions, see 2520.','3040'),('30911','Manufacture and Assembly of Motorcycles',NULL,'3091'),('30912','Manufacture of Motorcycle Engines and Parts Thereof',NULL,'3091'),('30913','Manufacture of Tricycles and Parts Thereof',NULL,'3091'),('30914','Manufacture of Side Cars',NULL,'3091'),('30915','Manufacture of Parts and Accessories of Motorcycles',NULL,'3091'),('30921','Manufacture of Bicycles and Bicycle Parts',NULL,'3092'),('30922','Manufacture of Invalid Carriages, Motorized and Non-motorized',NULL,'3092'),('30923','Manufacture of Baby Carriages',NULL,'3092'),('30991','Manufacture of Hand-propelled Vehicles',NULL,'3099'),('30992','Manufacture of Animal Drawn Vehicles',NULL,'3099'),('31010','Manufacture of Wood Furniture',NULL,'3101'),('31020','Manufacture of Rattan Furniture (Reed, Wicker, and Cane)',NULL,'3102'),('31030','Manufacture of Box Beds and Mattresses',NULL,'3103'),('31040','Manufacture of Partitions, Shelves, Lockers and Office and Store Fixtures',NULL,'3104'),('31050','Manufacture of Plastic Furniture',NULL,'3105'),('31060','Manufacture of Furniture and Fixtures of Metal',NULL,'3106'),('31090','Manufacture of Other Furniture and Fixtures, N.e.c.',NULL,'3109'),('32111','Manufacture of Jewelry Made of Precious and Semi-precious Stones',NULL,'3211'),('32112','Manufacture of Silverware and Plated Ware',NULL,'3211'),('32113','Manufacture of Watchbands and Bracelets of Precious Metals',NULL,'3211'),('32119','Manufacture of Articles Related to Jewelry',NULL,'3211'),('32120','Manufacture of Imitation of Jewelry and Related Articles\n','\nThis class includes :\nManufacture of costume or imitation jewelry :\nrings, bracelets, necklaces, and similar articles of jewelry made from base metals plated with precious metals; jewelry containing imitation stones such as imitation gems stones, imitation diamonds, and similar articles\nManufacture of metal watch bands (except precious metals)\nThis class excludes :\nManufacture of jewelry made from precious metals or clad with precious metals, see 3211;\nManufacture of jewelry containing genuine gem stones, see 3211;\nManufacture of precious metal watch bands, see 3211.','3212'),('32201','Manufacture of Guitars',NULL,'3220'),('32202','Manufacture of String Instruments, Other Than Guitars',NULL,'3220'),('32203','Manufacture of Pianos',NULL,'3220'),('32204','Manufacture of Musical Organs (All Types)',NULL,'3220'),('32205','Manufacture of Wind and Percussion Instruments',NULL,'3220'),('32206','Manufacture of Musical Instrument Parts and Accessories',NULL,'3220'),('32209','Manufacture of Musical Instruments, N.e.c.',NULL,'3220'),('32301','Manufacture of Sporting Gloves and Mitts',NULL,'3230'),('32302','Manufacture of Sporting Balls',NULL,'3230'),('32309','Manufacture of Sporting and Athletic Goods, N.e.c.',NULL,'3230'),('32401','Manufacture of Dolls and Doll Garments',NULL,'3240'),('32402','Manufacture of Wheeled Toys',NULL,'3240'),('32403','Manufacture of Billiard, Pool, Bowling Alley and Similar Games Equipment',NULL,'3240'),('32404','Manufacture of Electronic Games (Video Games, Checkers)',NULL,'3240'),('32409','Manufacture of Toys and Games, N.e.c.',NULL,'3240'),('32501','Manufacture of Medical, Surgical, Dental Furniture and Fixtures',NULL,'3250'),('32502','Manufacture of Ophthalmic Goods, Eyeglasses, Sunglasses, Lenses Ground to Prescription, Contact Lenses, Safety Goggles',NULL,'3250'),('32503','Manufacture of Prosthetic Appliances, Artificial Teeth Made to Order',NULL,'3250'),('32504','Manufacture of Medical and Precision Instruments',NULL,'3250'),('32505','Manufacture of Medical Thermometers',NULL,'3250'),('32506','Manufacture of Cement Used in Dentistry',NULL,'3250'),('32509','Manufacture of Other Medical and Dental Instruments and Supplies, N.e.c.',NULL,'3250'),('32910','Manufacture of Pens and Pencils of All Kinds',NULL,'3291'),('32920','Manufacture of Umbrellas, Walking Sticks, Canes, Whips and Riding Crops',NULL,'3292'),('32930','Manufacture of Articles for Personal Use, E.g. Smoking Pipes, Combs, Slides and Similar Articles',NULL,'3293'),('32940','Manufacture of Candles',NULL,'3294'),('32950','Manufacture of Artificial Flowers, Fruits and Foliage',NULL,'3295'),('32961','Manufacture of Wooden Coffin',NULL,'3296'),('32962','Manufacture of Metal Coffin',NULL,'3296'),('32991','Manufacture of Buttons, Except Plastic',NULL,'3299'),('32992','Manufacture of Brooms, Brushes and Fans',NULL,'3299'),('32993','Manufacture of Identification Plates, Badges, Emblems and Tags',NULL,'3299'),('32994','Manufacture of Signs and Advertising Displays',NULL,'3299'),('32995','Manufacture of Cigarette Lighters',NULL,'3299'),('32999','Manufacture of Miscellaneous Articles, N.e.c.',NULL,'3299'),('33110','Repair of Fabricated Metal Products\n','\nThis class includes repair and maintenance of fabricated metal products of division 25.\nThis class includes :\nRepair of metal tanks, reservoirs and containers\nRepair and maintenance for pipes and pipelines\nMobile welding repair\nRepair of steel shipping drums\nRepair and maintenance of steam or other vapor generators\nRepair and maintenance of auxiliary plant for use with steam generators : condensers, economizers, superheaters, steam collectors and accumulators\nRepair and maintenance of nuclear reactors, except isotope separators\nRepair and maintenance of parts for marine or power boilers\nPlatework repair of central heating boilers and radiators\nRepair and maintenance of fire arms and ordinance (including repair of sporting and recreational guns)\nThis class excludes :\nRepair of central heating systems, etc., see 4322;\nRepair of mechanical locking devices, safe, etc., see 8020.','3311'),('33120','Repair of Machinery\n','\nThis class includes repair and maintenance of industrial machinery and equipment like sharpening or installing commercial and industrial machinery blades and saws or the provision of welding (e.g. automotive, general) repair services; the repair of agricultural and other heavy and industrial machinery and equipment (e.g. forklifts and other materials handling equipment, machine tools, commercial refrigeration equipment, construction equipment and mining machinery), comprising machinery and equipment of division 28.\nThis class includes :\nRepair and maintenance of non-automotive engines, e.g. ship or rail engines\nRepair and maintenance of pumps and related equipment\nRepair and maintenance of fluid power equipment\nRepair of valves\nRepair of gearing and driving elements\nRepair and maintenance of industrial process furnaces\nRepair and maintenance of materials handling equipment\nRepair and maintenance of commercial refrigeration equipment and air purifying equipment\nRepair and maintenance of commercial-type general purpose machinery\nRepair of other power-driven hand-tools\nRepair and maintenance of metal cutting and metal forming machine tools and accessories\nRepair and maintenance of other machine tools\nRepair and maintenance of agricultural tractors\nRepair and maintenance of agricultural machinery and forestry and logging machinery\nRepair and maintenance of metallurgy machinery\nRepair and maintenance of mining, construction and oil and gas field machinery\nRepair and maintenance of food, beverage, and tobacco processing machinery\nRepair and maintenance of textile apparel, and leather production machinery\nRepair and maintenance of papermaking machinery\nRepair and maintenance of other special purpose machinery of division 28\nRepair and maintenance of weighing equipment\nRepair and maintenance of vending machines\nRepair and maintenance of cash registers\nRepair and maintenance of photocopy machines\nRepair of calculators, electronic or not\nRepair of typewriters\nThis class excludes installation, repair and maintenance of furnace and other heating equipment, see 4322.','3312'),('33130','Repair of Electronic and Optical Equipment\n','\nThis class includes repair and maintenance of goods produced in groups 265, 266 and 267, except those that are considered household goods.\nThis class includes the repair and maintenance of the measuring, testing, navigating and control equipment of group 265, such as:\naircraft engine instruments\nautomotive emissions testing equipment\nmeteorological instruments\nphysical, electrical and chemical properties testing and inspection equipment\nsurveying instruments\nradiation detection and monitoring instruments\nRepair and maintenance of irradiation, electromedical and electrotherapeutic equipment of class 2660 such as:\nmagnetic resonance imaging equipment\nmedical ultrasound equipment\npacemakers\nhearing aids\nelectrocardiographs\nelectromedical endoscopic equipment\nirradiation apparatus\nRepair and maintenance of optical instruments and equipment of class 2670, if the use is mainly commercial, such as:\nbinoculars\nmicroscopes (except electron and proton microscopes)\ntelescopes\nprisms and lenses (except ophthalmic)\nphotographic equipment\nThis class includes the repair of optical instruments and equipment of class 2670, such as: binoculars, microscopes (except electron proton) telescopes, prisms, and lenses (except ophthalmic) and photographic equipment, if the use is mainly commercial.\nThis class excludes :\nRepair and maintenance of photocopy machines, see 3312;\nRepair and maintenance of computers and peripheral equipment, see 9511;\nRepair and maintenance of computer projectors, see 9511;\nRepair and maintenance of communication equipment, see 9512;\nRepair and maintenance of commercial TV and video cameras, see 9512;\nRepair of household-type video cameras, see 9521;\nRepair of watches and clocks, see 9529.','3313'),('33140','Repair of Electrical Equipment\n','\nThis class includes the repair and maintenance of goods of division 27, except in class 2750 (domestic appliances).\nThis class includes :\nRepair and maintenance of power, distribution, and specialty transformers\nRepair and maintenance of electric motors, generators, and motor generator sets\nRepair and maintenance of switchgear and switchboard apparatus\nRepair and maintenance of relays and industrial controls\nRepair and maintenance of primary and storage batteries\nRepair and maintenance of electric lighting equipment\nRepair and maintenance of current-carrying wiring and non current-carrying wiring devices for wiring electrical circuits\nThis class excludes :\nRepair and maintenance of computers and peripheral computer equipment, see 9511;\nRepair and maintenance of telecommunications equipment, see 9512;\nRepair and maintenance of consumer electronics, see 9521;\nRepair of watches and clocks, see 9529.','3314'),('33151','Repairing of Ships and Boats Other Than Sports and Pleasure Boats',NULL,'3315'),('33152','Repairing of Sports and Pleasure Boats',NULL,'3315'),('33153','Repairing of Aircraft',NULL,'3315'),('33154','Repair and Maintenance of Aircraft Engines',NULL,'3315'),('33159','Repair of Transport Equipment, Except Motor Vehicles, N.e.c.',NULL,'3315'),('33190','Repair of Other Equipment\n','\nThis class includes the repair and maintenance of equipment not covered in other groups of this division.\nThis class includes :\nRepair or ropes, riggings, canvas and tarps\nRepair of fertilizer and chemical storage bags\nRepair or reconditioning of wooden pallets, shipping drums or barrels, and similar items\nRepair of pinball machines and other coin-operated games\nRestoring of organs and other historical musical instruments\nThis class excludes :\nRepair of household and office type furniture, furniture restoration, see 9524;\nRepair of bicycles and invalid carriages, see 9529;\nRepair and alteration of clothing, see 9529.','3319'),('33200','Installation of Industrial Machinery and Equipment\n','\nThis class includes the specialized installation of machinery. However, the installation of equipment that forms an integral part of building or similar structures, such as installation of escalators, electrical wiring, burglar alarm systems or air-conditioning systems, is classified as construction.\nThis class includes :\nInstallation of industrial machinery in industrial plant\nInstallation of industrial process control equipment\nInstallation of other industrial equipment, e.g. :\ncommunication equipment\nmainframe and similar computers\nirradiation and electromedical equipment, etc.\nDismantling large-scale machinery and equipment\nActivities of millwrights\nInstallation of bowling alley equipment\nMachine rigging\nThis class excludes:\nInstallation of electrical wiring, burglar alarm systems, see 4321;\nInstallation of air-conditioning system, see 4322;\nInstallation of elevators, escalators, automated doors, vacuum cleaning systems etc., see 4329;\nInstallation of doors, staircases, shop fittings, furniture, etc., see 4330;\nInstallation (setting-up) of personal computers, see 6209.','3320'),('35101','Electric Power Generation',NULL,'3510'),('35102','Electric Power Transmission',NULL,'3510'),('35103','Electric Power Distribution',NULL,'3510'),('35200','Manufacture of Gas; Distribution of Gaseous Fuels Through Mains\n','\nThis class includes the manufacture of gas and the distribution of natural or synthetic gas to the consumer through a system of mains. Gas marketers or brokers, which arrange the sale of natural gas over distribution systems operated by others, are included.\nThe separate operation of gas pipelines, typically done over long distances, connecting producers, with distribution of gas, or between urban centers, is excluded from this class and classified with other pipeline transport activities.\nThis class includes :\nProduction of gas for the purpose of gas supply by carbonation of coal, from by-products of agriculture or from waste\nManufacture of gaseous fuels with a specified calorific value, by purification, blending and other processes from gases of various types including natural gas\nTransportation, distribution and supply of gaseous fuels of all kinds through a system of mains\nSale of gas to the user through mains\nActivities of gas brokers or agents that arrange the sale of gas over gas distribution systems operated by others\nCommodity and transport capacity exchanges gaseous fuels\nThis class excludes :\nOperation of coke ovens, see 1910;\nManufacture of refined petroleum products, see 1920;\nManufacture of industrial gases, see 2011;\nWholesale of gaseous fuels, see 4661;\nRetail sale of bottled gas, see 4773;\nDirect selling of fuel, see 4799;\n(Long distance) tranportation of gases by pipelines, see 4930.','3520'),('35300','Steam, Air Conditioning Supply and Production of Ice\n','\nThis class includes :\nProduction, collection and distribution of steam and hot water for heating, power and other purposes\nProduction and distribution of cooled air\nProduction of ice for cooling purposes\nThis excludes production of ice for human consumption, see 1079.','3530'),('36000','Water Collection, Treatment and Supply\n','\nThis class includes water collection from various sources, treatment and distribution activities by various means of domestic and industrial needs. Collection of water from various sources, as well as distribution by various means is included.\nThe operation of irrigation canals is also included, however the provision of irrigation services through sprinklers, and similar agricultural support services, is not included.\nThis class includes :\nCollection of water from rivers, lakes, wells, etc.\nCollection of rain water\nPurification of water from water supply purposes\nTreatment of water for industrial and other purposes\nDistribution of water through mains, by trucks or other means\nDesalting of sea or ground water to produce water as the principal product of interest\nOperation of irrigation canals\nThis class excludes :\nOperation of irrigation equipment for agricultural purposes, see 0151;\nTreatment of wastewater in order to prevent pollution, see 3700;\n(Long distance) transport of water via pipelines, see 4940.','3600'),('37000','Sewerage\n','\nThis class includes :\nOperation of sewer systems or sewer treatment facilities\nCollecting and transporting of human or industrial wastewater from one or several users, as well as rain water by means of sewerage networks, collectors, tanks and other means of transport (sewage vehicles, etc.)\nEmptying and cleaning of cesspools and septic tanks, sinks and pits from sewage; servicing of chemicals toilets\nTreatment of wastewater (including human and industrial wastewater, water from swimming pool, etc.) by means of physical, chemical and biological processes like, dilution, screening, filtering, sedimentation etc.\nMaintenance and cleaning of sewers and drains, including sewer rodding','3700'),('38110','Collection of Non-hazardous Waste\n','\nThis class includes :\nCollection of non-hazardous solid waste (i.e. garbage) within a local area, such as collection of waste from households and businesses by means of refuse bins, wheeled bins, containers, etc. may include mixed recoverable materials.\nCollection of recyclable materials\nCollection of used cooking oils and fats\nCollection of refuse in litter-bins in public places\nCollection of construction and demolition waste\nCollection and removal of debris such as brush and rubble\nCollection of waste output of textile mills\nOperation of waste transfer stations for non-hazardous waste\nThis class excludes :\nCollection of hazardous waste, see 3812;\nOperation of landfills for the disposal of non-hazardous waste, see 3821;\nOperation of facilities where commingled recoverable materials such as paper, plastics, etc. are sorted into distinct categories, see 3830','3811'),('38120','Collection of Hazardous Waste\n','\nThis class includes the collection of solid and non-solid hazardous waste, i.e., explosive, oxidizing, flammable, toxic, irritant, carcinogenic, corrosive, infectious and other substances and preparations harmful for human health and environment. It may also entail identification, treatment, packaging and labeling of waste for purposes of transport.\nThis class includes :\nCollection of hazardous waste such as :\nused oil from shipment or garages\nbio hazardous waste\nused batteries\nOperation of waste transfer stations for hazardous waste\nThis class excludes remediation and clean up of contaminated buildings, mine sites, soil, ground water, e.g. asbestos removal, see 3900.','3812'),('38210','Treatment and Disposal of Non-hazardous Waste\n','\nThis class includes the disposal, treatment prior to disposal and other treatment of solid or non-solid non-hazardous waste.\nThis class includes :\nOperation of landfills for the disposal of non-hazardous waste\nDisposal of non-hazardous waste by combustion or incineration or other methods, with or without the resulting production of electricity or steam, substitute fuels, biogas, ashes or other by-products for further use, etc.\nTreatment of organic waste for disposal\nProduction of compost from organic waste\nThis class excludes :\nIncineration and combustion of hazardous waste, see 3822;\nOperation of facilities where commingled recoverable materials such as paper, plastics, used beverage cans and metals, are sorted into distinct categories, see 3830;\nDecontamination, clean up of land, water; toxic material abatement, see 3900.','3821'),('38220','Treatment and Disposal of Hazardous Waste\n','\nThis class includes the disposal and treatment prior to disposal of solid or non-solid hazardous waste, including waste that is explosive, oxidizing, flammable, toxic, irritant, carcinogenic, corrosive or infectious and other substances and preparations harmful for human health and environment.\nThis class includes :\nOperation of facilities for treatment of hazardous waste\nTreatment and disposal of toxic live or dead animals and other contaminated waste\nIncineration of hazardous waste\nDisposal of used goods such as refrigerators to eliminate harmful waste\nTreatment disposal and storage of radioactive nuclear waste including treatment and disposal of transition radio active waste, i.e. decaying within the period of transport, from hospitals; encapsulation, preparation and other treatment of nuclear waste for storage\nThis class excludes :\nIncineration of non-hazardous waste, see 3821;\nDecontamination, clean up of land, water, toxic material abatement, see 3900;\nReprocessing of nuclear fuels, see 2011.','3822'),('38300','Materials Recovery\n','\nThis class includes :\nProcessing of metal and non-metal waste and scrap and other articles into secondary raw materials, usually involving a mechanical or chemical transformation process\nRecovery of materials from waste streams in the form of :\nseparating and sorting recoverable materials from non-hazardous waste streams (i.e. garbage)  \nseparating and sorting of commingled recoverable materials, such as paper, plastics, used beverage cans and metals, into distinct categories.\nThis class excludes the manufacture of new final products from secondary raw materials, as this is covered by corresponding sub-classes in Manufacturing.','3830'),('39000','Remediation Activities and Other Waste Management Services\n','\nThis class includes :\nDecontamination of soils and groundwater at the place of pollution, either in situ or ex situ, using e.g. mechanical, chemicals or biological methods\nDecontamination of industrial plants or sites, including nuclear plants and sites\nDecontamination and cleaning up of surface water following accidental pollution, e.g. through collection of pollutants or through application of chemicals\nCleaning up of oil spills and other pollutions on land, in surface water, in ocean and seas, including coastal areas\nAsbestos, lead paint, and other toxic material abatement\nClearing of landmines and the like (including detonation)\nOther specialized pollution-control activities\nThis class excludes :\nTreatment and disposal of non-hazardous waste, see 3821;\nTreatment and disposal of hazardous waste, see 3822;\nOutdoor sweeping and watering of streets, etc, see 8129.','3900'),('41001','Residential (Dwelling) Building Constructions',NULL,'4100'),('41002','Non-residential Building Constructions',NULL,'4100'),('42100','Construction of Roads and Railways\n','\nThis class includes :\nConstruction of motorways, streets, roads, other vehicular and pedestrian ways\nSurface work on streets, roads, highways, bridges or tunnels :\nasphalt paving of roads\nroad painting and other marking\ninstallation of crash barriers, traffic signs and the like\nConstruction of bridges, including those for elevated highways\nConstruction of tunnels\nConstruction of railways and subways\nConstruction of airfield runways\nThis class excludes :\nInstallation of street lighting and electrical signals, see 4321;\nArchitectural and engineering activities, see 7110;\nProject management activities related to civil engineering works, see 7110.','4210'),('42201','Construction of Telecommunication Lines and Pipelines',NULL,'4220'),('42202','Water Main and Line Construction',NULL,'4220'),('42203','Construction of Gas and Energy Pipelines',NULL,'4220'),('42204','Construction of Electric Power Lines',NULL,'4220'),('42209','Other Construction of Utility Projects, N.e.c.',NULL,'4220'),('42900','Construction of Other Civil Engineering Projects\n','\nThis class includes :\nConstruction of industrial facilities, except buildings, such as: refineries and chemical plants\nConstruction of: waterways, harbor and river works, pleasure ports (marinas), locks, etc.; dams and dikes\nDredging of waterways\nConstruction work, other than buildings, such as: outdoor sports facilities\nLand subdivision with land improvement (e.g. adding of roads, utility infrastructure etc.)\nThis class excludes project management activities related to civil engineering works, see 7110.','4290'),('43110','Demolition\n','This class includes demolition or wrecking of buildings and other structures.','4311'),('43120','Site Preparation\n','\nThis class includes preparation of sites for subsequent construction activities.\nThis class includes :\nClearing of building sites\nEarth moving : excavation, landfill, leveling and grading of construction sites, trench digging, rock removal, blasting, etc.\nDrilling, boring and core sampling for construction, geophysical, geological or similar purposes\nThis class also includes:\nSite preparation for mining : overburden removal and other development and preparation of mineral properties and sites, except oil and gas sites\nBuilding site drainage\nDrainage of agricultural or forestry land\nThis class excludes :\nDrilling of production oil or gas wells, see 0610, 0620;\nTest drilling and test hole boring for mining operations (other than oil and gas extraction), see 0990;\nDecontamination of soil, see 3900;\nWater well drilling, see 4220;\nShaft sinking, see 4390;\nOil and gas field exploration, geophysical, geological and seismic surveying, see 7110.','4312'),('43210','Electrical Installation\n','\nThis class includes the installation in all kinds of buildings and civil engineering structures of electrical systems.\nThis class includes :\nInstallation of:\nelectrical wiring and fittings\ntelecommunications wiring\ncomputer network and cable television wiring, including fiber optic\nsatellite dishes\nlighting systems\nfire alarms\nburglar alarm systems\nstreet lighting and electrical signals\nairport runway lighting\nclosed-circuit television camera wirings\nThis class also includes connecting of electric appliances and household equipment, including baseboard heating.\nThis class excludes :\nConstruction of communications and power transmission lines, see 4220;\nMonitoring or remote monitoring of electronic security alarm systems, such as burglar and fire alarms, including their maintenance, see 8020.','4321'),('43220','Plumbing, Heat and Air-conditioning Installation\n','\nThis class includes the installation of plumbing, heating and air-conditioning systems, including additions, alterations, maintenance and repair.\nThis class includes installation in buildings or other construction projects of :\nheating systems (electric, gas and oil)\nfurnaces, cooling towers\nnon-electric solar energy collectors\nplumbing and sanitary equipment\nventilation, refrigeration or air-conditioning equipment and ducts\ngas fittings\nsteam piping\nfire sprinkler systems\nlawn sprinkler systems\nDuct work installation\nThis class excludes installation of electric baseboard heating, see 4321.','4322'),('43290','Other Construction Installation\n','\nThis class includes the installation of equipment other than electrical, plumbing, heating and air-conditioning systems or industrial machinery in buildings and civil engineering structures, including maintenance and repair.\nThis class includes :\nInstallation in buildings or other construction projects of :\nelevators, escalators\nautomated and revolving doors\nlightning conductors\nvacuum cleaning systems\nthermal, sound or vibration insulation\nThis class excludes installation of industrial machinery, see 3320.','4329'),('43301','Painting and Related Work',NULL,'4330'),('43302','Floor and Wall Tiling or Covering with Other Material',NULL,'4330'),('43303','Carpentry',NULL,'4330'),('43309','Other Building Completion and Finishing Activities',NULL,'4330'),('43900','Other Specialized Construction Activities\n','\nThis class includes :\nConstruction activities specializing in one aspect common to different kind of structures, requiring specialized skill or equipment :\nconstruction of foundations, including pile driving\ndamp proofing and water proofing works\nde-humidification of buildings\nshaft sinking\nerection of non-self - manufactured steel elements\nsteel bending\nbricklaying and stone setting\nroof covering for residential buildings\nscaffolds and work platform erecting and dismantling, excluding renting of scaffolds and work platforms\nerection of chimneys and industrial ovens\nwork with specialist access requirements necessitating climbing skills and the use of related equipment, e.g.; working at height on tall structures\nSubsurface work\nConstruction of outdoor swimming pools\nSteam cleaning, sand blasting and similar activities for building exteriors\nRenting of cranes with operator\nThis class excludes renting of construction machinery and equipment without operator, see 7730.','4390'),('45101'