18','Wholesale of Leather and Leather Goods, Including Man-made Leather, Except Footwear',NULL,'4641'),('46419','Wholesale of Textiles, Clothing and Footwear, N.e.c.',NULL,'4641'),('46421','Wholesale of Medicinal and Pharmaceutical Products',NULL,'4642'),('46422','Wholesale of Surgical and Orthopedic Instruments and Devices',NULL,'4642'),('46423','Wholesale of Photographic and Optical Goods',NULL,'4642'),('46424','Wholesale of Musical Instruments/sporting Goods (Including Bicycles), and Games and Toys',NULL,'4642'),('46425','Wholesale of Paper and Paper Products (Including Stationeries)',NULL,'4642'),('46426','Wholesale of Books, Magazines and Newspapers',NULL,'4642'),('46427','Wholesale of Perfumeries, Cosmetics and Soaps',NULL,'4642'),('46428','Wholesale of Watches, Clocks and Jewelries',NULL,'4642'),('46429','Wholesale of Miscellaneous Consumer Goods, N.e.c.',NULL,'4642'),('46491','Wholesale of Household-type Appliances, Except Radio and Television Equipment, Cd and Dvd Players/recorders',NULL,'4649'),('46492','Wholesale of Household Furniture, Furnishing and Fixtures',NULL,'4649'),('46493','Wholesale of Recorded Audio and Video Tapes, Cds, Dvds',NULL,'4649'),('46494','Wholesale of Chinaware, Glassware, Earthenware, Woodenware, Wickerware, Corkware, Plasticware, Cutlery and Utensils',NULL,'4649'),('46495','Wholesale of Handicraft Products',NULL,'4649'),('46496','Wholesale of Lighting Equipment',NULL,'4649'),('46497','Wholesale of Radio and Television Including Parts and Accessories',NULL,'4649'),('46499','Wholesale of Other Household Goods, N.e.c.',NULL,'4649'),('46510','Wholesale of Computers, Computer Peripheral Equipment and Software\n','\nThis class includes :\nWholesale of computers and computer peripheral equipment\nWholesale of software.\nThis class excludes :\nWholesale of electronic parts, see 4652;\nWholesale of office machinery and equipment, (except computers and peripheral equipment), see 4659;\nWholesale of computer-controlled machinery, see 4659.','4651'),('46521','Wholesale of Electronic Valves and Tubes',NULL,'4652'),('46522','Wholesale of Semi-conductor Devices',NULL,'4652'),('46523','Wholesale Micro-chips and Integrated Circuits',NULL,'4652'),('46524','Wholesale of Printed Circuits',NULL,'4652'),('46525','Wholesale of Telephone and Communications Equipment Including Parts and Accessories',NULL,'4652'),('46526','Wholesale of Blank Audio and Video Tapes and Diskettes, Magnetic and Optical Disks (Cds, Dvds)',NULL,'4652'),('46530','Wholesale of Agricultural Machinery, Equipment and Supplies\n','\nThis class includes :\nWholesale of agricultural machinery and equipment :\nploughs, manure spreaders, seeders\nharvesters\nthreshers\nmilking machines\npoultry-keeping machines, bee-keeping machines\ntractors used in agriculture and forestry\nThis class also includes lawn mowers however operated','4653'),('46591','Wholesale of Commercial Machinery and Equipment',NULL,'4659'),('46592','Wholesale of Industrial Machinery and Equipment',NULL,'4659'),('46593','Wholesale of Office Machinery Equipment Including Office Furniture, Furnishings, Appliances and Vases',NULL,'4659'),('46594','Wholesale of Professional and Scientific and Measuring and Controlling Equipment',NULL,'4659'),('46595','Wholesale of Transport Equipment and Supplies, Except Land Motor Vehicles, Motorcycles and Bicycles',NULL,'4659'),('46599','Wholesale of Other Machinery and Equipment, N.e.c.',NULL,'4659'),('46610','Wholesale of Solid, Liquid and Gaseous Fuels and Related Products\n','\nThis class includes :\nWholesale of automotive fuels, greases, lubricants, oils, such as :\ncharcoal, coal, coke, fuel wood, naphtha\ncrude petroleum, crude oil, diesel fuel, gasoline, fuel oil, heating oil, kerosene\nliquefied petroleum gases, butane and propane gas\nlubricating oils and greases, refined petroleum products','4661'),('46620','Wholesale of Metals and Metal Ores\n','\nThis class includes :\nWholesale of ferrous and non-ferrous metal ores\nWholesale of ferrous and non-ferrous metals in primary forms\nWholesale of ferrous and non-ferrous semi-finished metal products, n.e.c\nWholesale of gold and other precious metals.\nThis class excludes wholesale of metal scrap, see 4669.','4662'),('46631','Wholesale of Lumber and Planing Mill Products, Wood in the Rough',NULL,'4663'),('46632','Wholesale of Cement, Hydraulic',NULL,'4663'),('46633','Wholesale of Masonry Materials, Except Cement',NULL,'4663'),('46634','Wholesale of Flat Glass',NULL,'4663'),('46635','Wholesale of Hardware, Paints, Varnishes and Lacquers, and Plumbing Materials, Including Fittings and Fixtures',NULL,'4663'),('46636','Wholesale of Electrical Materials',NULL,'4663'),('46637','Wholesale of Wallpaper and Floor Coverings',NULL,'4663'),('46639','Wholesale of Construction Materials and Supplies, N.e.c.',NULL,'4663'),('46691','Wholesale of Industrial Chemical Products',NULL,'4669'),('46692','Wholesale of Fertilizers and Agro-chemical Products',NULL,'4669'),('46693','Wholesale of Non-metallic Products Except Cement, Sand and Gravel',NULL,'4669'),('46694','Wholesale of Scrap Metals, Waste and Junk',NULL,'4669'),('46695','Wholesale of Scraps, Except Metal',NULL,'4669'),('46699','Wholesale of Other Waste and Scrap and Other Products, N.e.c.',NULL,'4669'),('46900','Non-specialized Wholesale Trade\n','\nThis class includes wholesale of a variety of goods without any particular specialization','4690'),('47111','Retail Selling in Groceries',NULL,'4711'),('47112','Retail Selling in Supermarkets',NULL,'4711'),('47113','Retail Selling in Sari-sari Stores',NULL,'4711'),('47114','Retail Selling in Convenience Stores',NULL,'4711'),('47115','Retail Selling in Hypermarkets',NULL,'4711'),('47116','Retail Selling of Food Products in Pasalubong Store/center',NULL,'4711'),('47191','Retail Selling in Department Stores',NULL,'4719'),('47199','Retail Selling in Non-specialized Stores, N.e.c.',NULL,'4719'),('47211','Retail Sale of Fruits and Vegetables',NULL,'4721'),('47212','Retail Sale of Eggs and Dairy Products',NULL,'4721'),('47213','Retail Sale of Meat and Poultry Products',NULL,'4721'),('47214','Retail Sale of Bakery Products',NULL,'4721'),('47215','Retail Sale of Fish and Other Seafood (Fresh and Dried)',NULL,'4721'),('47216','Retail Sale of Rice, Corn and Other Cereals',NULL,'4721'),('47219','Retail Sale of Food Products, N.e.c.',NULL,'4721'),('47221','Retail Sale of Alcoholic Beverages (Not Consumed on the Spot)',NULL,'4722'),('47222','Retail Sale of Non-alcoholic Beverages (Not Consumed on the Spot)',NULL,'4722'),('47230','Retail Sale of Tobacco Products in Specialized Stores',NULL,'4723'),('47300','Retail Sale of Automotive Fuel in Specialized Stores\n','\nThis includes the retail sale of fuel for motor vehicles and motorcycles, including lubricating products and cooling products for motor vehicles.\nThis class excludes :\nWholesale of fuels, see 4661;\nRetail sale of fuel in combination with food, beverages, etc., with food and beverage sales dominating, see 4711;\nRetail sale of liquefied petroleum gas for cooking or heating, see 4775.','4730'),('47411','Retail Sale of Computers',NULL,'4741'),('47412','Retail Sale of Computer Peripheral Equipment',NULL,'4741'),('47413','Retail Sale of Computer Software',NULL,'4741'),('47414','Retail Sale of Mobile Phones and Other Handheld Mobile Devices (E.g. Cellular Phones, Smart Phones, Tablets)',NULL,'4741'),('47415','Retail Sale of Parts and Accessories of Cellular Phones and Other Handheld Mobile Devices',NULL,'4741'),('47419','Retail Sale of Other Telecommunications Equipment, N.e.c.',NULL,'4741'),('47421','Retail Sale of Radio and Television, Including Parts and Accessories',NULL,'4742'),('47422','Retail Sale of Audio and Video Equipment',NULL,'4742'),('47423','Retail Sale of Stereo Equipment, Cd and Dvd Players and Equipment',NULL,'4742'),('47429','Retail Sale of Audio and Video Equipment, N.e.c.',NULL,'4742'),('47511','Retail Sale of Textiles, All Kinds',NULL,'4751'),('47512','Retail Sale of Modistesnull Supplies',NULL,'4751'),('47521','Retail Sale of Hardware Materials',NULL,'4752'),('47522','Retail Sale of Glass and Mirror',NULL,'4752'),('47523','Retail Sale of Lumber',NULL,'4752'),('47524','Retail Sale of Construction Materials',NULL,'4752'),('47525','Retail Sale of Masonry Materials',NULL,'4752'),('47526','Retail Sale of Nipa, Bamboo and Rattan',NULL,'4752'),('47527','Retail Sale of Paints, Varnishes and Lacquers',NULL,'4752'),('47529','Retail Sale of Construction Supplies, N.e.c.',NULL,'4752'),('47530','Retail Sale of Carpets, Rugs, Wall and Floor Coverings in Specialized Stores\n','\nThis subclass includes carpets and rugs, curtains and net curtains, wallpaper and floor coverings.\nThis excludes retail sale of cork floor tiles, see 4752.','4753'),('47591','Retail Sale of Home Furnishing, Furniture and Fixtures, Including Lamps and Lamp Shades',NULL,'4759'),('47592','Retail Sale of Chinaware, Glassware, Earthenware and Utensils',NULL,'4759'),('47593','Retail Sale of Household Appliances, Articles and Equipment',NULL,'4759'),('47594','Retail Sale of Musical Instruments and Records, Tapes and Cartridges',NULL,'4759'),('47595','Retail Sale of Handicrafts',NULL,'4759'),('47599','Retail Sale of Electrical Household Appliances, Furniture, Lighting Equipment and Other Household Articles in Specialized Stores, N.e.c.',NULL,'4759'),('47610','Retail Sale of Books, Newspapers and Stationery in Specialized Stores\n','\nThis class includes retail sale of books of all kinds, newspapers and stationery. It also includes retail sale of office supplies such as pens, pencils, paper, etc.\nThis class excludes retail sale of second-hand or antique books, see 4774.','4761'),('47620','Retail Sale of Music and Video Recordings in Specialized Stores\n','\nThis class includes retail sale of musical records, audio tapes, compact discs and cassettes, video tapes and DVDs. This class also includes retail sale of blank tapes and discs.','4762'),('47631','Retail Sale of Sporting Goods and Athletic Supplies',NULL,'4763'),('47632','Retail Sale of Marine Supplies, Including Nets and Gears',NULL,'4763'),('47633','Retail Sale of Camping Goods and Bicycles',NULL,'4763'),('47640','Retail Sale of Games and Toys in Specialized Stores\n','This class includes retail sale of games and toys, made of all materials.\nThis class excludes retail sale of video game consoles; and non-customized software, including video games, see 4741.','4764'),('47711','Retail Sale of Wearing Apparel, Except Footwear',NULL,'4771'),('47712','Retail Sale of Made-up Textile Goods',NULL,'4771'),('47713','Retail Sale of Footwear, All Kinds',NULL,'4771'),('47714','Retail Sale of Leather and Artificial Leather Goods and Travel Accessories, Except Footwear',NULL,'4771'),('47719','Retail Sale of Other Clothing, Footwear and Leather Articles in Specialized Stores, N.e.c.',NULL,'4771'),('47721','Retail Sale of Drugs and Pharmaceutical Goods',NULL,'4772'),('47722','Retail Sale of Medical, Surgical and Orthopedic Goods/instruments and Dental Supplies',NULL,'4772'),('47723','Retail Sale of Perfumery, Cosmetic and Toilet Articles',NULL,'4772'),('47731','Retail Sale of Feeds, Fertilizers and Insecticides',NULL,'4773'),('47732','Retail Sale of Gifts and Novelty Goods',NULL,'4773'),('47733','Retail Sale of Office Machines and Equipment, Excluding Computers and Computer Peripheral Equipment',NULL,'4773'),('47734','Retail Sale of Jewelry, Watches and Clocks',NULL,'4773'),('47735','Retail Sale of Fresh and Artificial Flowers and Plants',NULL,'4773'),('47736','Retail Sale of Beauty Parlor Supplies and Equipment',NULL,'4773'),('47737','Retail Sale of Art Goods, Marble Products, Painting and Artistsnull Supplies',NULL,'4773'),('47738','Retail Sale of Optical Goods and Supplies',NULL,'4773'),('47739','Other Retail Sale of New Goods in Specialized Stores, N.e.c.',NULL,'4773'),('47741','Retail Sale of Second-hand Clothing, Footwear and Leather Articles',NULL,'4774'),('47742','Retail Sale of Books and Other Goods',NULL,'4774'),('47743','Retail Sale of Antiques and Auctioning Houses',NULL,'4774'),('47749','Retail Sale of Second-hand Goods, N.e.c.',NULL,'4774'),('47750','Retail Sale of Liquefied Petroleum Gas and Other Fuel Products',NULL,'4775'),('47761','Retail Sale of Pet',NULL,'4776'),('47762','Retail Sale of Pet Supplies',NULL,'4776'),('47810','Retail Sale Via Stalls and Markets of Food, Beverages and Tobacco Products\n','This class includes retail sale of food, beverages and tobacco products via stalls or markets.\nThis class excludes retail sale of prepared food for immediate consumption (mobile food vendors), see 5610.','4781'),('47820','Retail Sale Via Stalls and Markets of Textiles, Clothing and Footwear',NULL,'4782'),('47891','Retail Sale of Prepaid Cards',NULL,'4789'),('47892','Retail Sale of Internet Card',NULL,'4789'),('47893','Retail Sale of Electronic Load',NULL,'4789'),('47894','Retail Sale of Music and Video Recordings',NULL,'4789'),('47895','Retail Sale of Household Appliances and Consumer Electronics',NULL,'4789'),('47896','Retail Sale of Books',NULL,'4789'),('47897','Retail Sale of Games and Toys',NULL,'4789'),('47898','Retail Sale of Carpets and Rugs',NULL,'4789'),('47899','Other Retail Sale Via Stalls and Markets of Other Goods, N.e.c.',NULL,'4789'),('47911','Retail Sale Via Mail Order',NULL,'4791'),('47912','Retail Sale Via Telephone Order',NULL,'4791'),('47913','Retail Sale Via Internet',NULL,'4791'),('47991','Door-to-door Retailing',NULL,'4799'),('47992','Selling by Vending Machine',NULL,'4799'),('47993','Retail Sale of Health Products, Non-store',NULL,'4799'),('47994','Retail Sale of Water (Including Distribution)',NULL,'4799'),('47999','Other Retail Sale Not in Stores, Stalls or Markets, N.e.c',NULL,'4799'),('49111','Inter-urban Passenger Railway Transport',NULL,'4911'),('49112','Urban and Suburban Passenger Railway Transport',NULL,'4911'),('49120','Freight Rail Transport\n','This class includes freight transport by inter-urban, suburban and urban railways.\nThis class excludes :\nStorage and warehousing, see 5210;\nFreight terminal activities, see 5221;\nCargo handling, see 5224.','4912'),('49201','Inter-urban Bus Line Operation',NULL,'4920'),('49202','Urban and Suburban Bus Line Operation',NULL,'4920'),('49203','Local Bus Line Operation',NULL,'4920'),('49204','Chartered Buses Operation (E.g. Tourist Buses, Renting of Bus)',NULL,'4920'),('49205','Operation of School Buses/shuttle',NULL,'4920'),('49209','Transport Via Buses, N.e.c.',NULL,'4920'),('49310','Urban or Suburban Passenger Land Transport, Except Railway or Bus\n','\nThis class includes :\nLand transport of passengers by urban or suburban transport systems except by buses and railways. This may include different modes of street land transport. The transport is carried out on scheduled routes, on a fixed time schedule at normally fixed stops.\nThis class also includes :\nTown-to-airport or town-to-station lines\nOperation of funicular railways, aerial cableways etc.\nThis class excludes passenger transport by inter-urban railways, see 4911.','4931'),('49321','Jeepney and Uv Express Operation',NULL,'4932'),('49322','Tricycles and Pedicabs Operation',NULL,'4932'),('49323','Public Utility Cars and Taxicabs Operation',NULL,'4932'),('49324','Chartered Cars (Rent-a-car)',NULL,'4932'),('49325','Operations of Vehicles for Transportation Network Service (Ride-sharing Services)',NULL,'4932'),('49326','Public Utility Electric Vehicle (Ev) Operation such as Plug-in Electric Vehicle (Pev), Battery Electric Vehicle (Bev) and Hybrid Electric Vehicle (Hev)',NULL,'4932'),('49329','Other Land Transport Operation, N.e.c.',NULL,'4932'),('49331','Truck-for-hire Operation (With Driver)',NULL,'4933'),('49332','Freight Truck Operation',NULL,'4933'),('49333','Tank Truck Delivery Services',NULL,'4933'),('49339','Freight Transport Operation, by Road, N.e.c.',NULL,'4933'),('49400','Transport Via Pipeline\n','This class includes transport of gases, liquids, water, slurry and other commodities via pipelines. It also includes operation of pump stations.\nThis class excludes distribution of natural or manufactured gas, water or steam, see 3520,3530,3600; transport of water, liquids, etc, by trucks, see 4933.','4940'),('50111','Ocean Passenger Transport',NULL,'5011'),('50112','Interisland Water Passenger Transport',NULL,'5011'),('50113','Renting of Ship with Operator',NULL,'5011'),('50121','Ocean Freight Transport',NULL,'5012'),('50122','Interisland Water Freight Transport',NULL,'5012'),('50123','Towing and Pushing Services on Coastal and Trans-oceanic Waters',NULL,'5012'),('50210','Inland Passenger Water Transport\n','\nThis class includes transport of passenger via rivers, canals, lakes and other inland waterways, including inside harbors and ports. It also includes rental of pleasure boats with crew for inland water transport.','5021'),('50220','Inland Freight Water Transport\n','\nThis class includes transport of freight via rivers, canals, lakes and other inland waterways, including inside harbor and ports.','5022'),('51101','Domestic Air Passenger Transport',NULL,'5110'),('51102','International Air Passenger Transport',NULL,'5110'),('51103','Non-scheduled Air Passenger Transport',NULL,'5110'),('51201','Domestic Air-freight Transport',NULL,'5120'),('51202','International Air Freight Transport',NULL,'5120'),('51203','Non-scheduled Air Freight Transport',NULL,'5120'),('52101','General Bonded Warehouses Except Grain Warehouse',NULL,'5210'),('52102','Grain Warehouses',NULL,'5210'),('52103','Customs Bonded Warehouses',NULL,'5210'),('52104','Cold Storage',NULL,'5210'),('52109','Storage and Warehousing, N.e.c.',NULL,'5210'),('52211','Freight Terminal Facilities for Trucking Companies',NULL,'5221'),('52212','Operation of Parking Lots',NULL,'5221'),('52213','Operation of Toll Roads and Bridges',NULL,'5221'),('52219','Other Supporting Land Transport Activities, Including Towing Services and Truck Weighing Services, N.e.c.',NULL,'5221'),('52220','Service Activities Incidental to Water Transportation\n','\nThis class includes :\nActivities related to water transport of passengers, animals or freight :\noperation of terminal facilities such as harbors and piers\noperation of waterway locks, etc\nnavigation, pilotage and berthing activities\nlighterage, salvage activities\nlighthouse activities\nThis class excludes :\nCargo handling, see 5224;\nOperation of marinas, see 9329.','5222'),('52230','Service Activities Incidental to Air Transportation\n','\nThis class includes :\nActivities related to air transport of passengers, animals or freight:\noperation of terminal facilities such as airway terminals, etc.\nairport and air-traffic-control activities\nground service activities on airfields, etc.\nThis class also includes firefighting and fire-prevention services at airports.\nThis class excludes :\nCargo handling, see 5224;\nOperation of flying schools, see 8559.','5223'),('52241','Containerized Cargo Handling, Auxiliary Activity to Land Transport',NULL,'5224'),('52242','Non- Containerized Cargo Handling, Auxiliary Activity to Land Transport',NULL,'5224'),('52243','Cargo Handling, Auxiliary Activity to Water Transport',NULL,'5224'),('52244','Cargo Handling, Auxiliary Activity to Air Transport',NULL,'5224'),('52291','Freight Forwarding Services',NULL,'5229'),('52292','Customs Brokerage (Ship and Aircraft)',NULL,'5229'),('52293','Logistics Services',NULL,'5229'),('52299','Activities of Other Transport Agencies, N.e.c.',NULL,'5229'),('53100','Postal Activities\n','\nThis class includes :\nPickup, sorting, transport and delivery (domestic or international) of letter-post and (mail-type) parcels and packages by postal services operating under a universal service obligation. One or more modes of transport may be involved and the activity may be carried out with either self-owned (private) transport or via public transport.\nCollection of letter-mail and parcels from public letter-boxes or from post offices\nDistribution and delivery of mail and parcels\nThis class excludes postal giro, postal savings activities and money order activities, see 6419.','5310'),('53201','Private Postal Service',NULL,'5320'),('53202','Messenger Service',NULL,'5320'),('53203','Delivery of Food',NULL,'5320'),('53209','Other Courier Activities, N.e.c.',NULL,'5320'),('55101','Hotels',NULL,'5510'),('55102','Resort Hotels',NULL,'5510'),('55103','Condotels',NULL,'5510'),('55104','Pension Houses',NULL,'5510'),('55105','Camping Sites/facilities',NULL,'5510'),('55106','Motels',NULL,'5510'),('55107','Tourist Inn',NULL,'5510'),('55109','Other Short Term Accommodation Activities, N.e.c',NULL,'5510'),('55901','Dormitories/boarding Houses',NULL,'5590'),('55909','Other Accommodation, N.e.c.',NULL,'5590'),('56101','Restaurants (Full-service)',NULL,'5610'),('56102','Fast-food Restaurants/ Quick Service Restaurant',NULL,'5610'),('56103','Cafeterias',NULL,'5610'),('56104','Refreshment Stands, Kiosks and Counters',NULL,'5610'),('56105','Mobile Food Services E.g., Truck, Van and Other Motorized Vehicles and Non-motorized Carts',NULL,'5610'),('56106','Buffet and Eat-all-you-can Restaurants',NULL,'5610'),('56107','Carinderia or Eatery',NULL,'5610'),('56108','Food-to-go Counter (E.g., Fried/lechon/grilled Chicken, Pork, Beef or Fish and Other Related Products)',NULL,'5610'),('56109','Other Restaurants and Mobile Food Service Activities, N.e.c.',NULL,'5610'),('56210','Event Catering\n','\nThis class includes the provision of food services based on contractual arrangements with the customer, at the location specified by the customer, for a specific event.\nThis class excludes manufacture of perishable food items for resale, see 1079; retail sale of perishable food items, see division 47.','5621'),('56290','Other Food Service Activities\n','\nThis class includes industrial catering, i.e., the provision of food services based on contractual arrangements with the customer, for a specific period of time.\nAlso included is the operation of food concessions at sports and similar facilities. The food is often prepared in a central unit.\nThis class includes :\nActivities of food service contractors (e.g. for transportation companies)\nOperation of food concessions at sports and similar facilities\nOperation of canteens or cafeterias (e.g. for factories, offices, hospitals or schools) on a concession basis\nThis class excludes :\nManufacture of perishable food items for resale, see 1079;\nRetail sale of perishable food items, see division 47.','5629'),('56301','Night Clubs',NULL,'5630'),('56302','Bars and Cocktail Lounges',NULL,'5630'),('56303','Caf or Coffee Shops',NULL,'5630'),('56304','Tea Shops',NULL,'5630'),('56309','Other Beverage Serving Activities, N.e.c.',NULL,'5630'),('58110','Book Publishing\n','\nThis class includes the activities of publishing books in print, electronic (CD, electronic displays, etc.) or audio form or on the Internet.\nThis class includes :\nPublishing of books, brochures, leaflets and similar publications, including publishing of dictionaries and encyclopedia\nPublishing of atlases, maps and charts\nPublishing of audio books\nPublishing of encyclopedias, etc. on CD-ROM\nThis class excludes :\nProduction of globes, see 329;\nPublishing of advertising material, see 5819;\nPublishing of music and sheet books, see 5920;\nActivities of independent authors, see 9000.','5811'),('58120','Publishing of Directories and Mailing Lists\n','\nThis class includes the publishing of lists of facts/information (databases), that are protected in their form, but not in their content. These lists can be published in printed or electronic form.\nThis class includes :\nPublishing of mailing lists\nPublishing of telephone books\nPublishing of other directories and compilations, such as case law, pharmaceutical compendia, etc.','5812'),('58130','Publishing of Newspapers, Journals and Periodicals\n','\nThis class includes the activities of publishing newspapers, including advertising newspapers as well as periodicals and other journals. This information can be published in print or electronic form, including on the Internet. Publishing of radio and television schedules is included here.','5813'),('58190','Other Publishing Activities\n','\nThis class includes:\nPublishing (including on-line) of :\ncatalogs\nphotos, engravings and postcards\ngreeting cards\nforms\nposters, reproduction of works of art\nadvertising material\nother printed matter\nThis class also includes on-line publishing of statistics or other information.\nThis class excludes :\nRetail sale of software, see 4741;\nPublishing of advertising newspapers, see 5813;\nOn-line provision of software (application hosting and application service provisioning), see 6311.','5819'),('58200','Software Publishing\n','\nThis class includes :\nPublishing of ready-made (non-customized) software :\noperating systems\nbusiness and other applications\ncomputer games for all platforms\nThis class excludes :\nReproduction of software, see 1820;\nRetail sale of non-customized software, see 4741;\nProduction of software not associated with publishing, see 6201;\nOn-line provision of software (application hosting and application software provisioning), see 6311.','5820'),('59111','Complete Production of Motion Picture, Video and Television Programme Activities',NULL,'5911'),('59112','Pre and Main Production of Traditional and 2d Animation',NULL,'5911'),('59113','Pre and Main Production of 3d Animation',NULL,'5911'),('59119','Pre and Main Production of Other Motion Films and Etc.',NULL,'5911'),('59121','Post Production of Traditional and 2d Animation',NULL,'5912'),('59122','Post Production of 3d Animation',NULL,'5912'),('59129','Post Production of Other Motion Films and Etc.',NULL,'5912'),('59130','Motion Picture, Video and Television Programme Distribution Activities\n','\nThis class includes distributing film, video tapes, DVDs and similar productions to motion picture theatres, television networks and stations and exhibitors.\nThis class also includes acquiring film, video tape and DVD distribution rights.\nThis class excludes :\nFilm duplicating (except reproduction of motion picture film for theatrical distribution ) as well as reproduction of audio and video tapes, CDs or DVDs from master copies, see 1820;\nReproduction of motion picture film for theatrical distribution, see 5912.','5913'),('59140','Motion Picture Projection Activities\n','\nThis class includes the motion picture or video tape projection in cinemas, in the open air or in other projection facilities.','5914'),('59201','Sound Recording Activities',NULL,'5920'),('59202','Publishing of Music',NULL,'5920'),('60101','Radio Broadcasting and Relay Station and Studios',NULL,'6010'),('60102','Radio Program Production',NULL,'6010'),('60103','Radio Broadcasting Activities Over the Internet (Internet Radio Stations)',NULL,'6010'),('60201','Television Broadcasting and Relay Stations and Studios Including Closed Circuit Television Services',NULL,'6020'),('60202','Television Program Production',NULL,'6020'),('60203','Television Broadcasting Activities Over the Internet (Internet Television Stations)',NULL,'6020'),('61101','Wired (Landline) Services',NULL,'6110'),('61102','Wired Internet Access Service Activities (E.g. Dsl, Leased Line, Dial-up)',NULL,'6110'),('61103','Telegraph, Facsimile/telefax, and Telex Services',NULL,'6110'),('61109','Other Wired Telecommunications Activities',NULL,'6110'),('61201','Wireless Landline Services',NULL,'6120'),('61202','Mobile Telecommunications Services',NULL,'6120'),('61203','Wireless Internet Access Services (E.g. Internet Service Provider, Broadband)',NULL,'6120'),('61209','Other Wireless Telecommunication Services, N.e.c.\n','\nThis class excludes telecommunications resellers, see 6190.','6120'),('61300','Satellite Telecommunications Activities\n','\nThis class includes :\nOperating, maintaining or providing access to facilities for the transmission of voice, data, text, sound and video using a satellite telecommunications infrastructure\nDelivery of visual, aural or textual programming received from cable networks, local television stations, or radio networks to consumers via direct-to-home satellite systems. ( The units classified here do not generally originate programming material)\nThis class also includes provision of Internet access by the operator of the satellite infrastructure\nThis class excludes telecommunications resellers, see 6190.','6130'),('61901','Telephone Access in Facilities Open to the Public Service Activities',NULL,'6190'),('61902','Internet Access in Facilities Open to the Public Service Activities',NULL,'6190'),('61903','Voice Over Internet Protocol (Voip) Service Activities',NULL,'6190'),('61909','Other Telecommunications Service Activities, N.e.c.',NULL,'6190'),('62011','Game Design and Development',NULL,'6201'),('62019','Other Computer Programming Activities',NULL,'6201'),('62020','Computer Consultancy and Computer Facilities Management Activities\n','\nThis class includes the planning and designing of computer systems that integrate computer hardware, software and communication technologies.\nThe units classified in this class may provide the hardware and software components of the system as part of their integrated services or these components may be provided by third parties or vendors. The units classified in this class often install the system and train and support the users of the system.\nThis class also includes the provision of on-site management and operation of clientsNULL computer systems and/or data processing facilities, as well as related support services.\nThis class excludes :\nSeparate sale of computer hardware or software, see 4651,4741.\nSeparate installation of mainframe and similar computers, see 3320.\nSeparate installation (setting-up) of personal computers, see 6209.\nSeparate software installation, see 6209.','6202'),('62090','Other Information Technology and Computer Service Activities\n','\nThis class includes other information and computer related activities not elsewhere classified, such as :\ncomputer disaster recovery\ninstallation (setting-up) of personal computers\nsoftware installation\nThis class excludes :\nInstallation of mainframe and similar computers, see 3320;\nComputer programming, see 6201;\nComputer consultancy, see 6202;\nComputer facilities management, see 6202;\nData processing and hosting, see 6311.','6209'),('63111','Data Processing',NULL,'6311'),('63112','Website Hosting Services',NULL,'6311'),('63113','Application Hosting Services',NULL,'6311'),('63120','Web Portals\n','\nThis class includes :\nOperation of web sites that use a search engine to generate and maintain extensive databases of Internet addresses and content in an easily searchable format\nOperation of other web sites that act as portals to the Internet, such as media sites providing periodically updated content','6312'),('63910','News Agency Activities\n','\nThis class includes news syndicate and news agency activities furnishing news, pictures and features to the media.\nThis class excludes activities of independent photo journalists, see 7420; activities of independent journalists, see 9000.','6391'),('63990','Other Information Service Activities, N.e.c.\n','\nThis class includes other information service activities not elsewhere classified such as :\ntelephone base information services\ninformation search services on a contract or fee basis\nnews clipping services, press clipping services, etc.\nThis class excludes activities of call centers, see 8221.','6399'),('64110','Central Banking\n','\nThis class includes :\nIssuing and managing the countryNULLs currency\nMonitoring and control of the money supply\nTaking deposits that are used for clearance between financial institutions\nSupervising banking operations\nHolding the countryNULLs international reserves\nActing as banker to the government\nThe activities of central banks will vary for institutional reasons.','6411'),('64191','Universal Banking',NULL,'6419'),('64192','Commercial Banking',NULL,'6419'),('64193','Thrift Banking',NULL,'6419'),('64194','Private Development Banking',NULL,'6419'),('64195','Stock Savings and Loan Activities',NULL,'6419'),('64196','Rural Banking',NULL,'6419'),('64197','Cooperative Banking',NULL,'6419'),('64198','Specialized Government Banking',NULL,'6419'),('64199','Other Monetary Intermediation I.e., Islamic Banking, N.e.c.',NULL,'6419'),('64200','Activities of Holding Companies\n','\nThis class includes the activities of holding companies, i.e. units that hold the assets (owning, controlling-levels of equity) of a group of subsidiary corporations and whose principal activity is owning the group. The holding companies in this class do not provide any other service to the businesses in which the equity is held, i.e. they do not administer or manage other units.\nThis class excludes active management of companies and enterprises, strategic planning and decision making of the company, see 7010.','6420'),('64301','Investment Company Operation',NULL,'6430'),('64302','Investment House Operation',NULL,'6430'),('64303','Securities Dealership, Own Account',NULL,'6430'),('64304','Trust Corporation Operation',NULL,'6430'),('64305','Mutual Fund Company Operation',NULL,'6430'),('64910','Financial Leasing\n','\nThis refers to the business of extending credit through a non-cancelable lease contract under which the lessor purchases or acquires, at the instance of the lessee, machinery, equipment, motor vehicles, appliances, business and office machines, and other movable or immovable property in consideration of the periodic payment by the lessee of a fixed amount of money sufficient to amortize at least seventy percent (70%) of the purchase price or acquisition cost, including any incidental expenses and a margin of profit over an obligatory period of not less than two (2) years during which the lessee has the right to hold and use the leased property with the right to expense the lease rentals paid to the lessor and bears the cost of repairs, maintenance, insurance and preservation thereof, but with no obligation or option on his part to purchase the leased property from the owner-lessor at the end of the lease contract.\nThis class excludes operational leasing, see division 77, according to type of goods leased.','6491'),('64921','Credit Card Activities',NULL,'6492'),('64922','Lending Company Operation',NULL,'6492'),('64923','Financing Company Operations',NULL,'6492'),('64924','Venture Capital Corporation Operation',NULL,'6492'),('64925','Credit Granting Entity Operation',NULL,'6492'),('64929','Other Credit Granting, N.e.c',NULL,'6492'),('64930','Pawnshop Operations\n','\nThis group refers to the business of lending money on personal property physically delivered to the control and possession of the pawnshop operator as loan collateral. Allowable corollary activities of those engaged in pawnshop operations shall include money changing and/or performing as remittance agent, as may be registered with the Bangko Sentral ng Pilipinas.\nThis category covers pawnshop with single activity and those whose primary activity is lending money on personal property.\nPawnshops may also engage in other business activities such as acting as bills payment agent for utility companies and other entities, ticketing agent for airline companies, and other similar business activities provided that the appropriate department of the BSP shall be notified within five (5) working days from the date of actual engagement of the pawnshop in such business activity.','6493'),('64991','Mutual Building and Loan Association Operation',NULL,'6499'),('64992','Non-stock Savings and Loan Association Operation',NULL,'6499'),('64993','Credit Cooperative Activities',NULL,'6499'),('64994','Mutual Benefit Association Operation',NULL,'6499'),('64995','Foreign Exchange Dealing/ Money Changing (Money Service Businesses (Msbs))',NULL,'6499'),('64996','Remittance and Transfer Operations (Msbs)',NULL,'6499'),('64997','Other Msbs, I.e., Virtual Currency Exchange Dealing',NULL,'6499'),('64999','Non-bank Thrift Institution Operations, N.e.c.',NULL,'6499'),('65110','Life Insurance\n','\nThis class includes :\nUnderwriting annuities and life insurance policies, disability income insurance policies, and accidental death and dismemberment insurance policies (with or without a substantial savings element)','6511'),('65120','Non-life Insurance\n','\nThis class includes :\nProvision of insurance services other than life insurance: accident and fire insurance, health insurance, travel insurance, property insurance, motor, marine, aviation and transport insurance and pecuniary loss and liability insurance.','6512'),('65201','Reinsurance for Life Insurance',NULL,'6520'),('65202','Reinsurance for Non-life Insurance',NULL,'6520'),('65300','Pension Funding\n','\nThis class includes legal entities (i.e. funds, plans and/or programs) organized to provide retirement income benefits exclusively for the sponsorNULLs employees or members. This includes pension plans with defined benefits, as well as individual plans where benefits are simply defined through the memberNULLs contribution.\nThis class includes :\nEmployee benefit plans\nPension funds\nRetirement plans\nThis class excludes :\nManagement of pension funds, see 6630;\nCompulsory social security schemes, see 8430.','6530'),('66110','Administration of Financial Markets\n','\nThis class includes the operation and supervision of financial markets other than by public authorities, such as :\nCommodity contracts exchanges\nFutures commodity contracts exchanges\nSecurities exchanges\nStock exchanges and stock or commodity options exchanges.','6611'),('66120','Security and Commodity Contracts Brokerage\n','\nThis class includes :\nDealing in financial markets on behalf of others (e.g. stock broking) and related activities;\nSecurities brokerage\nCommodity contracts brokerage\nActivities of bureaux de change etc.\nThis class excludes :\nDealing in markets on own account, see 6499;\nPortfolio management, on a fee or contract basis, see 6630.','6612'),('66190','Other Activities Auxiliary to Financial Service Activities\n','\nThis class includes activities auxiliary to financial service activities not elsewhere classified, such as :\nfinancial transaction processing and settlement activities, including for credit card transactions\ninvestment advisory services\nactivities of mortgage advisers and brokers\nThis class also includes trustee, fiduciary and custody services on a fee or contract basis.\nThis class excludes :\nActivities of insurance agents and brokers, see 6622;\nManagement of funds, see 6630.','6619'),('66210','Risk and Damage Evaluation\n','\nThis includes the provision of administration services of insurance, such as assessing and settling insurance claims.\nThis class includes :\nAssessing insurance claims: claims adjusting, risk assessing, risk and damage evaluation and average and loss adjusting.\nSettling insurance claims\nThis class excludes :\nAppraisal of real estate, see 6820;\nAppraisal for other purposes, see 7490;\nInvestigation activities, see 8030.','6621'),('66220','Activities of Insurance Agents and Brokers\n','\nThis class includes the activities of insurance agents and brokers (insurance intermediaries) in selling, negotiating or soliciting of annuities and insurance and reinsurance policies.','6622'),('66231','Pre-need Plan for Health',NULL,'6623'),('66232','Pre-need Plan for Education',NULL,'6623'),('66233','Pre-need Plan for Memorial and Interment',NULL,'6623'),('66234','Pre-need Plan for Pension',NULL,'6623'),('66239','Pre-need Plan Activities, N.e.c.',NULL,'6623'),('66290','Other Activities Auxiliary to Insurance and Pension Funding\n','\nThis class includes :\nActivities involved in or closely related to insurance and pension funding (except financial intermediation, claims adjusting and activities of insurance agents) :\nsalvage administration\nactuarial services\nThis class excludes marine salvage activities, see 5222.','6629'),('66300','Fund Management Activities\n','\nThis class includes portfolio and fund management activities on a fee or contract basis, for individuals, businesses and others.\nThis class includes :\nManagement of mutual funds\nManagement of other investment funds\nManagement of pension funds','6630'),('68110','Real Estate Buying, Selling, Renting, Leasing and Operating of Self-owned/leased Apartment Buildings, Non-residential and Dwellings',NULL,'6811'),('68120','Real Estate Buying, Developing, Subdividing and Selling, of Residential Including Mass Housing',NULL,'6812'),('68131','Cemetery Development, Selling, Renting, Leasing and Operating of Self-owned Cemetery',NULL,'6813'),('68132','Columbarium Development, Selling, Renting, Leasing and Operating of Self-owned Columbarium (Including Burial Crypt)',NULL,'6813'),('68140','Renting or Leasing Services of Residential Properties',NULL,'6814'),('68190','Other Real Estate Activities with Own or Leased Property',NULL,'6819'),('68200','Real Estate Activities on a Fee or Contract Basis\n','\nThis class includes the provision of real estate activities on a fee or contract basis including real estate related services.\nThis class includes :\nActivities or real estate agents and brokers\nIntermediation in buying, selling and renting of real estate on a fee or contract basis\nManagement of real estate on a fee or contract basis\nAppraisal services for real estate\nActivities of real estate escrow agents\nThis class excludes :\nLegal activities, see 6910;\nFacilities support services, see 8110;\nManagement of facilities, such as military bases, prisons, and other facilities (except computer facilities management), see 8110.','6820'),('69100','Legal Activities\n','\nThis class includes :\nLegal representation of one partyNULLs interest against another party, whether or not before courts or other judicial bodies by, or under supervision of, persons who are members of the bar :\nadvice and representation in civil cases\nadvice and representation in criminal cases\nadvice and representation in connection with labor disputes\nGeneral counseling and advising, preparation of legal documents :\narticles of incorporation, partnership agreements or similar documents in connection with company formation\npatents and copyrights\npreparation of deeds, wills, trusts, etc.\nOther activities of notaries public, civil law notaries, bailiffs, arbitrators, examiners and referees.\nThis class excludes law court activities, see 8423.','6910'),('69200','Accounting, Bookkeeping and Auditing Activities; Tax Consultancy\n','\nThis class includes :\nRecording of commercial transactions from businesses or others\nPreparation or auditing of financial accounts\nExamination of accounts and certification of their accuracy\nPreparation of personal and business income tax returns\nAdvisory activities and representation on behalf of clients before tax authorities\nThis class excludes :\nData processing and tabulation activities, see 6311;\nManagement consultancy activities, such as design of accounting systems, cost accounting programs, budgetary control procedures, see 7020;\nBill collection, see 8291.','6920'),('70100','Activities of Head Offices\n','\nThis class includes the overseeing and managing of other units of the company or enterprise; undertaking the strategic or organizational planning and decision making role of the company or enterprise. Units in this class exercise operational control and manage the day-to-day operations of their related units.\nThis class also includes activities of head offices, centralized administrative offices, corporate offices, district, regional offices/operating headquarters, subsidiary management offices.\nThis class excludes activities of holding companies, not engaged in managing, see 6420.','7010'),('70200','Management Consultancy Activities\n','\nThis class includes the provision of advice, guidance and operational assistance to businesses and other organizations on management issues, such as strategic and organizational planning; decision areas that are financial in nature; marketing objectives and policies; human resource policies, practices and planning; production scheduling and control planning.\nThis provision of business services may include advice, guidance or operational assistance to businesses and the public service regarding :\npublic relations and communication\nlobbying activities\ndesign of accounting methods or procedures, cost accounting programs, budgetary control procedures\nadvice and help to business and public services in planning, organization, efficiency and control, management information etc.\nThis class excludes :\nDesign of computer software for accounting systems, see 6201;\nLegal advice and representation, see 6910;\nAccounting, bookkeeping and auditing activities, tax consulting, see 6920;\nArchitectural, engineering and other technical advisory activities, see 7110, 7490;\nAdvertising activities, see 7310;\nMarket research and public opinion polling, see 7320;\nExecutive placement or search consulting services, see 7810;\nEducational consulting activities, see 8560.','7020'),('71101','Environmental Engineering Activities',NULL,'7110'),('71102','Architectural and Other Engineering Activities',NULL,'7110'),('71103','Land Surveying Services',NULL,'7110'),('71109','Other Technical Activities Related to Architectural and Engineering',NULL,'7110'),('71200','Technical Testing and Analysis\n','\nThis class includes the performance of physical, chemical and other analytical testing of all types of materials and products, including :\nacoustics and vibration testing\ntesting of composition and purity of minerals etc.\ntesting activities in the field of food hygiene, including veterinary testing and control in relation to food production\ntesting of physical characteristics and performance of materials, such as strength, thickness, durability, radioactivity, etc.\nqualification and reliability testing\nperformance testing of complete machinery: motors, automobiles, electronic equipment, etc.\nradiographic testing of welds and joints\nfailure analysis\ntesting and measuring of environmental indicators: air and water pollution, etc.\nCertification of products, including consumer goods, motor vehicles, aircraft, pressurized containers, nuclear plants, etc.\nPeriodic road-safety testing of motor vehicles\nTesting with use of models or mock-ups (e.g. of aircraft, ships, dams, etc)\nOperation of police laboratories\nThis class excludes :\nTesting of animal specimens, see 7500;\nMedical laboratory testing, see 8690.','7120'),('72101','Research and Experimental Development in Natural Sciences',NULL,'7210'),('72102','Research and Experimental Development in Engineering and Technology',NULL,'7210'),('72103','Research and Experimental Development in Health Sciences',NULL,'7210'),('72104','Research and Experimental Development in Agricultural Sciences',NULL,'7210'),('72200','Research and Experimental Development on Social Sciences and Humanities\n','\nThis class includes :\nResearch and development on social sciences\nResearch and development on humanities\nInterdisciplinary research and development, predominantly on social sciences and humanities\nThis class excludes market research, see 7320.','7220'),('72300','Research and Experimental Development in Information Technology\n','\nThis subclass includes Research and Development (R & D) in :\nHuman interface technologies, which are largely graphical in structure, facilitate communication between computer systems and their users; communication technologies which comprise the information infrastructure for improving computer-to-computer communication.\nSystems support technologies which include development of software programmed to carry out specific tasks in a system.','7230'),('73101','Advertising Agency, Except Billboard and Outdoor Advertising',NULL,'7310'),('73102','Billboard and Outdoor Advertising Services',NULL,'7310'),('73103','Media Representation',NULL,'7310'),('73104','Commercial Art Services',NULL,'7310'),('73109','Advertising Services, N.e.c.',NULL,'7310'),('73200','Market Research and Public Opinion Polling\n','\nThis subclass includes :\nInvestigation into market potential, acceptance and familiarity of products and buying habits of consumers for the purpose of sales promotion and development of new products, including statistical analyses of the results.\nInvestigation into collective opinions of the public about political, economic and social issues and statistical analysis thereof.','7320'),('74101','Fashion Design',NULL,'7410'),('74102','Interior Decoration Services Other Than Those in Class 4330',NULL,'7410'),('74201','Digital Photograph Processing',NULL,'7420'),('74202','Commercial and Consumer Photograph Production (Except Aerial Photography)',NULL,'7420'),('74203','Photograph and Motion Pictures Processing (Not Related to Motion Pictures and Tv Industries)',NULL,'7420'),('74204','Film Developing and Printing and Photograph Enlarging',NULL,'7420'),('74205','Aerial Photography',NULL,'7420'),('74206','Microfilming Activities',NULL,'7420'),('74207','Underwater Photography',NULL,'7420'),('74209','Photographic Activities, N.e.c.',NULL,'7420'),('74901','Business Brokerage Activities',NULL,'7490'),('74902','Weather Forecasting and Meteorological Services',NULL,'7490'),('74903','Translation and Interpretation Services',NULL,'7490'),('74904','Environmental Consulting Services',NULL,'7490'),('74905','Statistical and Data Analytics Consulting Services',NULL,'7490'),('74906','Food Safety Consulting Services',NULL,'7490'),('74907','Halal Consulting Services',NULL,'7490'),('74909','Other Professional, Scientific and Technical Activities, N.e.c.',NULL,'7490'),('75000','Veterinary Activities\n','\nThis class includes animal health care and control activities for farm and pet animals.\nThis activities are carried out by qualified veterinarians when working in veterinary hospitals as well as when visiting farms, kennels or homes, in own consulting and surgery rooms or elsewhere.\nThis class also includes :\nActivities of veterinary assistants or other auxiliary veterinary personnel\nClinico-pathological and other diagnostic activities pertaining to animals\nAnimal ambulance activities\nThis class excludes :\nFarm animal boarding activities without health care, see 0156;\nSheep shearing, see 0156;\nHerd testing services, droving services, agistment services, poultry caponizing, see 0156;\nActivities related to artificial insemination, see 0156;\nPet animal boarding activities without health care, see 9690.','7500'),('77100','Renting and Leasing of Motor Vehicles (Except Motorcycle, Caravans, Campers)\n','\nThis class includes :\nRenting and operational leasing of the following types of vehicles:\npassenger cars (without drivers)\ntrucks, utility trailers and recreational vehicles\nThis class excludes :\nRenting or leasing of vehicles or trucks with driver, see 4932, 4933;\nFinancial leasing, see 6491;\nRenting and operational leasing of land-transport equipment (other than motor vehicles) without drivers, see 773.','7710'),('77210','Renting and Leasing of Recreational and Sports Goods\n','\nThis class includes renting of recreational and sports equipment :\npleasure boats, canoes, sailboats\nbicycles\nbeach chairs and umbrellas\nother sports equipment\nThis class excludes :\nRenting of video tapes and disks, see 7722;\nRenting of other personal and household goods n.e.c., see 7729;\nRenting of leisure and pleasure equipment as an integral part of recreational facilities, see 9329.','7721'),('77220','Renting of Video Tapes and Disks\n','\nThis class includes the renting of videotapes, record, CDNULLs DVDNULLs, etc.','7722'),('77291','Renting of Wearing Apparel',NULL,'7729'),('77292','Renting of Furniture',NULL,'7729'),('77293','Renting of Books, Journals and Magazines',NULL,'7729'),('77294','Renting of Ornamental Plants',NULL,'7729'),('77295','Renting of Electrical Appliances',NULL,'7729'),('77296','Renting of Audio-video Machines',NULL,'7729'),('77299','Renting of Personal and Household Goods, N.e.c.',NULL,'7729'),('77301','Renting of Land Transport Equipment',NULL,'7730'),('77302','Renting of Water Transport Equipment',NULL,'7730'),('77303','Renting of Air Transport Equipment',NULL,'7730'),('77304','Renting of Agricultural Machinery and Equipment',NULL,'7730'),('77305','Renting of Construction and Civil Engineering Machinery and Equipment',NULL,'7730'),('77306','Renting of Computers and Computer Peripherals Equipment',NULL,'7730'),('77307','Renting of Office Machinery and Equipment (Excluding Computers)',NULL,'7730'),('77309','Renting and Leasing of Other Machinery, Equipment and Tangible Goods, N.e.c.',NULL,'7730'),('77400','Leasing of Intellectual Property and Similar Products, Except Copyrighted Works\n','\nThis class includes the activities of allowing others to use of intellectual property products and similar products for which a royalty payment or licensing fee is paid to the owner of the product (i.e. the asset holder). The leasing of these product can take various forms, such as permission for reproduction, use in subsequent processes or products, operating businesses under a franchise etc. The current owners may or may not have created these products.\nThis class includes :\nLeasing of intellectual property products (except copyrighted works, such as books or software)\nReceiving royalties or licensing fee for the use of :\npatented entities\ntrademarks or service marks\nbrand names\nmineral exploration and evaluation\nfranchise agreements\nThis class excludes :\nAcquisition of rights and publishing, see divisions 58, 59;\nProducing, reproducing and distributing copyrighted works (books, software, film), see division 58, 59;\nLeasing of real estate, see group 681;\nLeasing of tangible products (assets), see groups 771, 772, 773;\nRenting of video tapes and disks, see 7722;\nRenting of books, see 7729.','7740'),('78101','Labor Recruitment and Provision of Personnel, Local',NULL,'7810'),('78102','Labor Recruitment and Provision of Personnel, Overseas',NULL,'7810'),('78103','On-line Employment Placement Agencies',NULL,'7810'),('78104','Casting Agencies Activities',NULL,'7810'),('78109','Other Activities of Employment Placement Agencies, N.e.c.',NULL,'7810'),('78201','Temporary Labor Recruitment and Provision of Personnel, Local',NULL,'7820'),('78202','Temporary Labor Recruitment and Provision of Personnel, Overseas',NULL,'7820'),('78300','Other Human Resources Provision\n','\nThis class includes provision of human resources for client businesses.\nThis provision of human resources is typically done on a long-term or permanent basis and the units classified here may perform a wide range of human resource and personnel management duties associated with this provision.\nThe units classified here represent the employer of record for the employees on matters relating to payroll, taxes, and other fiscal and human resource issues, but they are not responsible for direction and supervision of employees.\nThis class excludes :\nProvision of human resources functions together with supervision or running of the business, see the class in the respective economic activity of that business;\nProvision of human resources to temporarily replace or supplement the workforce of the client, see 7820.','7830'),('79110','Travel Agency Activities\n','\nThis class includes the activities of agencies primarily engaged in selling travel, tour, transportation and accommodation services to the general public and commercial clients.','7911'),('79120','Tour Operator Activities\n','\nThis class includes :\nArranging and assembling tours that are sold through travel agencies or directly by tour operators. The tours may include any or all of the following :\ntransportation\naccommodation\nfood\nvisits to museums, historical or cultural sites, theatrical, musical or sporting events','7912'),('79901','Activities of Booking Offices',NULL,'7990'),('79902','Accommodation Reservation Activities',NULL,'7990'),('79903','Transportation Reservation Activities',NULL,'7990'),('79904','Package Tour Reservation Activities',NULL,'7990'),('79905','Tourist Assistance Activities (E.g. Tourist Guides)',NULL,'7990'),('79906','Tickets Sales/booking, for Theatrical, Entertainment and Recreational Reservation Activities',NULL,'7990'),('79907','Visitor Information Activities',NULL,'7990'),('79908','Activities of Transportation Network Service',NULL,'7990'),('79909','Other Reservation Service and Related Activities, N.e.c.',NULL,'7990'),('80100','Private Security Activities\n','\nThis class includes the provision of one or more of the following : guard and patrol services, picking up and delivering money, receipts, or other valuable items with personnel and equipment to protect such properties while in transit.\nThis class includes :\narmored car services\nbodyguard services\npolygraph services\nfingerprinting services\nsecurity guard services\nThis class excludes public order and safety activities, see 8423.','8010'),('80200','Security Systems Service Activities\n','\nThis class includes :\nMonitoring or remote monitoring of electronic security alarm systems, such as burglar and fire alarms, including their maintenance\nInstalling, repairing, rebuilding, and adjusting mechanical or electronic locking devices, safes and security vaults\nThe units carrying out these activities may also engage in selling such security systems, mechanical or electronic locking devices, safes and security vaults\nThis class excludes :\nInstallation of security systems, such as burglar and fire alarms, without later monitoring, see 4321.\nSelling security systems, mechanical or electronic locking devices, safes and security vaults, without monitoring, installation or maintenance services, see 4759;\nSecurity consultants, see 7490;\nPublic order and safety activities, see 8423;\nProviding key duplication services, see 9529.','8020'),('80300','Investigation Activities\n','\nThis class includes:\nInvestigation and detective service activities\nActivities of all private investigators, independent of the type of client or purpose of investigation','8030'),('81100','Combined Facilities Support Activities\n','\nThis class includes :\nProvision of a combination of support services within a clientNULLs facility, such as general interior cleaning, maintenance, trash disposal, guard and security, mail routing, reception, laundry and related services to support operations within facilities.\nUnits classified here provide operating staff to carry out these support activities, but are not involved with or responsible for the core business or activities of the client.\nThis class excludes :\nProvision of only one of the support services (e.g. general interior cleaning services) or addressing only a single function (e.g. heating), see the appropriate class according to the service provided;\nProvision of management and operating staff for the complete operation of a clientNULLs establishment, such as a hotel, restaurant, mine or hospital, see the class of the unit operated;\nProvision of on site management and operation of a clientNULLs computer systems and/or data processing facilities, see 6202;\nOperation of correctional facilities on a contract or fee basis, see 8423.','8110'),('81210','General Cleaning of Buildings\n','\nThis class includes :\nGeneral (non-specialized) cleaning activities of all types of buildings, such as :\noffices\nhouses or apartments\nfactories\nshops\ninstitutions\nGeneral (non-specialized) cleaning of other business and professional premises and multiunit residential buildings\nThese activities cover mostly interior cleaning although they may include the cleaning of associated exterior areas such as windows or passageways.\nThis class excludes :\nSpecialized interior cleaning activities, such as chimney cleaning, cleaning of fireplaces, stoves, furnaces, incinerators, boilers, ventilation ducts, exhaust units, see 8129.','8121'),('81291','Industrial Cleaning Activities',NULL,'8129'),('81292','Pest Control Services, Non-agricultural',NULL,'8129'),('81299','Other Building and Industrial Cleaning Activities, N.e.c.',NULL,'8129'),('81300','Landscape Care and Maintenance Service Activities\n','\nThis class includes :\nPlanting, care and maintenance of :\nParks and gardens for :\nprivate and public housing\npublic and semi-public buildings (schools, hospitals, administrative buildings, church buildings, etc)\nmunicipal grounds (parks, green areas, cemeteries, etc.)\nhighway greenery (roads, train lines and tramlines, waterways, ports)\nindustrial and commercial buildings\nGreenery for :\nbuildings (roof gardens, facade greenery, indoor gardens)\nsports grounds (e.g. football fields, golf courses etc.) play grounds, lawns for sunbathing and other recreational parks\nstationary and flowing water (basins, alternating wet areas, ponds, swimming pools, ditches, watercourses, plant sewage systems)\nPlants for protection against noise, wind, erosion, visibility and dazzling\nThis class also includes maintenance of land in order to keep it in good ecological condition\nThis class excludes :\nCommercial production and planting for commercial production of plants, trees, see division 01, 02;\nTree nurseries (except forest tree nurseries), see 0130;\nMaintenance of land to keep it in good condition for agricultural use, see 015;\nConstruction activities for landscaping purposes, see Section F;\nLandscape design and architecture activities, see 7110;\nOperation of botanical gardens, see 9103.','8130'),('82110','Combined Office Administrative Service Activities\n','\nThis class includes the provision of a combination of day-to-day office administrative services, such as reception, financial planning, billing and record keeping, personnel and physical distribution (mail services) and logistics for others on a contract or fee basis.\nThis class excludes :\nProvision of operating staff to carry out the complete operations of a business, see class according to the business/activity performed;\nProvision of only one particular aspect of these activities, see class according to that particular activity.','8211'),('82191','Photocopying Service Activities',NULL,'8219'),('82192','Duplicating and Mailing Activities',NULL,'8219'),('82199','Other Specialized Office Support Activities',NULL,'8219'),('82211','Customer Relationship Management Activities',NULL,'8221'),('82212','Sales and Marketing (Including Telemarketing) Activities',NULL,'8221'),('82219','Other Call Centers Activities (Voice), N.e.c.',NULL,'8221'),('82221','Finance and Accounting Activities',NULL,'8222'),('82222','Human Resources and Training Activities',NULL,'8222'),('82223','Administrative Support Activities',NULL,'8222'),('82224','Document Processes Activities',NULL,'8222'),('82225','Payroll Maintenance and Other Transaction Processing Activities',NULL,'8222'),('82226','Medical Transcription Activities',NULL,'8222'),('82227','Legal Services Activities',NULL,'8222'),('82228','Supply Chain Management Activities',NULL,'8222'),('82229','Other Back Office Operations Activities, N.e.c',NULL,'8222'),('82291','Engineering Outsourcing Activities',NULL,'8229'),('82292','Product Development Activities',NULL,'8229'),('82293','Publishing Outsourcing Activities',NULL,'8229'),('82294','Research and Analysis Activities',NULL,'8229'),('82295','Intellectual Property Research and Documentation Activities',NULL,'8229'),('82296','Security Outsourcing Activities',NULL,'8229'),('82297','Knowledge Process Outsourcing (Kpo) Activities',NULL,'8229'),('82299','Other Non-voice Related Activities, N.e.c.',NULL,'8229'),('82301','Conventions, Trade Shows, Exhibits, Conferences and Meetings Activities',NULL,'8230'),('82309','Other Organization of Conventions and Trade Shows, N.e.c.\r',NULL,'8230'),('82910','Activities of Collection Agencies and Credit Bureaus\n','\nThis class includes :\nCollection of payments for claims and remittance of payments collected to the clients, such as bill or debt collection services (e.g. bills payment center)\nActivities of compiling information, such as credit and employment histories on individuals and credit histories on businesses and providing the information to financial institutions, retailers and others who have a need to evaluate the creditworthiness of these persons and businesses.','8291'),('82920','Packaging Activities\n','\nThis class includes :\nPackaging activities on a fee or contract basis, whether or not these involve an automated process:\nbottling of liquids, including beverages and food\npackaging of solids (blister packaging, foil covered etc.)\nsecurity packaging of pharmaceutical preparations\nlabeling, stamping and imprinting\nparcel-packing and gift wrapping\nThis class excludes :\nManufacture of soft drinks and production of mineral water, see 1104 and 1105;\nPackaging activities incidental to transport, see 5229.','8292'),('82990','Other Business Support Service Activities, N.e.c.\n','\nThis class includes support activities, such as :\nProviding verbatim reporting and stenotype recording of live legal proceedings and transcribing subsequent recorded materials, such as :\ncourt reporting or stenotype recording services\npublic stenography services\nReal-time (i.e. simultaneous) closed captioning of live television performances of meetings, conferences\nAddress bar coding services\nBar code imprinting services\nFundraising organization services on a contract or fee basis\nMail presorting services\nRepossession services\nParking meter coin collection services\nActivities of independent auctioneers\nAdministration of loyalty programmers\nOther support activities typically provided to businesses not elsewhere classified.\nThis class excludes :\nProvision of document transcription services, see 8219;\nProviding film or tape captioning or subtitling services, see 5912.','8299'),('84111','National Executive and Legislative Administration',NULL,'8411'),('84112','Public Administration, Regional Government',NULL,'8411'),('84113','Public Administration, Local Government',NULL,'8411'),('84114','Public Administration and Supervision of Financial and Fiscal Affairs; Operation of Taxation Schemes',NULL,'8411'),('84115','Ancillary Service Activities for the Government as a Whole',NULL,'8411'),('84119','General Public Administration Activities, N.e.c.',NULL,'8411'),('84120','Regulation of the Activities of Providing Health Care, Education, Cultural Services and Other Social Services, Excluding Social Security\n','\nThis class includes:\nPublic administration of programs aimed to increase personal well-being :\nhealth\neducation\nculture\nsport\nrecreation\nenvironment\nhousing\nsocial services\nPublic administration of R&D policies and associated funds for these areas.\nThis class also includes :\nSponsoring of recreational and cultural activities\nDistribution of public grants to artists\nAdministration of potable water supply programs\nAdministration of waste collection and disposal operations\nAdministration of environmental protection programs\nAdministration of housing programs\nThis class excludes :\nSewage, refuse disposal and remediation activities, see division 37, 38 39;\nCompulsory social security activities, see 8430;\nEducation activities, see division 85;\nHuman health-related activities, see division 86;\nActivities of libraries and public archives, (private, public or government operated) see 9101;\nOperation of museums and other cultural institutions, see 9102;\nSporting or other recreational activities, see division 93.','8412'),('84130','Regulation of and Contribution to More Efficient Operation of Businesses\n','\nThis class includes :\nPublic administration and regulation, including subsidy allocation, for different economic sectors:\nagriculture\nland use\nenergy and mining resources\ninfrastructure\ntransport\ncommunication\nhotels and tourism\nwholesale and retail trade\nAdministration of R&D policies and associated funds to improve economic performance\nAdministration of general labor affairs\nImplementation of regional development policy measures, e.g. to reduce unemployment\nThis class excludes scientific research and development, see division 72.','8413'),('84210','Foreign Affairs\n','\nThis class includes :\nAdministration and operation of the ministry of foreign affairs and diplomatic and consular missions stationed abroad or at offices of international organizations\nAdministration, operation and support for information and cultural services intended for distribution beyond national boundaries\nAid to foreign countries, whether or not routed through international organizations\nProvision of military aid to foreign countries\nManagement of foreign trade, international financial and foreign technical affairs.\nThis class excludes international disaster or conflict refugee services, see 8890.','8421'),('84220','Defense Activities\n','\nThis class includes :\nAdministration, supervision and operation of military defense affairs and land, sea, air and space defense forces such as :\ncombat forces of army, navy and air force\nengineering, transport, communications, intelligence, material, personnel and other non-combat forces and commands\nreserve and auxiliary forces of the defense establishment\nmilitary logistics (provision of equipment, structures, supplies, etc.)\nhealth activities for military personnel in the field\nAdministration, operation and support of civil defense forces\nSupport for the working out of contingency plans and the carrying out of exercises in which civilian institutions and populations are involved\nAdministration of defense-related R&D policies and related funds\nThis class excludes :\nScientific research and development, see division 72;\nProvision of military aid to foreign countries, see 8421;\nActivities of military tribunals, see 8423;\nProvision of supplies for domestic emergency use in case of peacetime disasters, see 8423;\nEducational activities of military schools, colleges and academies, see 8540;\nActivities of military hospitals, see 8610.','8422'),('84230','Public Order and Safety Activities\n','\nThis class includes :\nAdministration and operation of regular and auxiliary police forces supported by public authorities and of port, border, coastguards and other special police forces, including traffic regulation, alien registration, maintenance of arrest records\nFirefighting and fire prevention : administration and operation of regular and auxiliary fire brigades in fire prevention, firefighting, rescue of persons and animals, assistance in civic disasters, floods, road accidents, etc.\nAdministration and operation of administrative civil and criminal law courts, military tribunals and the judicial system, including legal representation and advice on behalf of the government or when provided by the government in cash or services\nRendering of judgements and interpretations of the law\nArbitration of civil actions\nPrison administration and provision of correctional services, including rehabilitation services, regardless of whether their administration and operation is done by government units or by private units on a contract or fee basis\nProvision of supplies for domestic emergency use in case of peacetime disasters\nThis class excludes :\nForestry fire-protection and fire-fighting services, see 0240;\nOil and gas field fire fighting, see 0910;\nFirefighting and fire-prevention services at airports provided by non-specialized units, see 5223;\nAdvice and representation in civil, criminal and other cases, see 6910;\nOperation of police laboratories, see 7120;\nAdministration and operation of military armed forces, see 8422;\nActivities of prison schools, see division 85;\nActivities of prison hospitals, see 8610.','8423'),('84300','Compulsory Social Security Activities\n','\nThis class includes :\nFunding and administration of government-provided social security programs:\nsickness, work-accident and unemployment insurance\nretirement pensions\nprogrammes covering losses of income due to maternity and temporary disablement, widowhood, etc.\nThis class excludes :\nNon-compulsory social security, see 6530;\nProvision of welfare services and social work (without accommodation), see 8810, 8890.','8430'),('85111','Public Pre-primary/pre-school Education',NULL,'8511'),('85112','Private Pre-primary/pre-school Education',NULL,'8511'),('85121','Public Pre-primary Education for Children with Special Needs',NULL,'8512'),('85122','Private Pre-primary and Primary Education for Children with Special Needs',NULL,'8512'),('85211','Public Primary/elementary Education',NULL,'8521'),('85212','Private Primary/elementary Education',NULL,'8521'),('85221','Public Primary/elementary Education for Children with Special Needs',NULL,'8522'),('85222','Private Primary/elementary Education for Children with Special Needs',NULL,'8522'),('85311','Public General Secondary Education',NULL,'8531'),('85312','Private General Secondary Education',NULL,'8531'),('85321','Public General Secondary Education for Children with Special Needs',NULL,'8532'),('85322','Private General Secondary Education for Children with Special Needs',NULL,'8532'),('85331','Public Technical and Vocational Secondary Education',NULL,'8533'),('85332','Private Technical and Vocational Secondary Education',NULL,'8533'),('85341','Public Technical and Vocational Secondary Education for Children with Special Needs',NULL,'8534'),('85342','Private Technical and Vocational Secondary Education for Children with Special Needs',NULL,'8534'),('85401','Public Higher Education',NULL,'8540'),('85402','Private Higher Education',NULL,'8540'),('85510','Sports and Recreation Education\n','\nThis class includes the provision of instruction in athletic activities to groups or individuals, such as by camps and schools. Overnight and day sports instruction camps, are also included.\nThis class does not include activities of academic schools, colleges and universities. Instruction may be provided in diverse settings, such as the unitNULLs or clientNULLs training facilities, educational institutions or by other means. Instructions provided in this class is formally organized.\nThis class includes :\nSports, instruction (basketball, volleyball, baseball, football, crickets, etc.)\nCamps, sports instruction\nCheerleading instruction\nGymnastics instruction\nRiding instruction, academies or school\nSwimming instruction\nProfessional sports, instructors, teachers, coaches\nMartial arts instruction\nCard game instruction, (such as bridge)\nYoga instruction\nThis class excludes cultural education, see 8552.','8551'),('85520','Cultural Education\n','\nThis class includes provision of instruction in the arts, drama and music. Units giving this type of instructions might be named \"schools\", \"studies\", \"classes\", etc. They provide formally organized instruction, mainly for hobby , recreational or self-development purposes, but such instruction does not lead to a professional diploma, baccalaureate or graduate degree.\nThis class includes :\nPiano instruction and other music instruction\nArt instruction\nDance instruction and dance studios\nDrama schools (except academic)\nFine arts schools (except academic)\nPerforming arts schools (except academic)\nPhotography schools (except commercial)','8552'),('85591','Professional and Licensure Review Services',NULL,'8559'),('85592','Training Centers and Facilities Activities Including Culinary, Caregiving, Language Proficiency',NULL,'8559'),('85593','Online Tutorial Services',NULL,'8559'),('85594','Driving Schools',NULL,'8559'),('85599','Other Education, N.e.c.',NULL,'8559'),('85601','Public Educational Support Services',NULL,'8560'),('85602','Private Educational Support Services',NULL,'8560'),('86111','Public General Hospitals Activities',NULL,'8611'),('86112','Public Sanitaria and Other Similar Activities',NULL,'8611'),('86113','Public Mental Health and Substance Abuse Hospitals Activities',NULL,'8611'),('86114','Public Maternity Hospitals Activities',NULL,'8611'),('86119','Other Public Hospitals, Sanitaria and Other Similar Activities, N.e.c.',NULL,'8611'),('86121','Private General Hospitals Activities',NULL,'8612'),('86122','Private Sanitaria and Other Similar Activities',NULL,'8612'),('86123','Private Mental Health and Substance Abuse Hospitals Activities',NULL,'8612'),('86124','Private Maternity Hospitals Activities',NULL,'8612'),('86129','Other Private Hospitals, Sanitaria and Other Similar Activities, N.e.c.',NULL,'8612'),('86211','Public Medical Activities (Including Puericulture and Laboratory Services)',NULL,'8621'),('86212','Public Dental and Laboratory Services',NULL,'8621'),('86219','Public Medical, Dental and Other Health Activities, N.e.c.',NULL,'8621'),('86221','Private Medical Activities',NULL,'8622'),('86222','Private Dental and Laboratory Services',NULL,'8622'),('86223','Child Care/pediatric Clinic Services',NULL,'8622'),('86224','Medical and Diagnostic Laboratory Services',NULL,'8622'),('86225','Dialysis Center Activities',NULL,'8622'),('86229','Private Medical, Dental and Other Health Activities, N.e.c.',NULL,'8622'),('86900','Other Human Health Activities\n','\nThis class includes :\nActivities for human health not performed by hospitals or by medical doctors or dentists :\nactivities of nurses, midwives, physiotherapists or other paramedical practitioners in the field of optometry, hydrotherapy, medical massage, occupational therapy, speech therapy, chiropody, homeopathy, chiropractic, acupuncture, etc..\nThese activities may be carried out in health clinics such as those attached to firms, schools, homes for the aged, labor organizations and fraternal organizations and in residential health facilities other than hospitals, as well as in own consulting rooms, patientNULLs homes or elsewhere. These activities do not involve medical treatment.\nThis class also includes :\nActivities of dental paramedical personnel such as dental therapists, school dental nurses and dental hygienists, who may work remote from, but are periodically supervised by the dentist\nActivities of medical laboratories such as: X-ray laboratories and other diagnostic imaging centers; blood analysis laboratories\nActivities of blood banks, sperm banks, transplant organ banks, etc.\nAmbulance transport of patients by any mode of transport including airplanes. These services are often provided during a medical emergency\nActivities of maternity and lying-in clinics\nThis class excludes :\nProduction of artificial teeth, denture and prosthetic appliances by dental laboratories, see 3250;\nTransfer of patients, with neither equipment for lifesaving nor medical personnel, see divisions 49, 50, 51;\nNon-medical laboratory testing, see 7120;\nTesting activities in the field of food hygiene, see 7120;\nHospital activities, see 861;\nMedical and dental practice activities, see 862;\nNursing care facilities, see 8710.','8690'),('87100','Residential Nursing Care Facilities\n','\nThis class includes activities of :\nhomes for the elderly with nursing care\nconvalescent homes\nrest homes with nursing care\nnursing care facilities\nnursing homes\nThis class excludes :\nIn-home services provided by health care professionals, see division 86;\nActivities of homes for the elderly without or with minimal nursing care, see 8730;\nSocial work activities with accommodation, such as orphanages, childrenNULLs boarding homes and hostels, temporary homeless shelters, see 8790.','8710'),('87201','Rehabilitation of People Addicted to Drugs or Alcohol',NULL,'8720'),('87202','Caring for the Mentally and Physically Handicapped',NULL,'8720'),('87209','Other Residential Care Activities for Mental Retardation, Mental Health and Substance Abuse, N.e.c.',NULL,'8720'),('87300','Residential Care Activities for the Elderly and Disabled\n','\nThis class includes the provision of residential and personal care services for the elderly and disabled who are unable to fully care for themselves and/or who do not desire to live independently. The care typically includes room, board, supervision and assistance in daily living, such as housekeeping services. In some instances these units provide skilled nursing care for residents in separate on-site facilities.\nThis class includes activities of :\nAssisted-living facilities\nContinuing care retirement communities\nHomes for the elderly with minimal nursing care\nRest homes without nursing care\nThis class excludes :\nActivities of homes for the elderly with nursing care, see 8710;\nSocial work activities with accommodation where medical treatment or accommodation are not important elements, see 8790.','8730'),('87901','Child Care Services',NULL,'8790'),('87902','Caring for Unwed Mothers and Children',NULL,'8790'),('87903','Caring for the Orphans',NULL,'8790'),('87909','Other Residential Care Activities, N.e.c.',NULL,'8790'),('88101','Welfare and Guidance Counseling Activities (Elderly and Disabled)',NULL,'8810'),('88102','Day-care Activities for the Elderly or for Handicapped Adults',NULL,'8810'),('88103','Vocational Rehabilitation and Habilitation Activities for Disabled Adults',NULL,'8810'),('88901','Welfare and Guidance Counseling Activities for Children and Adolescents',NULL,'8890'),('88902','Child-care Activities (Including for the Handicapped)',NULL,'8890'),('88903','Vocational Rehabilitation and Habilitation Activities for Unemployed Persons',NULL,'8890'),('88904','Charitable Activities',NULL,'8890'),('88909','Other Social Work Activities without Accommodation, N.e.c.',NULL,'8890'),('90001','Concerts and Opera or Dance Production',NULL,'9000'),('90002','Live Theatrical Presentations and Other Stage Productions',NULL,'9000'),('90003','Individual Artists Activities',NULL,'9000'),('90004','Ancillary Theatrical Activities',NULL,'9000'),('90005','Art Galleries',NULL,'9000'),('90006','Operation of Concert and Theatre Halls and Other Arts Facilities',NULL,'9000'),('90009','Other Creative, Arts and Entertainment Activities, N.e.c.',NULL,'9000'),('91010','Library and Archives Activities\n','\nThis class includes :\nDocumentation and information activities of libraries of all kinds, reading, listening and viewing rooms, public archives providing service to the general public or to a special clientele, such as students, scientists, staff, members as well as operation of government archives :\norganization of a collection, whether specialized or not\ncataloguing collections\nlending and storage of books, maps, periodicals, films, records, tapes, works of art, etc.\nretrieval activities in order to comply with information requests, etc.\nStock photo libraries and services','9101'),('91020','Museums Activities and Operation of Historical Sites and Buildings\n','\nThis class includes :\nOperation of museums of all kinds :\nart museums, museums of jewelry, furniture, costumes, ceramics, silverware\nnatural history, science and technological museums, historical museums, including military museums\nother specialized museums\nopen-air museums\nOperation of historical sites and buildings\nThis class excludes :\nRenovation and restoration of historical sites and buildings, see section F;\nRestoration of works of art and museum collection objects, see 9000;\nActivities of libraries and archives, see 9101.','9102'),('91030','Botanical and Zoological Gardens and Nature Reserves Activities\n','\nThis class includes :\nOperation of botanical and zoological gardens, including childrenNULLs zoos\nOperation of nature reserves, including wildlife preservation, etc.\nThis class excludes :\nLandscaping and gardening services, see 8130;\nOperation of sport fishing and hunting preserves, see 9319.','9103'),('92000','Gambling and Betting Activities\n','\nThis class includes :\nBookmaking and other betting operations\nOff-track betting\nOperation of casinos, including \"floating casinos\"\nSale of lottery tickets\nOperation (exploitation) of coin-operated gambling machines\nOperation of virtual gambling web sites\nThis class excludes : Operation (exploitation) of coin-operated games, see 9329.','9200'),('93110','Operation of Sports Facilities\n','\nThis class includes :\nOperation of facilities for indoor or outdoor sports events (open, closed or covered, with or without spectator seating) :\nbasketball, volleyball, football, baseball\nracetracks for auto, dog, horse races\nswimming pools and stadiums\ntrack and field stadiums\nboxing arenas\ngolf courses\nbowling lanes\nfitness centers\nbadminton courts\nbilliard halls\nOrganization and operation of outdoor or indoor sports events for professionals or amateurs by organizations with own facilities.\nThis class includes managing and providing the staff to operate these facilities.\nThis class excludes :\nRenting of recreation and sports equipment, see 7721;\nPark and beach activities, see 9329.','9311'),('93120','Activities of Sports Clubs\n','\nThis class includes the activities of sports clubs, which, whether professional, semi-professional or amateur clubs, give their members the opportunity to engage in sporting activities.\nThis class includes :\nOperation of sports clubs :\nbasketball clubs\nvolleyball clubs\nbadminton clubs\nfootball clubs\nbowling clubs\nswimming clubs\ngolf clubs\nboxing clubs\nbody-building clubs\nchess clubs\ntrack and field clubs\nshooting clubs, etc.\nThis class excludes :\nSports instruction by individual teachers, trainers, see 8551;\nOperation of sports facilities, see 9311;\nOrganization and operation of outdoor or indoor sports events for professionals or amateurs by sports clubs with their own facilities, see 9311.','9312'),('93190','Other Sports Activities\n','\nThis class includes :\nActivities of producers or promoters of sports events, with or without facilities\nActivities of individual own-account sportsmen and athletes, referees, judges, timekeepers, etc.\nActivities of sports leagues and regulating bodies\nActivities related to promotion of sporting events\nActivities of racing stables, kennels and garages\nOperation of sport fishing and hunting preserves\nSupport activities for sport or recreational hunting and fishing\nThis class excludes :\nBreeding of racing horses, see 0142;\nRenting of sports equipment, see 7721;\nActivities of sports and game schools, see 8551;\nActivities of sports instructors, teachers, coaches, see 8541;\nOrganization and operation of outdoor or indoor sports events for professionals or amateurs by sports clubs with/without own facilities, see 9311,9312;\nPark and beach activities, see 9329.','9319'),('93210','Activities of Amusement Parks and Theme Parks\n','\nThis class includes activities of amusement parks or theme parks. It includes the operation of a variety of attractions, such as mechanical rides, water rides, games, shows, theme exhibits and picnic grounds.','9321'),('93291','Operation of Ballrooms, Discotheques (Disconulls)',NULL,'9329'),('93292','Operation of Recreation Parks, Beaches, Including Renting of Facilities such as Bathhouses, Lockers, Chairs Etc.;',NULL,'9329'),('93293','Token, Coin or Cash-basis and Card-operated Games (Arcade)',NULL,'9329'),('93294','Indoor Playground and Playhouse Operations for Children',NULL,'9329'),('93295','Light And/or Sound System Operation for Fair and Shows, Discotheques and Dance Floor',NULL,'9329'),('93299','Other Amusement and Recreation Activities, N.e.c.',NULL,'9329'),('94110','Activities of Business and Employers Membership Organizations\n','\nThis class includes :\nActivities of organizations whose members interests center on the development and prosperity of enterprises in a particular line of business or trade, including farming, or on the economic growth and climate of a particular geographical area or political subdivision without regard for the line of business.\nActivities of federations of such associations\nActivities of chambers of commerce, guilds and similar organizations\nDissemination of information, representation before government agencies, public relations and labor negotiations of business and employer organizations\nThis class excludes activities of trade unions, see 9420.','9411'),('94120','Activities of Professional Membership Organizations\n','\nThis class includes :\nActivities of organizations whose membersNULL interests centre chiefly on a particular scholarly discipline or professional practice or technical field, such as medical associations, legal associations, accounting associations, engineering associations, architects associations, etc.\nActivities of associations of specialists engaged in scientific, academic or cultural activities, such as associations of writers, painters, performers of various kinds, journalists, etc.\nDissemination of information, the establishment and supervision of standards of practice, representation before government agencies and public relations of professional organizations\nThis class also includes activities of learned societies.\nThis class excludes education provided by these organizations, see division 85.','9412'),('94200','Activities of Trade Unions\n','\nThis class includes promoting of the interests of organized labor and union employees.\nThis class also includes :\nActivities of associations whose members are employees interested chiefly in the representation of their views concerning the salary and work situation, and in concerted action through the organization\nActivities of single plant unions, of unions composed of affiliated branches and of labor organizations composed of affiliated unions on the basis of trade, region, organizational structure or other criteria\nThis class excludes education provided by these organizations, see division 85.','9420'),('94910','Activities of Religious Organizations\n','\nThis class includes :\nActivities of religious organizations or individuals providing services directly to worshippers in churches, mosques, temples, synagogues or other places\nActivities of organizations providing monastery and convent services\nReligious retreat activities\nThis class also includes :\nReligious funeral service activities\nThis class excludes :\nEducation provided by such organizations, see division 85;\nHealth activities by such organizations, see division 86;\nSocial work activities by such organizations, see divisions 87and 88.','9491'),('94920','Activities of Political Organizations\n','\nThis class includes :\nActivities of political organizations and auxiliary organizations such as young peopleNULLs auxiliaries associated with a political party. These organizations chiefly engage in influencing decision-taking in public governing bodies by placing members of the party or those sympathetic to the party in political office and involve the dissemination of information, public relations, fund raising etc.','9492'),('94990','Activities of Other Membership Organizations, N.e.c.\n','\nThis class includes :\nActivities of organizations not directly affiliated to a political party furthering a public cause or issue by means of public education, political influence, fund raising etc.:\ncitizenNULLs initiative or protest movements\nenvironmental and ecological movements\norganizations supporting community and educational facilities n.e.c.\norganizations for the protection and betterment of special groups, e.g. ethnic and minority groups\nassociations for patriotic purposes, including war veteransNULL associations\nConsumer associations\nAutomobile associations\nAssociations for the purpose of social acquaintanceship such as rotary clubs, lodges etc.\nAssociations of youth, young personsNULL associations, student associations, clubs and fraternities etc.\nAssociations for the pursuit of a cultural or recreational activity or hobby (other than sports or games), e.g. poetry, literature and book clubs, historical clubs, gardening clubs, film and photo clubs, music and art clubs, craft and collectors clubs, social clubs, carnival clubs etc.\nThis class also includes grant giving activities by membership organizations or others\nThis class excludes :\nActivities of professional artistic groups or organizations, see 9000.\nActivities of sports clubs, see 9312;\nActivities of professional associations, see 9412.','9499'),('95110','Repair of Computers and Peripheral Equipment\n','\nThis class includes the repair of electronic equipment, such as computers and computing machinery and peripheral equipment.\nThis class includes the repair and maintenance of:\nDesktop and laptop computers\nMagnetic disk drives, flash drives and other storage devices\nOptical disk drives (CD-RW, CD-ROM, DVD-ROM, DVD-RW)\nPrinters, monitors, keyboards\nMice, joysticks and trackball accessories\nInternal and external computer modems\nDedicated computer terminals\nComputer servers, scanners, including bar code scanners\nSmart cards readers, virtual reality helmets\nComputer projectors\nThis class also includes the repair and maintenance of:\nComputer terminals like automatic teller machines (ATMNULLs) point-of-sale (POS) terminals, not mechanically operated\nHand-held computers (PDANULLs)\nThis class excludes the repair and maintenance of carrier equipment modems, see 9512.','9511'),('95120','Repair of Communications Equipment\n','\nThis class includes repair and maintenance of communications equipment such as :\nCordless telephones, mobile phones and other handheld mobile devices (e.g., cellular phones, smart phones, tablets) carrier equipment modems\nFax machines\nCommunications transmission equipment (e.g. routers, bridges, modems)\nTwo-way radios\nCommercial TV and video cameras','9512'),('95210','Repair of Consumer Electronics\n','\nThis class includes repair and maintenance of consumer electronics including smart electronics:\nTelevision, radio receivers\nVideo cassette recorders (VCR)\nCD/DVD players\nHousehold-type video cameras\nDigital recorder, CCTVs, remote control devices, and other similar electronic devices.','9521'),('95221','Repair and Servicing of Household Appliances',NULL,'9522'),('95222','Repair and Servicing of Home and Garden Equipment',NULL,'9522'),('95231','Repair of Boots and Shoes',NULL,'9523'),('95232','Repair of Luggage and Handbags',NULL,'9523'),('95241','Repair of Wood Furniture',NULL,'9524'),('95242','Repair of Rattan Furniture (Reed, Wicker and Cane)',NULL,'9524'),('95243','Repair of Furniture and Fixtures of Metal',NULL,'9524'),('95249','Repair of Other Furniture and Fixtures, N.e.c.',NULL,'9524'),('95291','Repair and Alteration of Jewelry',NULL,'9529'),('95292','Repair of Watches',NULL,'9529'),('95299','Other Repair of Personal and Household Goods, N.e.c.',NULL,'9529'),('96101','Spa Activities',NULL,'9610'),('96102','Steam and Bath Activities',NULL,'9610'),('96103','Slendering and Body Building Activities',NULL,'9610'),('96104','Beauty Treatment and Personal Grooming Activities',NULL,'9610'),('96105','Beauty Parlor/salon Activities',NULL,'9610'),('96106','Barber Shop Activities',NULL,'9610'),('96107','Massage Parlor',NULL,'9610'),('96109','Other Personal Services for Wellness Activities, N.e.c.',NULL,'9610'),('96210','Washing and Dry Cleaning of Textile and Fur Products\n','\nThis class includes :\nLaundering and dry-cleaning, pressing etc. of all kinds of clothing (including fur) and textiles, provided by mechanical equipment, by hand or by self-service coin-operated machines, whether for the general public or for industrial or commercial clients\nLaundry collection and delivery\nCarpet and rug shampooing and drapery and curtain cleaning, whether on clientsNULL premises or not\nProvision of linens, work uniforms and related items by laundries\nThis class also includes repair and minor alteration of garments or other textile articles when done in connection with cleaning.\nThis class excludes :\nRenting of clothing other than work uniforms, even if cleaning of these goods is an integral part of the activity, see 7730;\nRepair and alteration of clothing etc., as an independent activity, see 9529.','9621'),('96300','Funeral and Related Activities\n','\nThis class includes :\nBurial and incineration of human or animal corpses and related activities :\npreparing the dead for burial or cremation and embalming and morticiansNULL services\nproviding burial or cremation services\nrental of equipped space in funeral parlors\nRental or sale of graves\nMaintenance of graves and mausoleums.\nThis class excludes religious funeral service activities, see 9491.','9630'),('96400','Domestic Services\n','\nThis class includes maids, drivers, cooks, houseboys, gardeners, including governesses, tutors and personal secretaries, etc. employed in private households.','9640'),('96901','Social Escort Service Activities (Excluding Tourist Guides)',NULL,'9690'),('96902','Pet Boarding Activities',NULL,'9690'),('96903','Astrological and Spiritualist Activities',NULL,'9690'),('96904','Shoe Shiner, Porter, Valet Car Parker Activities',NULL,'9690'),('96905','Coin/bill/card-operated Machine Activities',NULL,'9690'),('96906','Event Planning/organizing Activities (E.g., Wedding, Birthday, Debut, Baptismal)',NULL,'9690'),('96909','Miscellaneous Service Activities, N.e.c.',NULL,'9690'),('97000','Activities of Households as Employers of Domestic Personnel\n','\nThis class includes :\nActivities of households as employers of domestic personnel such as maids, cooks, waiters, valets, butlers, laundresses, gardeners, gatekeepers, stable-lads, chauffeurs, caretakers, governesses, babysitters, tutors, secretaries, etc.\nIt allows the domestic personnel employed to state the activity of their employers in censuses or studies, even though the employer is an individual. The product produced by this activity is consumed by the employing household.\nThis class excludes :\nProvision of services such as cooking, gardening, etc. by independent service providers (companies or individuals), see PSIC class according to type of service.','9700'),('98100','Undifferentiated Goods-producing Activities of Private Households for Own Use\n','\nThis class includes :\nUndifferentiated subsistence goods - producing activities of households, i.e., the activities of households that are engaged in a variety of activities that produce goods for their own subsistence. These activities include hunting and gathering, farming, the production of shelter and clothing and other goods produced by the household for its own subsistence.\nIf households are also engaged in the production of marketed goods, they are classified to the appropriate goods-producing industry of PSIC.\nIf households are principally engaged in a specific goods-producing subsistence activity, they are classified to the appropriate goods-producing industry of PSIC.','9810'),('98200','Undifferentiated Services-producing Activities of Private Households for Own Use\n','\nThis class includes :\nUndifferentiated subsistence services-producing activities of households. These activities include cooking, teaching, caring for household members and other services produced by the household for its own subsistence.\nIf households are also engaged in the production of multiple goods for subsistence purposes, they are classified to the undifferentiated goods-producing subsistence activities of households.','9820'),('99011','Foreign Diplomatic Missions',NULL,'9901'),('99012','International Organizations',NULL,'9901'),('99019','International Organizations and Extra-territorial Organizations and Bodies, N.e.c.',NULL,'9901'),('99090','Activities of Other International Organizations\n','\nThis class includes activities of other international organizations mostly located and funded in the Philippines such as: Asia Pacific Economic Cooperation Center (APEC-Center), Southeast Asian Ministers of Education Organization (SEAMEO), SEAMEO Regional Center for Educational Innovation Technology and Regional Center for Graduate Study and Research in Agriculture (SEARCA).','9909');
